(72784, 'ruRU', 'Помощь Кобальтовой ассамблее', 'Поговорите с Венти в Кобальтовой ассамблее.', '$n, ты $gпришел:пришла; в подходящий момент.\n\nКогда-нибудь $gслышал:слышала; о Кобальтовой ассамблее? Когда-то это чудесное место было домом для моего народа.\n\nНо теперь здесь хозяйничает Расколотое Пламя, а нам пришлось уйти. \n\nДо недавних времен у нас еще теплилась надежда вернуть ассамблею, но последние новости говорят о том, что наши попытки тщетны.\n\nТы можешь нам помочь? Если сможешь, поговори с Венти в Кобальтовой ассамблее.', '', '', '', '', '', 'Поговорите с Венти в Кобальтовой ассамблее.', 47187),
(72783, 'ruRU', 'Заказы на предметы', 'Узнайте у заведующей Мимзи Камнебойки о заказах на предметы.', 'Классная штучка тебе из агрегата титанов досталась. Давай-ка ее сюда!\n\nШучу-шучу! Я понятия не имею, как ее использовать. А ты догадываешься?\n\nПоговори-ка с Мимзи Камнебойкой. У нее тут целый бизнес! Находит мастеров и поручает им заказы.\n\nОтдаешь материалы, а какой-нибудь умелец делает из них то, что тебе нужно. \n\nВсе проще простого! Так что найди Мимзи и попробуй $gсам:сама;! Только не говори ей, кто тебя послал.', '', '', '', '', '', '', 47187),
(72773, 'ruRU', 'Искусность приходит с опытом', 'Найдите Грейзика Заклепальстера в Вальдраккене.', 'Группа гоблинов исследует в Вальдраккене заброшенное устройство титанов. \n\nПрости за прямоту, но они устроили в городе страшный переполох. Многие боятся, что их исследования причинят больше вреда, чем блага.\n\nЖители Вальдраккена будут очень благодарны, если ты встретишься с гоблинами и найдешь ответы на их вопросы.\n\nТолько такие ответы, которые не приведут к уничтожению города.', '', '', '', '', '', 'Найдите Грейзика Заклепальстера в Вальдраккене.', 47187),
