(72729, 'ruRU', 'Великий рогоплав', 'Отнесите потемневшую монету островов Великому рогоплаву на равнины Он\'ары.', 'При рыбалке на Драконьих островах вам попалась странная монетка.\n\nСреди рыбаков ходят слухи, что на равнинах Он\'ары можно найти существо, которое любит их собирать.', '', '', '', '', '', '', 47187),
(72728, 'ruRU', 'Мир ждет', 'Выполните 10 локальных заданий на Драконьих островах.', 'Знаешь, что может сделать героя по-настоящему крутым? Помощь жителям Драконьих островов! \n\nЗдесь немало трудностей, с которыми нужно скорее разобраться. Покажи, насколько ты $gкрут:крута;, помогая другим!', '', '', '', '', '', '', 47187),
(72709, 'ruRU', 'Финансирование охоты за сокровищами', 'Купите записки археолога об артефактах у каталогизатора Джейкс.', '<Каталогизатор Джейкс копается в сумке с припасами и вскоре достает оттуда недавно нарисованную карту.>\n\nОдин из наших археологов сообщил о находках, связанных с утерянным артефактом. Предполагается, что это где-то здесь.\n\nЕсли ты отдашь припасы, чтобы проспонсировать следующую археологическую экспедицию, то можешь взять эту карту – на ней отмечено сокровище, спрятанное неподалеку.', '', '', '', '', '', '', 47187),
(72708, 'ruRU', 'Припасы Драконьих островов', 'Отнесите сумку с припасами Драконьих островов каталогизатору Джейкс в посольство Крылатого Приюта.', '<Похоже, протодракон сорвал эту сумку с припасами с какого-то незадачливого участника Драконьей экспедиции.\n\nКаталогизатор Джейкс в посольстве Крылатого Приюта наверняка знает, как лучше поступить с находкой.>', '', '', '', '', '', 'Отнесите сумку с припасами Драконьих островов каталогизатору Джейкс в посольство Крылатого Приюта.', 47187),
