(72686, 'ruRU', 'Пробуждение бури', 'Одолейте усиленных стихиями существ и соберите избыточную энергию в буре стихий.', 'Ситуация серьезная, $n. Воины стихий призывают яростные бури по всем Драконьим островам.\n\nКак только узнаешь о разразившейся буре, отправляйся к ней и убей усиленных существ. \n\nСразив врага, собирай у него избыточную энергию стихий. И имей в виду: чем сильнее враг, тем больше в нем избыточной энергии.\n\nНельзя позволить врагам и дальше искажать местные стихии.', '', '', '', '', '', '', 47187),
