(72648, 'ruRU', 'Искры жизни: Лазурный Простор', 'Соберите $1oa |4искру:искры:искр; жизни в Лазурном Просторе в режиме войны.', 'Прилив наполнил жизнью Лазурный Простор.\n\nПришло время собраться вместе с родными и близкими за большим столом и поделиться новыми историями.', '', '', '', '', '', 'Поговорите с фельдмаршалом Эмбератом в Вальдраккене.', 47187),
