(72585, 'ruRU', 'Знакомство со всеми', 'Выполните задания, связанные со знакомством с каждой крупной фракцией, в местах, где они обосновались: лагере Драконьей экспедиции, Марукае, Искаре и Вальдраккене.', 'Ты столько $gсделал:сделала; для Драконьих островов, $gгерой:героиня;. \n\nМногие благодарны тебе за помощь и хотят представить тебя своей общине. Отправляйся к ним и познакомься с каждой группой. Узнай, что они могут тебе предложить. \n\nДумаю, скоро ты поймешь, что чем больше ты трудишься на благо Драконьих островов, тем больше можешь получить взамен!', '', '', '', '', '', '', 47187),
(72584, 'ruRU', 'Место для сети', 'Забросьте сеть в рыболовную лунку речного устья.', 'Хочешь испытать свою сеть? Отправляйся к устью реки на юге Берегов Пробуждения и найди рыбное место. Там-то и можно будет забросить сеть.', '', '', '', '', '', '', 47187),
(72560, 'ruRU', 'Подъем', '', '', '', '', '', '', '', '', 47187),
(72525, 'ruRU', 'Базовое снаряжение каталогизатора', 'Воспользуйтесь набором припасов экспедиции, чтобы изучить снаряжение каталогизатора.', 'У каждого каталогизатора должна быть персональная камера!\n\nТы не $gобязан:обязана; придумывать для нее имя, но я очень советую это сделать. Так гораздо веселее.\n\nТак... теперь иди к первопроходцу Джебу, и он выдаст тебе нужное снаряжение.\n\nУ него всегда все есть – не помню, чтобы он хоть раз что-нибудь забыл. Невероятный специалист!', '', '', '', '', '', '', 47187),
(72524, 'ruRU', 'Базовое снаряжение скалолаза', 'Воспользуйтесь набором припасов экспедиции, чтобы изучить снаряжение скалолаза.', '<Первопроходец Джеб указывает на припасы рядом с собой.>\n\nТебе это понадобится.\n\nДля восхождения нужно снаряжение.', '', '', '', '', '', '', 47187),
(72519, 'ruRU', 'Темпоральная нас-двойка', 'Используйте хронокристалл на Вечнос и Хроми в Азмерлоте, чтобы они перестали падать сквозь время.', 'Все ясно... Они падают сквозь время и вероятностные континуумы.\n\nПоспеши, я знаю еще одно время-место, где мы можем их застать. Оно... необычное, но пусть тебя это не смущает. Судьба Хронорму в твоих руках.', '', '', '', '', '', 'Возвращайтесь к Ноздорму в настоящее время.', 47187),
(72512, 'ruRU', 'Шепот ветра', 'Встретьтесь с Он\'арой в Гнезде Он\'ары.', '<Годолото вопросительно склоняет голову, кивает вам и, наконец, смотрит в глаза. Затем она поднимает взгляд к небу... и горе неподалеку от Марукая. Вы понимаете, что вам нужно отправиться к Гнезду Он\'ары.>', '', '', '', '', '', 'Встретьтесь с Он\'арой в Гнезде Он\'ары.', 47187),
(72488, 'ruRU', 'Продвинутый тур в Тальдразусе', 'Пройдите все сложные маршруты в Тальдразусе.', 'И снова в Тальдразус! Его пики, долины и гоночные маршруты ждут тебя!\n\nНайди моих бронзовых коллег, пройди их сложные маршруты и заверши тур по Драконьим островам.', '', '', '', '', '', '', 47187),
(72487, 'ruRU', 'Тур в Тальдразусе', 'Пройдите все маршруты в Тальдразусе.', 'Тальдразус. Здесь находится Престол Аспектов и многие памятники драконьей истории. \n\nВысокие пики и крутые, глубокие ущелья так и ждут, чтобы над ними пролетели!\n\nМои бронзовые друзья уже подготовили для тебя новые маршруты. \n\nПройди их – и заверши подготовку наездника.', '', '', '', '', '', '', 47187),
(72486, 'ruRU', 'Продвинутый тур по Лазурному Простору', 'Пройдите все сложные маршруты в Лазурном Просторе.', 'Сложные маршруты Лазурного Простора созданы для того, чтобы научить тебя летать еще лучше! \n\nГлавное... не свалиться с дракона!\n\nКогда будешь $gготов:готова;, отыщи моих бронзовых коллег и пройди их маршруты!', '', '', '', '', '', '', 47187),
(72485, 'ruRU', 'Тур по Лазурному Простору', 'Пройдите все маршруты в Лазурном Просторе.', 'Маршруты Лазурного Простора – это уникальные испытания. Среди горных вершин, заснеженных просторов и густых лесов тебя ждет немало препятствий!\n\nКогда окажешься в Лазурном Просторе, ищи моих бронзовых друзей и проходи их маршруты!', '', '', '', '', '', '', 47187),
(72484, 'ruRU', 'Продвинутый тур по равнинам Он\'ары', 'Пройдите все сложные маршруты на равнинах Он\'ары.', 'Эти маршруты более сложные, но я не сомневаюсь, что ты справишься.\n\nМои бронзовые друзья проложили дополнительные маршруты на равнинах Он\'ары, включив в них несколько препятствий и сюрпризов. А еще на них ты сможешь попытаться побить собственный рекорд!\n\nЖелаю удачи!', '', '', '', '', '', '', 47187),
(72483, 'ruRU', 'Тур по равнинам Он\'ары', 'Пройдите все маршруты на равнинах Он\'ары.', 'О, равнины Он\'ары! Открытые просторы, воющие ветра, прекрасные виды... и новые гоночные маршруты!\n\nКак и на Берегах Пробуждения, если встретишь моих бронзовых коллег, поговори с ними и попробуй пройти их маршруты.', '', '', '', '', '', '', 47187),
(72482, 'ruRU', 'Продвинутый тур по Берегам Пробуждения', 'Пройдите все сложные маршруты на Берегах Пробуждения.', 'Итак, ты $gпреодолел:преодолела; все базовые маршруты на Драконьих островах и $gпоказал:показала; себя. Как насчет нового испытания?\n\nСложные маршруты во многом повторяют базовые, но местами отличаются и содержат дополнительные препятствия.\n\nДавай начнем с Берегов Пробуждения!', '', '', '', '', '', '', 47187),
(72481, 'ruRU', 'Тур по Берегам Пробуждения', 'Пройдите все маршруты на Берегах Пробуждения.', 'А что самое приятное в полетах на драконах? Конечно же, гонки! \n\nМои бронзовые коллеги нанесли на карту все гоночные маршруты островов. Этот удивительный разнообразный ландшафт просто создан, чтобы исследовать его на максимальной скорости.\n\nЕсли окажешься рядом с местом проведения на Берегах Пробуждения, обязательно поучаствуй!', '', '', '', '', '', '', 47187),
(72456, 'ruRU', 'Книги для благосклонности', 'Добудьте книги о происхождении черных драконов и принесите интендантам Гневиона и Сабеллиана.', 'Верхние укрепления у нас под контролем, но джарадины продолжают разорять внутренний двор. Там же полно бесценных исторических записей! Нам нужно действовать быстро, чтобы защитить наследие черных драконов.\n\nИ Гневион, и Сабеллиан хотят получить эти сведения, так что ты сможешь добиться благосклонности обоих, если принесешь каждому из них по книге.\n\nОтправляйся к обрушенной башне цитадели. Там должно быть что-нибудь достойное внимания.', '', '', '', '', '', '', 47187),
(72448, 'ruRU', 'Защита наследия', 'Уничтожьте двух редких врагов в Обсидиановой цитадели или Шлаковой топи.', 'Я много трудилась и многого достигла – и я не отдам цитадель врагам! \n\nУвы, появились новые угрозы. Я могу рассчитывать на тебя? \n\nПомоги нам защититься от них: найди и уничтожь двух самых могущественных из наших врагов.', '', '', '', '', '', '', 47187),
(72447, 'ruRU', 'Величайшая угроза', 'Уничтожьте двух редких врагов в Обсидиановой цитадели или Шлаковой топи.', 'Могучие джарадины и другие существа угрожают Обсидиановой цитадели и всему моему роду. \n\nТак дальше не может продолжаться.\n\nПомоги нам защититься: найди и уничтожь двух самых могущественных из наших врагов.', '', '', '', '', '', '', 47187),
(72435, 'ruRU', 'Ознакомление: Искара', 'Познакомьтесь с несколькими торговцами ценными товарами.', 'Добро пожаловать в Искару, дружище.\n\nМолва о твоих подвигах в Лощине Бурошкуров уже разошлась среди нашего народа. Ты уже $gпознакомился:познакомилась; со многими из нас, а другие только и ждут возможности обменяться с тобою знаниями и товарами.\n\nПрошу, удели немного времени знакомству с приветливыми жителями Искары. В нашей общине все друг друга поддерживают, и если ты много чего можешь нам предложить, то наш народ готов предложить тебе не меньше.', '', '', '', '', '', '', 47187),
(72434, 'ruRU', 'Круг у Рубинового святилища Жизни', 'Пройдите круг у Рубинового святилища Жизни.', 'Говорят, мне надо подрасти, чтобы участвовать в этих гонках. \n\nНо смотреть-то можно. Тебе стоит поучаствовать! Тогда я смогу посмотреть.', '', '', '', '', '', 'Пройдите круг у Рубинового святилища Жизни.', 47187),
(72429, 'ruRU', 'Ознакомление: Марукай', 'Встретьтесь с хранительницей известности и торговцем товарами за известность в Марукае.', '<Хан Сансок подает знак, и Окир вслух выражает ее волю.>\n\nМаруук не против чужаков, но потенциальные союзники должны доказать нам, что достойны чести ими стать. Знакомься с кланами, помогай в наших делах, и тогда весь наш народ узнает о твоей поддержке.\n\nНа нижнем уровне куртала на холме ты найдешь одну из дочерей ханам Матры. Она поможет тебе понять, насколько ты $gизвестен:известна; у нашего народа. Зайди познакомиться.', '', '', '', '', '', '', 47187),
(72428, 'ruRU', 'Хранители сокровищ', 'Добудьте 20 жгучих самоцветов у рогоплавов Драконьих островов для Гноклина Глюковерта из Драконьей экспедиции.', 'Не секрет, что рогоплавы в этих краях питают страсть к самоцветам, драгоценностям и прочим блестяшкам. Я однажды даже нашел очень редкий драгоценный камень в помете рогоплава!\n\nНу, может, это не самая приятная из задач, но, похоже, рогоплавы не только собирают драгоценности, но и поедают их.', '', '', '', '', '', '', 47187),
(72427, 'ruRU', 'Живой настой', 'Добудьте 13 листьев с шипами у плеточников Драконьих островов для Даррел из клана Маруук.', 'У меня к тебе простая просьба.\n\nУ алхимиков заканчивается ингредиент, нужный для одного непростого зелья. Это трава, и ее довольно легко добыть. Тебе просто нужно найти агрессивные растения и взять с них образцы. Справишься?', '', '', '', '', '', '', 47187),
(72423, 'ruRU', 'Пережить бурю', 'Добудьте 12 ед. оружия бури у нокхудских кентавров Драконьих островов для Тэмнааю из Искары.', 'А, ты как раз вовремя! До нас дошли слухи, что нокхуды используют могучее и очень опасное оружие, наделенное силой бури. Постарайся добыть несколько образцов, чтобы наши зачаровыватели смогли их изучить.\n\nДаже если узнать ничего не удастся, мы сможем найти этому оружию менее опасное применение.', '', '', '', '', '', '', 47187),
(72410, 'ruRU', 'Клешни и иглы', 'Добудьте 10 острых клешней косильщиков Драконьих островов для Гноклина Глюковерта из Драконьей экспедиции.', 'У наших портных начали заканчиваться иглы. Эти проклятые штуковины так и норовят переломиться пополам!\n\nОстрые части клешней косильщиков, обитающих в этих местах, вполне сгодятся на замену.', '', '', '', '', '', '', 47187),
(72406, 'ruRU', 'Ознакомление: Вальдраккен', 'Встретьтесь с важными поставщиками союза в Вальдраккене.', 'Добро пожаловать в Вальдраккен, $p. Я Унатос, хранитель известности в союзе Вальдраккена.\n\nВ знак признательности за твою помощь драконам мы поручили нескольким поставщикам в городе снабдить тебя лучшими припасами.\n\nЖелаешь ознакомиться со списком припасов и мест, где их можно получить?', '', '', '', '', '', '', 47187),
(72399, 'ruRU', 'Сад отшельника', 'Поговорите с садовником по имени Сзарет на Уступе Тени.', 'Родители всегда говорят, что нам надо держаться подальше от садов над Геликиром. Думают, что садовник злой и опасный. \n\nНо это не так! Он немного ворчливый, но очень милый! \n\nНикто из нас не был там с тех пор, как явились воины стихий. Это теперь слишком опасно. Надеюсь, у садовника все хорошо. Можешь заглянуть к нему за нас?', '', '', '', '', '', '', 47187),
(72397, 'ruRU', 'Ознакомление: лагерь Драконьей экспедиции', 'Встретьтесь с важными поставщиками лагеря Драконьей экспедиции.', 'Добро пожаловать в лагерь, $p.\n\nНам с Тодди потребовалось время, чтобы найти идеальное место для лагеря, но я более чем довольна нашим выбором.\n\nОтсюда легко добраться и до руин, и до мест обитания протодраконов, и до драконов, конечно.\n\nНе хочешь пройтись по лагерю и поговорить с поставщиками припасов для экспедиции?', '', '', '', '', '', 'Встретьтесь с Тодди Баки в палатке лагеря Драконьей экспедиции.', 47187),
