(72381, 'ruRU', 'Драконья экспедиция', 'Выполните 3 локальных задания тортолланов.', 'Помогите тортолланам, выполнив 3 локальных задания.', '', '', '', '', '', 'Вернитесь к коллекционеру Коджо.', 47187),
(72380, 'ruRU', 'Вместе мы непобедимы', 'Вернитесь к Престолу Аспектов и расскажите Алекстразе о том, что произошло после победы над Рашагет в Хранилище Воплощений.', '$n, сообщи Алекстразе и Ноздорму, что здесь произошло.\n\nМы с Кадгаром явимся к Престолу Аспектов в самое ближайшее время. Встретимся там.', '', '', '', '', '', 'Вернитесь к Алекстразе Хранительнице Жизни. Ее можно найти в Вальдраккене у Престола Аспектов.', 47187),
(72374, 'ruRU', 'Помощь союзу: крепость Драконьей Погибели', 'Отправляйтесь на Берега Пробуждения и начните осаду крепости Драконьей Погибели. Продолжайте помогать союзу Вальдраккена и тем, кто ему верен, на Драконьих островах.', 'Нашим союзникам снова нужна твоя помощь: это будет очередной вклад в наше общее дело на островах. В стенах Вальдраккена воцарился покой, ведь мы знаем: с твоей помощью мы спасли свое будущее.\n\nЧто ж, перейдем к делу.\n\nОставшиеся джарадины надвигаются на Берега Пробуждения из жарких недр крепости Драконьей Погибели. Нам нужно остановить их наступление.\n\nБудем ждать твоего возвращения, $n.', '', '', '', '', '', '', 47187),
(72373, 'ruRU', 'Помощь союзу: охота началась', 'Поучаствуйте в охоте Маруук на Драконьих островах. Продолжайте помогать союзу Вальдраккена и тем, кто ему верен, на Драконьих островах.', 'Наши союзники с равнин Он\'ары обратились с просьбой о помощи ко всем охотникам на этих землях.\n\nПока будешь исследовать острова, посети один из лагерей наших союзников и помоги им.\n\nНужно успеть многое сделать. Лучше не откладывай.', '', '', '', '', '', '', 47187),
