(72354, 'ruRU', 'Великое хранилище', 'Получите предмет из Великого хранилища.', 'Аспекты и их сородичи годами собирали необычные артефакты и оружие. Аспекты приказали построить защищенное чарами хранилище, где все эти ценные вещи будут дожидаться того дня, когда за ними явится достойная душа.\n\nВеликое хранилище находится за стенами банка. Возможно, если ты докажешь, что $gдостоин:достойна;, тебе достанется что-нибудь из древних сокровищ Аспектов.', '', '', '', '', '', '', 47187),
