(72293, 'ruRU', 'Приключения на Драконьих островах', 'Осмотрите тактическую карту и выберите, какой области Драконьих островов оказать поддержку.', 'О! Я знаю, что ты можешь сделать!\n\nДраконья экспедиция разместила недалеко отсюда замечательную карту островов. \n\nДолжна сказать, зарисовки на карте получились на редкость подробные и точные. Прости, мы тут не об искусстве рассуждаем.\n\nТебе стоит осмотреть ее, чтобы узнать, в каких уголках Драконьих островов нужна твоя помощь!', '', '', '', '', '', '', 47187),
(72292, 'ruRU', 'История о блистательной победе', 'Расскажите историю о вашей победе старейшине Поа в Искаре.', 'Вот это была битва!\n\nСтарейшина Поа в Искаре наверняка захочет послушать историю о вашей впечатляющей победе.', '', '', '', '', '', '', 47187),
(72291, 'ruRU', 'История о незабываемой победе', 'Расскажите историю о вашей победе старейшине Поа в Искаре.', 'Славный был бой! \n\nСтарейшина Поа в Искаре наверняка захочет послушать историю об этой победе.', '', '', '', '', '', '', 47187),
