(72269, 'ruRU', 'Тальдразус', 'Отправляйтесь в Вальдраккен и встретьтесь с Алекстразой Хранительницей жизни.', 'Алекстраза Хранительница жизни созывает собрание у Престола Аспектов, чтобы обсудить угрозу, которую несут воины стихий.\n\nОна приглашает любых искателей приключений, желающих помочь.', '', '', '', '', '', 'Отправляйтесь в Вальдраккен и встретьтесь с Алекстразой Хранительницей жизни.', 47187),
(72268, 'ruRU', 'Лазурный Простор', 'Поговорите с Масудом Мудрым на равнинах Он\'ары.', 'Кирин-Тору требуется помощь, чтобы отыскать камень клятвы синих драконов.\n\nНескольких магов видели на равнинах Он\'ары.', '', '', '', '', '', '', 47187),
(72267, 'ruRU', 'Равнины Он\'ары', 'Встретьтесь с посланником Тауразой на Рубиновой заставе.', 'Зеленым драконам нужна помощь героев. Но для этого придется подружиться с кентаврами равнин.\n\nТут тебе понадобится посланник Таураза.', '', '', '', '', '', '', 47187),
(72266, 'ruRU', 'Берега Пробуждения', 'Найдите Сендракс на Берегах Пробуждения.', 'Дракониду Сендракс нужна помощь со всеми, кто прибыл на Берега Пробуждения.', '', '', '', '', '', '', 47187),
(72263, 'ruRU', 'Без кавалерии никуда', 'Научитесь скакать на ездовом ворквине.', '$gПробудитель:Пробудительница;! Здесь по-прежнему бродят стада ворквинов!\n\nМне удалось пригнать нескольких – на них можно ездить верхом, чтобы дать отдохнуть крыльям. Еще не $gзабыл:забыла; навыки верховой езды?\n\nЭтот ворквин теперь твой. Пригодится, когда придется мотаться туда-сюда, выполняя приказы дракомандиров. Заботься о нем как следует.', '', '', '', '', '', '', 47187),
(72261, 'ruRU', 'Не просто тюрьма?', 'Принесите древний артефакт хранилища Лиллиан Яркой Луне.', '<Похоже, этот древний артефакт был порожден изначальными стихиями. Лиллиан Яркая Луна из Вальдраккена наверняка сможет о нем рассказать.>', '', '', '', '', '', '', 47187),
(72260, 'ruRU', 'Артефакты Хранилища', '', '', '', '', '', '', '', '', 47187),
(72259, 'ruRU', 'Артефакты Хранилища', '', '', '', '', '', '', '', '', 47187),
(72256, 'ruRU', 'Темные Когти', 'Передайте приказы лейтенанту Кодети и Темным Когтям.', 'Налейдея полна энтузиазма, но она историк, а не солдат. Она ничего не знает об опасностях, которые ждут нас на Драконьих островах.\n\nНо паниковать, разумеется, не стоит. Темные Когти обеспечат безопасность экспедиции.\n\nМне нужно обсудить логистические вопросы с Абиссианом и командованием Орды.\n\nМой лейтенант Кодети и другие драктиры сейчас знакомятся с городом. Исполни свой долг и сообщи ему, что мы собираемся у башни дирижаблей. Он передаст мои приказы остальным.', '', '', '', '', '', 'Встретьтесь с Налейдеей у башни дирижаблей около Оргриммара.', 47187),
