(72246, 'ruRU', 'Мирные сны', 'Поговорите с управляющим курорта.', 'Добро пожаловать на курорт \"Мирные сны\"!\n\nПриношу свои извинения, но мы пока не можем принимать гостей из-за обстоятельств, на которые не можем повлиять.\n\nСоветую обратиться к нашему управляющему Сицзаню Колючей Лапе. Он ответит на все вопросы.', '', '', '', '', '', '', 47187),
(72245, 'ruRU', 'Алхимия Драконьих островов', '', '', '', '', '', '', '', '', 47187),
(72244, 'ruRU', 'Начертание Драконьих островов', '', '', '', '', '', '', '', 'Поговорите с Джессамин Шпиц в посольстве Крылатого Приюта.', 47187),
(72243, 'ruRU', 'Травничество Драконьих островов', '', '', '', '', '', '', '', '', 47187),
(72242, 'ruRU', 'Инженерное дело Драконьих островов', '', '', '', '', '', '', '', '', 47187),
(72241, 'ruRU', 'Уроки минувших лет', 'Поговорите с дракомандиром Эмберталь.', 'Я Эмберталь, командир драктиров. Гневион помог нам, когда мы только пробудились, и теперь моя очередь помогать ему.\n\nНе сомневаюсь, у тебя много вопросов о драктирах и о том, откуда мы взялись. До недавних пор я бы не смогла на них ответить. \n\nНо Вневременный Ноздорму открыл нам всю правду. Мне даровали видение о том, кто и как нас создал... и почему нас заперли. \n\nПозволь, я расскажу тебе, что узнала.', '', '', '', '', '', '', 47187),
(72240, 'ruRU', 'Обсидиановые Хранители', 'Передайте приказы Дервишиан и Обсидиановым Хранителям.', 'Энергичность Тодди достойна восхищения. Но хочется верить, что это не ослепит ее перед лицом опасностей, которые ждут нас на Драконьих островах.\n\nТак или иначе, защита экспедиции – долг Обсидиановых Хранителей.\n\nМне нужно поговорить с Гневионом и лордом-командиром о предстоящем деле.\n\nМои драктиры пока знакомятся с городом. Найди Дервишиан, моего верного лейтенанта, и сообщи ей, что мы собираемся в порту. Она передаст мои приказы остальным.', '', '', '', '', '', 'Сообщите о своих успехах Тодди Баки в порту Штормграда.', 47187),
(72193, 'ruRU', 'Академия Алгет\'ар', 'Осмотрите академию Алгет\'ар.', 'Как я вижу, академия Алгет\'ар снова открывает миру свои двери. \n\nДавным-давно под эти священные своды пускали только драконов, но за прошедшие годы директор поняла, что будет мудрым решением принимать всех, кто захочет учиться. А еще она просила меня давать рекомендации по поводу новых перспективных учеников. \n\nТы $gстал:стала; для драконов настоящим другом, поэтому для нас будет честью, если ты посетишь нашу прекрасную академию. Учиться или нет – решай $gсам:сама;. Но я уверен, что Дорагоса с удовольствием устроит тебе экскурсию.', '', '', '', '', '', '', 47187),
(72192, 'ruRU', 'Чертоги Насыщения: порядок из хаоса', 'Войдите в Чертоги Насыщения и одолейте изначальное цунами.', 'Воины стихий хотят обрушить на мир былой хаос и не остановятся ни перед чем, пока не достигнут цели.\n\nДо меня дошли тревожные вести: враги проникли в Чертоги Насыщения под Тирхолдом и хотят использовать изобретения хранителя Тира в своих гнусных целях.\n\nПрошу тебя, $n, очисти священные чертоги от воинов стихий.', '', '', '', '', '', '', 47187),
(72191, 'ruRU', 'Редкая награда', '', '', '', '', '', '', '', '', 47187),
(72190, 'ruRU', 'Хранители и хранилища', 'Найдите Зуттики.', '$c! Нам очень нужна твоя помощь.\n\nВоины стихий напали на Тирхолдский резервуар. Мне удалось сбежать, но остальным, боюсь, не так повезло.\n\nРезервуар находится к северу отсюда. Отыщи Зуттики, она тебе все расскажет.\n\nЕсли, конечно, еще жива.', '', '', '', '', '', '', 47187),
(72189, 'ruRU', 'Сады и садовники', 'Поговорите с Грирмпехом.', 'Как тебе сад бабочек? Нравится?\n\nК югу отсюда есть еще сад, гораздо больше. За ним следит старый драконид по имени Грирмпех.\n\nКстати, ему не помешает помощь. Говорят, у него уже есть некий помощник, но я его никогда не видела. Не думаю, что от него много проку.\n\nЕсли зайдешь к Грирмпеху, сообщи ему, что ты от Ксины.', '', '', '', '', '', '', 47187),
(72175, 'ruRU', 'Фокус-покус!', 'Изготовьте $1oa |4палочку-удивлялочку:палочки-удивлялочки:палочек-удивлялочек; (огонь) и $2oa |4палочку-удивлялочку:палочки-удивлялочки:палочек-удивлялочек; (вода) для Сорагосы в Вальдраккене.', 'На этой неделе у нас очень интересные заказы! Ученики академии Алгет\'ар просто в восторге от этих забавных жезлов.\n\nМожет, поможешь сделать хотя бы несколько?', '', '', '', '', '', '', 47187),
(72172, 'ruRU', 'Сущности, осколки и всецветная пыль', 'Изготовьте $1oa |4горсть:горсти:горстей; всецветной пыли для Сорагосы в Вальдраккене.', 'Нам постоянно не хватает самых основных компонентов: сущностей, осколков... Вот и всецветная пыль почти закончилась.\n\nЕсли ты поможешь нам пополнить запас, может, нам не придется отвлекаться на это в первый же день недели.', '', '', '', '', '', '', 47187),
(72171, 'ruRU', 'Герой-одиночка', 'Завершите 12 боев в режиме \"Соло-суматоха\".', 'Хочешь отправиться на поиски битвы в одиночку? Одобряю. Ты весьма $gуверен:уверена; в своих силах. Проверим их на деле. Надеюсь, скучать не придется. \n\nПокажи, чего стоишь, и только потом возвращайся.', '', '', '', '', '', '', 47187),
(72168, 'ruRU', 'Герой стычек', 'Завоюйте очки чести в стычках на арене.', 'Считаешь себя прирожденным тактиком? Говорят, вы, смертные, часто устраиваете мелкие стычки. Иди и найди себе равных противников.\n\nПокажи, чего стоишь, и только потом возвращайся.', '', '', '', '', '', '', 47187),
(72167, 'ruRU', 'Герой войны', 'Завоюйте очки чести на эпических полях боя.', 'Что, хочешь \"настоящего сражения\"? Да будет так. Знаю пару мест, где даже мне придется непросто.\n\nОчень интересно посмотреть, как ты будешь умирать... Верней, справляться. Посмотрим, получится ли у тебя.', '', '', '', '', '', '', 47187),
(72166, 'ruRU', 'Герой сражений', 'Завоюйте очки чести на случайных полях боя.', 'Вы, смертные, просто обожаете устраивать возню из-за любого клочка земли, который находите. Будь по-вашему.\n\nТак или иначе, я повеселюсь. Давай, покажи, чего ты стоишь.', '', '', '', '', '', '', 47187),
(72159, 'ruRU', 'Отражение в чешуе', 'Добудьте $1oa |4глянцевую чешуйчатую шкуру:глянцевые чешуйчатые шкуры:глянцевых чешуйчатых шкур; для Ралатора Дубленого в Вальдраккене.', 'Чешуе можно найти много применений: чаще всего она используется для защиты, но иногда нам нужна ее отражающая поверхность. Многие из наших изящных зеркал на самом деле сделаны из чешуи.\n\nСейчас такие зеркала как раз пользуются большим спросом. Добудь для меня несколько чешуйчатых шкур, и я поделюсь с тобой секретами нашего ремесла.', '', '', '', '', '', '', 47187),
(72157, 'ruRU', 'Толща земли', 'Добудьте $1oa |4единицу:единиц:единиц; пробуждающейся земли для Секиты Землекоп в Вальдраккене.', 'Мне заказали несколько сотен тонн раскаленного первичного сплава, а у меня как раз закончилась пробуждающаяся земля. Понимаю, что задача не из простых, но, поверь, я достойно тебя вознагражу.', '', '', '', '', '', '', 47187),
(72154, 'ruRU', 'Скаг Метатель', '', '', '', '', '', '', '', '', 47187),
(72137, 'ruRU', 'Маленькое недоразумение', '', '', '', '', '', '', '', '', 47187),
(72135, 'ruRU', 'Тайны Нелтария', 'Добудьте в Нелтарии $1oa |4страницу:страницы:страниц; записей Нелтариона, $2oa |4обсидиановый журнал:обсидиановых журнала:обсидиановых журналов; и исследовательский труд.', '$gПутешественник:Путешественница;, у нас проблема... Джарадины начали выступать из Нелтария. Это значит, что они грабят его залы! \n\nВ Нелтарии хранится немало сокровищ. Но, что гораздо важнее, там скрыты ценные знания. История нашего рода, его падение – Сабеллиан и Гневион оба жаждут раскрыть тайны жизни и трудов Нелтариона.\n\nОтправляйся туда! Постарайся унести что-нибудь, пока джарадины все не разграбили!', '', '', '', '', '', '', 47187),
(72134, 'ruRU', 'Помощь путешественника', 'Используйте тактическую карту, чтобы выбрать вашу первую зону.', 'Землям, над которыми мы сейчас парим, – Расколотым островам – угрожает сразу несколько напастей.\n\nМы будем делать все возможное здесь, а ты изучи карту неподалеку и реши, кому хочешь помочь в первую очеред.', '', '', '', '', '', '', 47187),
(72131, 'ruRU', 'Излишки', '', '', '', '', '', '', '', '', 47187),
(72130, 'ruRU', 'Забытый грифон', '', '', '', '', '', '', '', '', 47187),
(72129, 'ruRU', 'Помощь Кадгару', 'Встретьтесь с Кадгаром в Аметистовой цитадели в Даларане.', 'Добро пожаловать в Даларан, $n. Я рад, что по пути сюда все обошлось.\n\nДавай поговорим в Аметистовой цитадели. Нам предстоит много дел.', '', '', '', '', '', 'Встретьтесь с Кадгаром в Аметистовой цитадели в Даларане.', 47187),
(72128, 'ruRU', 'Энкин Ненасытный', '', '', '', '', '', '', '', '', 47187),
(72127, 'ruRU', 'Капитан Копьеносица', '', '', '', '', '', '', '', '', 47187),
(72126, 'ruRU', 'Удивительная Улитка Хляп', '', '', '', '', '', '', '', '', 47187),
(72122, 'ruRU', 'Горе-экологи', 'Узнайте, что случилось с пропавшими экологами.', 'Состояние раненых стабильно, но теперь меня тревожит другое, $n.\n\nПара драконьих экологов прибыла на эту заставу, чтобы изучить болота. После нападения о них не было ни слуху ни духу.\n\nЕсли соберешься исследовать эти земли, поищи их и убедись, что они в порядке.\n\nИ будь $gосторожен:осторожна;. Говорят, эти болота кишат горлоками.', '', '', '', '', '', '', 47187),
(72121, 'ruRU', 'Хан Великий Панцирь', '', '', '', '', '', '', '', '', 47187),
(72117, 'ruRU', 'Культурный обмен', '', '', '', '', '', '', '', '', 47187),
(72116, 'ruRU', 'Лискрон Ослепительный', '', '', '', '', '', '', '', '', 47187),
(72114, 'ruRU', 'Акросот', '', '', '', '', '', '', '', '', 47187),
(72113, 'ruRU', 'Облики за завесой', '', '', '', '', '', '', '', '', 47187),
(72090, 'ruRU', 'Противостояние воинам стихий', '', '', '', '', '', '', '', '', 47187),
(72089, 'ruRU', 'Путь к Поднебесной обсерватории', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(72083, 'ruRU', 'Счастливая приманка', 'Заберите счастливую приманку капитана Хааба.', 'Я сейчас не в лучшем виде, |3-6($r), и это не потому, что я мертв.\n\nЯ погиб с оружием в руках – нужно было убедиться, что зверюга, убившая мою команду, не выживет и не убьет кого-то еще. Ни о чем не жалею. Да и отец бы гордился.\n\nНо загвоздка в том, что бой завершился ничьей!\n\nМой дух все еще здесь – как видишь, я сейчас с тобой разговариваю. И дух этого зверя тоже. Но я теперь призрак и для новой попытки даже не могу забрать свою счастливую приманку у мелюзги, которая все с меня обобрала!\n\nПоможешь мне с этим?', '', '', '', '', '', '', 47187),
(72079, 'ruRU', 'Большое пиршество', '', '', '', '', '', '', '', '', 47187),
(72075, 'ruRU', 'Ходовой товар', 'Возьмите рыбу для возврата в водоем и поднимитесь на драконе в воздух, чтобы сбросить ее с высоты.', 'Слабовато клюет, не находишь?\n\nЗнаешь, у меня тут возникла идея. Есть одна легенда, в которой сказано, что эти лавовые озера не всегда были полны теплолюбивой рыбы. Говорят, водоемы наполнялись рыбой, когда ее роняли драконы, пролетая сверху! Звучит невероятно, да?\n\nМожет, попробуешь пролететь на драконе и сделать так же?', '', '', '', '', '', '', 47187),
(72072, 'ruRU', 'Сброс с воздуха', 'Возьмите рыбу для возврата в водоем и поднимитесь на драконе в воздух, чтобы сбросить ее с высоты.', 'Клев мог бы быть и лучше, $gсогласен:согласна;?\n\nЗнаешь, у меня тут возникла идея. Есть одна легенда, в которой сказано, что рыба в этих озерах и реках была не всегда. Говорят, что водоемы наполнялись рыбой, когда драконы, пролетая сверху, сбрасывали ее вниз в проруби! Звучит невероятно, да?\n\nМожет, попробуешь пролететь на драконе и сделать так же?', '', '', '', '', '', '', 47187),
(72071, 'ruRU', 'Реванш на глубине', 'Убейте Мохоби.', 'Не хочешь немного порыбачить, $n?\n\nТут у берега у нас готов целый косяк наживки. Этот зверь бросится на нее, как только увидит, и даже позабудет, что он уже мертв.\n\nНужно, чтобы ты $gподплыл и помахал:подплыла и помахала; наживкой. Или, может, $gизобразил:изобразила; раненого тюленя. Тогда наша добыча точно не устоит.', '', 'Ужас из глубин.\n\nВся команда видела, как они с капитаном Хаабом бесследно сгинули в морской пучине. Но даже смерть не остудит жгучую жажду мести.', 'Мохоби', '', '', '', 47187),
(72068, 'ruRU', 'Помощь союзу: всеобщий пир', 'Отправляйтесь в Искару, что в Лазурном Просторе, и поучаствуйте в большом пиршестве. Продолжайте помогать союзу Вальдраккена и тем, кто ему верен, на Драконьих островах.', 'Нашим союзникам нужна твоя помощь, $n!\n\nТвои дела на островах не остались незамеченными. Наши верные союзники, искарские клыкарры, хотят отметить твои успехи, устроив грандиозный пир!\n\nОтправляйся в Искару и продолжай помогать друзьям союза. Когда доберешься до мерцающих вод южных земель, не стесняйся – присоединяйся к празднествам!', '', '', '', '', '', '', 47187),
(72067, 'ruRU', 'Заслуженный отдых!', 'Отправляйтесь на курорт \"Мирные сны\".', 'Привет! \n\nТы выглядишь совсем $gизможденным:изможденной;. $gОбессиленным:Обессиленной;. Тебе срочно нужен хороший отдых. И я как раз знаю одно местечко – курорт \"Мирные сны\"!\n\nУ нас проходят занятия по йо-ге, и это просто невероятные ощущения! Или, может, тебе нужна программа по уходу за лицом? Очень советую – и то, и другое!\n\nЧтобы нас найти, просто направляйся на север, как выйдешь из города.', '', '', '', '', '', '', 47187),
(72063, 'ruRU', 'Вернуть лодку Йенну', 'Верните игрушечную лодку Йенну.', 'Это игрушечная лодка Йенну. Если ее вернуть, он будет очень рад.', '', '', '', '', '', '', 47187),
(72061, 'ruRU', 'Призывательница бури Велдра', '', '', '', '', '', '', '', '', 47187),
(72060, 'ruRU', 'Особые процедуры', 'Верните солнечные очки Зелдису. Снова.', '<Похоже, грязевая маска с интересом наблюдает за вами, но ей некуда деваться с этой ветки!>', '', '', '', '', '', '', 47187),
(72058, 'ruRU', 'Кто громче топнет: Таролекк', '', '', '', '', '', '', '', '', 47187),
