(71242, 'ruRU', 'Помощь исследователям бури', 'Отнесите скопление энергии стихий ученому в Вальдраккене.', 'Похоже, вы обнаружили сгусток энергии, переполняющей существ в изначальной буре.\n\nВ Вальдраккене наверняка найдется ученый, которого заинтересует такая вещица.', '', '', '', '', '', '', 47187),
(71241, 'ruRU', 'Подсадные утки', 'Взведите охотничьи ловушки клана Айлааг в Первозданной долине.', 'В роще под названием Первозданная долина все дышит магией древних драконов. Там водится разновидность лис-виверн, чьи шкуры очень у нас ценятся. Но найти и изловить этих зверей непросто.\n\nВместо того, чтобы выслеживать их по следам, можешь воспользоваться ловушками, которые разместили в долине наши охотники. Для приманки используй мясо ближайших чирков. Я пошлю за пойманной добычей своих товарищей.', '', '', '', '', '', '', 47187),
(71239, 'ruRU', 'Поиски на высоте', 'Найдите Харлин Язвотрель на утесах Синего Пера.', 'Мне нужна помощь, а на тебя, как мне кажется, можно положиться.\n\n Мы с моей старой подругой Харлин Язвотрелью договаривались встретиться в городе несколько дней назад. Хотели наесться до отвала на Рубиновом Пиру, навести марафет в парикмахерской, потолкаться на местном аукционе...\n\nНо она так и не объявилась. Могла, конечно, заработаться, но мне было бы спокойнее точно знать, где она.\n\nПроверишь в горах к югу отсюда? Она говорила, что собиралась туда заскочить.', '', '', '', '', '', '', 47187),
(71238, 'ruRU', 'Рубиновый Пир!', 'Поговорите с шеф-поварами Румиястразой и Лакомкой на Рубиновом Пиру.', 'Внимание всем кулинарам!\n\nЖаждет ли ваше сердце познать лучшие оттенки вкуса со всего мира? Ищете ли вы возможности для грандиозных исследований? Готовы ли поставить на карту все ради того, с кем еще не знакомы?\n\nЕсли все это про вас, подходите к всемирно известному неподражаемому дуэту шеф-поваров – Румиястразе и Лакомке! Именно они устраивают Рубиновый Пир в Вальдраккене!', '', '', '', '', '', '', 47187),
(71235, 'ruRU', 'Боевые маги', 'Встретьтесь с магами Кирин-Тора рядом с Откосом лис-виверн в Лазурном Просторе.', 'Лок\'тар, |3-6($r). \n\nУ нас сейчас два мага заняты полевой работой. Если у тебя есть время, помощь им точно не помешает.\n\nЭти земли опасны даже в свои лучшие времена. \n\nА сейчас времена далеко не лучшие.', '', '', '', '', '', '', 47187),
(71234, 'ruRU', 'Суета в прибежище', 'Отправляйтесь в Прибежище Китобоя в Лазурном Просторе.', 'А, это ты, |3-6($r). \n\nПохоже, ты много путешествуешь. \n\nМой брат Вайюн возвращался с уловом из Прибежища Китобоя и сказал, что там разбили лагерь какие-то... странные личности.\n\nНе похоже, что они заняты чем-то предосудительным, но, может, ты заглянешь туда проведать Вайюна?\n\nА то характер у него непростой.', '', '', '', '', '', '', 47187),
(71233, 'ruRU', 'Падающая вода', 'Поговорите с Уиллой на Берегу трех водопадов в Лазурном Просторе.', 'Я люблю водопады. \n\nА знаешь, что может быть лучше, чем водопад? \n\nДва водопада! \n\nА лучше двух водопадов... В общем, загляни на Берег трех водопадов к западу отсюда и $gсам:сама; все увидишь!\n\nКстати, там весьма приветливая хозяйка таверны.', '', '', '', '', '', '', 47187),
(71232, 'ruRU', 'Известность на Драконьих островах', 'Поговорите с Теразалом в Вальдраккене.', 'На Драконьих островах еще многое предстоит сделать.\n\nХочу попросить тебя поговорить с Теразалом. Он подробнее расскажет, кому в этих землях требуется помощь.', '', '', '', '', '', 'Поговорите с Теразалом в Вальдраккене.', 47187),
(71231, 'ruRU', 'Зов охоты', 'Поговорите с наставником Фродрумом на равнинах Он\'ары.', '<Роки сбрасывает вам в руки записку.>\n\n$n, клан Шикаар приглашает тебя на великую охоту. Найди наставника Фродрума на равнинах Он\'ары.', '', '', '', '', '', '', 47187),
(71230, 'ruRU', 'Клыкаррские рыболовные снасти', 'Поговорите с Тавио в поселении Искара в Лазурном Просторе.', 'Снова привет, $n.\n\n<Роуи смотрит по сторонам и напевает себе под нос.>\n\nАх, да! Тавио делала мне мне новую сеть и сказала, что может сделать тебе такую же. А если принесешь ей нужные вещи, она смастерит тебе и другие снасти.\n\nИди и поговори с ней.', '', '', '', '', '', '', 47187),
(71229, 'ruRU', 'Зов просторов', 'Поговорите с ханом Хадари на равнинах Он\'ары.', '<Роки сбрасывает послание вам в руки.>\n\n$n, до клана Айлааг дошла молва о твоих великих подвигах. Приглашаю тебя познакомиться с нашим кланом и его обычаями.\n\nХан Хадари', '', '', '', '', '', '', 47187),
(71227, 'ruRU', 'Воздушные испытания', 'Поговорите с бронзовым хранителем времени, чтобы узнать о воздушных испытаниях.', '<Крылохлоп воодушевленно хлопает крыльями и роняет к вашим ногам записку и обгоревшего грызуна.>\n\n$gДраконий всадник:Драконья всадница;! Уже ни для кого не секрет, что ты отлично летаешь. Приглашаем проверить себя в воздушных испытаниях в разных частях Драконьих островов.\n\nЧтобы начать, поговори с любым бронзовым хранителем времени.', '', '', '', '', '', '', 47187),
(71219, 'ruRU', 'Беспутный Страж Дорог', 'Найдите Алви Стража Дорог.', 'Кажется, некоторые юные Стражи Дорог начинают пренебрегать своим долгом.\n\nСтраж Дорог Нори просила меня проведать ее младшую сестру Алви – она ведет службу у входа в Перевал Времени. Похоже, в последнее время она совсем отбилась от рук.\n\nЕсли твой путь лежит на восток, ты наверняка ее повстречаешь. Прошу, напомни Алви, как важна ее служба и передай, что сестра очень за нее волнуется.', '', '', '', '', '', '', 47187),
(71210, 'ruRU', 'На штурм Драконьей Погибели!', 'Отправляйтесь на Берега Пробуждения и помогите Обсидиановым изгоям в осаде Драконьей Погибели.', '<Крылохлоп роняет вам в руку слегка обугленную записку.>\n\n$n, Обсидиановые изгои наслышаны о твоей храбрости. Крепость Драконьей Погибели когда-то была нашим домом, но теперь в ней хозяйничают джарадины. Мы никогда с этим не смиримся. Помоги нам вернуть то, что принадлежит нам.\n\nБосс', '', '', '', '', '', '', 47187),
(71209, 'ruRU', 'Дитя равнин', 'Возьмите поводья Яши', 'Думаю, Яша готова вернуться на равнины. Она очень к нам с тобой привязалась, но я вижу, что ей хочется назад в природу.\n\nКогда-нибудь я стану жрицей ветра и обойду мир далеко за пределами ключей. Но сначала надо выдержать испытания посвященных! Как быстро летит время.\n\nЯ сделала седло и поводья из шерсти, которую ты $gсобрал:собрала;. Уверена, Яша с радостью последует за тобой.\n\nПрошу, возьми ее, $p. Пусть тоже путешествует.', '', '', '', '', '', '', 47187),
(71206, 'ruRU', 'Око буревика', 'Победите Штормаму в битве питомцев.', '', '', '', '', '', '', '', 47187),
(71205, 'ruRU', 'Гидроклыкарр', '', '', '', '', '', '', '', '', 47187),
(71202, 'ruRU', 'Бой с маленьким манадемоном', 'Победите Чародеуса в битве питомцев.', '', '', '', '', '', '', '', 47187),
(71199, 'ruRU', 'Приручение громоспина', '', '', '', '', '', '', '', '', 47187),
(71198, 'ruRU', 'Приручение громоспина', '', '', '', '', '', '', '', '', 47187),
(71197, 'ruRU', 'Приручение громоспина', '', '', '', '', '', '', '', '', 47187),
(71196, 'ruRU', 'Приручение громоспина', 'Добудьте $1oa |4порцию:порции:порций; светящейся жидкости у насекомых Драконьих островов, а также $2oa |4единицу:единицы:единиц; припасов Драконьих островов.', 'Я ужасно рада, что Яша теперь в безопасности.\n\nВот только ее раны затягиваются не так быстро, как хотелось бы. Надеюсь, магия, которой ее подвергали, не нанесла непоправимый урон.\n\nТы не $gмог:могла; бы набрать лимфы насекомых? Знаю, звучит отвратительно! Но это важный ингредиент для многих лечебных мазей.', '', '', '', '', '', '', 47187),
(71195, 'ruRU', 'Приручение громоспина', 'Добудьте зеленый карри Мелуун в ключах Он\'ир, а также $2oa |4единицу:единицы:единиц; припасов Драконьих островов.', 'Кажется, это теперь любимое место Яши. А еще ей не хочется возвращаться домой. И все же она дикий зверь.\n\nДолжна тебе кое в чем признаться... Мы с Мелуун не разговаривали с тех пор, как спасли Яшу. Знаю, она была права, но как с ней теперь заговорить?.. Что бы я ни делала, ей все не нравится. Понимаю, я должна больше времени уделять учебе.\n\nКстати, Мелуун готовит потрясающий карри. Яше он бы точно понравился. Ты бы не $gмог:могла; ее попросить сделать такой? Мелуун обычно работает в доме oн\', что к западу от ключей.', '', '', '', '', '', '', 47187),
(71194, 'ruRU', 'Пламенные прыгуны', 'Приучите рогошипов избегать запаха ледохмеля.', 'Мне удалось найти идеальное место для сети, но есть одна проблема... Рогошипы. Наверняка они разорят сети, стоит мне только отойти. Что делать?\n\nХм... Есть у меня одна идея. Мы обрабатываем сети для рыбалки в лаве ледохмелем, чтобы сделать их устойчивыми к жару. Нам просто нужно приучить рогошипов держаться подальше от этого запаха.\n\nБрось флягу с ледохмелем в рогошипа, а затем рань его. Только смотри не убей: мертвые они ничему не научатся, так ведь?', '', '', '', '', '', '', 47187),
(71193, 'ruRU', 'Подводная напасть', 'Выманите огромное подводное чудище из рыболовной лунки Тирхолда 5 зловещими раковинами и добудьте трофей в доказательство победы над ним.', 'Ты $gвидел:видела;? Там, под водой! Огромное голодное чудище в панцире! Пока эта жуть там прячется, я к воде ни ногой. Оно мне всю сеть попортит! Если тебе не сложно, попробуй выманить его зловещими раковинами. Ты их легко наловишь.', '', '', '', '', '', '', 47187),
(71192, 'ruRU', 'Контроль популяции хищников', 'Расставьте пугающие чучела.', 'Приветствую!\n\nЯ тут ищу место, где можно забросить сети, но, похоже, в окрестностях слишком много клуш: они поедают всех мальков – те и вырасти не успевают.\n\nУ меня есть чучела, которые смогут распугать хотя бы некоторых прожорливых птиц. Это позволит нам сохранить рыбные места в драконьих источниках. \n\nПоможешь мне расставить чучела?', '', '', '', '', '', '', 47187),
(71191, 'ruRU', 'Проблемы с сетью', 'Найдите сеть угрюмого рыбака в одной из лунок Лазурного Простора.', 'Вот беда... Мою сеть унесло течением. <вздыхает> Мои друзья любят рыбачить с удочками, а вот я нет...\nПрошу, верни мою сеть, если найдешь ее неподалеку.', '', '', '', '', '', '', 47187),
(71182, 'ruRU', 'Своенравные архивариусы', 'Встретьтесь с Синдрагосой наверху в Лазурных архивах.', 'Драктир! \n\nДвое из ваших что-то ищут в архивах к югу отсюда. Мне нужно с ними познакомиться, и будет здорово, если ты тоже там будешь.\n\nДавай встретимся в архивах наверху, когда у тебя будет время.', '', '', '', '', '', '', 47187),
(71179, 'ruRU', 'Дозорная площадка', 'Поговорите с командиром Тадезусом на дозорной площадке геликиров.', '$n, у меня для тебя новое задание.\n\nМне доложили, что воины стихий что-то затевают недалеко от Геликирского аванпоста. Это ставит под угрозу наши позиции в Тирхолде.\n\nПоговори с командиром Тадезусом – нужно решить, что следует предпринять.', '', '', '', '', '', 'Поговорите с командиром Тадезусом на дозорной площадке геликиров.', 47187),
(71178, 'ruRU', 'Путевые врата: Тенистый Приют', 'Найдите бездействующие путевые врата в Тенистом Приюте на равнинах Он\'ары.', 'Нам сообщили, что к юго-западу отсюда, на склоне среди зарослей, находятся неактивные путевые врата. Нужно, чтобы на них взглянул кто-то знающий, вроде тебя. Но предупреждаю: путь туда неблизкий.', '', '', '', '', '', '', 47187),
(71166, 'ruRU', 'Старейшая стрекоза', 'Победите Рогулю в битве питомцев.', '', '', '', '', '', '', '', 47187),
(71165, 'ruRU', 'Путевые врата: Грань Эпохи', 'Найдите неактивные путевые врата в Грани Эпохи в Тальдразусе.', 'Далеко-далеко отсюда, в скалистых землях Тальдразуса есть небольшая таверна, пристроившаяся на склоне горы. В прихожей этой таверны стоит всеми позабытый и давно уснувший камень.\n\nЧто скажешь, $n? Отправишься в очередное путешествие?', '', '', '', '', '', '', 47187),
(71162, 'ruRU', 'Путевые врата: Алгет\'ера', 'Найдите неактивные путевые врата на вершине башни в Алгет\'ере в Тальдразусе.', 'Еще один камень. Еще один шпиль.\n\nСоветую поскорей отправиться в путь. Дорога в этот раз неблизкая. И опасная, если верить тем, кто нашел врата.\n\nНу что, не $gструсил:струсила;?', '', '', '', '', '', '', 47187),
(71161, 'ruRU', 'Путевые врата: Вактрос', 'Найдите неактивные путевые врата на вершине башни в Вактросе в Лазурном Просторе.', 'Сообщается, что на юго-востоке, где ужасно холодно, находится еще один дремлющий камень.\n\nТолько не радуйся раньше времени: в такие места по доброй воле обычно не попадают. Но если, конечно, ты жаждешь приключений с риском для жизни, тогда вперед! Тебе понравится!\n\nВ общем, ты $gготов:готова;? Отлично!\n\nЗахвати вещи потеплее. Иди на восток. Когда от холода защиплет в носу, все равно продолжай идти. Ты поймешь, что цель уже близко, когда станет трудно дышать, а холод проберет до костей.', '', '', '', '', '', '', 47187),
(71160, 'ruRU', 'Глубинная бомба', '', '', '', '', '', '', '', '', 47187),
(71157, 'ruRU', 'Путевые врата: Поднебесная обсерватория', 'Найдите неактивные врата в Поднебесной обсерватории на Берегах Пробуждения.', 'Наши исследователи, которые отправились дальше на север, сообщают, что к северо-востоку отсюда есть еще один такой камень – на верхушке башни.\n\nПравда, говорят, что до него трудно добраться. Ну еще бы, на такой-то высоте! Но в тебе я не сомневаюсь, ты найдешь способ.', '', '', '', '', '', '', 47187),
(71155, 'ruRU', 'Лазурное хранилище', 'Остановите захватчиков из Расколотого Пламени в Лазурном хранилище.', 'У нас проблема, $n.\n\nПод Лазурными архивами находится Лазурное хранилище. За свою жизнь я собрала в нем немало ценных и опасных магических диковинок.\n\nНо в хранилище проник большой отряд Расколотого Пламени. Они убеждены, что найдут в нем ответы на свои вопросы.\n\nПрошу, останови это безрассудное вторжение, пока эти воры не пробудили угрозу за пределами их понимания.\n\nОни даже не представляют, с чем имеют дело.', '', '', '', '', '', '', 47187),
(71153, 'ruRU', 'Локальные задания, дополнительные задачи и сценарии Ох!', 'Выполните 3 локальных задания тортолланов.', 'Помогите тортолланам, выполнив 3 локальных задания.', '', '', '', '', '', 'Вернитесь к коллекционеру Коджо.', 47187),
(71152, 'ruRU', 'Возвращение в главный зал', 'Встретьтесь с Тодди в главном зале.', 'Теперь, когда у нас есть доступ к консолям управления, думаю, мы сможем преодолеть барьер.\n\nБуду ждать тебя в главном зале – надо довести дело до конца.', '', '', '', '', '', '', 47187),
(71151, 'ruRU', 'Путевые врата – новые исследования', 'Встретьтесь с Телином Темная Наковальня на Рубиновой заставе на Берегах Пробуждения.', '<Вы получили письмо на новеньком пергаменте без единого пятнышка и с печатью Драконьей экспедиции.\n\nТелин Темная Наковальня просит вас ему помочь.>', '', '', '', '', '', '', 47187),
(71150, 'ruRU', 'Путевые врата – новые исследования', 'Встретьтесь с Телином Темная Наковальня на Рубиновой заставе на Берегах Пробуждения.', '<Пергамент источает неприятный затхлый запах. Наконец-то придя в себя, вы прочитываете послание, в котором Телин сообщает о новых открытиях и просит вас помочь с разгадкой их тайн.\n\nУ вас остается только один вопрос: что делать со зловонным пергаментом?>', '', '', '', '', '', '', 47187),
(71149, 'ruRU', 'Путевые врата – новые исследования', 'Встретьтесь с Телином Темная Наковальня на Рубиновой заставе на Берегах Пробуждения.', '<В этот раз посланник принес вам не записку или мешочек, а предмет из личной коллекции Телина.\n\nВнимательно рассмотрев его, вы замечаете крошечное послание, в котором Телин опять просит вас о помощи.>', '', '', '', '', '', '', 47187),
(71148, 'ruRU', 'Путевые врата – новые исследования', 'Встретьтесь с Телином Темная Наковальня на Рубиновой заставе на Берегах Пробуждения.', '<Странное существо протягивает вам послание с подписью и печатью Драконьей экспедиции.\n\nДолжно быть, это просьба о помощи от знаменитого исследователя.>', '', '', '', '', '', '', 47187),
(71146, 'ruRU', 'Путевые врата – новые исследования', 'Встретьтесь с Телином Темная Наковальня на Рубиновой заставе на Берегах Пробуждения.', '<Обучаемый исследователь вручает вам туго скрученную записку. Похоже, вашему старому товарищу Телину Темная Наковальня нужна помощь.\n\nПрежде, чем убежать, зверек протягивает к вам лапку, будто прося поощрения за труд. Через несколько секунд раздается пронзительный крик, и странное создание гневно уходит без угощения.>', '', '', '', '', '', '', 47187),
(71145, 'ruRU', 'Великий укротитель', 'Победите Патчу в битве питомцев.', '', '', '', '', '', '', '', 47187),
(71144, 'ruRU', 'Гроза Альянса', 'Ни разу не погибнув, убейте 10 воинов Альянса, пока за вашу голову назначена награда.', 'Да! Не останавливайся, продолжай убивать этих псов из Альянса!\n\nЕще немного, |3-6($c), и как знать, может, ты поставишь новый рекорд.\n\nНо будет нелегко: Альянс назначил за твою голову награду, так что не зевай!\n\nЗа Орду!', '', '', '', '', '', '', 47187),
(71143, 'ruRU', 'Гроза Орды', 'Ни разу не погибнув, убейте 10 ордынцев, пока Орда охотится на вас.', 'Ух ты! Так держать, солдат! \n\nУбей еще немного ордынцев, и ты попадешь в книгу рекордов Альянса. \n\nНо будет нелегко: Орда назначила за твою голову награду, так что будь начеку!\n\nЗа Альянс!', '', '', '', '', '', '', 47187),
(71141, 'ruRU', 'Жабры с желчью', 'Убейте Гурблбоблра Захватчика в лагере Мокрого утеса.', 'Кад\'ирза безрассудна, но в крабах разбирается хорошо. Эти горлоки зашли слишком далеко!\n\nЯ заметил, что они стали по всем делам приходить к Гурблбоблру. И, что важно для нас, он приказывает остальным похищать крабов. Мы должны прекратить это безобразие, чтобы восстановить равновесие природы и защитить тех, кто о ней заботится.\n\nОдолей Гурблбоблра. Не дай горлокам захватить земли за пределами реки!', '', 'Горлок чудовищных размеров. Удивительно, что такие вообще существуют.', 'Гурблбоблр Захватчик', '', '', '', 47187),
(71140, 'ruRU', 'Два плюс два', 'Победите Бакшушек в битве питомцев.', '', '', '', '', '', '', '', 47187),
(71139, 'ruRU', 'Светящийся чародейский камень', 'Принесите светящийся чародейский камень Норико Всезнающей в лагерь Антонидаса.', '<Похоже, что камень довольно мощный. Он излучает жуткий потусторонний свет.\n\nСкорее всего, его стоит отдать Кирин-Тору, чтобы его поместили в безопасное место.>', '', '', '', '', '', 'Принесите светящийся чародейский камень Норико Всезнающей в лагерь Антонидаса.', 47187),
(71138, 'ruRU', 'Путевые врата: рубеж Русза\'тар', 'Найдите бездействующие путевые врата на рубеже Русза\'тар на равнинах Он\'ары.', 'Участник экспедиции исследовал равнины Он\'ары и заметил на возвышении дремлющие путевые врата.\n\nКак насчет увлекательной вылазки?', '', '', '', '', '', '', 47187),
(71135, 'ruRU', 'Нерешенные проблемы', 'Вступите в бой с Ледокусом в лагере Снегошкуров в Лазурном Просторе.', 'Если я чему и научился за время, проведенное в глуши, так это тому, что со злом надо кончать сразу, как его обнаружишь. Если не вырвать сорняк с корнем, он вырастет и сладить с ним будет куда тяжелее.\n\nЛедокус отравлял всем жизнь в этих горах еще с тех пор, как я был юнцом вроде тебя. Если он встанет во главе племени Снегошкуров, мы обречены.\n\nМне давно следовало его проучить – но я не проучил. Теперь только мы с тобой можем исправить мою ошибку.', '', 'Пора покончить с его бесчинствами и лишить власти.', 'Ледокус', '', '', '', 47187),
(71097, 'ruRU', 'Когтистая лапа помощи', 'Активируйте артефакт в башне над Кобальтовой ассамблеей и проследите за действиями Вендертвана.', 'Допустим, артефакт ты $gзарядил:зарядила;. А теперь включи его.\n\nИ не смотри на меня так! Хватит делать вид, тебе все равно, заработает ли он. \n\nПросто потряси его еще раз, а затем медленно отойди и дай мне завершить начатое.', '', '', '', '', '', '', 47187),
(71096, 'ruRU', 'Берегись когтей', 'Попробуйте активировать артефакт.', '<Вендертван трет глаза и издает рык боли.>\n\nЛадно. Раз не хочешь отдавать, тогда попробуй заставить эту штуку работать. \n\nЯ ведь все равно ее заберу. Силой, если потребуется.\n\nТак что вперед. Потряси, может, ну или придумай что-нибудь.', '', '', '', '', '', '', 47187),
(71095, 'ruRU', 'Принимая лапу помощи', 'Спросите Вендертвана, как ему помочь, и сделайте то, о чем он попросит.', 'Давай посмотрим, что можно сделать, чтобы ему помочь!\n\n<Хелет наклоняется ближе и шепчет.>\n\nНе волнуйся, мы не позволим ему взять ничего такого. Просто немного повеселимся!\n\nУже целую вечность никто не забирался сюда, к нам наверх. И нам ТАК скучно!\n\n<Хелет вам подмигивает.> \n\nПочему бы тебе не спросить, чего он хочет?', '', '', '', '', '', '', 47187),
(71094, 'ruRU', 'По-другому нельзя!', 'Найдите бинты для Вендертвана в башне над Кобальтовой ассамблеей.', 'Привет! \n\nТы здесь тоже, чтобы помогать? Как я погляжу, так и есть!\n\n<Хелет указывает на раненого драктира.>\n\t\t\t\nБедняга повредил крыло, пытаясь сюда долететь! Он похож на тех злыдней внизу, но его я совсем не боюсь. Я все равно ему помогу, ведь по-другому нельзя!\n\n<Хелет выпячивает грудь.> \n\t\t\t\nЯ буду его охранять, а ты пока найди, чем его перевязать!', '', '', '', '', '', '', 47187),
(71093, 'ruRU', 'Наследие Тира: тайны прошлого', 'Отправляйтесь в подземелье \"Ульдаман: наследие Тира\" в Бесплодных землях и добудьте диск.', 'Чтобы не дать Рашагет освободить других Воплощений, нужно восстановить силу Аспектов.\n\nПравда, у титанов и так хватает забот, а хранитель Тир давно мертв.\n\nУ королевы Алекстразы созрел план. В Бесплодных землях находится построенный титанами Ульдаман. Союзники Тира могли спрятать диск с его воспоминаниями там.\n \nНо говорят, что это место заполонили трогги. Собери подмогу, отправляйся в Ульдаман и отыщи диск во имя королевы драконов!', '', '', '', '', '', '', 47187),
