(71029, 'ruRU', 'Приемы охоты: обучение спутника', 'Выберите дополнительную способность спутника для великой охоты.', 'Ты не перестаешь восхищать кентавров Маруук. В благодарность за твои дела я научу тебя новым боевым командам для охотничьего спутника.', '', '', '', '', '', '', 47187),
(71028, 'ruRU', 'Приемы охоты: благословение Он\'ары', 'Выберите благословение Он\'ары для великой охоты.', 'Все больше кентавров Маруук знают о твоих подвигах. Слушай внимательно: я научу тебя, как взывать к Он\'аре, чтобы та защитила тебя и твоих союзников.', '', '', '', '', '', '', 47187),
(71027, 'ruRU', 'Разыскивается: Мара\'нар Громогласный', 'Убейте Мара\'нара Громогласного в Первозданной долине и добудьте одну из его пластин.', 'Нам нужен могучий охотник, который смог бы прикончить обезумевшего зверя.\n\nРокочущий ящер по прозвищу Мара\'нар Громогласный добрался из Зарослей громоспинов до Первозданной долины, неся за собой сплошные разрушения. Он электризует воду, валит деревья и разоряет утиные гнезда.\n\nНадо остановить эти бесчинства. Убей его и принеси одну из его пластин в доказательство кешиктену Джеботаю.\n\nДа хранит тебя Он\'ара.', '', 'Этот зверь – настоящая гроза Первозданной долины. Из-за него пострадало уже не одно утиное гнездо.', 'Мара\'нар Громогласный', '', '', '', 47187),
(71026, 'ruRU', 'Вопреки всему', 'Убейте 25 игроков Орды 70-го уровня на Драконьих островах.', 'Хотя вы, жалкие смертные, прекратили свои войны, поговаривают, что кое-кто из вас до сих пор не прочь намять соседу бока.\n\nЕсли хочешь, собери приятелей, а я покажу место, где можно вспомнить былое.\n\nКстати, если справишься, получишь награду. Так интереснее, правда?', '', '', '', '', '', '', 47187),
(71024, 'ruRU', 'Хаос и сумятица', 'Помогите Эриме расследовать происшествие на нижнем уровне Престола Аспектов.', '$n! $gСлышал:Слышала;, какой шум поднялся? На нижнем уровне что-то произошло.\n\nМой доверенный следователь Эрима уже там. Надо, чтобы кто-нибудь помог ему найти зацепки и выяснить, что произошло, пока он опрашивает свидетелей.', '', '', '', '', '', '', 47187),
(71023, 'ruRU', 'Известность в союзе Вальдраккена', 'Поговорите с Унатосом в Вальдраккене.', 'Судя по твоим делам, слава, которую ты $gснискал:снискала; до путешествия на Драконьи остова, вполне заслужена. \n\nЯ буду с удовольствием помогать тебе и дальше – предоставлять дополнительные припасы. Найди меня в Вальдраккене.', '', '', '', '', '', '', 47187),
(71022, 'ruRU', 'Рогатый лидер', 'Прикажите Тайвану бросить вызов упрямому барану.', 'Раз аргали не очень-то уважают Тайвана, посмотрим, как он справится с их самцом.\n\nЭто вожак всего стада и крайне упрямый зверь. Если Тайван сумеет показать над ним превосходство, стая начнет его слушаться.\n\nНайдешь этого барашка вон там, на холме. Удачи тебе, Тайван... Если и это не сработает, то он уже вряд ли станет пастухом.', '', '', '', '', '', '', 47187),
(71020, 'ruRU', 'Хранилище Воплощений – вынужденные меры', 'Добудьте 3 осколка посоха хранительницы стаи Денны в Хранилище Воплощений в эпохальном режиме.', 'Хранительница стаи Денна скрывается где-то в крепости и наверняка присматривает за хранилищем из своих покоев. Если добудешь осколки ее посоха, мы сможем заявиться прямо в ее логово.\n\nТрех осколков должно хватить. Четырех будет уже слишком много.', '', '', '', '', '', '', 47187),
(71019, 'ruRU', 'Хранилище Воплощений – вынужденные меры', 'Добудьте 3 осколка посоха хранительницы стаи Денны в Хранилище Воплощений в героическом режиме.', 'Хранительница стаи Денна скрывается где-то в крепости и наверняка присматривает за хранилищем из своих покоев. Если добудешь осколки ее посоха, мы сможем заявиться прямо в ее логово.\n\nТрех осколков должно хватить. Четырех будет уже слишком много.', '', '', '', '', '', '', 47187),
(71018, 'ruRU', 'Хранилище Воплощений – вынужденные меры', 'Добудьте 3 осколка посоха хранительницы стаи Денны в Хранилище Воплощений в обычном режиме.', 'Хранительница стаи Денна скрывается где-то в крепости и наверняка присматривает за хранилищем из своих покоев. Если добудешь осколки ее посоха, мы сможем заявиться прямо в ее логово.\n\nТрех осколков должно хватить. Четырех будет уже слишком много.', '', '', '', '', '', '', 47187),
(71017, 'ruRU', 'Послание Налуки', 'Отнесите рыбью голову от Налуки старине Мрачноклыку.', 'Дай угадаю, Клык велел тебе не открывать письмо?\n\nПохоже, ты так и $gпоступил:поступила;. Понятно, почему он так тебе доверяет! \n\nОтнеси ему рыбью голову. Он поймет, что это означает.', '', '', '', '', '', 'Отнесите рыбью голову от Налуки Мрачноклыку.', 47187),
(71016, 'ruRU', 'Сестра Мрачноклыка', 'Отнесите письмо Мрачноклыка его сестре Налуки в Искару.', 'Осталось только моя сестра, Налуки. Она работает помощницей в таверне в Искаре.\n\nПросто передай ей письмо. \n\nТолько $gсам:сама; его не открывай.', '', '', '', '', '', 'Доставьте письмо Мрачноклыка его сестре Налуки в Искару.', 47187),
(71015, 'ruRU', 'Сила есть, ума не надо', 'Найдите Варсека в Древнем дозоре.', 'Варсек – один из самых могучих драконидов, которые только существуют. И один из самых глупых, но он этого, конечно, никогда не признает.\n\nЛедокус его напугал, и Варсек затеял переоценку ценностей... или что-то такое. Заявил, что руины его предков стоят неисследованными, и решил стать \"ученым\".\n\nСкажи, чтобы возвращался. Ему там все равно не место!', '', '', '', '', '', 'Найдите Варсека в Древнем дозоре.', 47187),
(71014, 'ruRU', 'Союзник на острове', 'Найдите Барста на острове Длинного Когтя.', 'Барст – один из самых сильных фурболгов, что я знаю. Если свора Ледокуса его одолела, это о многом говорит.\n\nПоследнее, что я о нем слышал, это то, что он отправился на остров у берегов Искары. Сказал, что уходит \"на заслуженный отдых\". Ну и чушь.\n\nНайди Барста и передай, что пора возвращаться. \n\nИ пусть его манера речи тебя не обманывает! Он порвет на куски любого, кто не так на него посмотрит.', '', '', '', '', '', 'Найдите Барста на острове Длинного Когтя.', 47187),
(71013, 'ruRU', 'Не стоит мстить на голодный желудок', 'Поймайте $2oa |4ледяного быстроплава:ледяных быстроплавов:ледяных быстроплавов; в укрытии Мрачноклыка.', 'Теперь когда мы вернулись к нашей задаче, нам надо кое-что обсудить с бивня на бивень. Помнишь того гнолла, Ледокуса? С которым ты $gговорил:говорила;.\n\nМы с ним давние... приятели.\n\nОбъяснять придется долго. А пока я буду этим заниматься, ты наловишь рыбы. Надо накормить всех. Им понадобятся силы.', '', '', '', '', '', '', 47187),
(71012, 'ruRU', 'Варсек поможет общему делу', 'Сообщите Мрачноклыку, что Варсек поможет общему делу.', 'Думаю, я спокойно справлюсь с загадками этих мест позже. \n\nТолько давай не обсуждать это со стариной Мрачноклыком, ладно?\n\nЯ доберусь до его укрытия. Я долго сдерживал гнев и с радостью направлю его на Ледокуса.', '', '', '', '', '', 'Вернитесь к Мрачноклыку.', 47187),
(71011, 'ruRU', 'Разыскивается: ливневая лилия', 'Найдите ливневую лилию.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти ливневую лилию.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nВ Геликирском дозоре в Тальдразусе участники экспедиции видели могущественную воительницу стихий, к воротнику которой был прикреплен магический цветок. Доподлинно неизвестно, является ли он легендарной ливневой лилией, но поиски целесообразно начать с проверки этого предположения.', '', 'Могущественная воительница стихии воды в Тальдразусе. Носит на капюшоне ливневую лилию.', 'Алора Марево', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(71010, 'ruRU', 'Разыскивается: темпоральная подзорная труба', 'Найдите темпоральную подзорную трубу.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти темпоральную подзорную трубу.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nУчастники экспедиции слышали, как некий дворф рассказывал о магической подзорной трубе в тавернах на юге Тальдразуса. Рекомендуется начать поиски в этом регионе.', '', 'Караульный воинов стихий в Тальдразусе, использующий темпоральную подзорную трубу для планирования следующего нападения.', 'Караульный Мордрен', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(71009, 'ruRU', 'Элементарно, Варсек!', 'Помогите Варсеку разгадать тайну Древнего дозора.', 'Старина Мрачноклык опять хочет схлестнуться с Ледокусом? Увы, придется ему отказать. Я оставил все это в прошлом и решил стать ученым.\n\nПытаюсь раскрыть тайны истории – и войти в нее. Но одна загадка в этих руинах поставила меня в тупик. \n\nВот она: когда я касаюсь кристалла, он предлагает мне \"действовать по схеме\". Не имею ни малейшего понятия, о чем это он!\n\nДавай так: если мы с тобой решим эту загадку, я помогу Мрачноклыку покончить с Ледокусом раз и навсегда.', '', '', '', '', '', '', 47187),
(71008, 'ruRU', 'Разыскивается: каменное сердце Камнесерда', 'Найдите каменное сердце Камнесерда.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти каменное сердце Камнесерда.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nУчастники экспедиции сообщают, что видели Камнесерда в пещере в центральной части Лазурного Простора.', '', 'Камнесерд держит свое каменное сердце в... ну, вы понимаете.', 'Камнесерд', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(71004, 'ruRU', 'Разыскивается: сковывающий охунов тотем', 'Найдите сковывающий охунов тотем.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти сковывающий охунов тотем.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nСообщается, что на подъеме Песни Ветра на равнинах Он\'ары замечен воин стихий, использующий аналогичную силу. Вероятно, тотем стоит искать там.', '', 'Могущественный воин стихии воздуха с равнин Он\'ары. Использует сковывающий охунов тотем.', 'Процела Удар Урагана', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(71002, 'ruRU', 'Самое лучшее заклинание', 'Прочтите \"Манаштормы для новичков\" и узнайте секретное заклинание Миллхауса.', '<Зачарованная книга, пропитанная тайной магией, покачивается в воздухе. Она хранит в себе множество заклинаний и чар, порожденных изощренным разумом Миллхауса Манашторма.>', '', '', '', '', '', '', 47187),
(71001, 'ruRU', 'Разыскивается: извечный сердечник связи с землей', 'Найдите извечный сердечник связи с землей в Нелтарии.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти извечный сердечник связи с землей.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nВ ходе недавнего изучения записей из Обсидиановой цитадели удалось выяснить, что когда-то этот предмет находился в Драконьем тайнике Нелтария. Однако его текущее местоположение неизвестно.', '', 'Говорят, сердечник хранится где-то в драконьем тайнике Нелтария.', 'Извечный сердечник связи с землей', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(71000, 'ruRU', 'Барст поможет общему делу', 'Сообщите Мрачноклыку, что Барст поможет общему делу.', 'Что ж, сделка есть сделка. Раз Мрачноклык решил покончить с Ледокусом, то я в деле.\n\nВсю ярость, которая во мне осталась, я сберег для него. Мрачноклык тебе не рассказывал? \n\nМы все, кто охотился вместе с Мрачноклыком, считали себя непобедимыми. Пока не встретили Ледокуса. \n\nОн не просто нас победил, а унизил на глазах у всех, кто был в укрытии. \n\nОставил страдать от ран в назидание всем остальным.\n\nНо пришло время с ним поквитаться.', '', '', '', '', '', 'Вернитесь к старине Мрачноклыку.', 47187),
(70996, 'ruRU', 'Помощь с водорослями', 'Победите дикого водорослементаля на острове Длинного Когтя.', 'Ой-ей, похоже, Мрачноклыку несладко приходится. Хотелось бы мне сказать, что со сварами большой земли для меня покончено, но...\n\nЛедокус давно у меня в печенках сидит. Хотелось бы с ним поквитаться.\n\nАх, как же досадно, что я не могу бросить дела... На берегу вот расшалился элементаль, и только я могу с ним сладить. Он тот еще скользкий тип... буквально.\n\nДавай так: если ты с ним разделаешься, я прогуляюсь до лагеря Мрачноклыка.\n\nНу, что скажешь?', '', 'Вперед!', 'Водорослементаль', '', '', '', 47187),
(70995, 'ruRU', 'Разыскивается: череп Фенистразы', 'Найдите череп Фенистразы.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти череп Фенистразы.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nСообщается, что участники экспедиции видели его у джарадина-изгоя в горах к западу отсюда, но отдавать череп он пока отказывается.', '', 'Джарадин-отшельник хранит зачарованный череп на видном месте в своем алькове.', 'Тарджин Слепой', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(70994, 'ruRU', 'Удержать воду', 'Используйте устройство на $1oa |4сверкающем потоке:сверкающих потоках:сверкающих потоках; в пещере к востоку от руин хранилища Жизни.', 'Хочешь удостоиться великой чести и помочь всемирно известному ведущему геологу Драконьей экспедиции? Да-да, ты не $gошибся:ошиблась;, это действительно я. И, признаться, я в тупике!\n\nЯ прочесывала реку – изучала осадочные породы. Но вдруг вода стала уходить, унося с собой самые интересные образцы!\n\nСо мной мое запатентованное устройство для забора воды, но нужно, чтобы кто-то прошелся вокруг и собрал в него элементалей.\n\nКак думаешь, ты справишься?', '', '', '', '', '', '', 47187),
(70992, 'ruRU', 'Разыскивается: потерянный клыкаррский воздушный змей', 'Найдите потерянный клыкаррский воздушный змей.', '<Надпись выведена превосходным каллиграфическим почерком.>\n\nАрхивариусы обращаются с просьбой ко всем участникам экспедиции: для собрания артефактов необходимо найти потерянный клыкаррский воздушный змей.\n\nНашедшего просьба обратиться к каталогизатору Джейкс для передачи предмета и получения вознаграждения.\n\nУчастники экспедиции сообщают, что один из таких воздушных змеев привязан к клыкаррскому транспортному средству у западного побережья. Но добраться до него не представляется возможным. Слишком высоко!', '', 'Воздушный змей гордо следует за \"Пропавшей Арвилло\"...', 'Потерянный клыкаррский воздушный змей', '', '', 'Вернитесь к каталогизатору Джейкс в лагерь Драконьей экспедиции.', 47187),
(70990, 'ruRU', 'Путь к пряже', 'Состригите шерсть у скальных аргали.', 'Почти всю нашу шерсть мы собираем у своих аргали, но в сезоны с маленьким поголовьем нам приходится добывать природные ресурсы.\n\nНа ближайших равнинах живут дикие аргали – эти звери куда вспыльчивее, чем наши. Ты очень поможешь клану Айлааг, если сострижешь немного шерсти. Вот, возьми для этого лезвие.', '', '', '', '', '', '', 47187),
(70989, 'ruRU', 'Я и моя стая', 'Убейте прожорливого дракона вместе с Тайваном и стаей охотничьих бакаров.', 'Возможно, твой бакар освоит азы охоты, если ему покажут сородичи.\n\nМожешь взять для этого наших обученных бакаров. Выследите и убейте дракона, который кружит над этой областью. \n\nСейчас посмотрим, как Тайван поведет себя в стае!', '', '', '', '', '', '', 47187),
(70988, 'ruRU', 'Истина в яйце', 'Поговорите с Иланой на рубеже Русза\'тар на равнинах Он\'ары.', 'Мир подобен яйцу. $gСлышал:Слышала; такое когда-нибудь?\n\nЯйца! Это ключевой компонент кондитерских изделий и один из лучших катализаторов в кулинарии! Это жиры, способные раскрыть весь потенциал кислот и солей!\n\nНа островах полным-полно невероятно могучих птиц, но особенно вкусные яйца откладывают охотницы ветра с равнин.\n\nОбычно их гнезда можно найти в восточной части равнин, поэтому советую осмотреть окрестности заставы на рубеже Русза\'тар.', '', '', '', '', '', '', 47187),
(70987, 'ruRU', 'Связующее зерно', 'Поговорите с Мелианой Энорат в Руинах хранилища Жизни на Берегах Пробуждения.', 'Что может быть лучше, чем обед, который можно взять с собой, пока занимаешься исследованиями?\n\nБез уличной еды нельзя себе представить ни один шумный город мира. Но не любое блюдо подходит для еды на ходу. Чтобы оно сохраняло форму, требуется крахмал. Поэтому для приготовления часто используется хлеб, картофель, рис и тому подобное.\n\nХочу продемонстрировать коллегам из Пандарии квакмаис – он обладает очень насыщенным вкусом. Мне его показал Лакомка, когда мы впервые встретились рядом с развалинами титанов на Берегах Пробуждения.', '', '', '', '', '', '', 47187),
(70986, 'ruRU', 'Рядовая Шикзар', '', '', '', '', '', '', '', '', 47187),
(70985, 'ruRU', 'Одинокая разведчица', 'Поговорите с дриадами в Тенистном Приюте.', 'Знаю, знаю... Глупо все это. Дружба между кентавром и дриадой! Кто в такое поверит? Мы ведь совершенно разные.\n\nНо с тех пор, как я увидела Изумрудные сады, мне ужасно хотелось познакомиться с его обитательницами. Но что бы я ни говорила и ни делала, они едва обращают на меня внимание.\n\nЯ слышала, что им нравятся... растения. И милые зверьки. И, наверное, убивать живодеров... Но я понятия не имею, с чего начать.\n\nС тобой ведь они разговаривают? Можешь поспрашивать, что им нравится? Может быть, тогда у меня появится шанс.', '', '', '', '', '', 'Вернитесь к разведчице Сантуун.', 47187),
(70984, 'ruRU', 'Подавитель', '', '', '', '', '', '', '', '', 47187),
(70983, 'ruRU', 'О\'нанк Пескорой', '', '', '', '', '', '', '', '', 47187),
(70981, 'ruRU', 'Моря ароматов', 'Поговорите с Вайюном в Прибежище Китобоя в Лазурном Просторе.', 'Запах моря! Ты чувствуешь, $n? Ощущаешь множество минералов под толщей морской соли? По-другому и быть не может!\n\nСтранно, но сегодня в числе яств нет одной редкой рыбы, которую я пробовала там, где живут искарцы в Лазурном Просторе. Когда два клыкарра просто запекали ее на костре, обледеневшую тундру наполнял ни с чем не сравнимый аромат!\n\nБудет здорово, если ты раздобудешь эту рыбу. Я уверена, что наши гости будут поражены морским ароматом, как когда-то случилось со мной.', '', '', '', '', '', '', 47187),
(70979, 'ruRU', 'Магматон', '', '', '', '', '', '', '', '', 47187),
(70978, 'ruRU', 'Легенды о героях Драконьих островов', '', '', '', '', '', '', '', '', 47187),
(70977, 'ruRU', 'Рюкзаки от Огрызка', '', '', '', '', '', '', '', '', 47187),
(70976, 'ruRU', 'С горы с ветерком', 'Найдите Киопо на юго-восточном острове.', 'Как ты, наверно, знаешь, дети Искары удивительно самостоятельные. С самого юного возраста они могут сами о себе позаботиться.\n\nДетки постарше любят забираться на айсберг к юго-западу отсюда – это у них как обряд посвящения. Киопо, наш старший, сейчас как раз там. Скажи ему, что ты от меня, и он даст тебе наши сани.\n\nЭх, вспоминаю себя в его годы... Когда мы с друзьями...', '', '', '', '', '', '', 47187),
(70972, 'ruRU', 'Скакуны-макаронины', '', '', '', '', '', '', '', '', 47187),
(70971, 'ruRU', 'Каждой руке по оружию', '', '', '', '', '', '', '', '', 47187),
(70970, 'ruRU', 'Благие намерения', 'Остановите Алию Солнечный Полет и уничтожьте артефакт Вальтрукс.', 'Кажется, я знаю, где искать артефакт. Когда ты $gпринес:принесла; осколки, Алия стала лихорадочно шептать.\n\nОна повторяла что-то про пещеру и про то, как туда стремятся попасть пауки.\n\nНо я не вижу здесь рядом никаких пещер... И подозреваю, что она может быть дальше в руинах.\n\nМы останемся здесь, $n, и, если что, предоставим путь к отступлению. Прошу, спаси Алию и уничтожь проклятый артефакт.', '', 'Стоит поторопиться, прежде чем Алия окончательно поддастся влиянию артефакта.', 'Вальтрукс', '', '', '', 47187),
(70969, 'ruRU', 'Вступление в общину', '', '', '', '', '', '', '', '', 47187),
