(70964, 'ruRU', 'Гора на плечи', '', '', '', '', '', '', '', '', 47187),
(70963, 'ruRU', 'Здоровье запястий', '', '', '', '', '', '', '', '', 47187),
(70962, 'ruRU', 'Удобное сидение', '', '', '', '', '', '', '', '', 47187),
