(70958, 'ruRU', 'Грибы из будущего', 'Поговорите с капитаном стражей Синджорми на Временном Перекрестке в Тальдразусе.', 'Чтобы приготовить отличный обед, требуется отличное мастерство и ингредиенты отличнейшего качества. Это естественно. Обычно высокая кухня доступна только тем, кто обладает богатством и связями. Но на Рубиновом Пире рады всем и каждому! Иначе и быть не может!\n\nЛакомка подсказал мне идеальный ингредиент для сегодняшнего торжества. Он настолько редкий и изысканный... что его еще даже и на свете нет! Звучит заманчиво, правда?\n\nБронзовые драконы нашли портал в один из опасных вариантов будущего. Там растут черные трюфели с неописуемым вкусом!\n\nПоскорее наведайся туда!', '', '', '', '', '', '', 47187),
(70957, 'ruRU', 'Западные прибрежные воды', 'Поговорите со Сладколистом в Тенистом Приюте на равнинах Он\'ары.', 'Любуешься зеленью в нашем уголке, $n?\n\nЭто навевает мне воспоминания об одном блюде, которым меня угощали две сестры-дриады и их друг древень. Его звали Сладколист! Он живет на западном побережье равнин в Тенистом Приюте.\n\nЭто было чудесное сочетание свежих трав, овощей и специй. А изюминкой стали самые вкусные в мире морские водоросли!\n\nПогоди... Ты никогда не $gпробовал:пробовала; морские водоросли? Тогда обязательно найди их и попробуй. И для меня захвати, пожалуйста!', '', '', '', '', '', '', 47187),
