(70946, 'ruRU', 'Пусть не достанется никому', 'Убедите Алию уничтожить Вальтрукс.', 'Твои находки говорят о том, что все, кто пытался использовать силу этого артефакта, стали жертвами проклятия.\n\nДраконоиды, которые жили здесь, поубивали друг друга. Расколотое Пламя тоже явно подверглось пагубному влиянию.\n\nЭтот артефакт нужно не восстанавливать. Его нужно уничтожить, пока он не принес еще больше вреда.\n\nНадо убедить в этом Алию и Каттигата.', '', '', '', '', '', '', 47187),
(70945, 'ruRU', 'Улов покрупнее', '', '', '', '', '', '', '', '', 47187),
