(70941, 'ruRU', 'Рыболовные лунки', 'Поговорите с Нунвуком в поселении Искара в Лазурном Просторе.', 'Еще раз привет! А ты знаешь, что я стану самым лучшим рыбаком в деревне? Как-то раз я поймал здоровенную пиранью. Она мне чуть нос не откусила!\n\n<Роуи рассеянно смотрит по сторонам.>\n\nАх, да! Тут для тебя послание. Нунвук ждет тебя в Искаре. Он хочет что-то рассказать о рыболовных лунках.', '', '', '', '', '', '', 47187),
(70940, 'ruRU', 'Легенды о героях клыкарров', '', '', '', '', '', '', '', '', 47187),
(70939, 'ruRU', 'Кухонные приборы', '', '', '', '', '', '', '', '', 47187),
(70938, 'ruRU', 'Большие пиршества', 'Поговорите с Большим Кинууком в поселении Искара в Лазурном Просторе.', 'Вот ты где, $n! Суп уже на огне! \n\nСкорее беги в Искару. Большой Кинуук тебя обыскался. \n\nКак-то раз он велел мне принести для супа скользкую противную иглоспинку. Я не захотел и крикнул: \"Не буду, шеф!\"\n\nКак же он разозлился! Я думал, что сам полечу в суп!', '', '', '', '', '', '', 47187),
(70937, 'ruRU', 'Что такое Вальтрукс', 'Найдите зацепки, чтобы понять, что собой представляет артефакт Вальтрукс.', '<То\'тик говорит вполголоса.> \n\nМне это не нравится. От таинственных артефактов, которые что-то нашептывают и сулят величие, точно не стоит ждать ничего хорошего.\n\nНо сейчас мы не можем отступиться... Иначе до него доберется Расколотое Пламя. Чем бы это \"оно\" ни было...\n\nПодобные обломки мне знакомы. Синие драконы обычно оставляют подписи на своих работах. Смотри вокруг внимательнее и, может, увидишь что-то такое.\n\nНам пригодятся любые зацепки, чтобы предупредить Алию и Каттигата.', '', '', '', '', '', '', 47187),
(70936, 'ruRU', 'Украденные тотемы клыкарров', '', '', '', '', '', '', '', '', 47187),
(70935, 'ruRU', 'Поймал – отпусти: островная дорадо', '', '', '', '', '', '', '', '', 47187),
(70932, 'ruRU', 'Добавить остроты', 'Поговорите с Жулем у Обсидианового Трона.', 'Многие не представляют себе сытный обед без мяса. А без чего не может обойтись ни одно мясное блюдо?\n\nБез специй!\n\nЗдесь, на островах, можно найти одну редкую приправу, которая затмевает по вкусу все остальные и весьма хороша по консистенции. К сожалению, получить ее можно только из элементалей, обитающих в глубинах Обсидиановой цитадели. Но сейчас там хозяйничают джарадины.\n\nСоветую тебе обратиться к моему знакомому троллю – его как раз можно найти в тех местах. А зовут его, кажется... Жуль.', '', '', '', '', '', '', 47187),
(70931, 'ruRU', 'Шепчущие фрагменты', 'Заберите $1oa |4шепчущий фрагмент:шепчущих фрагмента:шепчущих фрагментов; у Расколотого Пламени.', 'Похоже, Вальтрукс пытается связаться с нами через этот осколок.\n\nМы сможем этим воспользоваться, если нам удастся оградить свой разум от влияния артефакта.\n\nЯ ошибалась насчет Расколотого Пламени. Они уже собрали несколько осколков. \n\nВальтрукс нашептывает, что они вот-вот найдут сам артефакт.\n\nНужно скорее забрать осколки у Расколотого Пламени, пока они не довершили начатое.', '', '', '', '', '', '', 47187),
(70930, 'ruRU', 'В тени чайных листьев', 'Поговорите с Лилиал Взрыв Зари в долине льдистых ткачей.', 'Сегодня у нас праздник чая! Заваренного, ледяного и не только! А еще необычных тортиков и печенья.\n\nНа островах есть один редкий ингредиент, который, как мне кажется, может придать чаю новые грани вкуса! Далеко в долине льдистых ткачей, где все кишит пауками, растет куст с удивительными листьями – морозный стрелолист.\n\nНедавно эти места как раз исследовала Драконья экспедиция. Может, кто-то из ее участников мог бы помочь?', '', '', '', '', '', '', 47187),
