(70919, 'ruRU', 'Герой для утенка', 'Отнесите утенка в пузыре обратно в лагерь экологов.', '<Этот утенок так долго находился в пузыре, что успеть заснуть. Он тихонько сопит и крякает во сне.>\n\n<Может, экологи смогут помочь малютке?>', '', '', '', '', '', 'Отнесите утенка в пузыре обратно в лагерь экологов.', 47187),
(70918, 'ruRU', 'Жизнь за утенка', 'Отнесите утенка в пузыре обратно в лагерь экологов.', '<Утенок истошно крякает. Если он останется здесь, сюда точно сбегутся недовольные горлоки!>\n\n<Может, экологи смогут помочь малютке?>', '', '', '', '', '', 'Отнесите утенка в пузыре обратно в лагерь экологов.', 47187),
(70917, 'ruRU', 'Рука помощи утенку', 'Отнесите утенка в пузыре обратно в лагерь экологов.', '<Утенок явно нервничает, но его переполняет энергия. Похоже, ему не терпится сбежать.>\n\n<Может, экологи смогут помочь малютке?>', '', '', '', '', '', 'Отнесите утенка в пузыре обратно в лагерь экологов.', 47187),
