(70893, 'ruRU', 'Большое пиршество', 'Выполните $1oa |4задачу:задачи:задач; для большого пиршества.', 'Большое пиршество уже началось! Это когда все объединяются, чтобы приготовить самый вкусный суп.\n\nДавай с нами!', '', '', '', '', '', '', 47187),
