(70883, 'ruRU', 'Сады войны', 'Найдите Грирмпеха в садах единства.', 'Приветствую тебя, $gсмертный:смертная;. Ко мне пришло послание от главного садовника Грирмпеха. Он говорит, что в садах ужасный беспорядок. Правда, я точно не знаю, хорошо это или плохо.\n\nМеня заверили, что все под контролем. Или \"все пучком\", как он выразился. Не знаю, что имел в виду этот садовник, но он наверняка все тебе объяснит. Отыщи его и получи нужное снаряжение.', '', '', '', '', '', '', 47187),
(70882, 'ruRU', 'Припасы за известность', '', '', '', '', '', '', '', '', 47187),
