(70879, 'ruRU', 'Отчет о мятежниках', 'Встретьтесь с капитаном Драйн на верхнем этаже Престола Аспектов.', 'То, что мы сегодня совершили – впечатляет. Правда, $n?\n\nМы сорвали злодейские планы мятежников, спевшихся с воинами стихий. Во всяком случае, пока что. Придется следить за развитием ситуации.\n\nКак можно скорее возвращайся к капитану Драйн и расскажи ей все в деталях.', '', '', '', '', '', '', 47187),
(70878, 'ruRU', 'Кольцо огня', 'Защищайте Мальдру Язык Пламени, пока она запечатывает портал воинов стихий.', 'В самой дальней части пещеры Пепельного Сланца воины стихий открыли огненный портал.\n\nЯ могу запечатать его, но это наверняка разозлит тварей, что скрываются на другой стороне. Ну и, конечно, стоит ждать встречи с Магматием.\n\nЧтобы их остановить, мне понадобится твоя защита.', '', 'Этого беснующегося огненного загробника нужно уничтожить, пока воины стихий не натравили его на Драконьи острова.', 'Магматий', '', '', '', 47187),
(70877, 'ruRU', 'Шанс для утенка', 'Отнесите утенка в пузыре обратно в лагерь экологов.', '<Хмурый утенок тихо крякает и испуганно таращится во все стороны.>\n\n<Может, экологи смогут помочь малютке?>', '', '', '', '', '', 'Отнесите утенка в пузыре обратно в лагерь экологов.', 47187),
(70876, 'ruRU', 'Рассредоточение', 'Уничтожьте $1oa |4средоточие:средоточия:средоточий; воинов стихий в пещере Пепельного Сланца.', 'Если Мальдра говорит правду, то мятежники создают рунические камни в пещере Пепельного Сланца.\n\nУчитывая, что это за штуковины, тут явно замешаны средоточия воинов стихий.\n\nНужно уничтожить эти средоточия. Когда ты их увидишь, то сразу поймешь, что это такое.\n\nНельзя, чтобы повстанцы и дальше создавали столь разрушительное оружие.', '', '', '', '', '', '', 47187),
(70875, 'ruRU', 'Худшие из худших', 'Убейте $1oa |4мятежника:мятежников:мятежников; и $2oa |4элементаля:элементалей:элементалей; в пещере Пепельного Сланца.', 'Мятежники в пещере Пепельного Сланца всецело преданы воинам стихий, а потому представляют серьезную угрозу для Вальдраккена.\n\nНужно убить их и их элементалей.', '', '', '', '', '', '', 47187),
(70874, 'ruRU', 'Сквозь стену', 'Получите благословение стихий Мальдры.', 'Мятежники в пещере пользуются благословением стихий, поэтому могут без вреда проходить сквозь стену огня. Я постараюсь наделить тебя тем же даром.\n\nНе бойся. Я много раз видела, как накладывают благословение. Повторить его будет несложно.', '', '', '', '', '', '', 47187),
(70873, 'ruRU', 'Успеть за падающей водой', 'Соберите $1oa |4частицу:частицы:частиц; падающей воды.', 'Пещера Пепельного Сланца скрывает настоящую угрозу. Именно там вырезают рунические камни и насыщают их изначальным огнем.\n\nОт твоего взгляда, конечно, не укрылась стена пламени, преграждающая вход. Я не могу ее развеять, но, думаю, смогу помочь обойти это препятствие. Если правильно использовать падающую воду, мы сумеем пройти через огонь.\n\nСобери частицы воды – они есть у элементалей неподалеку.', '', '', '', '', '', '', 47187),
(70871, 'ruRU', 'Искарская сеть', 'Принесите Тавио материалы для искарской сети.', 'Вижу, ты неплохо $gполадил:поладила; с местными.\n\nГоворишь, хочешь научиться нашим методам рыбалки? Что ж, голыми руками ты точно ничего не поймаешь. Я могу сделать тебе надежную сеть, достойную любого искарца.', '', '', '', '', '', '', 47187),
(70867, 'ruRU', 'Крепость Драконьей Погибели', '', '', '', '', '', '', '', '', 47187),
(70859, 'ruRU', 'Что сторожит страж', 'Заберите шепчущий осколок у околдованного стража Эдавикса.', 'Спасибо за помощь, |3-6($c). Это я маг из Кирин-Тора, который первым обнаружил этот артефакт, Вальтрукс, и узнал о планах Расколотого Пламени.\n\nВальтрукс обладает внушительной мощью и, возможно, наделен сознанием, так что первостепенная задача сейчас – завладеть им и как следует его изучить. И это сделаю я.\n\nУ Расколотого Пламени есть только догадки о его местонахождении, но мне с помощью магии удалось узнать, как до него добраться.\n\nНеподалеку находится околдованный страж, который держит магический осколок, связанный с Вальтруксом. С его помощью я смогу найти и сам артефакт.', '', 'Страж, околдованный силой Вальтрукса. Это ключ к тайне местонахождения артефакта.', 'Эдавикс', '', '', '', 47187),
(70858, 'ruRU', 'Возвращение в строй', 'Дайте ледяное противоядие Алии Солнечный Полет.', 'Прекрасно, противоядие готово. Я подержу Алию, а ты влей лекарство ей в рот.\n\nНадеюсь, она выкарабкается... Без ее магии артефакт нам не найти.', '', '', '', '', '', 'Поговорите с Алией Солнечный Полет.', 47187),
(70856, 'ruRU', 'Обратить в пепел', 'Уничтожьте $1oa |4зараженный труп:зараженных трупа:зараженных трупов; с помощью факела-огнемета.', 'Эти мерзкие пауки откладывают яйца в трупах.\n\nА иногда и в живых существах.\n\nВ Расколотом Пламени уже несколько погибших из-за этого – мы видели тела.\n\nНужно избавиться от этих яиц, иначе пропадем. И Расколотое Пламя не остановим.\n\nБери факел. Он заряжен силами огня и воздуха. Тебе надо просто его направлять в нужную сторону, остальное он сам сделает.\n\nКлыкарры знают, что с пауками шутки плохи. Так что я подготовилась.', '', '', '', '', '', '', 47187),
(70854, 'ruRU', 'Новости об успехах', 'Вернитесь к Джиханне в Детский сад для драконят в Вальдраккене.', 'Ты отлично $gсправился:справилась;, $n. Лаббинс делает успехи, и вообще это все ему очень нравится. \n\nДжиханна будет рада об этом услышать, так что поспеши сообщить ей прекрасные новости!', '', '', '', '', '', '', 47187),
(70853, 'ruRU', 'Друг для Лаббинса', 'Поймайте мухозявку в Диком уделе на Берегах пробуждения.', 'Как мы уже говорили, Лаббинсу нужны две вещи: друзья и драки.\n\nДумаю, мы сможем получить и то и другое одновременно.\n\nВ этих местах спариваются мухозявки. Если присмотреться, ты без труда их найдешь.\n\nНе забывай: чтобы поймать существо, его необходимо ослабить.\n\nКогда заманишь мухозявку в ловушку, возвращайся сюда. После битвы она может быть немного помятой, но у меня есть несколько тренировочных камней, которые это исправят!', '', '', '', '', '', '', 47187),
(70851, 'ruRU', 'Рожденные дикими', 'Узнайте у Ханико, что нужно Лаббинсу.', 'Мне нужно о многом тебе рассказать. Давай поговорим, а затем решим, как будет лучше для Лаббинса.', '', '', '', '', '', '', 47187),
(70850, 'ruRU', 'Вода и пламя', 'Спасите Мальдру от Ориана Темные Воды.', 'Отлично сработано. Пока ты $gбыл занят:была занята;, я осматривал лагерь и к своему удивлению увидел здесь старую подругу – Мальдру Язык Пламени.\n\nЯ знал, что она куда-то пропала. Ходили слухи, что она присоединилась к повстанцам, но похоже, это не так. Судя по всему, она у них в плену!\n\nМы не можем ее здесь бросить. Надо спасти ее от драконоидов, которые ее удерживают!', '', 'Этот лидер мятежников сковал свою пленницу, Мальдру Язык Пламени, оковами изначальной воды.', 'Ориан Темные Воды', '', '', '', 47187),
(70849, 'ruRU', 'Особый специалист', 'Поговорите с Ханико в Диком уделе на Берегах пробуждения.', 'У Лаббинса получается уже лучше, но, по-моему, ему надо еще немного помочь. \n\nНедавно я встретила очень умную исследовательницу из Драконьей экспедиции. Ее зовут Ханико, и она тоже дрессировщица питомцев. Но она все время работает только с протодраконами. Вот кто точно сможет помочь Лаббинсу! \n\nКажется, она направлялась на Берега Пробуждения. Так что ищи ее там. \n\nЯ так рада, что смогла помочь! \n\n<Она весело машет на прощание.>\n\nПока! И удачи тебе, Лаббинс.', '', '', '', '', '', '', 47187),
(70848, 'ruRU', 'Забытый драконий герб', 'Доставьте найденный предмет Эксадрии.', '<Возможно, это заинтересует Эксадрию.>', '', '', '', '', '', '', 47187),
(70847, 'ruRU', 'Древний обсидиановый амулет', 'Доставьте найденный предмет Когтеловщице Кавии.', '<Возможно, это заинтересует Когтеловщицу Кавию.>', '', '', '', '', '', '', 47187),
(70845, 'ruRU', 'По стопам Тира', 'Найдите место первого испытания Тира в Лазурном Просторе.', 'Хранитель Тир просчитал все. Он предположил, что однажды ремесленникам островов понадобится поддержка – и создал Двигатель открытий. Эта машина создает особый материал, с помощью которого можно мастерить чудесные предметы, недоступные простым смертным.\n\nТир создал меня, чтобы двигатель открытий не угодил не в те руки. Я решаю, кто получит его силу, а кто нет. Лишь тот, кто достоин, сможет обрести полную власть над двигателем. \n\nСправишься ли ты?', '', '', '', '', '', 'Найдите место первого испытания Тира в Лазурном Просторе.', 47187),
(70843, 'ruRU', 'Камень с души', 'Уничтожьте тайники с опаляющими руническими камнями.', '<Этот рунический камень невероятно похож на тот, что мятежник пытался установить в Вальдраккене.\n\nОн явно не закончен – но вы замечаете неподалеку тайники с готовыми камнями.\n\nЕсли уничтожить их сейчас, мятежники не смогут пустить эти камни в ход.>', '', '', '', '', '', '', 47187),
(70842, 'ruRU', 'Места детонации', 'Соберите карты Туманного дола.', 'Раз мятежники составляют планы будущих атак, эти записи стоит поискать.\n\nОбыщи их лагерь – там могут быть и другие карты с пометками вроде той, что мы нашли в Вальдраккене.', '', '', '', '', '', '', 47187),
(70841, 'ruRU', 'Больше реликвий титанов', '', '', '', '', '', '', '', '', 47187),
(70840, 'ruRU', 'Реликвия титанов', '', '', '', '', '', '', '', '', 47187),
(70839, 'ruRU', 'В поисках реликвий титанов', '', '', '', '', '', '', '', '', 47187),
(70838, 'ruRU', 'Целеустремленные мятежники', 'Убейте $1oa |4мятежника или воина:мятежников или воинов:мятежников или воинов; стихий.', 'Место, где обосновались мятежники... его-то мы и искали. И надо же – их неосмотрительный диверсант привел нас прямиком к цели.\n\nПоверить не могу, что мои братья так низко пали, что стали заодно с воинами стихий. Нельзя это так оставлять. Разделайся с этими мятежниками и их друзьями, воинами стихий, пока они не наворотили дел.', '', '', '', '', '', '', 47187),
(70837, 'ruRU', 'Проверить зацепку', 'Встретьтесь со следователем Эримой в Туманном доле.', '<Следователь Эрима просматривает карту.>\n\nПрестол Аспектов отмечен крестом, с этим все ясно.\n\nНо кроме этого, в кружок обведен Туманный дол. Должно быть, это следующая цель мятежников. Или там находится их штаб.\n\nЕсть лишь один способ выяснить наверняка. Встретимся на месте.', '', '', '', '', '', '', 47187),
(70835, 'ruRU', 'Прочная экспедиционная лопата', '', '', '', '', '', '', '', '', 47187),
