(70783, 'ruRU', 'Скаара', '', '', '', '', '', '', '', '', 47187),
(70781, 'ruRU', 'Как с неба свалиться', 'Найдите Харлин Язвотрель на утесах Синего Пера.', 'Ты это $gвидел:видела;?!\n\nЭто крылатое существо просто упало с неба! Понятия не имею, кто это и откуда, но это точно не обитатель островов.\n\nПостой-ка... я припоминаю, как одна энергичная гоблинша спрашивала, в какой стороне утесы Синего Пера. Вдруг она может что-то знать?', '', '', '', '', '', '', 47187),
(70780, 'ruRU', 'Знамена Он\'ары', '', '', '', '', '', '', '', '', 47187),
(70779, 'ruRU', 'Истории Тарджина', 'Добудьте $1oa |4впечатляющий драконий череп:впечатляющих драконьих черепа:впечатляющих драконьих черепов; у могущественных драконов или протодраконов на Драконьих островах.', '<Во время разговора с вами лицо Тарджина по-прежнему обращено к далекому острову.>\n\nТы считаешь себя $gдостойным:достойной; великих легенд и историй джарадинов?\n\nТы даже ростом едва достигаешь высоты нашего оружия. Да уж.\n\nХранить наше наследие тебе точно не по зубам.\n\nЕсли сможешь, докажи обратное. Разыщи драконов – других достойных противников здесь нет.\n\nПринеси мне трофеи в доказательство победы над сильнейшими.', '', '', '', '', '', '', 47187),
(70763, 'ruRU', 'Резчик А\'тир', '', '', '', '', '', '', '', '', 47187),
(70754, 'ruRU', 'Тушение воинов огня', 'Принесите изначальное ядро Ретельши.', 'Ретельши в Вальдраккене изучает воинов стихий. Ему это пригодится. Он наверняка будет благодарен.', '', '', '', '', '', '', 47187),
(70753, 'ruRU', 'Рассеивание воинов воздуха', 'Принесите изначальное ядро Ретельши.', 'Ретельши в Вальдраккене изучает воинов стихий. Ему это пригодится. Он наверняка будет благодарен.', '', '', '', '', '', '', 47187),
(70752, 'ruRU', 'Испарение воинов воды', 'Принесите изначальное ядро Ретельши.', 'Ретельши в Вальдраккене изучает воинов стихий. Ему это пригодится. Он наверняка будет благодарен.', '', '', '', '', '', '', 47187),
(70751, 'ruRU', 'Териллод Фанатичный', '', '', '', '', '', '', '', '', 47187),
(70750, 'ruRU', 'Помощь союзу', 'Продолжайте помогать союзу Вальдраккена и тем, кто ему верен, на Драконьих островах.', 'Эй ты! Да-да, я к тебе обращаюсь. Здесь что, еще кто-то есть?\n\n<Теразал бросает беглый взгляд на многочисленных прохожих.>\n\nНа этих не обращай внимания. Они к делу не относятся. Это про тебя я наслышан и именно с тобой хочу говорить.\n\nСоюз Вальдраккена поручил мне найти тех, кто сумел снискать славу на островах и ставит во главу угла безопасность наших союзников.\n\nДелай то, что у тебя получается лучше всего. Ты будешь щедро $gвознагражден:вознаграждена;.', '', '', '', '', '', '', 47187),
(70748, 'ruRU', 'Только для синих', 'Поищите записи Малигоса в Лазурных архивах.', 'Неудивительно, что твои спутники ничего не нашли. \n\nТолько синие драконы имеют право читать эти книги.\n\nОднако в моем присутствии несколько самых важных книг согласятся расстаться со своими секретами.', '', '', '', '', '', '', 47187),
(70747, 'ruRU', 'Лазурный маг', 'Поговорите с верховным магом Кадгаром в лагере Антонидаса.', 'У меня нет времени, чтобы препираться с колдунами. \n\nИди и пообщайся с этим \"верховным магом\", $p. Поучись, если будет чему, но не теряй бдительности. Кто знает, друг это или враг...\n\nПо нашим данным, к югу отсюда расположен большой архив. \n\nКак раз туда я и направляюсь.', '', '', '', '', '', '', 47187),
(70746, 'ruRU', 'Оттенки синего', 'Сопроводите Эмберталь и Телаша к лагерю Антонидаса.', 'Эй, $p!\nКак я рада видеть знакомое лицо в этих краях. Мы с Телашем как раз обсуждали доклад о... новых гостях, которые тут появились.\n\n<Эмберталь понижает голос.>\n\nО синих драконах. \n\nУчитывая наши прошлые... встречи с ними, мы с Телашем решили сами оценить ситуацию. \n\nПожалуйста, помоги нам.', '', '', '', '', '', '', 47187),
(70745, 'ruRU', 'Принудительный отдых', 'Убейте призывательницу элементалей.', 'Не думаю, что те воины стихий – какие-то важные шишки. Они испугались маленькой собачонки!\n\nОни упоминали какую-то Вадне. Наверно, это их главная, из-за которой тут и появились элементали. От этой призывательницы нужно избавиться. Я так понимаю, она довольно близко, раз доставляет столько неприятностей. Проверь, не прячется ли она в пещере прямо под нами. Там еще любят прохлаждаться нерадивые сотрудники.', '', 'Эта воительница стихий призывает пар и пламя и может сварить противников заживо.', 'Вадне Черное Сердце', '', '', '', 47187),
(70744, 'ruRU', 'Повсюду кости!', 'Устраните загрязнения в $1oa |4месте:местах:местах;.', '<Администратору курорта точно не понравится, если повсюду будут пятна крови...>', '', '', '', '', '', '', 47187),
(70743, 'ruRU', 'Бесценная Детка', 'Найдите Детку Эльзары.', 'Эй ты, |3-6($pr)! Ты достаточно $gкомпетентен:компетентна;?\n\nОсознаешь, насколько все серьезно?\n\nНадеюсь, что так!\n\nМоя Детка пропала! Ты $gдолжен:должна; спасти мое сокровище! Поторопись, в этих ужасных условиях о малышке некому позаботиться.', '', '', '', '', '', '', 47187),
(70742, 'ruRU', 'В поисках наследия', 'Обыщите Обсидиановую обсерваторию, чтобы узнать об истории драктиров.', 'С высоты я взглянула на один из артефактов, который Эдресс обнаружила у входа в руины. Внутри, несомненно, есть еще.\n\nНа них наложена какая-то защита, но мне надо подобраться поближе, чтобы все рассмотреть. Это очень древняя магия.\n\nЭто место выглядит заброшенным, но я уверена, что, как только мы войдем, все изменится. Будь $gосторожен:осторожна;. Мы должны выяснить как можно больше.', '', '', '', '', '', '', 47187),
(70741, 'ruRU', 'Пара любимых безделушек', 'Найдите $1oa |4потерянную вещь:потерянные вещи:потерянных вещей;.', '<Кажется, занятия по йо-ге прервали. Вещи гостей разбросаны повсюду. \n\nЕсли вы их соберете, администратор курорта будет вам благодарен.>', '', '', '', '', '', '', 47187),
(70740, 'ruRU', 'Паровая очистка', 'Убейте $1oa |4элементаля:элементалей:элементалей; на нижнем ярусе курорта.', 'Сицзань не шибко обеспокоен вторжением элементалей на наш чудесный курорт, но всплески огня и пара надо срочно унять.\n\nМы пригласили музыкантов, чтобы те выступили на нижнем ярусе курорта, но элементали испортили им инструменты и оборудование. Раньше такого не было, и я подозреваю, что тут замешаны воины стихий.\n\nЕсли хочешь помочь, займись элементалями в восточной части нижнего яруса. Там должны будут пройти первые мероприятия.', '', '', '', '', '', '', 47187),
(70739, 'ruRU', 'Друзья из клана Тирай', 'Помогите охотнику Нарману получить совет, как добиться дружбы.', 'Я охотился вместе с ханами, обгонял быстрейших бакаров и голыми руками одолел взрослого зуброна. Я в совершенстве освоил мастерство охоты.\n\nОднако в мастерстве взаимопонимания мне еще многому надо научиться. \n\nЖрец ветра Дава из клана Он\'ир – идеал настоящего друга. Я хочу всего лишь стать достойным его, но я совсем не разбираюсь в традициях и ритуалах. Мне нужен совет старейшин из Марукая.', '', '', '', '', '', 'Поговорите с охотником Нарманом на Шикаарской возвышенности в Марукае.', 47187),
(70738, 'ruRU', 'Занятия по йо-ге', 'Найдите инструктора по йо-ге и $1oa |4посетителя:посетителей:посетителей; занятий.', 'Дела шли так хорошо, а теперь... Элементали доставляют нам... некоторые неприятности.\n\nГости уже приступили к процедурам, как вдруг нагрянула толпа элементалей! Эти злобные создания все нам сорвали. Может, даже отвлекли нового инструктора по йо-ге от работы. \n\nА, ты, неверное, не знаешь... Йо-га – это такой новый вид разминки, который заодно помогает медитировать. Инструктор и ученики наверняка так расслабились, что даже не заметили появления элементалей.\n\nНо лучше подстраховаться, правда? Иди, поищи их.', '', '', '', '', '', '', 47187),
(70732, 'ruRU', 'Тренировочный бой', 'Победите Гвоша в битве питомцев.', 'Итак! Ты $gиспользовал:использовала; камень для Лаббинса, так что пора проверить, что он умеет в бою! \n\nЯ знаю одного большого старого рогоплава по кличке Гвош. Он живет на берегу к северу отсюда и обожает драться! Ну, для него это скорее игра. А еще он очень добр к другим питомцам! \n\nЛаббинс с удовольствием с ним поиграет... ну, вернее, поборется.', '', '', '', '', '', '', 47187),
(70730, 'ruRU', 'Подарок для шикаара', 'Помогите жрецу ветра Даве подготовить идеальный подарок.', 'Ах, $p!\n\nТы чувствуешь приветливое тепло солнца? Тебе радостно в его ярких лучах? Что несет тебе новый день? Надежду на будущее? Чувство, что жизнь складывается, как тебе всегда хотелось?\n\nТогда ты знаешь, что чувствую я.\n\nПорой улыбка друга светит ярче и теплее солнца. Для меня этот друг – Нарман из клана Шикаар. Он дал мне надежду, когда все казалось тщетным.\n\nТакой достойный кентавр заслуживает высочайших почестей.\n\nНадо спросить он\', как лучше его отблагодарить.', '', '', '', '', '', '', 47187),
(70723, 'ruRU', 'Измельчение воинов земли', 'Принесите изначальное ядро Ретельши.', 'Ретельши в Вальдраккене изучает воинов стихий. Ему это пригодится. Он наверняка будет благодарен.', '', '', '', '', '', '', 47187),
(70722, 'ruRU', 'Что нужно Лаббинсу', 'Поговорите с Патчу в Искаре.', 'Мне кажется, я знаю, что нам делать, $n. \n\nНо сначала давай все обсудим.\n\nПосле этого я даже подарю тебе кое-что! Это же весело, правда?', '', '', '', '', '', '', 47187),
(70721, 'ruRU', 'По зову сердца', 'Помогите жрецу ветра Даве и охотнику Нарману обменяться подарками.', 'У Зеркала Небес есть небольшой пруд. Там я встретил Нармана, когда проходил обучение.\n\nПосвященные приходят туда, чтобы ощутить дуновение ветра и сблизиться с Он\'арой. Я в первый раз увидел друга в отражении воды, когда внезапный поток ветра заставил меня открыть глаза. Это место самое прекрасное на равнинах.\n\nДля доверительной беседы лучше не найдешь.', '', '', '', '', '', '', 47187),
