(70711, 'ruRU', 'Маршрут над речными стремнинами – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70710, 'ruRU', 'Маршрут над речными стремнинами', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70708, 'ruRU', 'Пустота', 'Выпейте с Колгаром.', 'Иногда кажется, что уже прошли годы. А иногда, что все случилось вот только что. \n\nЯ бы хотел выговориться, если у тебя есть время. \n\nВыпьем чего-нибудь? Заказывай что захочешь. Я оплачу.', '', '', '', '', '', '', 47187),
(70706, 'ruRU', 'Путевые врата: Тенистый Приют', 'Найдите бездействующие путевые врата в Тенистом Приюте на равнинах Он\'ары.', 'Нам сообщили, что к юго-западу отсюда, на склоне среди зарослей, находятся неактивные путевые врата. Нужно, чтобы на них взглянул кто-то знающий вроде тебя. Но предупреждаю, что путь неблизкий.', '', '', '', '', '', '', 47187),
(70703, 'ruRU', 'Наследие Тирхолда', 'Узнайте о свойствах серебряной чешуйки вместе с Кораносом в Тирхолде.', 'Хранитель Тир всегда трепетно относился к загадкам. Так что у его дара должен быть какой-то скрытый смысл. Эту чешую он, скорее всего, выковал в своей бывшей цитадели. Это может стать ключом к пониманию его тайн.\n\nВы с Кораносом должны отправиться в Тирхолд, $n. Это мой доверенный советник в этих землях. Уверена, он поможет тебе лучше во всем разобраться.', '', '', '', '', '', 'Поговорите с Кораносом в Тирхолде.', 47187),
(70702, 'ruRU', 'Путевые врата – новые исследования', 'Встретьтесь с Телином Темная Наковальня на Рубиновой заставе на Берегах Пробуждения.', '<Посланник привлекает ваше внимание пронзительным воплем, засовывает вам в руку записку и убегает.\n\nЭто послание от Телина Темная Наковальня, в котором он просит вас о помощи.>', '', '', '', '', '', '', 47187),
(70701, 'ruRU', 'Сны о потерявшихся аргали', 'Приведите потерявшихся аргали в земли клана Айлааг.', 'Несколько наших аргали опять отбились от стада.\n\nПастухи не могут отправиться на поиски: на гряде, окружающей это место, слишком опасно. Ты бы нам очень $gпомог:помогла;, вернув пропавших животных. Возьми с собой одного из наших бакаров. А если не знаешь, где искать, обратись к пастухам.', '', '', '', '', '', '', 47187),
(70698, 'ruRU', 'Исследовательница Незримое Крыло', '', '', '', '', '', '', '', '', 47187),
(70697, 'ruRU', 'Помощь профессионала', 'Поговорите с Патчу в Лазурном Просторе.', 'Мы подлечили Лаббинса, но я боюсь, что он по-прежнему растерян и напуган. Думаю, пора позвать на помощь еще кое-кого.\n\nК юго-западу отсюда, в дальнем уголке Лазурного Простора, живет наставница питомцев Патчу. Это один из лучших специалистов в мире!\n\nЗагляни к ней. Я уверена, она сможет помочь Лаббинсу.', '', '', '', '', '', '', 47187),
