(70647, 'ruRU', 'Я иду искать!', 'Спасите Лаббинса и верните его Джиханне в детский сад для драконят в Вальдраккене.', '$n, как здорово, что ты здесь! Я так переживаю, очень нужна твоя помощь.\n\nМне недавно удалось спасти брошенного детеныша протодракона. Я назвала его Лаббинс. Он такой милашка! Он жил у меня, ни в чем не нуждался и, может, однажды стал бы чьим-то питомцем. \n\nНо потом он пропал! Я беспокоюсь, что он потерялся. Вдруг он ранен? Я бы тотчас отправилась на поиски, но мне нужно присматривать за другими малышами. Может, ты сможешь его поискать?', '', '', '', '', '', '', 47187),
(70644, 'ruRU', 'Приручение дикого козла', '', '', '', '', '', '', '', '', 47187),
