(70641, 'ruRU', 'Клятва пробуждения', 'Поговорите с красными драконами у Рубинового святилища Жизни.', 'Подожди, $p. Я хочу лично поблагодарить тебя за восстановление камня клятвы.\n\nЯ и не знала о драктирах до вашего пробуждения в Запретном крае. Никто не понимал, чего ждать от вашего появления: защитите ли вы жизненные силы этого мира или станете для них... угрозой.\n\nСоветую тебе побольше узнать о нашем камне клятвы. Поговори с моими сородичами тут, в Рубиновом святилище Жизни. Возможно, наши истории помогут тебе во всем разобраться.', '', '', '', '', '', '', 47187),
(70640, 'ruRU', 'РАЗЫСКИВАЕТСЯ: Босс', 'Убейте Фригеллия у лагеря Антонидаса.', '<Буквы на пергаменте слегка светятся синим.>\n\nЭлементаль Фригеллий, некогда любимец Малигоса, страдает без своего хозяина. \n\nКогда процветающее поселение в один миг превратилось в руины, проказливое и игривое существо стало злобным и опасным.\n\nЕго нужно устранить.\n\nО победе сообщите коменданту Сайнегосу.', '', '', 'Фригеллий', '', '', '', 47187),
