(70633, 'ruRU', 'Топливо для машины', 'Воспользуйтесь бутилированной сущностью, чтобы активировать двигатель открытий.', 'Что ж, ты $gсправился:справилась; с первым испытанием, которое оставил после себя Хранитель Тир. И хоть это лишь начало, я верю, что ты все преодолеешь. А сейчас – продолжай раскрывать секреты Кузни. \n\nДвигатель открытий ждет бутилированную сущность. Отдай ее и посмотри, что произойдет.', '', '', '', '', '', '', 47187),
