(70627, 'ruRU', 'Что с кланом Зимней Шкуры?', 'Поговорите с Соновой Снегонорой в Дозоре Терона.', 'Мы могли бы примкнуть к другому клану... если бы были уверены, что это безопасно.\n\nБоюсь, другие могли поддаться искушению воинов стихий так же, как и мы. \n\nЭта \"Драконья экспедиция\" сообщает, что закрепилась рядом с территорией клана Зимней Шкуры.\n\nВозможно, они уже попали под дурное влияние. А может, их могло бы спасти наше предупреждение. В любом случае, мы им нужны.\n\nЕсли ты доберешься до Дозора Терона, найдешь там Сонову Снегонору, \"эксперта по фурболгам\". Расспроси его про клан Зимней Шкуры.', '', '', '', '', '', '', 47187),
(70620, 'ruRU', 'Мысли чешуйчато', 'Принесите $1oa |4крепкую чешуйку:крепкие чешуйки:крепких чешуек; Ралатору Дубленому в Вальдраккен.', 'Меня часто спрашивают, как мне удалось стать таким мастером в деле снятия шкур. Я всегда отвечаю: дело в чешуе. \n\nЧто, интересно? Принеси мне чешую, и я покажу, что имею в виду.', '', '', '', '', '', '', 47187),
(70618, 'ruRU', 'Зов кузни', 'Принесите $1oa |4кусок:куска:кусков; серевитовой руды Секите Землекопу в Вальдраккен.', 'Кузня... она взывает ко мне... Просит серевит. Эй! Ты! Быстро принеси мне серевит! Да-да, много, очень много серевита! <Секита начинает смеяться, как одержимый.>', '', '', '', '', '', '', 47187),
(70617, 'ruRU', 'Копай, копай, копай!', 'Принесите $1oa |4кусок:куска:кусков; драконитовой руды Секите Землекопу в Вальдраккен.', 'Нет ничего полезнее драконитовой руды. Из нее можно столько всего изготовить! О, это идеальная руда, чистая, чистейшая...\n\nПринеси мне драконит. Он мне очень нужен. Ты же рудокоп? Ну так иди и копай руду!', '', '', '', '', '', '', 47187),
(70613, 'ruRU', 'Пока никто не пострадал', 'Принесите $1oa шт. витой коры Агрикусу в Вальдраккен.', 'Привет, $p! Ты ведь $gопытный травник:опытная травница;, верно? У моей двери... ну, если бы у меня была дверь... буквально столпились алхимики. Умоляют поделиться с ними витой корой. А мы уже почти все распродали! \n\nПоможешь мне добыть еще? Боюсь, если алхимики не смогут создавать флаконы, то возьмутся за мои вещи.', '', '', '', '', '', '', 47187),
(70595, 'ruRU', 'Требуются услуги портного', 'Выполните заказы портных для Консорциума ремесленников.', 'Привет-привет, $p! Заказы на изделия поступают каждую минуту!\n\nЕсли тебе нужна работа, Консорциум ремесленников всегда ее предоставит!\n\nМожешь заняться публичными заказами, а если у тебя уже есть постоянные клиенты, поработай над заказами от гильдии или частных лиц! Главное, сделай все быстро-быстро и чисто-чисто!', '', '', '', '', '', '', 47187),
(70594, 'ruRU', 'Требуются услуги кожевника', 'Выполните заказы кожевников для Консорциума ремесленников.', 'Привет-привет, $p! Заказы на изделия поступают каждую минуту!\n\nЕсли тебе нужна работа, Консорциум ремесленников всегда ее предоставит!\n\nМожешь заняться публичными заказами, а если у тебя уже есть постоянные клиенты, поработай над заказами от гильдии или частных лиц! Главное, сделай все быстро-быстро и чисто-чисто!', '', '', '', '', '', '', 47187),
(70593, 'ruRU', 'Требуются услуги ювелира', 'Выполните заказы ювелиров для Консорциума ремесленников.', 'Привет-привет, $p! Заказы на изделия поступают каждую минуту!\n\nЕсли тебе нужна работа, Консорциум ремесленников всегда ее предоставит!\n\nМожешь заняться публичными заказами, а если у тебя уже есть постоянные клиенты, поработай над заказами от гильдии или частных лиц! Главное, сделай все быстро-быстро и чисто-чисто!', '', '', '', '', '', '', 47187),
(70592, 'ruRU', 'Требуются услуги начертателя', 'Выполните заказы начертателей для Консорциума ремесленников.', 'Привет-привет, $p! Заказы на изделия поступают каждую минуту!\n\nЕсли тебе нужна работа, Консорциум ремесленников всегда ее предоставит!\n\nМожешь заняться публичными заказами, а если у тебя уже есть постоянные клиенты, поработай над заказами от гильдии или частных лиц! Главное, сделай все быстро-быстро и чисто-чисто!', '', '', '', '', '', '', 47187),
(70591, 'ruRU', 'Требуются услуги инженера', 'Выполните заказы инженеров для Консорциума ремесленников.', 'Привет-привет, $p! Заказы на изделия поступают каждую минуту!\n\nЕсли тебе нужна работа, Консорциум ремесленников всегда ее предоставит!\n\nМожешь заняться публичными заказами, а если у тебя уже есть постоянные клиенты, поработай над заказами от гильдии или частных лиц! Главное, сделай все быстро-быстро и чисто-чисто!', '', '', '', '', '', '', 47187),
(70589, 'ruRU', 'Требуются услуги кузнеца', 'Выполните заказы кузнецов для Консорциума ремесленников.', 'Привет-привет, $p! Заказы на изделия поступают каждую минуту!\n\nЕсли тебе нужна работа, Консорциум ремесленников всегда ее предоставит!\n\nМожешь заняться публичными заказами, а если у тебя уже есть постоянные клиенты, поработай над заказами от гильдии или частных лиц! Главное, сделай все быстро-быстро и чисто-чисто!', '', '', '', '', '', '', 47187),
(70586, 'ruRU', 'Слишком много поваров', 'Изготовьте $1oa |4поварской колпак:поварских колпака:поварских колпаков; из ткани стихий для Фулафон из Вальдраккена.', 'Если я чему и научилась за годы работы швеей, $p, так это тому, что чем больше поваров на кухне, тем верней они все испортят.\n\nВот и сейчас: собралась я пойти выпить – и в последнюю минуту приходит заказ. На целый шкаф рабочей одежды для шеф-поваров.\n\nДавай ты сошьешь колпаки, а я возьму на себя все остальное.', '', '', '', '', '', '', 47187),
(70571, 'ruRU', 'Всем по барабану!', 'Изготовьте $1oa |4барабан из дикой шкуры:барабана из дикой шкуры:барабанов из дикой шкуры; для шкуродела Коруза из Вальдраккена.', 'О наших барабанах знает каждый обитатель островов – народ кентавров много веков оттачивал мастерство их изготовления. Боюсь, сейчас таких барабанов постоянно не хватает.\n\nВижу, ты и $gсам:сама; кое-что умеешь. Поможешь мне изготовить несколько барабанов на продажу?', '', '', '', '', '', '', 47187),
(70569, 'ruRU', 'Все для клиентов', 'Изготовьте $1oa |4корзину:корзины:корзин; с цветами травника для шкуродела Коруза из Вальдраккена.', 'У меня много ценных клиентов, но Трискет – один из любимчиков. Недавно он пришел ко мне, потому что его старая сумка для трав совсем износилась. \n\nЯ пообещал, что сделаю для него несколько корзин на замену. \n\nПоможешь мне, $p? Трискет будет благодарен.', '', '', '', '', '', '', 47187),
(70567, 'ruRU', 'Бакару только кость покажи...', 'Изготовьте $1oa |4костяной арбалет:костяных арбалета:костяных арбалетов; для шкуродела Коруза из Вальдраккена.', 'Ко мне поступила партия чудесных костяных арбалетов, но наши бакары добрались до них прежде, чем новые владельцы. Бакары обожают грызть кости, даже обработанные. Увы, погрызенные арбалеты уже не спасти.\n\nПоможешь изготовить новые?', '', '', '', '', '', '', 47187),
(70565, 'ruRU', 'Белая ворона... то есть ожерелье', 'Изготовьте $1oa |4подвеску:подвески:подвесок; нависших угроз для Тулурадорми из Вальдраккена.', 'Эй, ювелир, нравится мое ожерелье?\n\nНу конечно же нравится. Но если я хочу, чтобы его заметили все вокруг, надо сделать так, чтобы оно выделялось.\n\nЗнаю! Изготовь простые подвески – выставим их на продажу, и пусть наводнят рынок. Как только твои украшения станут носить все подряд, мое ожерелье будет сиять на их фоне!', '', '', '', '', '', '', 47187),
(70564, 'ruRU', 'Есть на что взглянуть', 'Изготовьте $1oa |4увеличительное стекло:увеличительных стекла:увеличительных стекол; из расколотого оникса для Тулурадорми из Вальдраккена.', 'Ювелир, совсем скоро состоится моя выставка. Но я боюсь, что клиенты не смогут в полной мере оценить красоту каждого самоцвета, если не выдать им специальные линзы.\n\nОсобых излишеств не нужно. Просто изготовь несколько увеличительных стекол, чтобы наши клиенты увидели все до последней мелочи.', '', '', '', '', '', '', 47187),
(70563, 'ruRU', 'Выставка', 'Изготовьте несколько разных самоцветов для Тулурадорми из Вальдраккена.', 'Приветствую, ювелир. Как смотришь на то, чтобы потренироваться в огранке?\n\nЯ хочу провести выставку и показать на ней разные варианты обработки самоцветов. Думаю, твои камни тоже могут туда попасть – если поспешишь. Но имей в виду: я принимаю только работы высочайшего качества.', '', '', '', '', '', '', 47187),
(70560, 'ruRU', 'Важней всего – разборчивый почерк', 'Изготовьте $1oa |4основной каталог:основных каталога:основных каталогов; исследователя для Талендары из Вальдраккена.', '$gМой ученик:Моя ученица;! $gГотов:Готова; взяться за перо? Сегодня исследователи из Драконьей экспедиции принесли множество заметок о своих приключениях. Их будто курица лапой писала. Меня попросили переделать все в разборчивый каталог, который можно читать прямо в дороге. И вот незадача: именно сегодня у меня разболелась рука. Могу ли я снова на тебя положиться?', '', '', '', '', '', '', 47187),
(70559, 'ruRU', 'Перо помощи', 'Изготовьте $1oa |4прочное перо:прочных пера:прочных перьев; писца для Талендары из Вальдраккена.', '$gМой ученик:Моя ученица;, как я рада тебя видеть.\n\nСегодня несколько новичков под моим началом впервые пробовали себя в начертании. Но все они давили на перья слишком сильно и переломали их!\n\nБоюсь, придется попросить тебя об услуге. Можешь изготовить несколько писчих перьев про запас?', '', '', '', '', '', '', 47187),
(70557, 'ruRU', 'Выстрел в ногу', 'Изготовьте $1oa |4заряд:заряда:зарядов; салютов бронзовых драконов для Тикки Трескобум из Вальдраккена.', 'Клянусь всемогущими гаджетами, коллега, сегодня нас с тобой ждет кое-что по-настоящему крупное!\n\nТут недавно среди местных охотников \"выстрелила\" странная мода на фейерверки... Они запускают их, чтобы вспугнуть уток и поднять их на крыло. Не думаю, что утки на такое купятся, но кто я, чтобы спорить с покупателями? Как думаешь, справишься?', '', '', '', '', '', '', 47187),
(70550, 'ruRU', 'Добро пожаловать в Кобальтовую ассамблею', 'Поговорите с Ксавин в Кобальтовой ассамблее, чтобы узнать, что можно сделать.', 'Нам нужна твоя помощь.\n\nРасколотое Пламя захватило большую часть Кобальтовой ассамблеи. \n\nПрошу, помоги нам от них отбиться. Нас совсем немного, но мы сможем как-нибудь тебя поддержать.', '', '', '', '', '', '', 47187),
(70549, 'ruRU', 'Проще простого', '', '', '', '', '', '', '', '', 47187),
(70541, 'ruRU', 'Приемы охоты: спутники', 'Выберите, участвовать ли в великой охоте с бакаром или охуном.', 'Твоя известность в племени Маруук растет. Теперь ты можешь охотиться с упорным бакаром или стремительным охуном.', '', '', '', '', '', '', 47187),
(70540, 'ruRU', 'Лучший друг инженера', 'Изготовьте $1oa |4универсальный инструмент:универсальных инструмента:универсальных инструментов; для Тикки Трескобум из Вальдраккена.', 'Эй, коллега, ты часом не $gвидел:видела; мой...\n\nУх... дай-ка мне этот...\n\nТак, мне надоело. Пора завести в лавке побольше инструментов... А то $gсам:сама; видишь, как бывает.', '', '', '', '', '', '', 47187),
(70533, 'ruRU', 'Как без рук', 'Изготовьте $1oa |4порцию:порции:порций; масла витого огня для Конфлаго из Вальдраккена.', 'Ты знаешь, что масло витого огня – великолепный завершающий ингредиент? Я вот знаю. И представь: оно у меня закончилось! А без масел я работать не могу. Умоляю, $p, помоги пополнить запасы в лаборатории.', '', '', '', '', '', '', 47187),
(70532, 'ruRU', 'Фронтовые нужды', 'Изготовьте $1oa |4освежающее лечебное зелье:освежающих лечебных зелья:освежающих лечебных зелий; для Конфлаго из Вальдраккена.', 'О, $p, приятно тебя видеть. Несколько бойцов серьезно пострадали в битвах с воинами стихий. Нам очень нужны зелья здоровья. Ты же $gискатель:искательница; приключений, у тебя наверняка найдется парочка в запасе. Правда, нам понадобится далеко не парочка.', '', '', '', '', '', '', 47187),
(70526, 'ruRU', 'Слет на равнинах Он\'ары', '', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70501, 'ruRU', 'Разрешение на охоту', 'Выполните тренировочные задания великой охоты.', 'О, ты наконец $gрешил:решила; показать свои охотничьи навыки? Учти, нужно не просто бегать вокруг и атаковать все, что движется. Для Шикаар охота всегда наполнена смыслом. Мы охотимся, чтобы добывать еду и делать одежду, чтобы оттачивать силу для битв с могучим врагом, чтобы поддерживать природу в равновесии.\n\nМы никогда не истребляем животных подчистую – взращиваем семя для будущих великих охот. Покажи, что $gготов:готова; следовать этим правилам, и сможешь к нам присоединиться.\n\nПравда, у меня есть сомнения в том, что твой друг справится.', '', '', '', '', '', '', 47187),
(70450, 'ruRU', 'Как избавиться от выдреков', 'Распугайте противных выдреков.', 'Привет, дружище! Эти выдреки растаскивают весь мой улов!\n\nБудь моя воля, они бы давно у меня взлетели на воздух! Но клыкарры от этой идеи не в восторге. Так что я сделал противовыдрековое устройство – АК-УЛА, но... Проблема в том, что я плохо плаваю.\n\nА у тебя, мне кажется, должно получиться активировать устройство, поплавать туда-сюда и распугать этих надоед. Окажешь услугу?', '', '', '', '', '', '', 47187),
(70446, 'ruRU', 'Личная история', 'Встретьтесь с Эмберталь в Обсидиановой обсерватории.', 'Изучая архивы, я обнаружила кое-какие намеки на то, что Обсидиановая обсерватория очень много значила для Хранителя Земли. Трудно и представить, какие знания о нашем народе там могут храниться.\n\nЭмберталь интересовалась таким, так что я все ей рассказала. Надеюсь, не зря.\n\nОна уже отправилась туда на разведку. Не $gмог:могла; бы ты приглядеть за ней? Она, конечно, опытный боец, но мало ли что случится? Кто знает, на что вы там наткнетесь.', '', '', '', '', '', '', 47187),
(70444, 'ruRU', 'Поля Дикой Ярости', 'Встретьтесь с Гаргтоком на Полях Дикой Ярости.', 'Храбрейшим из Шикаар! \n\nСоберите ваших лучших бойцов и отправляйтесь на Поля Дикой Ярости. Может, именно вы будете признаны самым яростным воином!\n\nПокажите, на что вы способны. Продемонстрируйте всем красивый бой!\n\nМогут действовать дополнительные условия и ограничения.', '', '', '', '', '', '', 47187),
(70442, 'ruRU', 'Битва на пиру', '', '', '', '', '', '', '', '', 47187),
(70438, 'ruRU', 'Кто сказал, что рыбы не летают', 'Возьмите рыбу для возврата в водоем и поднимитесь на драконе в воздух, чтобы сбросить ее с высоты.', 'Клев мог бы быть и лучше, $gсогласен:согласна;?\n\nЗнаешь, у меня тут возникла идея. Есть одна легенда, в которой сказано, что рыба в этих озерах и реках была не всегда. Говорят, что водоемы наполнялись рыбой, когда драконы, пролетая сверху, сбрасывали ее вниз в проруби! Звучит невероятно, да?\n\nМожет, попробуешь пролететь на драконе и сделать так же?', '', '', '', '', '', '', 47187),
(70437, 'ruRU', 'Тирхолд', 'Встретьтесь с Алекстразой у Престола Аспектов.', 'С тех пор, как драконы в последний раз появлялись в Тирхолде, прошли века.\n\nНо мы должны туда отправиться и узнать, в каком состоянии находится первый камень клятвы.\n\nДавай встретимся у Престола Аспектов. Мы должны выяснить, какие опасности могут нас поджидать в бывшей крепости Тира.', '', '', '', '', '', 'Встретьтесь с Алекстразой в Тирхолде.', 47187),
