(70414, 'ruRU', 'Сотрясая землю', 'Разместите тотемы землелома, чтобы освободить застрявшие сталагмиты.', 'Именем Каз\'горота, что здесь происходит? \n\nЭта магма обладает собственным разумом и поглощает пещерные камни стихий внизу. Все это не просто так... Я должен во всем разобраться!\n\nПомести тотемы землелома рядом с каждым из плененных элементалей, чтобы освободить их!', '', '', '', '', '', '', 47187),
(70412, 'ruRU', 'Гонки драконов – Слалом Дикого удела', '', '', '', '', '', '', '', '', 47187),
(70410, 'ruRU', 'Гонки драконов – Полет Морозной Вспышки', '', '', '', '', '', '', '', '', 47187),
(70377, 'ruRU', 'Забытый модный аксессуар', 'Найдите владельца очков.', '<Отвратительные, но явно дорогие очки перепачканы в слизи.\n\nВладелец наверняка их ищет. Такой стиль сейчас на пике моды.>', '', '', '', '', '', '', 47187),
(70376, 'ruRU', 'Второе испытание Тира: сила', 'Выдержите второе испытание Тира на равнинах Он\'ары.', '<Когда вы подходите к статуе, надпись на ней начинает тускло светиться.>\n\n\"Прими силу Хранителя и яви миру свою непреклонную волю – волю того, чей дух силен\".', '', '', '', '', '', '', 47187),
(70374, 'ruRU', 'Химиа Благословленная', 'Победите стихии.', 'Стихии считают эти земли своими и не слишком-то рады нашему появлению.\n\nО, стихии! Похоже, вы забыли про воздух, дарующий нам защиту! Невидимый, вездесущий и необходимый для существования! Вы забываете о воздухе так же легко, как дышите. Но встреча со мной укрепит вашу память.', '', '', '', '', '', 'Вернитесь к старейшине Назуун в Тиракай.', 47187),
(70373, 'ruRU', 'Смертогургургль!', 'Запрыгните в летак и победите Смертогургургля!', 'Смертогургургль! Смертогургургль! Смертогургургль делгрбррл!\n\nГру-у-у-ум бларглг!!!\n\n<Вы и без перевода понимаете, что мурлоки просят вас помочь им одолеть местную версию Смертокрыла. Прежде чем вы успеваете ответить, раздается рев мотора!>', '', 'Смертогургургль! Смертогургургль! Смертогургургль делгрбррл!!!', 'Смертогургургль', '', '', '', 47187),
(70371, 'ruRU', 'Смертогургургль!', 'Запрыгните в летак и победите Смертогургургля!', 'Смертогургургль! Смертогургургль! Смертогургургль делгрбррл!\n\nГру-у-у-ум бларглг!!!\n\n<Вы и без перевода понимаете, что мурлоки просят вас помочь им одолеть местную версию Смертокрыла. Прежде чем вы успеваете ответить, раздается рев мотора!>', '', 'Смертогургургль! Смертогургургль! Смертогургургль делгрбррл!!!', 'Смертогургургль', '', '', '', 47187),
(70370, 'ruRU', 'Тест на профориентацию', 'Пройдите опрос Гефесты о личных качествах, чтобы подобрать подходящую профессию.', 'Привет! Хочешь поработать с Консорциумом ремесленников? Ты сможешь отлично заработать и помочь клиентам со всего Азерота получить превосходные товары и услуги!\n\nОтлично! В каких двух областях ты разбираешься?\n\nПостой... ты $gобучен:обучена; только одной профессии? Столько возможностей упускаешь!\n\n<Гефеста на секунду задумывается.>\n\nДавай сделаем вот что. Я задам несколько вопросов о твоих личных качествах – так мы сможем выяснить, какая профессия лучше всего тебе подойдет в дополнение к первой! Что скажешь?', '', '', '', '', '', '', 47187),
(70368, 'ruRU', 'Тест на профориентацию', 'Пройдите опрос Гефесты о личных качествах, чтобы подобрать подходящую профессию.', 'Привет! Хочешь поработать с Консорциумом ремесленников? Ты сможешь отлично заработать и помочь клиентам со всего Азерота получить превосходные товары и услуги!\n\nПостой... ты не $gобучен:обучена; никакой профессии? Столько возможностей упускаешь!\n\n<Гефеста на секунду задумывается.>\n\nДавай сделаем вот что. Я задам несколько вопросов о твоих личных качествах – так мы сможем выяснить, какая профессия лучше всего тебе подойдет. Что скажешь?', '', '', '', '', '', '', 47187),
