(70352, 'ruRU', 'Ставки повышаются', 'Вместе с Толуики убейте рогоплавов и враждебных протодраконов.', 'О, ты здесь! Ты ведь уже $gубивал:убивала; протодраконов?\n\nВыходит, что с твоим опытом и моими навыками охоты мы сможем одолеть еще немало этих громадин! Их привлекают источники неподалеку. \n\nПомоги мне доказать самой себе, что я чего-то стою.', '', '', '', '', '', '', 47187),
(70351, 'ruRU', 'Суета в саду', 'Поговорите с Акорой у Рубиновых Омутов Жизни.', 'Я годы ухаживала за этим садом, чтобы однажды принять мое призвание. И вот этот день настал!\n\nЯ люблю заботиться о цветах, деревьях и растениях – люблю даже жучков, которые в них живут. Работая в саду, я чувствую рядом дух природы, дух великого дракона.\n\nОсталось только одно. Я собираюсь пробудить дух великого дракона, как в старых легендах.\n\n<Акора счастливо улыбается.>\n\nСпустись в сад. Я буду ждать у омута, где покоятся ее кости. Там я расскажу обо всем подробнее.', '', '', '', '', '', '', 47187),
(70341, 'ruRU', 'Заслуженная победа', 'Вернитесь к двигателю открытий в Вальдраккен.', 'Даже в малом может крыться великое сокровище.\n\nОтнеси сущность к двигателю открытий.', '', '', '', '', '', '', 47187),
(70339, 'ruRU', 'По стопам Тира: равнины Он\'ары', 'Найдите место второго испытания Тира на равнинах Он\'ары.', 'Хоть ты и $gсправился:справилась; с первым испытанием, не жди, что легко преодолеешь второе. Хранитель Тир хотел, чтобы двигатель открытий достался лишь достойным – лишь тем, кто станет использовать его мудро. \n\nЕсли твоя воля непреклонна, отправляйся на равнины Он\'ары. Жду не дождусь увидеть, на что ты $gспособен:способна;.', '', '', '', '', '', 'Найдите место второго испытания Тира на равнинах Он\'ары.', 47187),
(70338, 'ruRU', 'Похищение детенышей', 'Спасите детенышей.', 'Судя по поведению Сильвии, там ее детеныши! \n\nДолжно быть, великаны утащили их, пока она была больна и не могла защитить потомство.\n\nВ таком возрасте малыши очень юркие. Надеюсь, великаны не успели их отловить...\n\nВот, возьми мой талисман невидимости... И поспеши. Спаси детенышей, пока их не съели!', '', '', '', '', '', '', 47187),
(70337, 'ruRU', 'Пепельный дозор', 'Принесите он\'ирские \"песни ветра\" в Пепельный дозор.', 'Здравствуй!\n\nВетер принес весть, что в развалинах Пепельного дозора укрылась группа странников. Похоже, они интересуются только прошлым, тогда как мы, кентавры, стремимся жить настоящим под крылом Он\'ары.\n\nТак или иначе, это гости в нашем доме. Я сделал для них \"песнь ветра\", чтобы они могли слышать присутствие Он\'ары. Пусть это принесет к их очагу радость и утешение.', '', '', '', '', '', '', 47187),
(70335, 'ruRU', 'Простые инструменты для раскопки', '', '', '', '', '', '', '', '', 47187),
(70319, 'ruRU', 'Нергазурай', 'Принесите сердце выдрека, бедренную кость камнезуба, чешую рогатого длиннорога и потроха стервятника Мукуру Омытому Дождем на заставу Лесной Тропы.', 'Мой дядя часто рассказывал мне, как сражался с длиннорогом по имени Нергазурай. Рассказывал, как его ярко-розовая чешуя мелькала среди холмов, когда Нергазурай выслеживал добычу, рассказывал о бритвенно-острых когтях и ядовитых клыках.\n\nЯ охотился и вдруг увидел яркую вспышку... Но среагировал слишком поздно – меня укусили за плечо. Этот зверь так же ужасен, как и в историях дяди. Но мне удалось выжить.\n\nРану нужно промыть от заразы. Пожалуйста, принеси необходимые предметы. Боюсь, что времени мало.', '', '', '', '', '', '', 47187),
(70299, 'ruRU', 'В помощь драконам', 'Убейте воинов стихий в Грозовом разломе.', 'Ветер принес слова о том, что какие-то чужаки объединились с кланом Нокхуд, чтобы напасть на наших соседей – драконов. Эти воины стихий – настоящее проклятие, постигшее земли наших предков.\n\nУбей чужаков и принеси мне ядра подчиненных ими элементалей.', '', '', '', '', '', '', 47187),
(70279, 'ruRU', 'Кровь драконов', 'Убейте Каркидана.', 'Как ты наверняка уже $gвидел:видела;, в этих землях водятся существа, которые сильно превосходят по размеру своих собратьев.\n\nМы думаем, что их благословили боги дикой природы. Эти животные – достойные цели для охотников, желающих проявить себя. Неподалеку как раз находится такой зверь, мы зовем его Каркидан. Если сможешь его одолеть, это произведет на меня впечатление.', '', '', '', '', '', '', 47187),
(70268, 'ruRU', 'Ожившие воспоминания', 'Отдайте дневник Веритистразу.', 'Вы нашли дневник. Он в плохом состоянии, часть текста уже не восстановить. Похоже, что он принадлежал молодой женщине – черному дракону, до того как на их род пало проклятие. \n\nБолее поздние записи прочесть невозможно, но, листая начало текста, вы замечаете имя – Веритистраз.', '', '', '', '', '', 'Отдайте дневник Веритистразу в Рубиновом святилище', 47187),
(70244, 'ruRU', 'Нокхуд не пройдет', 'Войдите в деревню вместе с ханам Матрой Сарест и отбейте это место у клана Нокхуд.', 'Тысячи лет клан Тирай охранял рог Друсала – нашу священную реликвию. Разграбив эту деревню, Балакар предал все то, что связывало его с Маруук. И эту вину не искупить.\n\nМы должны вернуть рог, прежде чем Балакар его уничтожит, и спасти всех выживших из клана Тирай. Я отправлюсь с тобой, чтобы лично призвать к ответу того, кто недостоин называться ханом. Нокхуды познают гнев ханам Матры!', '', '', '', '', '', '', 47187),
(70242, 'ruRU', 'Как жить дальше', 'Получите инертный сосуд у Треллейна в Рубиновом святилище Жизни.', 'Я вижу глубокий шрам в душе его друга. В этом месте есть нечто такое, что разбередило рану. Но, возможно, сейчас мне удастся полностью ее залечить.\n\nПора заняться исцелением Колгара.\n\nМой друг Треллейн изучает наложение чар в Рубиновом святилище. Скажи ему, что мне нужен пустой сосуд. Он не откажет.', '', '', '', '', '', '', 47187),
(70241, 'ruRU', 'В последний путь', 'Приведите Батораса к Дурозу и Колгару.', 'Так внезапно... Он спал, а я на секунду отвернулся, и... Мы каждый день приходили сюда, ему хотелось посидеть с дракончиками. Я и не знал, что он...\n\n<Похоже, Колгар плакал. Он трет глаза тыльной стороной ладони.>\n\nДа что уж там, я все понимал. А вот теперь не знаю, что делать. Как же с ним быть?..\n\nМожет, ты... сходишь за Баторасом?', '', '', '', '', '', '', 47187),
(70240, 'ruRU', 'Обезболивающее зелье', 'Добудьте $1oa |4цветок:цветка:цветков; млечного щелкоцвета, $2oa |4цветущую отмелилию:цветущие отмелилии:цветущих отмелилий; и флакон с водой Омутов Жизни.', 'Хорошо, что вы привели его сюда. Он сейчас очень страдает, хотя стойко переносит боль. Со временем это ждет всех.\n\nБоюсь, что тут виновата не хворь, а возраст. Но, возможно, я смогу хотя бы частично облегчить его страдания.\n\nМне нужно, чтобы ты $gсходил:сходила; в сад неподалеку и $gпринес:принесла; щелкоцветов, отмелилий и чистую воду. Надо, чтобы хватило на обезболивающее зелье.', '', '', '', '', '', '', 47187),
(70239, 'ruRU', 'Затаенная боль', 'Сопроводите Дуроза и Колгара и помогите им найти помощь.', 'Дуроз стар и хвор, но упрям, как кодо. Его невозможно было остановить, когда он решил сесть на корабль и лететь сюда. Все, что я мог сделать, это помочь ему передвигаться.\n\nВ бою я не раз видел, как он страдал от боли, так что сейчас, когда он скрывает, что ему тяжело, я-то все вижу. В последнее время ему становится хуже с каждым днем. Поможешь мне отвести его к зельеварам? А то эль больше не помогает. \n\nЕсли ты понесешь наше оружие, я смогу помочь ему дойти.', '', '', '', '', '', '', 47187),
(70236, 'ruRU', 'Выбитый глаз дракона', 'Доставьте предмет Эмилии Беллок.', '<Может, это как раз то, что ищет Эмилия Беллок.>', '', '', '', '', '', '', 47187),
(70235, 'ruRU', 'Ремонтные работы', 'Изготовьте $1oa |4серевитовый ремонтный молот:серевитовых ремонтных молота:серевитовых ремонтных молотов; для кузнеца Куроко из Вальдраккена.', 'Такой войны Драконьи острова не знали уже тысячи лет. Наша броня выше всяких похвал, но даже она может износиться, если битвам нет конца. Нам поступил большой заказ на серевитовые ремонтные молоты, так что пригодится любая помощь. Если подсобишь с молотами, я подсоблю тебе с навыком кузнечного дела Драконьих островов.', '', '', '', '', '', '', 47187),
(70233, 'ruRU', 'Нехватка топоров', 'Изготовьте $1oa |4драконитовый топор:драконитовых топора:драконитовых топоров; для кузнеца Куроко из Вальдраккена.', 'У нас возникла путаница с заказами, и наши исследователи остались без драконитовых топоров. Это надо срочно исправить! Мы ищем мастеров, которые нам помогут, – а в благодарность обучим новым знаниям, которые помогут изготавливать еще более могучее снаряжение.', '', '', '', '', '', '', 47187),
(70229, 'ruRU', 'Мистик Боку', 'Найдите Боку в Тиракае.', 'Несколько дней назад все мистики были отозваны к стоянке горных порогов. Остался только один. Его зовут Боку. Ты найдешь его на вершине холма в святилище Он\'ары.\n\nЭто всего лишь посвященный, но он наверняка сумеет связаться с Он\'арой, чтобы получить ее благословение. Быть может, поддержка Он\'ары поможет нам победить в этой войне еще до того, как она начнется.', '', '', '', '', '', 'Найдите Боку в Тиракае.', 47187),
(70221, 'ruRU', 'Жажда работы', '', '', '', '', '', '', '', 'Получите рвение мастера у Томаса Брайта.', 47187),
(70220, 'ruRU', 'Тенистый Приют', 'Поговорите с капитаном стражи Элоуин, Сариосой, Сидрой Целительницей и Вираником.', 'Мы должны предупредить остальных зеленых драконов о том, что барьер, защищающий Древние Ветви, под угрозой. Нам с Геритием нужно многое обсудить.\n\n$n, я отмечу тебя своим знаком. Для других драконов он будет означать, что ты $gмой доверенный посланник:моя доверенная посланница;.\n\nОтправляйся в путь и собери мой народ. Они должны приготовиться к битве.', '', '', '', '', '', '', 47187),
(70215, 'ruRU', 'Главное – любознательность', 'Поговорите с исказительницей Деландрой в лагере Антонидаса.', 'Я не спешила обсуждать эти символы не потому, что тебе не доверяю, а потому, что природа самих символов и камней, на которых они находятся, остается весьма загадочной.\n\nДа, камней несколько. Они разбросаны по всем островам.\n\n<Исказительница Деландра бросает на вас взгляд. В ее глазах мелькает искра любопытства.>\n\nВижу, ты этого не $gзнал:знала;.\n\nИтак. Судя по твоей настойчивости и упорству, с которым ты меня $gискал:искала;, ты жаждешь понять, что за открытие недавно $gсовершил:совершила;. Пожалуй, пришло время все подробно обсудить.', '', '', '', '', '', '', 47187),
(70213, 'ruRU', 'Харкин Мрачноскал', '', '', '', '', '', '', '', '', 47187),
(70212, 'ruRU', 'Пенумбрий', '', '', '', '', '', '', '', '', 47187),
(70210, 'ruRU', 'Сохраняя традиции', 'Разместите благовония и расчистите путь к Вечным курганам от призрачных чудовищ.', 'Одна из традиции клана Айлааг, когда мы останавливаемся в этом лагере, совершать паломничество к Вечным курганам, чтобы испросить доброго пути и защиты от напастей, угрожавших нашим предкам. Из-за клана Нокхуд это путешествие стало опасным.\n\nХочу спросить, сможешь ли ты нам помочь? Чтобы мы продолжили эту традицию.', '', '', '', '', '', '', 47187),
(70209, 'ruRU', 'Победный кряк', '', '', '', '', '', '', '', '', 47187),
(70207, 'ruRU', 'Фрагмент хвоста', 'Доставьте предмет Эмилии Беллок.', '<Может, это как раз то, что ищет Эмилия Беллок.>', '', '', '', '', '', '', 47187),
(70204, 'ruRU', 'Золотой коготь', 'Доставьте предмет Эмилии Беллок.', '<Может, это как раз то, что ищет Эмилия Беллок.>', '', '', '', '', '', '', 47187),
