(70198, 'ruRU', 'Зов островов', 'Встретьтесь с Налейдеей Речной Блеск в Дуротаре.', 'Наши друзья собираются в Дуротаре. Все это так захватывающе!\n\nДавай с нами, $n! Пришло время отправиться на Драконьи острова!', '', '', '', '', '', '', 47187),
(70197, 'ruRU', 'Зов островов', 'Встретьтесь с Тодди Баки в порту Штормграда.', 'Ты $gготов:готова; к лучшему приключению в своей жизни? Я точно готова!\n\nНаши союзники уже собрались, и все припасы упакованы. Так что не будем терять времени!\n\nЯ буду ждать тебя в порту Штормграда. Пора отправляться на Драконьи острова!', '', '', '', '', '', '', 47187),
(70196, 'ruRU', 'Зачистка', '', '', '', '', '', '', '', '', 47187),
(70195, 'ruRU', 'Во власти бури', 'Спасите Алтан и поищите информацию о чужаке.', 'Мне сообщили, что нокхудов сопровождает чужак, владеющий невиданной магической силой. Этот чужак сокрушил наши ряды подобно буре. \n\nЕсли у нокхудов и впрямь появились союзники, способные творить подобные разрушения, мы должны разузнать об этом как можно больше.\n\nЯ отправила Алтан, своего охуна, на поиски этого чужака, но она пока не вернулась. Меня это тревожит. $n, я хочу попросить тебя поискать любые зацепки, чтобы раскрыть тайну чужака, и узнать, что так задержало Алтан.', '', '', '', '', '', '', 47187),
