(70185, 'ruRU', 'Таинственный зверь', 'Найдите и убейте зверя, а затем принесите трофей разведчице Томуль.', '<Вы видите отпечаток большой лапы. Но в окрестностях не наблюдается никаких существ с лапами, тем более такого размера.\n\nЕсли вы убьете этого огромного зверя, это наверняка впечатлит кентавра.>', '', '', '', '', '', 'Принесите шкуру Конкулара разведчице Томуль.', 47187),
