(70182, 'ruRU', 'Сладок вкус победы', 'Вернитесь к двигателю открытий в Вальдраккен.', 'Даже в малом может крыться огромный потенциал. Эта бутилированная сущность кажется легкой, но в ней содержится огромная мощь. \n\nОтнеси ее к двигателю открытий.', '', '', '', '', '', '', 47187),
(70181, 'ruRU', 'Первое испытание Тира: точность', 'Выдержите первое испытание Тира в Лазурном Просторе.', '<Когда вы подходите к статуе, надпись на ней начинает тускло светиться.>\n\n\"Прими силу Хранителя и неси ее свет в будущее, чтобы там он воссиял для всех нас\".', '', '', '', '', '', '', 47187),
(70180, 'ruRU', 'Как завести машину', 'Помогите Грейзику зарядить загадочное устройство.', 'Тут кое-кто из городских утверждает, будто вот эту машину собрал сам легендарный дозорный титанов Тир. \n\nНо вот незадача: она отказывается работать! Мы уже перепробовали все: разбирали ее, калибровали, даже током слегка били. Ничего не сработало, кроме удара током. К слову... у меня есть отличная мысль.\n\nВидишь вон тот гирокоптер? Залезай в него, и давай-ка чуть-чуть... подзарядим эту титанскую штуковину.', '', '', '', '', '', '', 47187),
(70179, 'ruRU', 'Два дела одновременно', 'Добудьте строительные материалы у элементалей земли.', 'Здравствуй, $gпутешественник:путешественница;! Похоже, ты кое-что умеешь. Можно попросить тебя помочь?\n\nМне и Азкре поручили заняться башней, находящейся в удивительном состоянии, которое я называю \"предреставрационным\". Но проблема в том, что, когда мы начали ее восстанавливать, на нас напали элементали земли! \n\nИ тут я сказала себе: \"Зефрен, почему бы нам не сделать два дела одновременно: победить элементалей земли, а заодно добыть материалы для строительства\"? И в этот момент появляешься ты! Ну что, поможешь нам?', '', '', '', '', '', '', 47187),
(70175, 'ruRU', 'Сломанная окантовка', 'Доставьте предмет Эмилии Беллок.', '<Может, это как раз то, что ищет Эмилия Беллок.>', '', '', '', '', '', '', 47187),
(70174, 'ruRU', 'Клан Шикаар', 'Встретьтесь с ханом Сансок.', 'Хан Сансок – самая искусная охотница нашего клана. Она лишена слуха, но раз за разом проявляет выдающиеся качества и охотницы, и лидера.\n\nЭто наставница для нас всех. Предводительница, которой мы доверяем, и бесстрашная защитница Маруук.\n\nВстретиться с ней – огромная честь.', '', '', '', '', '', '', 47187),
(70172, 'ruRU', 'Что скрывают горы', '', '', '', '', '', '', '', '', 47187),
(70171, 'ruRU', 'Приятные случайности', 'Найдите последнюю картину Хадсона.', '<Похоже, Ранпиата вот-вот заплачет.>\n\nЭто из-за меня? Из-за меня от него ушло вдохновение?\n\nОн говорит, что любит меня, но... Ты $gвидел:видела;, как тяжело ему без искусства.\n\nЯ желаю ему только добра. Если без меня ему лучше... я уйду. \n\nЭто его последняя картина, которую он выбросил. Последнее, что он попытался нарисовать, прежде чем бросить это дело. \n\nУ меня просто сердце разрывалось. Я спрятала ее в доме. Пожалуйста... отнеси картину ему... Пусть не забывает, как это важно.', '', '', '', '', '', '', 47187),
(70170, 'ruRU', 'Забрать силой', 'Заберите картины Хадсона у финальных боссов подземелий \"Чертоги Насыщения\", \"Академия Алгет\'ар\", \"Лазурное хранилище\" и \"Нелтарий\".', 'Боюсь, он бывает слишком упрямым.\n\nНо я просто так не сдамся. Попробуем еще раз! \n\nЕсть еще работы, которые он выбросил. Но они в гораздо более опасных местах. Надеюсь, ты справишься!', '', '', '', '', '', '', 47187),
(70169, 'ruRU', 'Даже деревьям нужны друзья', 'Поговорите с Раувросом.', 'Я знаю, что вы с Ран хотите помочь. \n\nНо это едва ли возможно. Мое вдохновение... желание рисовать... просто ушло. \n\nНо Ран права. Ради тебя я должен хотя бы попытаться.\n\nПриводи своего друга, этого начинающего художника.', '', '', '', '', '', '', 47187),
(70168, 'ruRU', 'Удручающие происшествия', 'Заберите картины Хадсона у финальных боссов подземелий \"Рубиновые Омуты Жизни\", \"Наступление клана Нокхуд\" и \"Лощина Бурошкуров\".', 'Ты $gпроделал:проделала; весь этот путь... Мне так жаль!\n\nРаньше мой дорогой Хадсон просто обожал писать картины. Это было смыслом его жизни! Не знаю, почему так произошло. \n\nНесколько недель назад, возвращаясь из творческого путешествия, он в порыве ярости выбросил все свои незавершенные работы. \n\nПрошу, $gпутешественник:путешественница;... можешь их найти? Вдруг это вернет ему вдохновение. \n\nХадсон не боится забираться в опаснейшие места, где открываются великолепные виды. Надеюсь, ты к этому $gготов:готова;.', '', '', '', '', '', '', 47187),
(70166, 'ruRU', 'Радость творчества', 'Отнесите приветственную картину Раувроса Хадсону.', 'Нравится моя коллекция? Это все работы Хадсона, самого выдающегося художника на свете.\n\nОни очень редкие и наверняка высоко ценятся – Хадсон ведет уединенный образ жизни и уже давно не писал картин. Как бы я хотел с ним встретиться... Или даже поучиться у него!\n\nА ты... похоже, не из застенчивых. Сможешь разыскать его ради меня? В-вот! Возьми кое-что из моих работ. Вдруг это его заинтересует!\n\nХотя, может, он посчитает меня дилетантом... Ох...', '', '', '', '', '', '', 47187),
(70164, 'ruRU', 'Шанс ученого', 'Поговорите с хрономантом Фосилдралом и Сибрит Странничкой в руинах хранилища Жизни.', '$p, можно тебя на минуту? Кажется, я близка к прорыву!\n\nКогда колыбель разрушилась, я утратила нечто большее, чем просто способность сражаться. Я перестала ощущать себя драктиром. Возможно, тебе это знакомо?\n\nЯ всегда любила собирать и разбирать разные вещи, поэтому решила примкнуть к экспедиции. Но с этим артефактом все оказалось не так-то просто. \n\nТы можешь попросить Фосилдрала и Сибрит прочитать мои записи? Я хочу доказать, что я хороший мастер... и им, и себе.', '', '', '', '', '', '', 47187),
(70163, 'ruRU', 'Перекрестье пещер – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70161, 'ruRU', 'Перекрестье пещер', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70159, 'ruRU', 'Вкус дома', 'Попросите у участников Драконьей экспедиции из Орды нужные ингредиенты.', 'Наконец-то еще один драктир! Нам нужна помощь.\n\nМы с братом хотим приготовить еду, но...\n\n<Шрамалеш обводит взглядом окрестности.>\n\nЗдесь все настолько другое! Трудно найти привычные ингредиенты.\n\nПридется приспосабливаться. Можешь попросить у ордынцев немного плодов, белка и эмульсирующей жидкости? Тогда мы наконец-то сможем поесть.', '', '', '', '', '', '', 47187),
(70158, 'ruRU', 'Спринт по садам – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70157, 'ruRU', 'Спринт по садам', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70156, 'ruRU', 'Древнее пробуждение', 'Усильте путевые врата.', 'Путевые врата – прямо за мной. Невозможно сказать, сколько времени у нас есть, прежде чем чары, наложенные на сосуд, ослабнут или, что еще хуже, исчезнут совсем.\n\nЕсли вся эта энергия вырвется на свободу, произойдет настоящая катастрофа. \n\nИтак, ты $gготов:готова; продолжить?', '', '', '', '', '', '', 47187),
(70155, 'ruRU', 'Смотри, слушай, дыши', 'Порыбачьте вместе с Трешраком.', 'Привет, $r. Редко кто останавливается, чтобы поздороваться или поболтать со мной. Обычно все спешат по своим делам.\n\nХочешь, порыбачим вместе?', '', '', '', '', '', '', 47187),
(70154, 'ruRU', 'Врата в неизвестность', 'Проследуйте за исказительницей Деландрой к путевым вратам.', 'Эти чары защитят нас от нестабильной энергии внутри.\n\nЯ открою путь к ближайшему камню. \n\nКогда окажешься там, держись рядом. Мне понадобится твоя помощь, чтобы зарядить устройство.', '', '', '', '', '', '', 47187),
(70152, 'ruRU', 'Рыболовная лихорадка', '', '', '', '', '', '', '', '', 47187),
(70148, 'ruRU', 'Без предназначения', 'Найдите когтя Этрети в посольстве Крылатого Приюта.', 'У тебя найдется пара минут? \n\nЯ переживаю за одного драктира, который недавно тут проходил. Он задавал много вопросов, но, кажется, наши ответы его... разочаровали.\n\nСказал, что он \"Коготь Этрети\". Я так понимаю, это какое-то невысокое звание, да?\n\nМне кажется, ему нужна помощь. Поможешь мне сделать доброе дело?\n\nЭтрети разговаривал с Колмаром – вон он стоит.', '', '', '', '', '', '', 47187),
(70146, 'ruRU', 'Бой на нагорье', '', '', '', '', '', '', '', '', 47187),
(70139, 'ruRU', 'Сберечь обереги', 'Осмотрите повреждения камней-оберегов в Тирхолдском резервуаре.', 'Резервуар был защищен тремя камнями-оберегами, которые установил еще Тир. \n\nИх задача – стабилизировать магию стихий, которая на Драконьих островах очень сильна. \n\nКогда ты меня $gпробудил:пробудила;, я почувствовала, что западный оберег поврежден. Боюсь, что воины стихий могли проделать это и с остальными. \n\nНужно понять, насколько пострадали обереги, чтобы решить, что делать дальше.', '', '', '', '', '', '', 47187),
(70136, 'ruRU', 'Когда времени в обрез', 'Найдите посох Дозорного Времени и записки Дозорных Времени и убейте бешеного вожака в Текущих лесах Тальдразуса.', 'Уф-ф... секундочку...\n\nМое первое задание... Нестабильная темпоральная энергия просачивается в лес... Влияет на животных... Оценить влияние и по возможности собрать энергию для Дозорных Времени...\n\n<Зера качает головой.>\n\nКогда я изучала стаю ворквинов, на меня напал медведь, обезумевший от переизбытка магии времени. Застал меня врасплох. Я еле спаслась.\n\nСможешь найти мое потерянное снаряжение, |3-6($c)? Правда... медведь, скорее всего, еще там.', '', '', '', '', '', '', 47187),
(70135, 'ruRU', 'Вторжение элементалей', 'Убейте $1oa |4изначального элементаля:изначальных элементалей:изначальных элементалей; в посольстве Крылатого Приюта.', 'Мастера, ремесленники и исследователи Драконьей экспедиции не выдержат тяжестей сражения.\n\nА вот мы с тобой – другое дело, $p.\n\nНа Драконьих островах мы должны защитить тех, кто не может защитить себя сам.\n\nОтгони элементалей, наступающих с севера, чтобы экспедиция не отвлекалась на повседневные заботы.', '', '', '', '', '', '', 47187),
(70134, 'ruRU', 'Воспоминания', 'Заберите капсулу времени Веритистраза.', 'Спасибо, что внимательно слушаешь, дитя. У меня есть к тебе просьба. \n\nНет-нет, больше никаких историй.\n\nКогда мы покидали это место, я оставил... что-то вроде капсулы времени. Может быть, ты... сможешь ее принести? Она находится в самом низу Рубиновых Омутов Жизни за одной из колонн.\n\nКапсулу я спрятал, поэтому, чтобы ее увидеть, нужно активировать печать.', '', '', '', '', '', '', 47187),
(70132, 'ruRU', 'Присядь и послушай', 'Присядьте ненадолго и полюбуйтесь видами.', '<Старый дворф никак не реагирует на ваше приближение. Нахмурившись, он смотрит вдаль. Отсюда открывается прекрасный вид, и вам кажется, что стоит ненадолго остановиться и полюбоваться этой панорамой.>', '', '', '', '', '', '', 47187),
(70129, 'ruRU', 'Пальцедав Ужасный', 'Помогите Роуи убить Пальцедава Ужасного.', 'Ты $gправ:права;, у меня не хватит сил, чтобы справиться с этим йети... в одиночку уж точно! \n\nХорошо, что ты здесь!\n\nЛогово Пальцедава Ужасного, этого злобного йети, прямо перед нами. Эта пещера... большая. Но не страшная! Ну, может, только чуть-чуть. \n\nМожешь пойти туда и начать его бить? А я... а я сразу за тобой!', '', '', '', '', '', '', 47187),
(70126, 'ruRU', 'Последний штрих', 'Убедите клиента обращаться к Мигелю за выполнением будущих заказов.', 'О, $p, рад тебя видеть! \n\nТы $gоказал:оказала; неоценимую помощь Консорциуму ремесленников и нам с Томасом лично. Спасибо тебе.\n\nКак один ремесленник другому, хочу рассказать о еще одной важной вещи – налаживании хороших отношений с заказчиками.\n\nСегодня я выполнил заказ для клиента и хочу, чтобы ты с ним $gпоговорил:поговорила;. Убедишь его обращаться ко мне, если в будущем ему что-то понадобится? Просто напомни ему, что самые качественные товары стоит заказывать у меня лично.', '', '', '', '', '', '', 47187),
(70125, 'ruRU', 'Куда подевался Гневион?', 'Спросите Сендракс, когда прибудут драконы.', 'Куда ж подевался Гневион?\n\nОн сказал, что будет ждать нас с послом королевы драконов Алекстразы, Хранительницы жизни.\n\nТак-то драконы не нарушают обещаний.\n\nНу что ж! Хоть кто-то нас встречает. Спроси у этой малютки, когда прибудут остальные.', '', '', '', '', '', '', 47187),
(70124, 'ruRU', 'Сырье для практики', 'Добудьте $1oa |4чешуйку изначального протодракончика:чешуйки изначальных протодракончиков:чешуек изначальных протодракончиков;.', 'Местные протодраконы совсем не похожи на тех, которых я когда-либо видел.\n\nИх чешуя от природы огнеупорна и прочнее стали, но при этом остается гибкой. Просто невероятно.\n\nНашим умельцам не терпится с ней поработать.\n\nДля начала добудь чешую протодракончиков. Маленькие чешуйки наверняка пластичнее. То, что надо, пока мы учимся с ними работать.', '', '', '', '', '', 'Встретьтесь с Телином Темная Наковальня в посольстве Крылатого Приюта.', 47187),
(70123, 'ruRU', 'Изначальные вредители', 'Убейте $1oa |4изначального протодракона:изначальных протодраконов:изначальных протодраконов; на Диких берегах.', '<Лазурател с подозрением косится на протодраконов, затаившихся на гряде позади него.>\n\nКлянусь, эти протодраконы приближаются к лагерю каждый раз, когда я поворачиваюсь к ним спиной...\n\nЭто точно не те драконы, к которым нас пригласил Гневион.\n\nЭто безжалостные хищники, которые не станут слушать уговоры. Придется ответить той же жестокостью.\n\nЧтобы протодраконы не распоясались, придется сократить их число, иначе наша экспедиция не успеет и начаться.', '', '', '', '', '', 'Встретьтесь с дракомандиром Лазурателом в посольстве Крылатого Приюта.', 47187),
(70122, 'ruRU', 'Исследователи в опасности', 'Спасите 3 участников Драконьей экспедиции на Диких берегах.', 'Не прими научное любопытство участников экспедиции за трусость, $p.\n\nМы тебе не отшельники, сгорбившиеся над книгами в одиноких башнях.\n\nМы искатели приключений, исследующие каждый уголок Азерота в погоне за знаниями!\n\nНо наша любовь к приключениям нередко приводит к опасным ситуациям, заставляя нас переоценивать свои возможности... Увы, именно это и произошло с несколькими нашими коллегами.\n\nНо какое может быть веселье без капельки риска?', '', '', '', '', '', 'Встретьтесь с Тодди Баки в посольстве Крылатого Приюта.', 47187),
(70112, 'ruRU', 'Угроза фурболгов', '', '', '', '', '', '', '', '', 47187),
(70110, 'ruRU', 'Изучение Тальдразуса', '', '', '', '', '', '', '', '', 47187),
(70100, 'ruRU', 'Изучение Лазурного Простора', '', '', '', '', '', '', '', '', 47187),
(70079, 'ruRU', 'Изучение равнин Он\'ары', '', '', '', '', '', '', '', '', 47187),
(70074, 'ruRU', 'Набег на Расколотое Пламя', '', '', '', '', '', '', '', '', 47187),
(70070, 'ruRU', 'Но... я герой уток!', 'Найдите Огнекряка и проследите, чтобы он вернулся к Граку.', 'Постой... Что-то не так...\n\n<Грак озирается по сторонам.> \n\nОгнекряк! Похоже, он опять спустился вниз по реке! Сколько бы я ни запрещал, он постоянно убегает поиграть с рогоплавами!\n\nПрошу, посмотри, все ли в порядке. Его могли опять проглотить...', '', '', '', '', '', 'Расскажите Граку, что вы увидели.', 47187),
(70069, 'ruRU', 'Для других я погонщик утят', 'Накормите $1oa |4утенка:утят:утят; и вернитесь к Граку.', 'Мои дни почти сочтены... но работа еще не окончена. \n\nНайди стаю у залива. Я оставляю их там, чтобы они учились сами за себя постоять. Скоро им придется жить самостоятельно.\n\nСегодня о них позаботишься ты. Отнеси им добытую еду, а затем приведи утят ко мне. Внимательно следи за Пилотом. Она вечно норовит откуда-нибудь спрыгнуть.', '', '', '', '', '', '', 47187),
(70068, 'ruRU', 'Кобальтовая катастрофа', '', '', '', '', '', '', '', '', 47187),
(70067, 'ruRU', 'Послание нокхудам', '', '', '', '', '', '', '', '', 47187),
(70062, 'ruRU', 'Для кого-то я жуколов', 'Добудьте $1oa |4часть жука-летуна:части жуков-летунов:частей жуков-летунов;.', 'А, $gюный:юная:$r; |3-6($r), ты-то мне и $gнужен:нужна;. Я взрастил здесь многие поколения живых созданий. \n\nНо больше всего мне дороги мои утята. Увы, мое тело состарилось и ослабло... а круговорот жизни не стоит на месте.\n\nТы не $gмог:могла; бы раздобыть еды для моей стаи?', '', '', '', '', '', '', 47187),
(70061, 'ruRU', 'Тренировочные крылья', 'Направляйте дракончика и уничтожьте $2oa |4беспокойный росток:беспокойных ростка:беспокойных ростков;, $3oa |4незваного мелкого острожала:незваных мелких острожалов:незваных мелких острожалов; и $4oa |4безжалостный шквал:безжалостных шквала:безжалостных шквалов;.', 'Драконы давно не возвращались на острова, $p. Сказать по правде... за несколько поколений многие наши навыки забылись.\n\nЭтих дракончиков довольно просто обучить, а вот заставить слушаться куда сложнее.\n\nПостой-ка...\n\nДаже мажордом Селистра доверяет тебе самые ответственные задачи. Сможешь помочь одному из наших малышей?', '', '', '', '', '', '', 47187),
(70060, 'ruRU', 'Подъем до академии – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70059, 'ruRU', 'Подъем до академии', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70058, 'ruRU', 'Недуг друга', 'Добудьте $1oa |4мягкое рубиновое перо:мягких рубиновых пера:мягких рубиновых перьев;, $2oa |4обрезок ткани:обрезка ткани:обрезков ткани; и $3oa |4стеклянную бусину:стеклянных бусины:стеклянных бусин; в Рубиновом святилище Жизни для починки счастливого утенка.', 'Счастливый утенок поранился, когда мы летали... Он так хорошо держался, но я... врезалась в дерево!\n\n<Лиллистраза с горечью указывает на потрепанную игрушечную утку у себя на голове.>\n\nУ него набивка высыпается! И все перья помялись! И глаза не хватает! О, нет!\n\nПомоги вылечить счастливого утенка. Ладно?', '', '', '', '', '', '', 47187),
(70055, 'ruRU', 'Печать штормов', 'Отнесите печать штормов грозовому охотнику Уильяму в Штормград.', '<Какой-нибудь великий знаток магии заинтересуется этой находкой.>', '', '', '', '', '', 'Отнесите печать штормов грозовому охотнику Уильяму в Штормград.', 47187),
(70052, 'ruRU', 'Горная трасса – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70051, 'ruRU', 'Горная трасса', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(70050, 'ruRU', 'Побороть бурю', 'Поговорите с грозовым охотником Уильямом в порту Штормграда.', 'Что, тебя отправляют в небольшое приключение?\n\nЧто ж. В любом случае мы не сможем отплыть, пока кто-нибудь не усмирит эти бури стихий.\n\nПодойди к грозовому охотнику Уильяму, исследование бурь в экспедиции – это по его части. Он предоставит тебе необходимое снаряжение.\n\nА пока тебе достается все веселье, я прослежу за дальнейшими приготовлениями.\n\nНо за тобой должок!', '', '', '', '', '', 'Поговорите с грозовым охотником Уильямом в порту Штормграда.', 47187),
(70049, 'ruRU', 'Борьба с бурей', 'Добудьте $1oa |4частицу:частицы:частиц; энергии стихий у противников в зонах изначальных бурь в Калимдоре и Восточных королевствах.', 'Используя силу стихий, наши враги безжалостно сеют разрушения в Восточных королевствах и Калимдоре.\n\nЧтобы остановить их, нужно действовать с не меньшим упорством, $n.\n\nНайди место их новой атаки и устрани противников в зоне изначальной бури, чтобы успеть разрушить их планы.\n\nМы должны защитить Азерот!', '', '', '', '', '', '', 47187),
(70048, 'ruRU', 'Угроза стихий', 'Добудьте $1oa |4частицу:частицы:частиц; энергии стихий у противников в зонах изначальных бурь в Калимдоре и Восточных королевствах.', 'Рашагет стремительно наращивает армию воинов стихий.\n\nКирин-Тор сообщает, что в ключевых точках Калимдора и Восточных королевств бушуют бури невиданной силы.\n\nВраг черпает силу пробудившихся стихий и, похоже, собирается погрузить в хаос не только Драконьи острова, но и земли Альянса и Орды.\n\nРазыщи неприятеля и выясни, как они действуют. Их нужно остановить, пока не стало слишком поздно.', '', '', '', '', '', '', 47187),
(70047, 'ruRU', 'Ледяные темницы', '', '', '', '', '', '', '', '', 47187),
(70042, 'ruRU', 'Край новых возможностей', 'Добудьте несколько предметов для Виша Затыря.', 'Не пугай так! Я уж думал, что меня прищучили!\n\nТолько глянь на этих отважных исследователей, готовых покорять Драконьи острова... и на их рюкзаки, полные снаряжения.\n\nДа мы тут разбогатеем!\n\nОсмотрись вокруг и ухвати пару вещичек. Навар поделим.', '', '', '', '', '', '', 47187),
(70041, 'ruRU', 'Ярость Пожирательницы Бурь', 'Взойдите на парящий диск Кадгара и сдерживайте натиск воинов стихий.', 'Рашагет пытается уничтожить башню, вытянув из нее чародейскую энергию!\n\nКалесгос сдерживает драконицу, как может, а я укрепляю силовые линии своей магией.\n\nБоюсь, долго мы так не продержимся. Прямо сейчас сюда направляется подкрепление воинов стихий!\n\nВозьми мой измененный чародейский диск. Сдерживай натиск врага... Будем надеяться на чудо.', '', '', '', '', '', 'Поговорите с Калесгосом у подножия Вактроса.', 47187),
(70040, 'ruRU', 'Падение сквозь время', 'Соберите союзников и поговорите с Ноздорму.', 'Когда магия бронзовых драконов столкнулась с магией Бесконечности, Хронорму и Вечнос утратили контроль и начали проваливаться сквозь время.\n\nОни прорывают саму ткань времени, не в силах остановиться, и вызывают в пространстве несчетные колебания. Мы должны найти их и вернуть обратно. Только так можно избежать еще больших разрушений. Я вижу, что именно ты остановишь падение Хронорму.\n\nСобери команду союзников и спаси Хронорму. А пока я постараюсь настроиться на ее магию.', '', '', '', '', '', 'Соберите союзников и поговорите с Ноздорму.', 47187),
(70035, 'ruRU', 'Прогулка Рурика по речным стремнинам', '', '', '', '', '', '', '', '', 47187),
(70034, 'ruRU', 'Поставки для ремесленников: чешуя саламантеры', 'Доставьте чешую саламантеры Гефесте в Рубиновое святилище Жизни.', 'Есть работа по снятию шкур! Консорциум ремесленников просит меня принести им чешую саламантеры.\n\nКак будто я малое дитя на побегушках!\n\nКстати... может, ты $gмог:могла; бы этим заняться?', '', '', '', '', '', 'Доставьте чешую саламантеры Гефесте в Рубиновое святилище Жизни.', 47187),
(70033, 'ruRU', 'Поставки для ремесленников: кожаные сапоги первопроходца', 'Доставьте кожаные сапоги первопроходца Гефесте в Рубиновое святилище Жизни.', 'Тебе нужна работа, $gкожевник:кожевница;? Ко мне поступил заказ от Консорциума ремесленников на изготовление обуви.\n\nУ меня и без них от клиентов отбою нет! Как ты думаешь, сколько сегодня приходило исследователей, у которых прохудились сапоги?\n\nЗаймешься заказом, если будет время? Вот мерки. Может, работа с Консорциумом – неплохой вариант для тебя?', '', '', '', '', '', 'Доставьте кожаные сапоги первопроходца Гефесте в Рубиновое святилище Жизни.', 47187),
(70032, 'ruRU', 'Поставки для ремесленников: очки ювелира', 'Доставьте увеличительные стекла из расколотого оникса Гефесте в Рубиновое святилище Жизни.', 'Тебе нужна работа, ювелир? Со мной связался Консорциум ремесленников, и они хотят заказать очки.\n\nЗаказать у меня! Как будто мне заняться больше нечем.\n\nСможешь же подхватить эту задачу?', '', '', '', '', '', 'Доставьте увеличительные стекла из расколотого оникса Гефесте в Рубиновое святилище Жизни.', 47187),
(70031, 'ruRU', 'Поставки для ремесленников: гладкая скалка шеф-повара', 'Доставьте гладкую скалку шеф-повара Гефесте в Рубиновое святилище Жизни.', 'Тебе нужна работа, $gначертатель:начертательница;?\n\nУ меня есть заказ от организации под названием \"Консорциум ремесленников\".\n\nРабота несложная, как раз для ученика. Думаю, ты справишься.', '', '', '', '', '', 'Доставьте гладкую скалку шеф-повара Гефесте в Рубиновое святилище Жизни.', 47187),
(70030, 'ruRU', 'Поставки для ремесленников: оптика гарантированного качества', 'Доставьте оптику гарантированного качества Гефесте в Рубиновое святилище Жизни.', 'О, инженер! Ты как раз вовремя!\n\nЯ тут совсем закопалась в схемах. А сейчас приходила одна высокая дама, и ей нужна была оптика.\n\nТы же знаешь, как это изготовить?\n\nКак закончишь, отнеси заказ в Рубиновое святилище Жизни. Та дама сказала, что она из Консорциума ремесленников или что-то вроде того.', '', '', '', '', '', 'Доставьте оптику гарантированного качества Гефесте в Рубиновое святилище Жизни.', 47187),
(70029, 'ruRU', 'Поставки для ремесленников: рунические серевитовые жезлы', 'Доставьте $1oa |4рунический серевитовый жезл:рунических серевитовых жезла:рунических серевитовых жезлов; Гефесте в Рубиновое святилище Жизни.', 'А ты, похоже, неплохо накладываешь чары. Не поможешь с моим заказом?\n\nКонсорциум ремесленников запросил для одного клиента несколько жезлов из серевита, но я не сильна в зачаровывании жезлов.\n\nЕсли согласишься помочь, Гефеста заплатит тебе за проделанную работу. Найти ее можно в Рубиновом святилище Жизни.', '', '', '', '', '', '', 47187),
(70028, 'ruRU', 'Поставки для ремесленников: залежи соли', 'Доставьте $1oa |4образец:образца:образцов; залежей соли Гефесте в Рубиновое святилище Жизни.', 'Есть работа для горняка!\n\nЯ тут слышал от Гефесты, что Консорциуму ремесленников нужна соль.\n\nЯ могу и сам ее добыть, но мне, если честно, неохота с этим возиться.\n\nБудь другом, сделай то, что они просят.', '', '', '', '', '', 'Доставьте $1oa |4образец:образца:образцов; залежей соли Гефесте в Рубиновое святилище Жизни.', 47187),
(70027, 'ruRU', 'Поставки для ремесленников: тканые поручи геодезиста', 'Доставьте тканые поручи геодезиста Гефесте в Рубиновое святилище Жизни.', 'Тебе нужна работа, $gпортной:портниха;? Ко мне поступил заказ от Консорциума ремесленников, им требуется нарукавье.\n\nПриятно, конечно, что эти исследователи проявляют интерес к нашему ремеслу, но у меня совсем нет времени.\n\nМожет, ты $gхотел: хотела; бы взять этот заказ?', '', '', '', '', '', 'Доставьте тканые поручи геодезиста Гефесте в Рубиновое святилище Жизни.', 47187),
(70026, 'ruRU', 'Поставки для ремесленников: лавовые жуки', 'Доставьте $1oa |4лавового жука:лавовых жуков:лавовых жуков; Гефесте в Рубиновое святилище Жизни.', 'Тебе нужна работа, $gтравник:травница;? Консорциум ремесленников просит меня собрать жуков – их ждут покупатели.\n\nВ окрестностях, конечно, можно найти много всего, но жуков быстро собрать не получится.\n\nСоберешь нескольких, если отправишься в более дальние земли?', '', '', '', '', '', 'Доставьте $1oa |4лавового жука:лавовых жуков:лавовых жуков; Гефесте в Рубиновое святилище Жизни.', 47187);
