(70025, 'ruRU', 'Поставки для ремесленников: драконитовый серп', 'Доставьте драконитовый серп Гефесте в Рубиновое святилище Жизни.', 'Похоже, тебе нечем заняться. Не хочешь поработать?\n\nКо мне поступил заказ от Консорциума ремесленников, нужно сделать драконитовый серп. Я могу сделать его в два счета, но лучше поручить такую работу $gученику:ученице;, то есть тебе.\n\nИзготовь серп и отнеси его в Рубиновое святилище Жизни. Дренейка Гефеста заплатит за работу.', '', '', '', '', '', 'Доставьте драконитовый серп Гефесте в Рубиновое святилище Жизни.', 47187),
