(69992, 'ruRU', 'Печать штормов', 'Отнесите печать штормов грозовой охотнице Сухракке в Дуротар.', '<Какой-нибудь великий знаток магии заинтересуется этой находкой.>', '', '', '', '', '', 'Отнесите печать штормов грозовой охотнице Сухракке в Дуротар.', 47187),
(69984, 'ruRU', 'Окаймленный золотом зуб дракона', 'Доставьте найденный предмет Эксадрии.', '<Вы нашли останки погибшего дракона. Эксадрии будет интересно на них взглянуть.>', '', '', '', '', '', '', 47187),
(69983, 'ruRU', 'Кость с выжженной гравировкой', 'Доставьте найденный предмет Когтеловщице Кавии.', '<Таинственные руны джарадинов, вырезанные на кости. Когтеловщице Кавии будет интересно на них взглянуть.>', '', '', '', '', '', '', 47187),
(69981, 'ruRU', 'Запросы клиентов', 'Спросите у клиентов Консорциума ремесленников, довольны ли они своим заказом.', 'Эй, |3-6($c), не хочешь мне помочь?\n\nНаши любимые клиенты разместили через Консорциум ремесленников заказ на доработку предметов, но мы так и не узнали, что они думают о результате.\n\nЕсли встретишь их, выясни, понравились ли им покупки. Счастливы клиенты – счастливы мы!', '', '', '', '', '', 'Доставьте снаряжение Маре Мощь Древа на переправу у речной развилки.', 47187),
(69979, 'ruRU', 'Достойная охота', 'Убейте Горизонта, старейшего из быков.', 'Мудрость не дается просто так. Ее нужно заслужить. Если хочешь доказать, что $gдостоин:достойна;, сделай это так, как принято у нас: учись на практике.\n\nВыследи и убей Горизонта, старейшего из быков, который скрывается от поколений охотников.\n\nТак ты обретешь мудрость.', '', 'Горизонт – старейший бык, перехитривший не одно поколение охотников. Может быть, у вас наконец получится добраться до этого зверя.', 'Горизонт', '', '', '', 47187),
