(69965, 'ruRU', 'Проверка качества', 'Опробуйте инструменты Гефесты на ближайших жеодах для Консорциума ремесленников.', 'Тебе нужна работа, |3-6($c)?\n\nЯ представляю Консорциум ремесленников, новую торговую компанию. Мы помогаем умельцам и клиентам находить друг друга, обрабатывая заказы через нашу сеть.\n\nДраконья экспедиция заказала партию зачарованных орудий для добычи руды. Нужное оборудование готово, но мы хотим испытать его перед тем, как передать заказчику.\n\nЕсли ты нам с этим поможешь, мы в долгу не останемся.', '', '', '', '', '', '', 47187),
