(69946, 'ruRU', 'Мастер своего ремесла', 'Найдите мастера Кхадин, чтобы обучиться у нее секретам профессии.', 'Когда я путешествовал по равнинам, в пещере на севере мне встретилась мудрая мастерица из народа кентавров. Она достигла вершины мастерства в своем деле и желает поделиться опытом с другими.\n\nОна помогла мне усвоить знания, почерпнутые на Драконьих островах.\n\nЕсли хочешь совершенствоваться в одной из специализаций своей профессии, попроси ее мудрого совета. Ее зовут Кхадин из клана Тирай.', '', '', '', '', '', 'Поговорите с Кхадин в пещере Кхадин.', 47187),
(69944, 'ruRU', 'Побороть бурю', 'Поговорите с грозовой охотницей Сухраккой у башни дирижаблей.', 'Да уж, этот колдун знает толк в эффектных появлениях, $gсогласен:согласна;?\n\nМы не сможем отплыть, пока кто-нибудь не усмирит эти бури стихий.\n\nПодойди к грозовой охотнице Сухракке. Исследование бурь в экспедиции – это по ее части. Она предоставит тебе необходимое снаряжение.\n\nА я пока прослежу за дальнейшими приготовлениями. И у меня как раз будет время прочесть еще несколько томов об истории драконов, прежде чем мы отправимся.', '', '', '', '', '', 'Поговорите с грозовой охотницей Сухраккой у башни дирижаблей.', 47187),
(69939, 'ruRU', 'Утешение для диких малышей', 'Найдите снег в стаканчике и скормите его взволнованной выдре.', 'Вот ты где, $n! Ищу тебя по всему городу.\n\nЕще один из местных зверьков страдает от недостатка лакомств и заботы в организме. Не поищешь что-нибудь сладкое, чтобы угостить его?', '', '', '', '', '', '', 47187),
(69938, 'ruRU', 'Рыболовная лихорадка', '', '', '', '', '', '', '', '', 47187),
(69936, 'ruRU', 'Главный дикарь Замбул', 'Победите надзирателя Замбула.', 'Отличная работа. Теперь осквернители не смогут заставлять моих предков сражаться на их стороне. Но у нас осталась еще одна проблема – здоровяк, который раздает приказы.\n\nЭто их надзиратель, Замбул. Его надо остановить.\n\nРазберись с ним.', '', '', 'Надзиратель Замбул', '', '', '', 47187),
(69934, 'ruRU', 'Сердца обливаются кровью', 'Доставьте медикаменты.', 'Зелья готовы, их осталось только доставить.\n\nОдин ящик нужно отнести в небольшую пещеру внизу, в расщелине. Не передавай никому, просто оставь там. Не волнуйся, все это пойдет на пользу.\n\nДругой ящик отнеси в госпиталь на Геликирский аванпост. Там работает мой старый друг.\n\nЯ... понимаю, что ты ничего этого делать не $gобязан:обязана;. Да и я тоже. Но ты мне очень $gпомог:помогла;, а эти медикаменты смогут спасти чью-то жизнь.', '', '', '', '', '', '', 47187),
(69933, 'ruRU', 'Цена любопытства', 'Добудьте срез упрямой лианы.', 'Взгляни на ту сторону расщелины, |3-6($r). Воины стихий напали на Геликирский аванпост несколько дней назад, но бой все еще продолжается.\n\nИм нужно чем-то смазывать и сшивать раны. Я могу сделать все необходимое, но у меня кончаются ингредиенты. Раз уж ты $gворвался:ворвалась; в мой дом, будешь помогать.\n\nНайди в саду лозу подлиннее, отломи от корня и принеси мне.', '', '', '', '', '', '', 47187),
(69932, 'ruRU', 'Важна каждая жизнь', 'Добудьте ингредиенты для новой перевязки Фонтанчика.', 'Пока я смешиваю зелья для Геликира, остальные мои обязанности остаются без внимания.\n\nКо мне в сад залетела утка со сломанным ребром. Рану удалось обработать, но нужно сменить повязку. И раз уж ты $gготов:готова; помочь...\n\n<Сзарет вручает вам список ингредиентов.>\n\nВот список необходимого. Принеси мне то, что нужно.', '', '', '', '', '', '', 47187),
(69931, 'ruRU', 'Охота с налета', '', '', '', '', '', '', '', '', 47187),
(69930, 'ruRU', 'Базрикрон', '', '', '', '', '', '', '', '', 47187),
(69925, 'ruRU', 'Борьба с бурей', 'Добудьте $1oa |4частицу:частицы:частиц; энергии стихий у противников в зонах изначальных бурь в Калимдоре и Восточных королевствах.', 'Используя силу стихий, наши враги безжалостно сеют разрушения в Восточных королевствах и Калимдоре.\n\nЧтобы остановить их, нужно действовать с не меньшим упорством, $n.\n\nНайди место их новой атаки и устрани противников в зоне изначальной бури, чтобы успеть разрушить их планы.\n\nМы должны защитить Азерот!', '', '', '', '', '', '', 47187),
(69924, 'ruRU', 'Башни пылающей мощи', '', '', '', '', '', '', '', '', 47187),
(69923, 'ruRU', 'Угроза стихий', 'Добудьте $1oa |4частицу:частицы:частиц; энергии стихий у противников в зонах изначальных бурь в Калимдоре и Восточных королевствах.', 'Рашагет стремительно наращивает армию воинов стихий.\n\nКирин-Тор сообщает, что в ключевых точках Калимдора и Восточных королевств бушуют бури невиданной силы.\n\nВраг черпает силу пробудившихся стихий и, похоже, собирается погрузить в хаос не только Драконьи острова, но и земли Альянса и Орды.\n\nРазыщи неприятеля и выясни, как они действуют. Их нужно остановить, пока не стало слишком поздно.', '', '', '', '', '', '', 47187),
(69919, 'ruRU', 'Мастер тут как тут', 'Узнайте у Эзли, как выполнять заказы на изготовление предметов.', 'Кажется, ты $gнеплохой мастер:неплохая мастерица;. Не хочешь выполнить несколько заказов для искателей приключений и заработать горы, горы, горы золота?\n\nЯ расскажу о правилах работы с Консорциумом ремесленников, и затем ты сможешь брать заказы у любого рабочего места на Драконьих островах!', '', '', '', '', '', '', 47187),
(69918, 'ruRU', 'Сотрясение основ', 'Убейте камнекрушительницу Токару, Мольку Камнеломку и элементалей, которых они призвали.', 'Джарадины-камневязы способны разрушить само основание цитадели. Их надо остановить!\n\nМы даже не успели отвоевать цитадель, а уже можем потерять ее в куче обломков. Это недопустимо.\n\nСделай все, что сможешь, $n... то есть убей их!', '', 'Как и камнекрушительница Токара, Молька умело обращается с твердым обсидиановым камнем, скрытым под цитаделью.', 'Молька Камнеломка', '', '', '', 47187),
(69915, 'ruRU', 'Адресная реклама', 'Добудьте листовки у коз речной развилки и надоедливых коз.', 'Привет-привет-привет! Тебе случайно не нужна подработка?\n\nМы устраиваем грандиозную распродажу в честь открытия службы заказов. Надо привлечь внимание! Вот только мои рекламные листовки унесло ветром, и затем их растащили козы.\n\nСможешь собрать листовки и принести обратно?', '', '', '', '', '', '', 47187),
(69914, 'ruRU', 'Пробуждение джарадинов', 'Получите приказы от мажордома Селистры.', 'Жаль, что у нас нет времени на любезности, но не каждый из нас обладает даром Хронорму.\n\nЯ Селистра, мажордом королевы драконов Алекстразы, Хранительницы жизни.\n\nКоролева просила передать свои искренние приветствия и отвести вас к ней в Омуты Жизни.\n\nНо, боюсь, мы не сможем сразу туда отправиться. Сначала мне понадобится помощь.\n\nДжарадины, наши древние противники, пробудились из-под земли и уже успели напасть на ближайшую заставу!', '', '', '', '', '', 'Встретьтесь с Сендракс в посольстве Крылатого Приюта.', 47187),
(69912, 'ruRU', 'Первая серьезная задача!', 'Убедите Сендракс запустить сигнальную ракету и оповестить драконов о вашем прибытии.', '<Сендракс явно озадачена.>\n\nНикогда не видела, чтобы мажордом опаздывала, особенно так сильно и на такую важную встречу.\n\nСтранно это...\n\n<Сендракс оживляется от посетившей ее мысли.>\n\nЯ могу выпустить сигнальную ракету. Так драконы поймут, что вы прибыли, и сразу примчатся вас встречать!\n\nПравда, мне еще не приходилось подавать аварийные сигналы...', '', '', '', '', '', 'Встретьтесь с Гневионом в посольстве Крылатого Приюта.', 47187),
(69911, 'ruRU', 'Ужасный беспорядок', 'Помогите послу Фастразу восстановить посольство.', 'Я бы с радостью поприветствовала вас как подобает, но часовых такому не учат.\n\n<Сендракс указывает на стоящую позади башню.>\n\nОбратись к послу Фастразу в гостевых покоях. Возможно, он поможет тебе все прояснить, пока не прибудут драконы.\n\nТолько ступай осторожно. Когда я его в последний раз видела, он выгребал из посольства обломки.', '', '', '', '', '', '', 47187),
(69910, 'ruRU', 'Куда подевался Гневион?', 'Спросите Сендракс, когда прибудут драконы.', 'Как странно...\n\nАбиссиан сказал, что нас будет ждать Гневион, а вместе с ним – посол королевы драконов Алекстразы, Хранительницы жизни.\n\nОбычно драконы не нарушают обещания.\n\nЧто ж, хоть кто-то готов нас встретить. Будь так $gлюбезен:любезна;, спроси у этого драконида, когда прибудут остальные.', '', '', '', '', '', '', 47187),
(69904, 'ruRU', 'Подозрительная тишина', 'Найдите учеников Норико в лагере Антонидаса.', 'Уделишь минутку, $p? От моих учеников, Сидролюба и Таки, уже довольно давно ничего не слышно. \n\nЭто меня тревожит. \n\nЯ послала их в таверну за кое-какими припасами. Они не могли далеко отойти...\n\nНайди их, только имей в виду... Они... сущее наказание.', '', '', '', '', '', '', 47187),
(69902, 'ruRU', 'Теория на практике', 'Помогите Тиргону исцелить существо.', '$n, нужна твоя помощь...\n\nНадеюсь, никто не думал, что мне придется одному готовить лекарство, успокаивать дракончика, заниматься лечением и учить детей. Хотелось бы мне поговорить с тем, кто придумал многозадачность. \n\nМожешь начать с тех цветов. Мне нужна пара минут, чтобы подготовиться к лечению протодракончика. \n\nНадеюсь, это происшествие будет для детей познавательным.', '', '', '', '', '', '', 47187),
(69901, 'ruRU', 'Мнение эксперта', 'Соберите $1oa |4солнцецвет:солнцецвета:солнцецветов;.', 'Ияли не говорила, как долго страдало это создание? Если оно даже не может есть, надо действовать как можно скорее.\n\nОбычно в лагерях Драконьей экспедиции есть все необходимое, чтобы исцелить этого дракончика. Но доставлять припасы на этот рубеж оказалось не так просто. Поставки сильно задерживаются.\n\nНо не волнуйся. Нам поможет сама земля! Если ты достанешь пару солнцецветов, я приготовлю из них успокаивающую мазь. Дракончику станет полегче, и я смогу заняться лечением.', '', '', '', '', '', '', 47187),
(69900, 'ruRU', 'Определение источника', 'Убейте воина стихий, ставящего эксперименты в Диком уделе.', 'Судя по тому, что рассказывают дети, в Дикий удел мог заявиться воин стихий.\n\nНужно как можно скорее выяснить, так ли это.\n\nДругие исследователи не раз замечали, что воины стихий похищают драконьи яйца или детенышей, чтобы наделить их оскверняющей силой. Некоторые дракончики отторгают эту силу и начинают медленно умирать... Но это воинов стихий, конечно, не волнует.\n\nИх нужно выдворить из Дикого удела. Сделай это, а я постараюсь отвлечь детей. Они не должны знать о таком.', '', '', '', '', '', '', 47187),
(69899, 'ruRU', 'Секретные наблюдения', 'Помогите Ияли и ее друзьям.', 'Знаю, я веду себя странно. Прости...\n\nТы наверняка уже $gдогадался:догадалась;, что я что-то скрываю.\n\nМогу открыть тебе мой секрет... если хочешь. Только пообещай, что не расскажешь взрослым!', '', '', '', '', '', '', 47187),
(69898, 'ruRU', 'Научный мясод', 'Добудьте $1oa |4кусок:куска:кусков; вкуснейшего мяса речного чудища.', 'У меня тут... еще одно задание на дом... Профессор Тиргон нас просто заваливает учебой! Он велел нам узнать, что протодракончики... едят! Вот...\n\nОтвет я знаю! Мясо речных чудищ! \n\nДостанешь мне кусочек? Это мне для проекта нужно, чтобы было наглядно.\n\nТолько найди мясо получше, ладно? Как у... упитанных чудищ. Такой кусок мяса, который мама-дракон дала бы детенышу, чтобы тот рос большим и сильным. Это... господин Тиргон так задавал.', '', '', '', '', '', '', 47187),
(69897, 'ruRU', 'Задачка на анализ поведения', 'Погладьте $4oa |4спящего дракончика:спящих дракончиков:спящих дракончиков; и вернитесь к Ияли.', 'Мне нужен тот, кто разбирается в протодракончиках. В тех, которые живут в Диком уделе, например. \n\nОни такие же сердитые, как и взрослые драконы? Они кусаются? Дышат огнем?\n\nА что будет, если я... мм-м... если ты погладишь дракончика? Он поймет, что ты $gдобрый:добрая; и хочешь помочь?\n\nЭто мне для науки надо. Тиргон всегда говорит, что надо проверять гипопо... Нет. Гипер... Фу ты! Гипсо... Теории, короче!\n\nЯ думаю, что дракончикам будет приятно, если их погладят. Сможешь проверить?', '', '', '', '', '', '', 47187),
(69896, 'ruRU', 'Коварный маршрут', 'Встретьтесь с повелительницей стихий Тайянь в руинах хранилища Жизни.', 'Понятно, что участники Драконьей экспедиции должны быть готовы к опасностям дикой природы. Но отбиваться от элементалей?!\n\nНа наших раскопках среди руин хранилища Жизни полный переполох. Из земли поднимаются каменные чудовища! Мы вызвали специалиста по стихиям, но кажется, ей тоже одной не справиться.\n\nМожет, ты сумеешь ей помочь? Наш лагерь сразу на том берегу реки.', '', '', '', '', '', '', 47187),
