(69870, 'ruRU', 'Не просто картинки', 'Встретьтесь с каталогизатором Акундой и канониром Френ у Бурных потоков.', 'Фотографии помогают стать ближе, $p.\n\nИз предосторожности наши каталогизаторы работают по двое, и приятно наблюдать, как исследователи разных рас и фракций объединяются в стремлении узнать все об островах.\n\nОдна такая увлеченная парочка сейчас наносит на карту центральные реки Берегов Пробуждения.\n\nЕсли хочешь помочь в исследованиях, занеси для них в каталог образцы местной природы.', '', '', '', '', '', 'Встретьтесь с каталогизатором Акундой и канониром Френ у Бурных потоков.', 47187),
(69869, 'ruRU', 'Рай каталогизатора', 'Поговорите с каталогизатором Корали в лагере Драконьей экспедиции.', '<Док Бананс совсем запыхался. Он протягивает вам письмо. В нем вас приглашают вернуться в лагерь Драконьей экспедиции и пройти обучение. Док отчаянно пытается пояснить, что происходит.>\n\nДобрый эльф. Гордый, маленький. Много камер. Да?\n\n<Док Бананс радостно кивает и ждет вашего ответа.>', '', '', '', '', '', 'Поговорите с каталогизатором Корали в лагере Драконьей экспедиции.', 47187),
(69868, 'ruRU', 'Ткач Гнезда Аразна', '', '', '', '', '', '', '', '', 47187),
