(69855, 'ruRU', 'Зов скалолаза', 'Поговорите с первопроходцем Джебом в лагере Драконьей экспедиции.', '<Док Бананс совсем запыхался. Он протягивает вам письмо. В нем вас приглашают вернуться в лагерь Драконьей экспедиции и пройти обучение. Док отчаянно пытается пояснить, что происходит.>\n\nОт Джеб. Добрый друг. Лазать. Да-да?\n\n<Док Бананс радостно кивает и ждет вашего ответа.>', '', '', '', '', '', 'Поговорите с первопроходцем Джебом в лагере Драконьей экспедиции.', 47187),
