(69097, 'ruRU', 'Печати сняты', 'Поговорите с каталогизатором Джейкс в лагере Драконьей экспедиции.', '<Док Бананс совсем запыхался. Он протягивает вам письмо с просьбой вернуться в лагерь Драконьей экспедиции. Док отчаянно пытается пояснить, что происходит.>\n\nШумный дворф. Серьезный эльф. Тебя ждут. Ясно?\n\n<Док Бананс взволнованно кивает и ждет вашего ответа.>', '', '', '', '', '', 'Поговорите с каталогизатором Джейкс в лагере Драконьей экспедиции.', 47187),
(69096, 'ruRU', 'Призвание Тайвана', 'Попробуйте утешить сироту Чаймей.', 'Видишь ребенка, сидящего у ручья, вдалеке от всех?\n\n<Селбек указывает на северо-восток, и вы видите юного кентавра, глядящего в воду отсутствующим взглядом.>\n\nИз-за нокхудов Чаймей лишилась родителей. Я вылечила ее тело, но с тех пор как мы ее нашли, она совсем ничего не ела и не проронила ни слова. Она просто сидит на месте и смотрит вдаль. \n\nЯ умею исцелять болезни и раны, но что делать сейчас и не представляю. Может, попробуешь с ней поговорить, $n?', '', '', '', '', '', '', 47187),
(69095, 'ruRU', 'Преданный пес', 'Отправляйтесь с Тайваном обратно в Марукай.', 'Благодаря тебе и Тайвану состояние раненых стабильно, но многим придется пройти лечение в Марукае.\n\nПочему бы вам двоим не возглавить нашу колонну? Это ведь вы у нас герои дня!', '', '', '', '', '', '', 47187),
(69094, 'ruRU', 'Спасение кентавров', 'Спасите раненых кентавров в деревне Даруукан.', 'Коварство нокхудов не знает границ! В деревне Даруукан жили только ремесленники, у них не было шансов против налетчиков.\n\n$n, мы отчаянно нуждаемся в твоей помощи. Нокхуды по-прежнему рядом, и мы должны позаботиться о раненых!\n\nОбыщи деревню и, если найдешь выживших, приведи их ко мне. Нужно осмотреть их и оказать помощь всем, кому сможем.', '', '', '', '', '', '', 47187),
(69093, 'ruRU', 'Новая загадка', 'Поговорите с Налейдеей Речной Блеск в лагере Драконьей экспедиции.', '<Док Бананс совсем запыхался. Он протягивает вам письмо с просьбой вернуться в лагерь Драконьей экспедиции. Док отчаянно пытается пояснить, что происходит.>\n\nЗакрытая дверь. Секреты титанов. Ясно?\n\n<Док Бананс взволнованно кивает и ждет вашего ответа.>', '', '', '', '', '', 'Поговорите с Налейдеей Речной Блеск в лагере Драконьей экспедиции.', 47187),
(68799, 'ruRU', 'Возвращение в Рубиновое святилище Жизни', 'Вернитесь в Рубиновое святилище Жизни.', 'И это лишь начало твоих путешествий с драконом! \n\nНа Драконьих островах приключения и возможности поджидают повсюду. Не забывай навещать нас на заставах.\n\nА пока возвращайся к Алекстразе и продолжай исследовать новые земли.', '', '', '', '', '', 'Вернитесь к Алекстразе в Рубиновое святилище Жизни.', 47187),
(68798, 'ruRU', 'Драконьи символы', 'Найдите драконий символ в Поднебесной обсерватории и поговорите с Литрагосой, чтобы его использовать.', 'Конечно, приключения – это не только про нас с Гленсерой. Литрагосе тоже не терпится помочь тебе попрактиковаться в управлении драконом, а Селорму ты уже знаешь. Что ж, отлично.\n\nНа Драконьих островах ты будешь находить символы, которые позволят тебе осваивать трюки и способности. Один находится прямо здесь – в Поднебесной обсерватории.\n\nКогда доберешься до него, Литрагоса поможет им воспользоваться!', '', 'Такие символы встречаются по всем Драконьим островам. Они помогут вам освоить новые летные навыки и приемы.', 'Драконий символ', '', '', '', 47187),
(68797, 'ruRU', 'Новая пара рогов', 'Встретьтесь с Гленсерой и воспользуйтесь постаментом трансформации, чтобы изменить внешний вид вашего дракона.', 'Драконов, как и смертных, очень волнует их внешность. Совместные путешествия и приключения изменят твоего дракона.\n\nПоговори с Гленсерой у Постамента трансформации и убедись $gсам:сама;!', '', '', '', '', '', '', 47187),
(68796, 'ruRU', 'Поднебесная обсерватория', 'Отправляйтесь в Поднебесную обсерваторию на Берегах Пробуждения.', 'Теперь ты знаешь основы полетов на драконе. И у тебя неплохо получается!\n\nЯ хочу представить тебе пару товарищей. Мы обосновались в Поднебесной обсерватории.\n\nСелорму покажет тебе дорогу. Поговори с ним, когда будешь $gготов:готова; к полету!\n\nУвидимся там!', '', '', '', '', '', 'Встретьтесь с лордом Андестразом в Поднебесной обсерватории.', 47187),
(68795, 'ruRU', 'Полеты на драконе', 'Поговорите с лордом Андестразом в Рубиновом святилище Жизни.', 'Кое-что ты наверняка уже $gуспел:успела; понять: территория Драконьих островов огромна. \n\nНекоторым драконам хочется исследовать все уголки и потайные местечки, даже если до них не добраться с земли. Для путешествий по островам нужна вторая пара глаз, поэтому эти драконы будут рады взять всадника.\n\nПоговори с лордом Андестразом в Рубиновом святилище Жизни. Он объяснит подробнее, чего они хотят.', '', '', '', '', '', 'Поговорите с лордом Андестразом в Рубиновом святилище Жизни.', 47187),
(68794, 'ruRU', 'Союзник драконов', 'Поговорите с Алекстразой у Престола Аспектов в Вальдраккене.', 'Мы высоко ценим твою помощь Драконьим островам, $n.\n\nВ награду за служение драконам Хранительница жизни хочет тебе кое-что показать.\n\nПоговори с ней на вершине башни. Там уже собрались все Аспекты.', '', '', '', '', '', 'Поговорите с Алекстразой у Престола Аспектов в Вальдраккене.', 47187),
(68644, 'ruRU', 'Сахар, пряности и прочие радости', 'Помогите вылечить Сильвию.', 'Так, теперь у нас есть все, что нужно для Сильвии!\n\nКак раз вовремя! Боюсь, долго бы она не протянула.\n\nНо нужно, чтобы кто-нибудь мне помог. Я могла бы попросить Калли, но... может, лучше ты?\n\nСкажи, когда будешь $gготов:готова; начать, $n.', '', '', '', '', '', '', 47187),
(68643, 'ruRU', 'Витамины и минералы', 'Добудьте $1oa |4сосуд:сосуда:сосудов; с минеральной водой.', 'Я должна была знать, что Стерии не понравится, если я попрошу тебя сражаться с животными...\n\nНо всегда можно найти альтернативные методы исследований.\n\nВозьми эти флаконы и наполни их водой из ближайших ледяных глыб. \n\nЯ думаю, что вместе с минералами они впитали энергию от силового кристалла. Вероятно, это и послужило причиной вспышки.', '', '', '', '', '', '', 47187),
(68642, 'ruRU', 'Иглоукалывание в подарок', 'Добудьте $1oa |4насыщенную магией иглу:насыщенные магией иглы:насыщенных магией игл;.', 'Я хочу помочь Сильвии, но не хочу еще сильнее задерживать Калли.\n\nЧтобы дать бедняжке лекарство, мне нужны насыщенные магией иглы кристаллоспинов. Думаю, они не слишком рассердятся, если ты выдернешь парочку. \n\nИ осторожней с бакарами! Они едят кристаллоспинов и могут разозлиться, если увидят, что ты интересуешься их едой. Если тебе все-таки придется от них защищаться, иглы можно добыть и у них.\n\nНо... постарайся, чтобы до этого не дошло.', '', '', '', '', '', '', 47187),
(68641, 'ruRU', 'Мох всему голова', 'Добудьте $1oa |4комок:комка:комков; дракомха.', 'Бедняжка...\n\nПохоже, она заболела, съев что-то зараженное.\n\nК счастью, мой дед-друид научил меня лечить чародейские болезни.\n\nУ меня с собой нет всех нужных ингредиентов, но попробуем обойтись тем, что можно добыть неподалеку.\n\nСперва мне понадобится дракомох. Это редкий лишайник, растущий только на костях драконов.', '', '', '', '', '', '', 47187),
(68639, 'ruRU', 'Крадущиеся северные хищники', 'Убейте $1oa |4зараженного морозношкура:зараженных морозношкуров:зараженных морозношкуров;.', 'Нам поручили изучение морозношкуров.\n\nСиловые линии сильно изменили места, где эти животные добывают пищу. Чародейская энергия проникла в воду, в растительность... и в существ, на которых они охотятся, вроде лис-виверн.\n\nНо, в отличие от других живых организмов, морозношкуры приспособились к изменениям и стали сильнее.\n\nПравда, вместе с этим и агрессивнее, и это меня тревожит. Если ты вступишь в бой с несколькими особями, я смогу пронаблюдать за их поведением и узнать больше об их новой силе. \n\nЭти данные помогут Кирин-Тору решить, как поступить с морозношкурами.', '', '', '', '', '', '', 47187),
(68087, 'ruRU', 'Опасность в Даруукане', 'Выслушайте срочное сообщение Селбек от посланника из клана Тирай.', 'Похоже, придется отправить вас с Тайваном обратно в Марукай. \n\nНо что это?.. Кто-то приближается? Надеюсь, не еще один незнакомец с огромным бакаром!', '', '', '', '', '', '', 47187),
(68085, 'ruRU', 'Обучение пастуха', 'Обучите Тайвана пасти аргали в Маллаке.', 'Хочешь, чтобы я научил твоего бакара пасти стада? Это мы, конечно, умеем, но ТАКИХ здоровяков я еще не тренировал...\n\nПохоже, аргали его не боятся, а они, уж поверь, прекрасно чувствуют чужие намерения. \n\nЯ готов дать ему шанс, но пастуший бакар должен быть не только осторожным, но и очень умным. А если ему не удастся возглавить стадо, аргали просто не будут его слушаться. Все гораздо сложнее, чем кажется! Пусть попробует, а я посмотрю.', '', '', '', '', '', '', 47187),
(68084, 'ruRU', 'Добродушный великан', 'Отправьте Тайвана на обучение к пастуху Теватею в Маллак.', 'Если у Тайвана проблемы со свирепостью, как говорит Джадар, то, возможно, из него получится отличный пастуший бакар! \n\nНаши собратья из клана Айлааг лучше всех заботятся о стадах аргали и не требуют дорогих подарков, чтобы помочь соседям. \n\nОтведи Тайвана к пастуху Теватею. Ты найдешь его в Маллаке, между двумя холмами на юго-западе отсюда. Там он дрессирует своих бакаров.\n\nАх, Он\'ара, пусть это сработает! У меня совсем не осталось идей.', '', '', '', '', '', '', 47187),
(68083, 'ruRU', 'Давай еще раз, Тайван!', 'Вернитесь к целительнице Селбек в Марукай, чтобы сообщить неутешительные новости.', 'Возвращайся к тираям и передай, что даже я не сделаю из Тайвана охотника. Ему это просто не дано.\n\nЯ еще никогда не видел менее свирепого бакара. Готов представить, что если за ним не следить, он заведет себе друзей среди травоядной дичи! Пф!', '', '', '', '', '', 'Вернитесь к целительнице Селбек в Марукай.', 47187),
(67921, 'ruRU', 'Гончая-охотник', 'Поохотьтесь с Тайваном на опасных зверей, чтобы доказать, что он достоин.', 'Возьми своего здоровенного бакара и поохоться на местную дичь. Выбирай добычу покрупнее. Я посмотрю на вас отсюда и решу, достоин ли он учиться у шикааров. \n\nНо знай: я дрессирую только самых лучших.', '', '', '', '', '', '', 47187),
(67772, 'ruRU', 'Проблема с Тайваном', 'Помогите целительнице Селбек подготовить Тайвана к обучению.', 'Добро пожаловать в Марукай! Рада знакомству. Я Селбек, целительница клана Тирай.\n\nТы хорошо ладишь с животными, $n? Может быть, подход от $gиноземца:иноземки; вроде тебя поможет решить мою проблему.\n\nБакар по кличке Тайван – прекрасный друг, но для клана он стал обузой. Боюсь, если мы не выясним, на что он годится, придется его прогнать. Поможешь мне?', '', '', '', '', '', '', 47187),
(67742, 'ruRU', 'Авиатур над архивами – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67741, 'ruRU', 'Авиатур над архивами', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67724, 'ruRU', 'Оберегающий огонь', 'Добудьте $1oa |4моток:мотка:мотков; льдистого шелка.', 'Мы с Каттигатом пришли сюда, чтобы проявить себя. Хотели помешать Расколотому Пламени и найти Вальтрукс.\n\nА теперь мы вынуждены присматривать за эльфийкой, которую немного покусали ледяные пауки. Мы так ни разу и не столкнулись с Расколотым Пламенем! И уже, возможно, не столкнемся, если эти пауки нас прикончат!\n\nНадо приструнить их, чтобы не нападали. \n\nК счастью, есть один народный метод. Когда горит шелк коконов, получается запах, который очень не нравится паукам.\n\nПринеси немного шелка, и я брошу его в огонь. Это их отпугнет!', '', '', '', '', '', '', 47187),
(67700, 'ruRU', 'К Драконьим островам!', 'Взойдите на борт \"Сурового дракона\" в порту Штормграда и отправляйтесь на Драконьи острова.', 'Отличные новости, $p! Первому отряду экспедиции удалось высадиться на Драконьих островах.\n\nБлагодаря тебе и другим участникам Драконьей экспедиции мы подготовили защищенное место высадки и уже связались с посольством драконов.\n\n$gГотов:Готова; отправиться с нами в новое плавание до Драконьих островов?', '', '', '', '', '', 'Встретьтесь с Тодди Баки на побережье Драконьих островов.', 47187),
(67606, 'ruRU', 'Лекарство дриад', 'Найдите вкусное угощение для детенышей и скормите его унылому утенку.', 'Пока тебя не было, снозаяц нашептал мне, что один здешний утенок совсем приуныл. Но нам повезло – я знаю, как ему помочь!\n\nКогда меня одолевает хандра, я ем что-нибудь сладкое и вкусненькое! Как знаток милых и очаровательных зверюшек, уверяю тебя: это средство подействует и на них.\n\nБольше всего нашему утенку нравится местный десерт под названием \"вкусное угощение для детенышей\". Добудь-ка его и отнеси бедняжке! Так поступила бы любая дриада!', '', '', '', '', '', '', 47187),
(67605, 'ruRU', 'Рокочущие равнины', 'Добудьте рог Аянги.', 'По этой гряде бродит кошмарное штормовое чудище. Многие шикаарские охотники попытались одолеть бестию, но не совладали с ее яростным натиском.\n\nЕсли хочешь проявить себя, попробуй разобраться с этим монстром и принеси его рог в качестве трофея.', '', 'Гнусный рокочущий ящер, повадившийся разрушать лагеря кентавров.', 'Аянга', '', '', '', 47187),
(67566, 'ruRU', 'Пролет над Морозными землями – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67565, 'ruRU', 'Пролет над Морозными землями', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67564, 'ruRU', 'Курьер', 'Отнесите Томасу Мак-Брайту счет Консорциума ремесленников.', '$gИскатель:Искательница; приключений, ты случайно не в святилище Жизни направляешься?\n\nОтнесешь этот счет Томасу Брайту? Он заказывал несколько особых бутылок, и наш стеклодув наконец подсчитал стоимость материала.\n\nИди по этой дороге, скоро ты его встретишь. Наверняка он нашел какого-то бедолагу и рассказывает ему все про свою семейную жизнь...\n\nУверена, он отплатит тебе за услугу.', '', '', '', '', '', 'Отнесите Томасу Мак-Брайту счет Консорциума ремесленников в Рубиновое святилище Жизни.', 47187),
(67299, 'ruRU', 'Прочь, драконы', 'Сбейте $1oa |4протодракона:протодраконов:протодраконов; из чародейского сокрушителя.', 'Воины стихий без перерыва атакуют наш лагерь верхом на драконах!\n\nМы отражаем налеты щитами, но не можем сбить их на землю без твоей помощи.\n\nВыстрели в них из нашего сокрушителя и очисти небеса!', '', '', '', '', '', '', 47187),
(67298, 'ruRU', 'Чудеса света', 'Узнайте, где Томас черпает вдохновение.', 'Мой друг Томас черпает вдохновение, исследуя эти дикие земли.\n\nБыть может, если ты последуешь его примеру, то и тебя вдруг осенит?', '', '', '', '', '', '', 47187),
(67297, 'ruRU', 'Тур по Искаре – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67296, 'ruRU', 'Тур по Искаре', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67295, 'ruRU', 'Работа по призванию', 'Поговорите с Мигелем Брайтом о специализации.', 'Значит, осваиваешь специализацию? Это так замечательно – овладеть особым навыком по душе!\n\nКак представитель Консорциума ремесленников, я с радостью помогу тебе на этом пути.\n\nНу, что скажешь? Найдется минутка выслушать пару мудрых советов и, быть может, научиться чему-то полезному?', '', '', '', '', '', '', 47187),
(67222, 'ruRU', 'Потемневшие облака', 'Избавьтесь от воинов стихий на подъеме Песни Ветра.', 'Воины стихий наводнили подъем Песни Ветра и распространяют там свои безумные учения. Наши сородичи наивно купились на их доводы.\n\nВозможно, если мы поможем очистить священные земли от врагов, другие кланы отплатят добром и придут на выручку в тяжелый час. Поможешь нам это сделать?', '', '', '', '', '', '', 47187),
(67221, 'ruRU', 'Талант к кузнечному делу', 'Соберите $1oa |4кусок:куска:кусков; кристаллизованного драконита в пласте Тлеющих Осколков.', 'Чтобы использовать все возможности кузни Хранителя Земли, надо узнать основы выплавки обожженного обсидианового сплава. Только тогда ты сможешь пойти по стопам величайших кузнецов Нелтариона.\n\nПринеси мне кусок кристаллизованного драконита из недр пласта Тлеющих Осколков. Я передам тебе знание, о котором ты мечтаешь.', '', 'Оживлен заключенным внутри драконитом и весьма опасен.', 'Кристаллизованный осколок стали', '', '', '', 47187),
(67178, 'ruRU', 'Белые глаза, синий дракон', 'Помогите Юмадорму победить Сетогосу.', '$PC, проследи, пожалуйста, чтобы никто не нарушал правил.\n\nСетогоса вечно ищет лазейку и толкует правила как ей вздумается. \n\nЖаль будет, если Юмадорму проиграет из-за ее жульничества.', '', '', '', '', '', '', 47187),
(67177, 'ruRU', 'Разыскивается: Пожиратель', 'Убейте Пожирателя и заберите его рога.', 'Если хочешь стать $gсвоим:своей; среди клыкарров, начни с помощи новым друзьям! \n\nРядом недавно обосновался зверь, которого мы называем Пожирателем. \n\nВслед за ним сюда мигрируют еще больше таких же чудовищ. В каком-то смысле это нам даже на пользу.\n\nУбей Пожирателя и принеси мне его рога. Они пойдут на материалы для строительства этого аванпоста.', '', 'Огромный зверь, забредший далеко от своих обычных мест охоты.', 'Пожиратель', '', '', '', 47187),
(67175, 'ruRU', 'Как обезвредить взрывоопасную игрушечную лодку', 'Поговорите с мамой Тулк и возьмите игрушечную лодку.', 'Жаль было бы отбирать у ребенка игрушку, но Кирин-Тору полезно изучить, как она впитала столько магии.\n\nНо опять же... я не хочу обижать наших друзей-клыкарров. Мой жезл мог бы рассеять магию...\n\nДавай поговорим с мамой Тулк, а потом уже решим.', '', '', '', '', '', '', 47187),
(67174, 'ruRU', 'Обнаружение магии', 'Проверьте предметы клыкарров в месте рыбалки Кхури на следы тайной магии.', 'Здравствуй! Я Мива Зведоокая, занимаюсь исследованиями тайной магии в этих краях. \n\nВ Лазурном Просторе магия повсюду. Она бывает безобидная... а бывает и опасная. \n\nМоя задача – оградить поселения клыкарров от магической энергии. \n\nВ лагере Антонидаса уже был инцидент, когда ящик со снастями внезапно вспыхнул! \n\nПожалуйста, возьми мой детектор и проверь несколько предметов вокруг. Мне сейчас некогда: я разговариваю с Джалк.', '', '', '', '', '', '', 47187),
(67173, 'ruRU', 'Гноллы-воры', '', '', '', '', '', '', '', '', 47187),
(67167, 'ruRU', 'Время дуэли!', 'Предложите $1oa |4драктиру:драктирам:драктирам; сыграть в Hearthstone.', 'Колода снова у меня, пора найти новых игроков для моего клуба! Драктиров, например...\n\nДа, это еще одна вещь, с которой ты можешь мне помочь, $n! \n\nЯ буду чуточку занят, попробую заинтересовать других драконов. Но я еще очень хочу пригласить драктиров!\n\nПоговоришь с ними? Учти, многие из них еще ни разу не играли.', '', '', '', '', '', '', 47187),
(67154, 'ruRU', 'Энтропические останки', 'Соберите $1oa |4образец:образца:образцов; спекшегося песка в Зыбучих песках.', 'На тех, кто проходит через временные пути, часто остается песок времени. \n\nОбычно такой песок быстро рассеивается, но иногда энтропические колебания, созданные путешествиями во времени, заставляют его затвердевать. В таких случаях избавиться от него очень сложно. Из-за этого мне пришлось выкинуть несколько пар отличных ботинок.\n\nЭтот спекшийся песок – именно то, что нам нужно. Постарайся набрать его как можно больше.', '', '', '', '', '', '', 47187),
(67143, 'ruRU', 'Особый напиток', 'Изготовьте добросердечный эль |A:Professions-Icon-Quality-Tier3-Small:20:20|a, используя навыки любой профессии.', 'Теперь, когда сущности элементалей у нас, надо поместить их в эту бутылку. Справишься?\n\nРецепт очень простой, делай все то же, что и обычно.\n\nА если ты вдруг потеряешь или истратишь все реагенты высокого качества, то всегда сможешь добыть еще из элементалей Лощины рогоплавов.', '', '', '', '', '', 'Отнесите подарок Мигелю Брайту в Рубиновое святилище Жизни.', 47187),
(67142, 'ruRU', 'Черви на еду', 'Соберите обугленную в лаве плоть почвенных червей из Пепельных потоков.', 'В сражениях за Обсидиановую цитадель страшно разыгрывается аппетит, а драконы едят немало. Надо пополнить запасы продовольствия.\n\nВ магме под коркой застывшей лавы копошатся очень даже вкусные черви. Ты со мной, скорее всего, не согласишься, но для голодного дракона это настоящий деликатес.\n\nВозьми нашего слугу Гульчака и укажи ему на бугры под лавой. Он подманит червей, и ты сможешь их поймать.', '', '', '', '', '', '', 47187),
(67137, 'ruRU', 'Профессиональная экипировка', 'Поговорите с Марой Мощью Древа.', 'Я тут слышал от Гефесты, что ты тоже занимаешься ремеслом.\n\nМы хотим вручить тебе кое-какое профессиональное снаряжение. Абсолютно бесплатно. В конце концов, для чего еще нужны деловые партнеры?\n\nПоговори с нашей портнихой Марой Мощь Древа, и она тебе все подберет.', '', '', '', '', '', 'Поговорите с Марой Мощь Древа в Рубиновом святилище Жизни.', 47187),
(67111, 'ruRU', 'Помощь при отравлении', 'Добудьте $1oa |4ледяную ядовитую железу:ледяные ядовитые железы:ледяных ядовитых желез;.', 'Не стоило затевать этот поход. С нашей помощью Алия Солнечный Полет пыталась помешать Расколотому Пламени завладеть опасным артефактом. Нам удалось узнать, что он находится где-то в этих руинах.\n\nНо воины Пламени добрались сюда раньше. Кроме того, это место кишит ледяными пауками. Они отравили Алию. Без противоядия она вряд ли долго продержится.\n\nЯ могу его изготовить, но для этого нужны ядовитые железы здешних пауков. Я боюсь оставлять ее без присмотра. Поищешь для меня ингредиенты?', '', '', '', '', '', '', 47187),
(67100, 'ruRU', 'Подарок для Мигеля', 'Узнайте у Томаса о качестве изделий, а затем добудьте для подарка Мигелю $2oa |4пламенный дух:пламенных духа:пламенных духов; у Лощины рогоплавов.', 'Эй, $p, не окажешь мне услугу?\n\nЯ хочу что-нибудь подарить своему другу Мигелю.\n\nУ него скоро день рождения, а я так занят, что никак не могу что-то подготовить. \n\nПоможешь сделать ему подарок высокого качества?', '', '', '', '', '', '', 47187),
(67099, 'ruRU', 'Глаза дракона', 'Поговорите с Миридиан, Зефарионом и Эворианом в округе.', 'Мы знаем, что джарадины готовят открытое нападение, но нельзя забывать о других опасностях. Опасностях менее очевидных.\n\nТри дракона провели разведку и обнаружили потенциальные угрозы.\n\nВстреться с каждым из них и забери их доклады. Как только соберешь информацию, возвращайся ко мне, и мы подготовимся к любым козням джарадинов.', '', '', '', '', '', '', 47187),
(67096, 'ruRU', 'Тур Текущих лесов – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67095, 'ruRU', 'Тур Текущих лесов', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67094, 'ruRU', 'У дриад всегда полно работы', 'Помогите Талендре накормить многочисленных зверьков Вальдраккена.', 'Мое сердце радуется при виде Вальдраккена, снова полного жизни. Но за тысячи лет столько было запущено. И не в последнюю очередь пострадали очаровательные городские зверьки! Увы, у нас не хватает дриад заботиться обо всех малютках. \n\nКак тебе идея стать почетной дриадой Вальдраккена? Милые зверушки уже так долго не пробовали свои любимые лакомства. Разве ты не хочешь поухаживать за ними?', '', '', '', '', '', '', 47187),
(67093, 'ruRU', 'Загадочное святилище', 'Найдите способ получить реликвию, спрятанную в Пустынном святилище, а затем вернитесь к Ноздорму на Престол Аспектов в Вальдраккене.', 'Неподалеку отсюда наши исследователи нашли странное святилище. В нескольких местах с внешней стороны нам удалось разобрать письмена, если точнее, руны титанов. Полагаю, они относятся к предводителю титанов – Великому Отцу Аман\'тулу.\n\nМы хотели рассмотреть все это получше, но, похоже, активировали защиту святилища. Выход заблокировало толщей песка, и мы едва выбрались.\n\nТочно не знаем, что именно там охраняется, но явно что-то важное. Может, тебе удастся выяснить?', '', '', '', '', '', 'Вернитесь к Ноздорму в Вальдраккен.', 47187),
(67084, 'ruRU', 'Важная цель', 'Положите древние слитки титановой стали в кузню и завершите поручение, оставленное Тиром.', '<Вы снова слышите голос Тира.>\n\nИтак, ваше поручение, друзья мои.\n\nРасплавьте слитки в огне и активируйте кузню. Я уже все для вас подготовил.\n\nСеребряная чешуйка сохранила чертеж. Сейчас вы все поймете.', '', '', '', '', '', 'Поговорите с Алекстразой в Тирхолде.', 47187),
(67081, 'ruRU', 'Насыщение материалов', 'Добудьте $1oa |4древний слиток:древних слитка:древних слитков; титановой стали и победите изначальное цунами в Чертогах Насыщения.', '<Образ Тира снова начинает говорить.>\n\nВам удалось снова разжечь огонь в кузне. Но следующее поручение будет сложнее.\n\nВ чешуйке содержатся чертежи того, что я прошу выковать. Необходимые для этого материалы хранятся у Иридия, одного из моих дозорных. Их происхождение уникально, найти другие такие же почти невозможно.\n\nИдите к Иридию в Чертоги Насыщения. Я надеюсь, что благодаря его неусыпному надзору Чертоги все еще функционируют.', '', '', '', '', '', '', 47187),
(67080, 'ruRU', 'Поставки для ремесленников: драконий алхимический раствор', 'Извлеките компоненты из зелий, изготовьте с их помощью $1oa |4бутылку:бутылки:бутылок; драконьего алхимического раствора и отнесите этот раствор Гефесте в Рубиновое святилище Жизни.', 'Хочешь поработать, алхимик?\n\nЯ получил заказ на алхимический раствор от Консорциума ремесленников. Мне было бы безумно интересно с ними поработать и узнать, как они ведут дела, но у меня совершенно нет времени.\n\nТак что это шанс для тебя, $gмоего ученика:моей ученицы;. Извлеки компоненты из зелий, которые ты $gделал:делала; раньше, и изготовь алхимический раствор, а затем отнеси его Гефесте. Просто иди по этой дороге, и найдешь ее.', '', '', '', '', '', '', 47187),
(67079, 'ruRU', 'Под крепким замком', 'Добудьте в Тирхолде основной и вспомогательный диски безопасности.', 'Кузница охраняется гораздо надежнее, чем любая другая часть Тирхолда. Для нас это станет серьезным препятствием, |3-6($c).\n\nЛишь у немногих существ в крепости есть доступ к системе безопасности, а протокол активации требует нескольких кодов на случай порчи.\n\nСлужители не отдадут свои ключи безопасности добром, так что, вероятно, придется забирать их силой. Будь осторожнее, $n.', '', '', '', '', '', '', 47187),
(67078, 'ruRU', 'Инструкция по выплавке', 'Положите серебряную чешуйку к горну Тирхолда.', '<Вокруг вас перекатывается эхо древнего голоса.>\n\nПрошу прощения у дорогих друзей за то, что я вынужден так внезапно вас покинуть.\n\nОднако обещаю, что не оставлю вас без своей защиты. Я знаю, что для вас настали тяжелые времена. И чтобы мой дар был использован должным образом, я должен поручить вам выполнение нескольких заданий.\n\nПервое очень простое: разожгите заново кузню в Тирхолде. Ключом к ней станет серебряная чешуйка.', '', '', '', '', '', 'Поговорите с Кораносом в Тирхолде.', 47187),
(67077, 'ruRU', 'Воспоминания о прошлом', 'Поговорите с Ноздорму, чтобы увидеть воспоминание из прошлого.', 'На этом самом месте мы в последний раз виделись с нашим другом Тиром.\n\nМы не вполне понимали, из-за чего он уходил, просто знали, что это что-то важное.\n\nХотя нам больно вновь переживать те минуты, похоже, искра позвала нас сюда, чтобы мы увидели все еще раз. Ноздорму может показать нам картину прошлого – возможно, мы найдем подсказки, оставленные Тиром.', '', '', '', '', '', '', 47187),
(67076, 'ruRU', 'Искра открытий', 'Исследуйте искру титанов в Тирхолде.', 'Эта искра необычного происхождения, но мне она почему-то кажется знакомой. Ума не приложу, для чего она была создана. Хочется верить, что она еще на шаг приблизит нас к разгадке.\n\nСледуй за ней – вдруг удастся узнать больше о ее предназначении. А я пока постараюсь еще что-нибудь выяснить.', '', '', '', '', '', 'Поговорите с Калесгосом в Тирхолде.', 47187),
(67075, 'ruRU', 'Спрятанная магия', 'Раскройте тайну серебряной чешуйки, выявляя скрытую магию консолей в Тирхолде.', 'Как любопытно! В этой крепости множество тайн, и только хранитель Тир знает ее секреты. Если мы хотим выяснить больше, нам нужно продолжать исследовать Тирхолд. \n\nМне кажется, что раскрыть тайны этого места нам поможет чешуя.\n\nТолько есть одна сложность. Стражи Тирхолда все еще... нестабильны. Они могут посчитать тебя $gнарушителем:нарушительницей; спокойствия и попробовать тебе помешать. Возьми этот проводник. Он поможет в случае опасности.', '', '', '', '', '', '', 47187),
(67074, 'ruRU', 'Дар из серебра', 'Поговорите с Алекстразой, чтобы увидеть дар Тира.', 'На исходе своих дней титан-хранитель Тир преподнес нам дар – драконью чешую из чистого серебра. Она дожидалась нашего возвращения в хранилищах Вальдраккена, но, похоже, для нее пришло время покинуть это место.\n\nМы точно не знаем, какие тайны она скрывает, но этот дар всегда был для нас символом единства и дружбы. Мы хотим поделиться этим сокровищем с тобой – $gверным союзником:верной союзницей; драконов. Скажи мне, когда будешь $gготов:готова;, $n.', '', '', '', '', '', '', 47187),
(67073, 'ruRU', 'Красная заря', 'Найдите Алекстразу.', 'Мы вот-вот вернем себе силу... если Рашагет добьется своего раньше, ее победа сулит мрачное будущее всему Азероту.\n\nНельзя этого допустить, $n!\n\nСкорее. Найди Алекстразу и помоги ей, пока не все потеряно!', '', '', '', '', '', '', 47187),
(67068, 'ruRU', 'На крыльях ветра', 'Добудьте яйцо охотницы ветров.', 'Охотницы ветров?! Ох и трудно же с ними сладить. Наша смотрительница стойл Маррен недавно чуть не погибла – упала со скалы, пытаясь приручить такую птицу.\n\nГордость не позволяет ей делиться подробностями, но Маррен сказала, что птица была такой агрессивной и оттеснила ее к обрыву, потому что думала, что ее яйца в опасности.\n\nПолагаю, если ты туда наведаешься, то сможешь найти яйца. Тебе нужно к горным склонам к востоку отсюда.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67067, 'ruRU', 'Сбор квакмаиса', 'Соберите $1oa |4стебель:стебля:стеблей; дикого квакмаиса.', 'В Вальдраккене есть шеф-повар дракон? Это действительно так? Тогда мне нужно, чтобы она попробовала мой биск дугового света! Это старинный рецепт нашей семьи.\n\nЯ знаю, что за растение ты ищешь. Оно растет у воды неподалеку, но с этим не все так просто.\n\nСтеблями квакмаиса питаются жуки и мелкие саламантеры. А они, в свою очередь, служат пищей для рогоплавов. Ничего страшного, если ты вовремя заметишь их приближение, но некоторые из них умеют очень неплохо маскироваться.\n\nТак что лучше не терять бдительность.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67066, 'ruRU', 'Загадочные лакомства', 'Раздобудьте загадочную острую рыбу-ленту.', 'Руми и Лакомка?\n\nОх, с тех пор прошло уже много времени. Поедание рыбы, шеф-повара утенок и дракон... звучит как начало детской сказки от старейшины Поа. Такое просто так не забывается!\n\nА что касается рыбы, то это была загадочная острая рыба-лента. Клыкарры ее обожают! Рыба-лента водится здесь, у самого берега, хотя найти ее не так-то просто.\n\nНо хочу предупредить, что сейчас у лазурноклыков брачный период. Если эти кровожадные чудовища увидят, что ты покушаешься на их любимую закуску, они начнут грызть тебя.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67065, 'ruRU', 'Грибы грядущего', 'Поймайте 7 трюфелеток из дыры времени в будущем воинов стихий.', 'Вкусные грибы? Альтернативное будущее – это тебе не кладовка с вкусностями для завтрака.\n\nНо все же... Будет лукавством сказать, что мне никогда не хотелось снова отведать блюдо от Руми и Лакомки.\n\nЧто ж! Я разрешаю тебе пройти через портал, но не советую делать это в одиночку.\n\nЯ слышала от стражей про эти темные грибы. Похоже, они все время перемещаются с места на место. Используй это так, как считаешь нужным.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67064, 'ruRU', 'Ползучее наслаждение', 'Соберите $1oa |4пучок:пучка:пучков; светящихся ползучих водорослей.', 'О, Румиястраза! Мы с сестрами-дриадами, Селиной и Фелиной, как-то готовили для нее ужин.\n\nМы использовали особые растения – светящиеся ползучие водоросли. Они растут вдоль всего побережья, но ими питаются косяки рюшечниц. Так что рыбы могут напасть, если увидят, что ты покушаешься на их еду.\n\nПередавай поварам от меня привет. Здесь, в нашей обители, им всегда рады.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67063, 'ruRU', '...И обжаривать примерно 10 тысяч лет', 'Соберите $1oa |4щепотку:щепотки:щепоток; острой лавовой специи;.', 'Специи? А! Тебя, должно быть, послала та драконица-повариха. У которой еще утка на голове сидит.\n\nДжарадины собирают острые лавовые специи с огненных элементалей. Их полно внизу. \n\nЧто? Не смотри на меня так! Я не вру, это и правда порошок из элементалей!\n\nУдачи. Она тебе понадобится. Особенно если сунешься туда в одиночку.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67062, 'ruRU', 'Как снежный ком', '', '', '', '', '', '', '', '', 47187),
(67053, 'ruRU', 'Дай миру шанс', 'Представьтесь посланникам от Орды.', 'Да пребудет с тобой Свет, $p.\n\nЭта экспедиция проходит при содействии и Орды, и Альянса. Мы получили четкие распоряжения: помогать всем участникам экспедиции, невзирая на фракции.\n\nПредставители Орды, воевода Люторез и ее дочь Шуджа, стоят на страже на другой стороне лагеря.\n\nМы с воеводой вместе боролись против Плети. Люторез знает, что такое благородство, и станет ценным членом команды.\n\nИди и предложи ей помощь. Покажи, что Альянс уважает свои обязательства.', '', '', '', '', '', 'Поговорите с воеводой Брекой Люторез в посольстве Крылатого Приюта.', 47187),
(67050, 'ruRU', 'Обморожение: причины и симптомы', 'Разместите тотемы, чтобы освободить клыкарров-охотников Лазурного Простора.', 'В этих тотемах живут стихии, |3-6($r). Выпусти их на волю и разбей лед. Освободи своих друзей-клыкарров!', '', '', '', '', '', '', 47187),
(67047, 'ruRU', 'В тепле и покое', 'Соберите $1oa |4листок:листка:листков; морозного стрелолиста.', 'У растения, которое тебе нужно, тонкий стебель, покрытый красными листьями.\n\nНо смотри не наткнись на пауков, пока собираешь цветы. К паукам советую не приближаться. Если все же придется, держи оружие наготове.\n\nИ передай своим приятелям – за ними должок. Пусть угостят меня парой чашечек своего напитка, когда я буду в городе.', '', '', '', '', '', 'Вернитесь к Румиястразе, заглянув на Рубиновый Пир в Вальдраккене.', 47187),
(67039, 'ruRU', 'Великолепное путешествие', 'Найдите пропавших животных.', 'Некоторые из питомцев клана потерялись по дороге из предыдущего лагеря. Не те, кого мы берем на охоту. Такие вряд ли сумеют выжить одни в дикой природе.\n\nПожалуйста, сходи поищи их. В клане их любят, пусть даже они не годятся для охоты!', '', '', '', '', '', '', 47187),
(67036, 'ruRU', 'Гнев Кирин-Тора', 'Возьмите чародейский сокрушитель и помогите Кадгару победить воинов стихий.', 'Вот. Это устройство собрано из деталей, которые ты $gнашел:нашла;. \n\nУстанови его рядом с Кадгаром и обрати воинов стихий в бегство! \n\nНам надо продержаться еще немного, Калесгос вернется совсем скоро.', '', '', '', '', '', '', 47187),
(67035, 'ruRU', 'Сохранение знаний', 'Найдите $1oa |4древний фолиант:древних фолианта:древних фолиантов;, разбросанных по лагерю Антонидаса.', 'Здравствуй, |3-6($r). Меня зовут Алтаний. Жаль, что нам довелось встретиться в такое... неспокойное время.\n\nМы помогали Кирин-Тору изучать историю этих краев, как вдруг напали воины стихий.\n\nБоюсь, несколько томов все еще остались где-то здесь, и они могут бесследно исчезнуть.\n\nТебе обязательно нужно их найти! Если они пропадут, мы утратим эти знания навсегда.', '', '', '', '', '', '', 47187),
(67034, 'ruRU', 'Ветром и водой', 'Соберите реагенты у Ревущих драконьих источников.', 'К востоку отсюда расположен драконий источник, где гнездятся дикие орлы. Их сброшенные перья надолго сохраняют магию и применяются во многих ритуалах.\n\nЕще там водятся яростные духи стихий, чьи ядра тоже бывают полезны.\n\nНабери и того, и другого. Но помни, что орлы – священные птицы. Я не возьму перья, если орлы пострадали ради них.', '', '', '', '', '', '', 47187),
(67033, 'ruRU', 'Постройка укреплений', 'Добудьте $1oa |4деталь:детали:деталей; чародейского сокрушителя.', 'Воины стихий объявили войну Кирин-Тору с тех пор, как мы прибыли в Лазурный Простор. Они ненавидят нас за изучение тайной магии.\n\nЯ пошлю Калесгосу письмо с просьбой вернуться из Лазурных архивов. Надо сдержать их до его возвращения.\n\nПервая атака уничтожила одно из основных устройств нашей чародейской защиты. Принеси мне детали, и я соберу его.', '', '', '', '', '', '', 47187),
(67032, 'ruRU', 'Подъем на Вактрос – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67031, 'ruRU', 'Подъем на Вактрос', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
