(67012, 'ruRU', 'Когда речные чудища летают', '', '', '', '', '', '', '', '', 47187),
(67007, 'ruRU', 'Помощь в архивах', 'Поговорите с Кеморой в архивах Вальдраккена.', '<Записка написана изящным, очень аккуратным почерком, но чернила быстро расплываются по мокрому пергаменту, от которого исходит запах забродившего напитка.>\n\nИскатели приключений! Ценители знаний!\n\nАрхивы ищут храбрецов, готовых искать ответы и раскрывать секреты прошлого – а может, даже и будущего!\n\nНас ждут испытания не для слабых духом или нетвердых волей.\n\nНелюбознательным и трусливым просьба не беспокоить.\n\nКемора', '', '', '', '', '', '', 47187),
(67006, 'ruRU', 'Погасить огонь', '', '', '', '', '', '', '', '', 47187),
(67005, 'ruRU', 'Как приручить протодракона', '', '', '', '', '', '', '', '', 47187),
(67004, 'ruRU', 'Полезные вещи в больших сундуках', 'Найдите сундук Хранителя Земли. Постарайтесь доставить его истопнику Волраксу, чтобы получить награду.', 'Мы наконец получили все, что нужно, и можем открыть сундук Хранителя Земли. Мы видели несколько таких сундуков под цитаделью. Найди хотя бы один, и я тебя награжу.\n\nЯ изготовил специальные цепи – доставь сундук сюда, мы откроем его и разделим сокровища.\n\nИ смотри по сторонам: может, увидишь, как кто-то уже тащит сундук. Ведь я послал не только тебя.', '', '', '', '', '', 'Вернитесь к истопнику Волраксу с сундуком Хранителя Земли или без него.', 47187),
(67003, 'ruRU', 'Лазурный слалом – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(67002, 'ruRU', 'Лазурный слалом', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66998, 'ruRU', 'Вода против огня', 'Убейте элементалей лавы в Вулканической пещере.', 'Я столько лет присматриваю за элементалями лавы, но впервые вижу их в таком настроении! Мы еле-еле удерживаем их в пещере.\n\nУ тебя есть свободная минутка? Сократи число элементалей, а мы проследим, чтобы они не вырвались наружу.\n\nВозьми с собой пойманного элементаля воды.\n\nЯ всегда ношу с собой несколько таких, когда приходится иметь дело с элементалями лавы. Природные враги – отличный способ отвлечь внимание!', '', '', '', '', '', '', 47187),
(66997, 'ruRU', 'Труд воспитателя', 'Встретьтесь с Веросом в садах Рубиновых Омутов Жизни.', 'Я так рад, что Лазтак принял призвание воспитателя! Именно сейчас, когда у малюток режутся зубки.\n\nДа и в целом в яслях бывает непросто. Дракончики взволнованы, воспитатели тоже, еще сильнее, чем обычно.\n\nКогда у тебя найдется время, загляни к нам в сады. Там внизу нам пригодилась бы твоя помощь!', '', '', '', '', '', '', 47187),
(66972, 'ruRU', 'Старый Камнеклык', 'Окажите Старому Камнеклыку милосердие у лагеря Антонидаса.', 'У меня сегодня мрачное поручение, $p. Мы убиваем зверей не только чтобы доказать свое мастерство. Иногда это проявление сострадания.\n\nПо лесу к востоку от лагеря Антонидаса бродит старый мамонт. Я давно подметил его издалека и слышал порой его горестный рев. Он явно страдает от ужасной боли.\n\nЕго нынешнее состояние меня беспокоит – слепо продираясь через кусты, он может нечаянно кого-то ранить или убить. \n\nПорадуй мое старое сердце и подари покой усталой душе того мамонта. Принеси мне бивень, чтобы почтить его память.', '', 'Древний мамонт, который теперь представляет угрозу для других и самого себя.', 'Старый Камнеклык', '', '', 'Поговорите с Хемингом Эрнестуэем-младшим в Затерянном лагере.', 47187),
(66971, 'ruRU', 'Лик Смерти', 'Выследите Ледяную Челюсть у пещеры клана Зимней Шкуры.', 'Скажи, $gдруг:подруга;, ты когда-нибудь $gзаглядывал:заглядывала; в лицо смерти?\n\n<Эрнестуэй выдерживает драматичную паузу.>\n\nЧто я несу? $gЗаглядывал:Заглядывала;, конечно.\n\nУ смерти ведь много лиц. \n\nЯ слышал от клыкарров из племени Имбу, что одно из них живет прямо в этих холмах. Даже тот, кто просто произнесет его имя, накличет на себя жестокую смерть от лютого холода.\n\nЛедяная Челюсть.\n\n<Эрнестуэй с опаской озирается по сторонам.>\n\nНу вот, теперь тебе придется его убить. Как минимум для того, чтобы он не убил меня!', '', 'Легендарный предвестник смерти во льдах.', 'Ледяная Челюсть', '', '', 'Поговорите с Хемингом Эрнестуэем-младшим в Затерянном лагере.', 47187),
(66970, 'ruRU', 'Тай\'фун Перерожденный', '', '', '', '', '', '', '', '', 47187),
(66969, 'ruRU', 'Кланы равнин', 'Явитесь к хану Сансок в Марукай.', 'Пока ты ждешь посла, поговори с ханом Сансок. Она хочет узнать, как прошло твое знакомство с кланами, и ждет тебя в центре Марукая.', '', '', '', '', '', '', 47187),
(66968, 'ruRU', 'Зачистка стаи', 'Выследите Йетора возле Щита Ронина.', '<Эрнестуэй указывает на обочину дороги.>\n\nВидишь следы на снегу? \n\nЭто тропа йети. \n\nОбычно они бы не стали охотиться так близко к дороге, но что-то согнало их с привычных мест. Попробуй выследить их вожака. Не хватало еще, чтобы они начали нападать на путников!\n\nЕсли вожак окажется особенно огромный и злобный, принеси его голову в качестве трофея. Это отпугнет остальных.', '', 'Хуже большого йети может быть только большой йети, у которого есть друзья.', 'Йетор', '', '', 'Поговорите с Хемингом Эрнестуэем-младшим в Затерянном лагере.', 47187),
(66964, 'ruRU', 'Не в те руки', 'Найдите Алию Солнечный Полет в Затерянных руинах в Лазурном Просторе.', 'На нас обрушилось невероятное... нет... неисчислимое множество проблем!\n\nНе знаю даже, с чего и начать! \n\nКирин-Тор раскрыл заговор Расколотого Пламени. Они охотятся за артефактом под названием Вальтрукс.\n\nОн наделен огромной мощью и, быть может, даже сознанием! Это делает его вдвойне опасней... а опасности нам и так уже хватает.\n\nАлия Солнечный Полет отправилась на юг с парой клыкарров – выяснить, чем занято Расколотое Пламя. Они должны были уже вернуться.\n\nНайди ее и не дай Пламени захватить артефакт!', '', '', '', '', '', '', 47187),
(66963, 'ruRU', 'Письмо в пути', 'Найдите в лагере неподалеку каталогизатора Вульферда и скажите ему не ждать новых припасов.', 'Я ведь говорила Вевеси, что смогу вытащить повозку из грязи.\n\nТак нет же, ему лишь бы магией блеснуть... Смотри, что он наделал!\n\n<Носильщица Беннет вздыхает.>\n\nМожешь подняться в лагерь, пока я пытаюсь образумить Вевеси? Найди там каталогизатора Вульферда и скажи, что ему наверняка придется заказать в Боралусе новый набор деталей для камеры.', '', '', '', '', '', 'Передайте дурные вести каталогизатору Вульферду в лагере Драконьей экспедиции.', 47187),
(66960, 'ruRU', 'Клозикк Вознесенный', '', '', '', '', '', '', '', '', 47187),
(66958, 'ruRU', 'Защищать и вести', 'Выследите Кроворога к востоку от Искары.', 'На днях искарские охотники рассказали, что наткнулись на останки растерзанного лося. \n\nСудя по всему, особенно жестокому носорогу по кличке Кроворог нравится рвать на части более мелкую добычу. \n\nУ лосей в Лазурном Просторе хватает соперников и без этого пришлого монстра, который повадился на них нападать!\n\nПринеси мне его рог. Я хочу впечатлить наших друзей-клыкарров!', '', 'Злобный зверь, истребляющий местных зубронов.', 'Кроворог', '', '', 'Поговорите с Хемингом Эрнестуэем-младшим в Затерянном лагере.', 47187),
(66957, 'ruRU', 'Тень на льду', 'Осмотрите вершину ледника над лагерем Антонидаса.', 'Я слышал сплетни, проезжая через лагерь Антонидаса. Там ходят слухи об изуродованных трупах зверей, которые находят по всем ледяным равнинам. \n\nЭто неизвестное чудовище напугало магов и истребило половину здешних животных.\n\nПопробуй поискать след на вершине ледника. Спорю на что угодно, именно его любой хищник с головой на плечах выбрал бы своими владениями.\n\nПринеси мне часть его тела, чтобы Кирин-Тор наконец успокоился.', '', 'Злой великан, который любит играть с добычей.', 'Мерзлый кулак', '', '', 'Поговорите с Хемингом Эрнестуэем-младшим в Затерянном лагере.', 47187),
(66956, 'ruRU', 'Охотник на драконов Игордан', '', '', '', '', '', '', '', '', 47187),
(66952, 'ruRU', 'Одежда гноллов', 'Добудьте 20 кусков гнолльской ткани у гноллов Драконьих островов для Дофеноса из союза Вальдраккена.', 'С гноллами нет никакого сладу. От их постоянных набегов страдают и участники экспедиции, и простые жители Драконьих островов. Но я никак не возьму в толк, почему одежда гноллов, несмотря ни на что, остается чистой?\n\nКогда снова придется от них отбиваться, сможешь принести мне образец их ткани? Хочу разобраться.', '', '', '', '', '', '', 47187),
(66950, 'ruRU', 'Сердце великана', 'Добудьте 5 ядер у горных, ледяных и огненных великанов Драконьих островов для Тэмнааю из Искары.', 'На Драконьих островах живет много великанов, а внутри у них, по слухам, прекрасные самоцветы. Обычно мы не охотимся на обитателей Драконьих островов ради наживы, но эти великаны и так недавно начали проявлять агрессивность.\n\nРаз уж нам все равно придется избавиться от самых опасных, можем заодно собрать их самоцветы.', '', '', '', '', '', '', 47187),
(66948, 'ruRU', 'Прибытие посла', 'Узнайте о ситуации в Изумрудных садах.', 'Признаюсь, мне никогда в жизни не приходилось покидать Изумрудные сады, встречаться с кентаврами и тем более со смертными с материка.\n\nНо я здесь не ради знакомства, а чтобы просить о помощи. Поддержка кентавров необходима, чтобы мы смогли защитить камень клятвы и выполнять наш долг.\n\nХорошо, что и ты $gвызвался:вызвалась; помогать. Нам надо многое обсудить.', '', '', '', '', '', '', 47187),
(66947, 'ruRU', 'Лазурный марафон – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66946, 'ruRU', 'Лазурный марафон', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66944, 'ruRU', 'Павлиний пигмент', 'Добудьте 8 перьев у павлинов Драконьих островов для Гноклина Глюковерта из Драконьей экспедиции.', 'У павлинов Драконьих островов такие яркие перья! Наверняка из них выйдут хорошие пигменты, которые пойдут на краски нашим писцам.', '', '', '', '', '', '', 47187),
(66943, 'ruRU', 'Дерево для письма', 'Добудьте 15 кусков пергамента из коры древней разложения на Драконьих островах для Дофеноса из союза Вальдраккена.', 'Исследуя Драконьи острова, мы нередко делаем неожиданные открытия. Выяснилось, что кора древней, пострадавших от магии разложения, очень похожа на кожаный пергамент. \n\nКак ни странно, этот необычный пергамент способен выдержать магию даже мощных начертаний. Нам это очень пригодится! Поможешь добыть этот материал?', '', '', '', '', '', '', 47187),
(66940, 'ruRU', 'Опыты с эликсирами', 'Добудьте 15 образцов слизи у горлоков Драконьих островов для Даррел из клана Маруук.', 'Наши алхимики занялись поисками новых ингредиентов для опытов. И их последняя находка очень... как бы это сказать... интересная.\n\nОказывается, слизь горлоков обладает свойствами, которые могут повысить эффективность некоторых эликсиров.', '', '', '', '', '', '', 47187),
(66939, 'ruRU', 'Охота на мастера охоты', 'Выследите мастера охоты Кракла у Щита Имбу.', 'Стражники из Затерянного лагеря поговаривают, что тут завелась тварь, которая любит издеваться над местной живностью. Называет себя \"главным охотником\".\n\nОхота охотой, но пытать живых существ я не позволю. \n\nИ потом, неплохо бы подвесить на мой фургон талисман на удачу.\n\n<Эрнестуэй сплевывает в сторону.> \n\nПринеси мне его лапу.', '', 'Злобный гнолл, который ради удовольствия мучает ни в чем не повинных существ.', 'Мастер охоты Кракл', '', '', 'Поговорите с Хемингом Эрнестуэем-младшим в Затерянном лагере.', 47187),
(66934, 'ruRU', 'Смерть покорительницы', '', '', '', '', '', '', '', '', 47187),
(66933, 'ruRU', 'Маршрут \"Зеркало Небес\"', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66931, 'ruRU', 'Что за шум?', 'Узнайте, что происходит в Рубиновом святилище Жизни.', 'Это было не просто землетрясение.', '', '', '', '', '', '', 47187),
(66929, 'ruRU', 'Собери их все', 'Верните Юмадорму его колоду.', '$PC, пожалуйста, помоги мне вернуть мои карты. \n\nСетогоса никак их не отдаст, хотя я сказал, что они мне нужны. Я хочу научить других студентов играть в Hearthstone и организовать клуб!\n\nСетогоса всегда была ко мне грубой, но это уже слишком.', '', '', '', '', '', '', 47187),
(66921, 'ruRU', 'Рывок до Марукая', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66903, 'ruRU', 'Зачистка хранилища', '', '', '', '', '', '', '', '', 47187),
(66901, 'ruRU', 'Разрушение мира', '', '', '', '', '', '', '', '', 47187),
(66897, 'ruRU', 'Топливо для кузницы', 'Добудьте 10 магмовых ядер у лавовых существ Драконьих островов для Даррел из клана Маруук.', 'Чтобы ковать лучшие клинки, мы используем в своих кузницах магмовые ядра – едва ли что-то другое может дать достаточно жара. Но запасы скоро иссякнут – нам бы их пополнить.\n\nДобыть эти ядра можно у большинства лавовых существ на Драконьих островах.', '', '', '', '', '', '', 47187),
(66895, 'ruRU', 'Не лучше прежнего', 'Устраните пророчицу Визос.', 'Последователи Разрушителя миров слишком доверчивы. За долгие годы мы служили разным лидерам, надеясь, что они приблизят Время Сумерек и возвращение Смертокрыла.\n\nНо Смертокрыл до сих пор не вернулся, да и Сумерек никаких не наступило.\n\nПора выбрать нового лидера, и ты нам в этом поможешь.', '', 'Последний в длинной череде лидеров.', 'Визос Нажива', '', '', '', 47187),
(66893, 'ruRU', 'Помощь пернатым', 'Вылечите $1oa |4раненого длиннорога:раненых длиннорогов:раненых длиннорогов; в Бурных потоках.', 'Пускай мне ничего не известно об элементалях воды, но длиннорогов я знаю отлично!\n\nЯ быстренько смешала бальзам, который укрепит их силы и подготовит к битве. Я никогда не испытывала его на настоящих длиннорогах, но прочла теорию от корки до корки.\n\nПора набраться храбрости и за дело!', '', '', '', '', '', '', 47187),
(66892, 'ruRU', 'Водяная угроза', 'Убейте $1oa |4элементаля воды:элементалей воды:элементалей воды; в Бурных потоках.', 'Элементали убивают длиннорогов! Я знаю, как укрощать крупных зверей, но не ожидала, что придется усмирять элементалей! Они совсем не похожи на детенышей рокочущих ящеров...\n\n<Дазакрос встревоженно вздыхает.>\n\nСможешь избавиться от нескольких элементалей? Длиннороги куда сообразительнее, чем могут показаться. Они сами за себя постоят, как только появится возможность!', '', '', '', '', '', '', 47187),
(66891, 'ruRU', 'Взрывчатая зола', 'Добудьте 20 порций взрывчатой золы у фениксов Драконьих островов для Гноклина Глюковерта из Драконьей экспедиции.', 'Когда погибают фениксы Драконьих островов, от них остается необычная зола. С этой субстанцией мы сможем очень неплохо доработать кое-какие сложные механизмы. Хотя я бы, пожалуй, использовал это во взрывотехнике.', '', '', '', '', '', '', 47187),
(66890, 'ruRU', 'Украденные инструменты', 'Добудьте 20 украденных инструментов у гноллов на Драконьих островах для Дофеноса из союза Вальдраккена.', 'На наши караваны то и дело нападают гноллы. Похоже, их привлекают разные инженерные инструменты. Мы не можем допустить, чтобы эти дикие налетчики постигли наше особое искусство! Да и задержек в нашей работе эти кражи принесли столько, что мне и говорить не хочется.\n\nЕсли мы вернем часть украденного, то работа снова пойдет по плану.', '', '', '', '', '', '', 47187),
(66886, 'ruRU', 'Взлет Изумрудных садов – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66885, 'ruRU', 'Взлет Изумрудных садов', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66884, 'ruRU', 'Огнеупорное снаряжение', 'Добудьте 10 ед. огнеупорного снаряжения у джарадинов на Драконьих островах для Тэмнааю из Искары.', 'Броня джарадинов выдерживает даже самое жаркое пламя. Такое свойство очень пригодится нам в бою с врагом!\n\nПостарайся добыть что-нибудь у джарадинов. Мы изучим броню и зачаруем наше собственное снаряжение теми же чарами.', '', '', '', '', '', '', 47187),
(66883, 'ruRU', 'Древнее кольцо дракона', 'Доставьте найденный предмет Эксадрии.', '<Возможно, это заинтересует Эксадрию.>', '', '', '', '', '', '', 47187),
(66882, 'ruRU', 'Потерянный рюкзак', 'Доставьте найденный предмет Когтеловщице Кавии.', '<Возможно, это заинтересует Когтеловщицу Кавию.>', '', '', '', '', '', '', 47187),
(66881, 'ruRU', 'Ралли речной расщелины – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66880, 'ruRU', 'Ралли речной расщелины', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66879, 'ruRU', 'Длиннорогий переполох', 'Встретьтесь с Дазакрос в Бурных потоках.', 'Длиннороги! Их мощные клювы дробят кости, быстрые ноги уносят от опасности, а крепкий желудок переваривает все, что растет и бегает на островах.\n\nТакое призвание проще всего! Теперь я смогу все время проводить с любимыми птичками. А в случае чего я сумею укротить любого зверя на Драконьих островах.\n\nНе сходишь со мной на плато длиннорогов к северу? Помощник в этом деле никогда не помешает.', '', '', '', '', '', '', 47187),
(66878, 'ruRU', 'Кросс по топям – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66877, 'ruRU', 'Кросс по топям', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66875, 'ruRU', 'Сохранение прошлого: академия Алгет\'ар', 'Добудьте сногонек запутанных воспоминаний у директора академии Алгет\'ар.', 'Как это чудесно! Академия Алгет\'ар снова открыта. Директор Дорагоса наверняка очень рада вновь оказаться в своем храме знаний.\n\nДавненько мне не удавалось побеседовать со своей дорогой подругой. Сходи и узнай, не согласится ли она на чашечку чая. А заодно попробуй поступить в академию. Говорят, сейчас туда принимают любых учеников.\n\nДумаю, тебе будет интересно, ведь ты так часто заглядываешь в эти архивы.', '', '', '', '', '', '', 47187),
(66874, 'ruRU', 'Сохранение прошлого: Чертоги Насыщения', 'Добудьте голографический распространитель у изначального цунами в Чертогах Насыщения.', 'А ты знаешь, что под Тирхолдом расположен огромный комплекс под названием... Чертоги Насыщения? Как это загадочно! И волнующе! Мы сможем столько там почерпнуть! \n\nХранитель Тир прятал там многие свои секреты. Интересно, что они из себя представляют? Не зря говорят, что он был гениальнейшим из хранителей. \n\n<Кемора смотрит вдаль мечтательным взглядом.>\n\nУвы, воины стихий норовят все испортить. Если их не остановить, они наверняка разрушат чудесные творения Тира. Прошу, избавься от них, пока они не нанесли хранилищу непоправимый урон.', '', '', '', '', '', '', 47187),
(66868, 'ruRU', 'Сохранение прошлого: наследие Тира', 'Добудьте затерянную во времени редкость у хронолорда Дейоса в Ульдамане.', 'Я рылся в архивах, искал сведения о хранителе Тире, но, как ни странно, любые упоминания об Ульдамане были уничтожены. Кроме пары абзацев, намекающих на какой-то секрет, который он там спрятал.\n\nСогласись, очень интригует. Наверняка там скрываются и другие секреты. Может, соберешь друзей и поищешь? Любая находка станет ценнейшим открытием.', '', '', '', '', '', '', 47187),
(66864, 'ruRU', 'Поиски реликвии: лощина Бурошкуров', 'Добудьте идол гниломага у гниломага Око Гнева в лощине Бурошкуров.', 'О! Тебя-то мне и надо. Ходят слухи, что гноллы из лощины Бурошкуров практикуют магию разложения – в надежных руках это могучее оружие. У гноллов руки не надежные.\n\nМы должны поскорее заняться этим вопросом. Отправляйся в лощину и принеси что-нибудь, пропитанное их магией... Так мы сможем изучить природу их новой силы.\n\nТолько сохраняй благоразумие и не отправляйся туда в одиночку. Магия Бурошкуров заставляет жертв разлагаться до костей. \n\nМы ведь не хотим, чтобы с тобой такое случилось?', '', '', '', '', '', '', 47187),
(66860, 'ruRU', 'Поиски реликвии: наследие Тира', 'Добудьте часы текучих песков у хронолорда Дейоса в Ульдамане.', 'Кемора заставила меня выискивать любые упоминания о хранителе Тире и Ульдамане, даже самые мелкие. Я обшарил столько книг, что на руках живого места не осталось от бумажных порезов. \n\nПочти везде эти имена вырваны или вымараны. Кроме одного. Я... отложил его, чтобы показать ей позже. Судя по всему, в Ульдамане спрятано какое-то сокровище. Я был бы счастлив его получить. \n\nЧтобы Кемора смогла продолжать исследования, разумеется.', '', '', '', '', '', '', 47187),
(66848, 'ruRU', 'Знамения ветра', 'Помогите он\' Сештэн с ритуалом.', 'Он\'ара не говорит на каком-либо языке, как мы, – ее голос разносится в самих потоках ветра. Нас, мистиков, учат ощущать ее присутствие, распознавать голос и расшифровывать послания.\n\nСобранные тобой материалы позволили мне связать тотемы с определенным зовом. Помоги мне с ритуалом, чтобы я смогла выявить песню Он\'ары и понять ее значение.', '', '', '', '', '', '', 47187),
(66847, 'ruRU', 'Хранилище Воплощений: Ярость Пожирательницы Бурь', 'Войдите в Хранилище Воплощений и одолейте Рашагет.', 'О нет! Мы заточили Воплощения, чтобы спасти наш мир, а теперь Рашагет пытается их освободить!\n\nЭтого нельзя допустить. Останови ее, $n! Под угрозой вся жизнь на Азероте!\n\nМне нужно вернуться на Престол Аспектов и обсудить с Ноздорму наши дальнейшие действия. Но не волнуйся, без помощи я тебя не оставлю. Калесгос и Кадгар отправятся с тобой и помогут тебе пройти через Хранилище.\n\nЖелаю удачи, $gзащитник:защитница;.', '', '', '', '', '', 'Поговорите с Калесгосом у Престола Аспектов в Вальдраккене.', 47187),
(66846, 'ruRU', 'Сердце колоды', 'Помогите призраку изготовить новую карту.', 'В день, когда Драконьи острова начали погружаться в сон, должна была состояться моя последняя игра. Но судьба сыграла со мной злую шутку: моя лучшая карта пропала прямо перед соревнованием.\n\nВидишь ли, карта Го Хи принадлежала мне. Я не знаю, как она оказалась у ее предков.\n\nНо после стольких веков я не могу забрать ее обратно. С моей стороны было глупо так поступать.\n\nБыть может, мы с тобой сделаем новую карту? Такую, какой ни у кого нет... Точно! Ты ведь поможешь?\n\nСкажи, когда будешь $gготов:готова; начать.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66845, 'ruRU', 'Легендарная карта', 'Найдите призрака драконида и верните легендарную карту.', 'Все случилось прошлой ночью. Лежу я, видишь ли, на походной постели, ворочаюсь, не могу уснуть, как вдруг по всей таверне повеяло странным холодом. \n\nИ вот, из неоткуда... возник призрак драконида! Он перевернул верх дном все мои вещи, а затем исчез! \n\nНо с утра я поняла самое страшное... призрак забрал мою любимую карту!\n\nПрошу, будь $gдобр:добра;, выследи призрака и верни ее мне. Для меня это самое ценное сокровище.', '', 'Какими бы ни были обстоятельства, всегда найдется более надежный и изящный способ, чем воровство.', 'Таинственный фантом', '', '', '', 47187),
(66844, 'ruRU', 'Могучая Шокари', 'Убейте летучую лису Шокари.', 'Из всех зверей, что я здесь видел, летучая лиса Шокари была самая гордая.\n\nДа только она полакомилась гноллом-шаманом и заразилась гнилью. Я видел, как она пожирает одного из своих детенышей. Тут я и понял, что она сошла с ума.\n\nЯ забрал остальных детенышей с собой, но Шокари напала на меня и чуть не растерзала насмерть. Еле ноги унес.\n\nШокари надо прикончить. Если гниль разъест ей мозги еще больше, она придет уже за нами.', '', 'Роскошная лиса-виверна, которая была полноправной хозяйкой в этих лесах, заразилась гнилью.', 'Летучая лиса Шокари', '', '', '', 47187),
(66843, 'ruRU', 'Где же Лух?', 'Найдите Луха.', 'Ты Луха нигде не $gвидел:видела;? Помощник мой.\n\nСказал, что хочет минутку прогуляться, а прошел уже час! \n\nЯ ему говорил далеко не отходить, мол, вокруг опасно, а он уперся, как баран.\n\nЯ даже не сержусь: вокруг такая красота, а ему всегда нравилось любоваться цветами.\n\nПоможешь его разыскать? Нас с повозкой у Берега трех водопадов уже заждались!', '', '', '', '', '', '', 47187),
(66841, 'ruRU', 'Осколок древних времен', 'Добудьте артефакт и отнесите его Танессе Серебряный Цветок.', 'Вечно ты бегаешь туда-сюда, всем помогаешь. Может, и старику Ганнару подсобишь?\n\nПока я осматривал местность, мне попалось что-то интересное у водопада на юге отсюда. Глаза у меня уже не те, так что наверняка не скажу. Должно быть, это древний черепок или какой-то кувшин.\n\nВот только плавать я не мастак, так что давай я заплачу пару монет, а ты отнесешь находку Танессе Серебряный Цветок.', '', '', '', '', '', 'Отнесите артефакт Танессе Серебряный Цветок.', 47187),
(66840, 'ruRU', 'Безопасная вода', 'Принесите Мэнни Риду образцы воды.', 'Моя важнейшая обязанность – следить за тем, чтобы у всех в лагере была чистая питьевая вода.\n\nПока гноллы на востоке балуются с магией разложения, нужно проявлять особую осторожность.\n\nЯ не хочу пугать остальных, собирая образцы, но кому-то их взять нужно.\n\nПринеси мне воду из трех водопадов неподалеку. За это я щедро тебя вознагражу.', '', '', '', '', '', '', 47187),
(66839, 'ruRU', 'Время варить!', 'Соберите кровавые ягоды, ягоды бронзового рога и цветки драконолиста.', 'Когда у нас с ребятами был перерыв, нам захотелось пропустить пару кружечек, и мы заявились в таверну.\n\nИ что ты думаешь? У них совсем нет выпивки! Что это за таверна такая? Таверна, где заправляют Крепкие Петли, вот что!\n\nНо ничего, мы и без них справимся! В лесу к востоку отсюда растут цветы и травы – самое то для душистой медовухи. Не хочешь помочь и пособирать цветочки? Мы за наградой не постоим!', '', '', '', '', '', '', 47187),
(66838, 'ruRU', 'Наверху холоднее', 'Добудьте плотные медвежьи шкуры, поохотившись на густошерстных медведей.', 'Хорошая хозяйка таверны всегда угадывает, что нужно гостям. Но кто знал, что по ночам здесь бывает так холодно? Промашка вышла...\n\nГостям понадобятся одеяла – толстые и теплые. Думаю, подойдут медвежьи шкуры.\n\nВ лесу на востоке отсюда водятся очень крупные медведи. Принеси мне их шкуры, и я в долгу не останусь! \n\nТы ведь поможешь? Только подумай о бедных искателях приключений... Вдруг у них ноги замерзнут?', '', '', '', '', '', '', 47187),
(66837, 'ruRU', 'Завтрак под угрозой', 'Добудьте мясо ворквинов-долгоногов и полосатых зубронов к югу от Берега трех водопадов.', 'Мой брат Валдо должен был заказать новые припасы. Прошла уже неделя, но ничего не пришло. \n\nМеня это не удивляет. Этот ленивый олух, наверное, заснул где-нибудь! Теперь у нас кончается провизия, а на охоту времени нет, мне нужно работать – за себя и за Валдо! \n\nСможешь этим заняться? Мясо ворквинов-долгоногов и полосатых зубронов поддержит нашу кухню на плаву, пока я заказываю припасы.', '', '', '', '', '', '', 47187),
(66836, 'ruRU', 'Кольцо в Роще солнечных бликов – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66835, 'ruRU', 'Кольцо в Роще солнечных бликов', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66834, 'ruRU', 'Реллен Знающий', 'Возложите подношения в пещере и познайте учения Реллена.', 'Отнеси подношения в центральную пещеру. Здесь ты узнаешь легенду Реллена Знающего, чьи подвиги положили начало обычаям кентавров.', '', '', '', '', '', '', 47187),
(66833, 'ruRU', 'Мармони в беде', '', '', '', '', '', '', '', '', 47187),
(66831, 'ruRU', 'Лягушки в мешке', 'Встретьтесь с Кешки у Омутов Жизни и выпустите на волю спасенных лягушек.', 'Все лягушки в сборе, $n! Наверное, придется все равно нести их Акоре. У Омутов Жизни им ничто не грозит. Рано или поздно рогоплавам надоест гоняться за лягушками, и они про них забудут.\n\nМы так и не нашли ничего, что развеселило бы Акору. Надеюсь, она поймет.', '', '', '', '', '', '', 47187),
(66830, 'ruRU', 'Полное рогоплавие!', 'Выведите в безопасное место $1oa |4запуганную лягушку:запуганных лягушек:запуганных лягушек; с помощью банки светлячков Кешки.', 'Как меня бесят эти рогоплавы!\n\n<Кешки сердито топает ногой, из-за чего ее очки съезжают набок.>\n\nЗдоровенные жадины и хулиганы, вот они кто! Нельзя же хватать мелких зверушек и есть всех подряд только потому, что лощину в честь них назвали!\n\nВозьми мою банку со светлячками: лучший друг любителя лягушек. Она их успокоит – тогда ты их соберешь и отнесешь куда-нибудь подальше от рогоплавов.\n\nА если они решат броситься и на тебя, не стесняйся отплатить им той же монетой!', '', '', '', '', '', '', 47187),
(66828, 'ruRU', 'Посиделки в лощине', 'Встретьтесь с Кешки в Лощине рогоплавов.', 'Впервые вижу, чтобы Акора так расстроилась. Она никогда не хандрит и не чахнет, прямо как ее цветы. Но эту свою легенду она воспринимает очень серьезно и без умолку о ней твердит. Хм...\n\n<Кешки вертит в руках очки.>\n\nЯ почти ничего не знаю про ее цветы, а лягушки никого, кроме меня, не развеселят...\n\nНо к северу отсюда есть тихая и укромная Лощина рогоплавов, куда я прихожу поразмышлять. Может быть, там мы найдем что-нибудь, что поднимет ей настроение? Или... хотя бы придумаем, как ей помочь?', '', '', '', '', '', '', 47187),
(66827, 'ruRU', 'Цветы наших трудов', 'Соберите в саду $1oa |4зрелый драконов фрукт:зрелых драконовых фрукта:зрелых драконовых фруктов;, $1oa |4ароматный драконий цветок:ароматных драконьих цветка:ароматных драконьих цветков; и $1oa |4тугой стручок:тугих стручка:тугих стручков; для подношения духу дракона.', 'Легенда гласит, что она может спеть лишь для того, кто доказал, что преданно служит жизни.\n\nЯ уже годы старательно ухаживаю за садом. Думаю, и я, и мои растения наконец готовы.\n\nСоберем все, что нужно, у омута. Можешь помочь мне с урожаем!\n\nВозьми стручки с семенами с низких кустов, драконьи цветы с солнечных полей и драконовы фрукты с верхних ветвей деревьев – их можно подцепить моими старыми граблями. И берегись листвы – иногда она проявляет вздорный характер!', '', '', '', '', '', '', 47187),
(66825, 'ruRU', 'Рубиновая церемония', 'Поучаствуйте в церемонии призвания в Рубиновом святилище Жизни.', '$p! Найдется немного времени? Мы вот-вот начнем церемонию призвания, и нам нужна кое-какая помощь. \n\nДля драконоидов это нечто особенное. Одни становятся искусными садоводами; другие посвящают себя дикой природе...\n\nЭти юные драконоиды закончили обучение и готовы принять свое первое призвание. Я знаю, они будут в восторге, если в этом поучаствуешь ты. Когда будешь $gготов:готова;, вручи им предметы с этого стола.', '', '', '', '', '', '', 47187),
(66805, 'ruRU', 'Ключи преданности', 'Найдите $1oa |4большой обсидиановый ключ:больших обсидиановых ключа:больших обсидиановых ключей;.', '', '', '', '', '', '', 'Принесите собранный ключ Сабеллиану в Обсидиановую цитадель.', 47187),
(66788, 'ruRU', 'Проклюнувшаяся надежда', 'Помогите матушке Элион привести омут в порядок.', 'Поверить не могу! Яйца черных драконов! После стольких лет!\n\nТолько посмотри, как тут все запущено! Надо что-то делать! Этим яйцам нужен самый лучший уход.\n\nПока эти хвастуны спорят как дети и выслуживаются перед Хранительницей жизни, мы от них ничего не дождемся! Но ты... Ты ведь не оставишь старую хранительницу яиц совсем одну?', '', '', '', '', '', '', 47187),
(66787, 'ruRU', 'Кольцо Крылатого Приюта – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66786, 'ruRU', 'Кольцо Крылатого Приюта', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66785, 'ruRU', 'Последняя хранительница яиц', 'Поговорите с матушкой Элион.', 'Я понимаю твое беспокойство, |3-6($c), но сейчас все прояснится.\n\nА, я вижу, мы уже не одни. Прошу, останься и посмотри, как все встанет на свои места.\n\nА когда появится время, поговори с нашей хранительницей яиц. Ей непременно понадобится помощь.', '', '', '', '', '', 'Поговорите с матушкой Элион.', 47187),
(66784, 'ruRU', 'Задушить бурю', 'Убейте зовущих бурю воинов стихий, чтобы закрыть Тропу Штормов.', 'Ты неплохо сражаешься, держась всего на двух ногах!\n\nНо воинам стихий не важно, какие чудеса храбрости мы проявляем, пока им удается призывать подмогу. Надо закрыть их портал – Тропу Штормов!\n\nПробейся к пещере недалеко отсюда, где его поддерживают зовущие бурю воины стихий. Убей их, и портал закроется. Я постараюсь помочь.', '', '', '', '', '', '', 47187),
(66783, 'ruRU', 'Возрожденные клятвы', 'Помогите хану Сансок, хану Тигари, ханам Матре Сарест и Меритре обменяться дарами.', 'Много веков назад я и первые кентавры поклялись уважать друг друга и сотрудничать. С тех пор многое изменилось, но мне кажется, что сейчас самое время повторить наши обеты.\n\nВместе с клятвой была написана речь. С ней память о союзе с зелеными драконами передается новым поколениям кентавров. Каждая строка речи сопровождается подношением от ханов. Надеюсь, кентавры не забыли их истинный смысл.\n\nВыбор даров невероятно важен. Только верное подношение закрепит наш союз.', '', '', '', '', '', '', 47187),
(66781, 'ruRU', 'Вопрос вкуса', 'Найдите камень для Мордигана Стальной Рот в Прибежище Китобоя.', 'Никакого уважения!\n\nПарочка вонючих горлоков ворует запчасти нашего оборудования, и нам приходится его отключать... Ха! Да я лизал камни, когда ты еще пешком под стол $gходил:ходила;! Мне не нужны эти новомодные гномские гаджеты. \n\nПринеси мне камень, и я это докажу!', '', '', '', '', '', 'Вернитесь к Мордигану Стальной Рот.', 47187),
(66780, 'ruRU', 'Претендент на трон', 'Поговорите с последователями Гневиона.', 'Я много раз спасал Азерот от гибели и посвятил этому всего себя, а этот глупец заявился сюда и хочет присвоить звание Аспекта? Нет уж, не выйдет.\n\nПоговори с моими товарищами, $n. Пускай расскажут, что думают обо мне и о том, что я сделал для этого мира.', '', '', '', '', '', '', 47187),
(66779, 'ruRU', 'Законный наследник', 'Поговорите с последователями Сабеллиана.', 'Я наследник Нелтариона и лидер единственной сохранившейся стаи черных драконов. Не ожидал, что мне придется соперничать за то, что принадлежит мне по праву. И уж точно не с заносчивым дракончиком, пробывшим на этой земле не дольше твоего, $gсмертный:смертная;.\n\nНо если тебя не убедили эти очевидные факты, поговори с моими драконами. Тебе не обязательно верить лишь моему слову.', '', '', '', '', '', '', 47187),
(66778, 'ruRU', 'Горки Уктулут – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66777, 'ruRU', 'Горки Уктулут', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66737, 'ruRU', 'Новое решение', 'Посадите семена на $1oa |4участке:участках:участках; плодородной почвы и дайте им взойти.', 'Верос старается как может, но дракончики все время попадают в неприятности. Не мои, конечно... Однако не все драконы приучают свое потомство к тому, что сейчас не до баловства.\n\nЯ считаю, что игры на свежем воздухе не должны отвлекать от учебы, но сад надо обезопасить. Возьми эти семена и посади их тут рядом. Когда они вызреют и расцветут, их аромат будет отпугивать насекомых.\n\nСадовники тебе помогут. И, может, мои бронзовые собратья тоже, если будешь вести себя подобающим образом.', '', '', '', '', '', '', 47187),
(66735, 'ruRU', 'Всего лишь небольшая стрижка', 'Подрежьте $1oa |4разросшийся куст:разросшихся куста:разросшихся кустов;.', 'То, что пчелы пугают дракончиков – это только часть проблемы. Обычно опыление – это хорошо, но когда пчел так много, флора выходит из-под контроля.\n\nВозьми, пожалуйста, мои садовые ножницы и подрежь сорняки. Тут уже начали появляться опасные плеточники, но, надеюсь, мы успеем остановить процесс. Лучшее лекарство – это профилактика.\n\nНам сейчас очень нужна профилактика, $n.', '', '', '', '', '', '', 47187),
(66734, 'ruRU', 'Будто медом намазано', 'Возьмите распылитель дыма, соберите $2oa |4надоедливую пчелу:надоедливых пчел:надоедливых пчел; и выпустите их у озера.', 'О, хвала Хранительнице жизни! Хоть кто-то не занят!\n\nОбычно сады – прекрасное место для игр дракончиков, но с тех пор как цветы расцвели, тут развелось огромное количество пчел. Дракончики пугаются, драконы злятся, а не далее как вчера одного из дракончиков ужалили и...\n\n<Верос делает глубокий вдох, чтобы успокоиться, а затем умоляюще смотрит на вас.>\n\nТы не $gмог:могла; бы отловить пчел и выпустить их у озера? Возьми распылитель дыма, он их усмирит.', '', '', '', '', '', '', 47187),
(66733, 'ruRU', 'Речной маршрут Зеленого Купола – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66732, 'ruRU', 'Речной маршрут Зеленого Купола', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66730, 'ruRU', 'Эксперты по выживанию', 'Поговорите со стариной Мрачноклыком у Замерзшего озера в Лазурном Просторе.', 'Знаю, нам хорошо досталось, но нельзя забывать, зачем мы здесь. Наши товарищи рассчитывают на нас, и я не собираюсь их разочаровывать. Поищем в этих диких краях временное убежище. У меня как раз есть местечко на примете.\n\nКончай стоять и ныть. Живее!', '', '', '', '', '', 'Поговорите со стариной Мрачноклыком у Замерзшего озера в Лазурном Просторе.', 47187),
(66728, 'ruRU', 'Пролет над Пепельными потоками – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66727, 'ruRU', 'Пролет над Пепельными потоками', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66726, 'ruRU', 'Трасса Дикого удела – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66725, 'ruRU', 'Трасса Дикого удела', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66724, 'ruRU', 'Блесколовка', 'Добудьте $1oa |4блескорыбку:блескорыбки:блескорыбок; и положите их в корзину с подношениями.', 'Прости, что мы тебя в это втянули, $gпутешественник:путешественница;. \n\nМой брат порой... чересчур увлекается. Это только одна из его причуд. Но она может его погубить. \n\nМеня он и слушать не хочет. И тебя, возможно, не захочет. \n\nНо он помешан на нашем предке – Корик Блесколовке. Возможно, она сможет его убедить.\n\nБудь $gдобр:добра;, поймай несколько блескорыбок и принеси сюда. Это поможет нам установить контакт с духом Корик, заключенным в этом камне.', '', '', '', '', '', '', 47187),
(66722, 'ruRU', 'Слалом Дикого удела – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66721, 'ruRU', 'Слалом Дикого удела', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66719, 'ruRU', 'Один шаг назад', 'Защититесь от Зова.', 'Я говорю это с тяжелым сердцем, но мне знакома напасть, постигшая твоих сородичей. Если ты пойдешь дальше в руины, то наверняка тоже подвергнешься безумию.\n\nЭта сила взывает к самой твоей природе, и противиться ей невозможно. Это жажда, которую хочется немедленно удовлетворить.\n\nМне стыдно это признавать, но у меня есть средство от этой заразы. Полностью оно не поможет, но ты сможешь себя контролировать... По крайней мере, пока что.', '', '', '', '', '', '', 47187),
(66718, 'ruRU', 'Смерть гноллам', '', '', '', '', '', '', '', '', 47187),
(66715, 'ruRU', 'Извлечение', 'Спасите клыкарров из лагеря Снегошкуров в Лазурном Просторе.', 'Сейчас самое важное – вернуть остальных. Желательно целыми и невредимыми.\n\nМне нелегко это признавать, но один я с врагом не справлюсь. \n\nТы сможешь нам помочь?', '', '', '', '', '', 'Расспросите Ледокуса о клыкаррах-охотниках', 47187),
(66712, 'ruRU', 'Полет Морозной Вспышки – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66711, 'ruRU', 'Угощение во тьме', 'Поймайте $1oa |4речного моллюска;речных моллюсков;речных моллюсков; для Хадари.', 'Из-за образа жизни нашего клана некоторых ресурсов постоянно не хватает. У нас нет времени на поиски месторождений металлов.\n\nПри прошлом хане много с кем были налажены торговые отношения, и я не вижу причин от них отказываться.\n\nНа берегу неподалеку есть ведра, которыми мы ловим моллюсков – кое-кто из наших соседей считает их деликатесом. Принеси мне этих моллюсков, они послужат товаром для обмена.', '', '', '', '', '', '', 47187),
(66710, 'ruRU', 'Полет Морозной Вспышки', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66709, 'ruRU', 'Начинающий полевой врач', 'Помогите старине Мрачноклыку оправиться от ран.', '<Сложно сказать, сколько этот раненый клыкарр пролежал посреди леса. Без вашей помощи он точно долго не протянет.>', '', '', '', '', '', '', 47187),
(66708, 'ruRU', 'Езда по снегу', 'Найдите пропавших клыкарров-охотников в Лазурном Просторе.', 'Приветствую тебя, |3-6($c). Этот магический купол просто удивителен. Но хотя он защищает нас от холода и диких животных, мы не можем вечно полагаться на Кирин-Тор.\n\nНесколько дней назад самые опытные из наших охотников отправились в лес на поиски еды и припасов, но так и не вернулись. Отряд возглавляет старина Мрачноклык, опытный охотник, отлично знающий эти земли. И все же я не могу за них не волноваться.\n\nПрошу, отыщи наших охотников.', '', '', '', '', '', 'Найдите пропавших клыкарров-охотников в Лазурном Просторе.', 47187),
(66704, 'ruRU', 'Мугурлглрлгл!', 'Мурглгулглрлглгул!', 'Мрглгулглррлглгул! Грургуглуллгурл!\n\nГруглрлгллруг рргулгрулгргл груглл гургулл гур. Мургллгллруг гургллглрл Мургул груггуллгл. Мургуглегургллгур гурглл гургулгул гуруулгурллгр гууглрллгл.\n\nМгргулллгллл гурл гуглл.\n\n<Вы точно не знаете, что говорит ваш собеседник, но он постоянно повторяет пронзающий жест. Похоже, этот мурлок просит вас кого-то убить.>', '', '', '', '', '', '', 47187),
(66703, 'ruRU', 'Как снежный ком', 'Добудьте $1oa |4тотем:тотема:тотемов; Снегошкуров у шаманов Снегошкуров в Лазурном Просторе.', 'Гноллы-Снегошкуры умные. Они знают хитрость: кладешь еду на лед – еда хранится дольше. Но не просто лед. Волшебный лед! \n\nЕго шаманы заговаривают! А Ледокуса оставили здесь, помирать с голоду среди лакомых клыкарров.\n\nЕсли |3-6($r) хочет помочь клыкаррам, времени мало. \n\nНо Ледокус знает, как снять заклятие.\n\nЗачем Ледокус помогает? Он тоже не любит шаманов.', '', '', '', '', '', '', 47187),
(66700, 'ruRU', 'Черный локус', 'Отнесите черный локус телемантке Эрилин.', 'Как же сложно удержаться. Расколотое Пламя было не готово к силе локуса. Но у меня он лег в ладонь как влитой. Забавно.\n\n<Аденедал трясет головой.>\n\nНет-нет. Не сегодня. Хватит. Забери его. Это бремя не для меня.\n\nПрощай, дорогой друг.', '', '', '', '', '', '', 47187),
(66699, 'ruRU', 'Мудрость местных', 'Поговорите с клыкаррами в лагере Антонидаса.', 'Калесгос верно решил просить совета у клыкарров. Они живут здесь поколениями и успели изучить каждый камушек.\n\nМногие по пути разбили лагеря по всему Лазурному Простору. \n\nРасспроси их! Кто-то должен что-то знать о силовых линиях.', '', '', '', '', '', '', 47187),
(66698, 'ruRU', 'Подсчет аргали', 'Поговорите с пастухом из клана Айлааг и верните пропавших овец.', 'Один из наших главных ресурсов – стада аргали. Потеря каждого аргали сказывается на силе нашего клана.\n\nНесколько из них отбились от стада. Нашим пастухам пригодилась бы твоя помощь.', '', '', '', '', '', '', 47187),
(66696, 'ruRU', 'Искушая судьбу: будущее Темных Земель', '', '', '', '', '', '', '', '', 47187),
(66692, 'ruRU', 'Круг у Рубинового святилища Жизни – Высокая сложность', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66690, 'ruRU', 'Наступление клана Нокхуд: последний предок', 'Одолейте хана Балакара и добудьте медальон предков во время наступления клана Нокхуд.', 'Ты $gдоказал:доказала;, что ты наш друг. Тебе близок наш уклад жизни и то, что важно для нас. Я хочу поведать о еще одном нашем предке, но эта встреча будет опасной.\n\nУбей лидера клана Нокхуд Балакара, этого безродного предателя, и принеси мне его медальон – он не расстается с этой ценной вещицей. Я навечно буду у тебя в долгу.', '', '', '', '', '', '', 47187),
(66689, 'ruRU', 'Не просто камень', 'Покажите благословленные бурей осколки Уату.', '<Гладкие, чуть горячие осколки светятся, видно, что внутри в них посверкивают молнии.>\n\n<Может, Уату или Олекк знают об этом больше.>\n\n<От мысли, что осколок могут забрать, в вас поднимается желание прижать его крепче. Оставить себе навсегда.>', '', '', '', '', '', 'Вернитесь к Уату в Сероверхие сосны.', 47187),
(66688, 'ruRU', 'Знаки ветра', 'Соберите дары ветра и поместите их в сосуд для жертвоприношений у поющего камня.', 'Когда воплощения стихий, истинные первенцы этого мира, бросили вызов кентаврам, Химиа встретила их, вооружившись нашим даром. Силой ветра.\n\nПосреди равнин гордо возвышается поющий камень. Поднеся к нему дар ветра, ты пробудишь ее отголосок. Такие дары можно найти повсюду: это может быть перо птицы, спора растения или семена речного тростника.', '', '', '', '', '', '', 47187),
(66687, 'ruRU', 'Царство лучших охотников', 'Добудьте $1oa |4моток:мотка:мотков; паутины тенеплета, $2oa |4коготь лисы-виверны:когтя лис-виверн:когтей лис-виверн; и $3oa |4чешуйку громоспина:чешуйки громоспинов:чешуек громоспинов;.', 'Тебе пора познакомиться с Релленом Знающим. Он подарил кентаврам орудия, без которых не выжить в суровых диких землях. Его эхо требует подношения, добытые у могучих зверей.\n\nБудь $gосторожен, странник:осторожна, странница;. Нынешние звери не такие опасные, как много веков назад, но тебе предстоит охотиться на самых могучих хищников.', '', '', '', '', '', '', 47187),
(66684, 'ruRU', 'Погоня за штормом', 'Уничтожьте воинов стихий и их источник магии бури.', '<Уату резко вырывает застрявший осколок и делает быстрый вдох.>\n\nЯ... полностью потерял над собой контроль. Олекк был прав. Эта ужасная магия – дело рук воинов стихий. Прошу, останови их!\n\nЯ должен вернуть брата обратно в лагерь.', '', '', '', '', '', '', 47187),
(66683, 'ruRU', 'Последняя возможность', 'Расспросите о благословленных бурей осколках на Сосновой заставе.', '<Глаза Уату закрыты, а руки скрещены на груди. Он говорит невнятно.>\n\nНу конечно, из всех зверей меня покалечил именно олень. Валяйся теперь и ешь с ложечки. Вся слава достанется моему братцу, как дома уже привыкли.\n\n<Уату поднимает взгляд.> А? Что у тебя там? Светящиеся камни? Я бы взглянул на один, но в остальном это не ко мне. Я охотник, а не археолог. <Уату фыркает, хмуро уставившись на свою ногу.> Может, это знак, что пора менять профессию. Иди, ты явно поспособнее меня будешь.', '', '', '', '', '', '', 47187),
(66681, 'ruRU', 'Бесчисленные бури', 'Убейте $1oa |4благословленного бурей зверя:благословленных бурей зверей:благословленных бурей зверей; в Сероверхих соснах.', 'Если отправишься в лес, увидишь там благословленных бурей зверей. Мне трудно просить тебя об этом, но этих бедолаг лучше убить. Им уже не поможешь, а они страдают и очень агрессивны.\n\nДумаю, это все из-за воинов стихий. Я видел, что на их заставе неподалеку действует какой-то странный магический алтарь.\n\nЯ осмотрю местность еще раз. Если не вернусь одновременно с тобой, разведчик Уату передаст тебе следующие поручения. Мы будем рады любой помощи.', '', '', '', '', '', '', 47187),
(66680, 'ruRU', 'Подсчет овец', 'Задобрите Хочу лакомством, а затем спасите $3oa |4потерявшегося аргали:потерявшихся аргали:потерявшихся аргали; в Сероверхих соснах, подавая ей команды свистком.', 'Неприятно. Мы с Олекком, моим братом, ходили на разведку. Только посмотри, что со мной сделал бешеный олень!\n\n<Уату показывает на свою окровавленную ногу и морщится.>\n\nТы ведь нам поможешь? После недавнего нападения воинов стихий наши аргали убежали в леса. Но лагерю не обойтись без молока и шерсти.\n\nВозьми этот свисток и дай Хочу команду отогнать аргали обратно домой. У Сондо, нашего мясника, есть ее любимые лакомства, если она заупрямится.', '', '', '', '', '', '', 47187),
(66679, 'ruRU', 'Круг у Рубинового святилища Жизни', 'Планируйте через кольца.', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66676, 'ruRU', 'Скрытное проникновение', 'Вернитесь к Радии у ключей Он\'ир.', 'Это Яша... мой тайный друг. Я забочусь о ней с тех пор, как ее бросила мать.\n\nОна выглядит неважно. Не представляю, что они с ней сделали. Надо отвести ее домой. Пусть моя он\' посадит меня под замок до конца жизни, но Яшу нужно вылечить. Я буду вечно благодарна тебе, $p. Прости, что впутала тебя во все это.\n\nЕсли ты не против еще одного приключения... не хочу терпеть выговор от моей он\' в одиночку. Давай встретимся у родников!', '', '', '', '', '', 'Вернитесь к Радии у ключей Он\'ир.', 47187),
(66675, 'ruRU', 'Сила Аспектов', 'Помогите Алекстразе у первого камня клятвы.', 'Первый камень клятвы – древний дар, полученный нами от титанов. Если то, о чем мы узнали, правда, возможно, я смогу снова его активировать и тем самым вернуть силы Аспектов.\n\nМы не можем предсказать, каким будет итог, но, если есть хоть малейший шанс, я должна попытаться.\n\nЯ буду рада, если ты мне поможешь, $n.', '', '', '', '', '', '', 47187),
(66671, 'ruRU', 'Затерянный путь', 'Встретьтесь с Мэдди Громкострел в Затерянном лагере в Лазурном Просторе.', 'Похоже, ты $gспособный искатель:способная искательница; приключений, да и к тому же $gполон:полна; энтузиазма! Как насчет помощи Драконьей экспедиции?\n\nУ нас тут есть милый лагерь посреди очаровательной глуши.\n\nТам будет чем заняться, если захочешь туда отправиться. \n\nКак доберешься, поговори с Мэдди, моей сестрицей. Она поможет тебе освоиться.', '', '', '', '', '', 'Встретьтесь с Мэдди Громкострел в Затерянном лагере в Лазурном Просторе.', 47187),
(66660, 'ruRU', 'На старт... внимание...', 'Встретьтесь с Андантенорму и Сиазератель в прошлом.', '<Взгляд Ноздорму расфокусирован.>\n\nЧем дальше они падают, тем быстрее перемещаются. Они пробивают дыры в ткани времени, и это вызывает существенные колебания. Тебе придется действовать быстро.\n\n<Взгляд Ноздорму фокусируется и перемещается на вас.>\n\nЯ отправлю своих Дозорных Времени, чтобы помогли тебе ориентироваться в потоках времени. Это ускорит дело. Не связывайся с местными и не останавливайся, пока не найдешь Хронорму!\n\nСтупай. Время дорого.', '', '', '', '', '', '', 47187),
(66658, 'ruRU', 'Наступление клана Нокхуд: хранители основателей', 'Отправьтесь к месту наступления клана Нокхуд, одолейте Маруука и Тииру и поместите их оружие в курган Тиракая.', 'Мы остановили пробудителя гробниц Арбана, но к тому времени оружие Маруука и Тииры уже было похищено. Наши величайшие предки могут прямо сейчас вновь сражаться на этих равнинах... за Нокхуд.\n\nИди к месту наступления клана Нокхуд. Найди Маруука и Тииру, одолей их и отнеси их оружие к погребальному холму Тиракая. Мы снова похороним героев с заслуженными почестями там, где сможем вернее сберечь их покой.', '', '', '', '', '', '', 47187),
(66657, 'ruRU', 'И оставайтесь мертвыми!', 'Войдите в главный курган и победите пробудителя гробниц Арбана.', 'Пробудитель гробниц Арбан проник в самый большой курган – там погребены первые предки Маруук. Останови Арбана, пока он не оживил Маруука и Тииру!', '', '', '', '', '', '', 47187),
(66656, 'ruRU', 'Теперь уж точно вечный сон', 'Одолейте духов прославленных кентавров и освободите их с помощью тотема отдохновения Зорига.', 'Предков сковала темная магия. Они не станут нас слушать и сразу нападут. Укхелы возродили наших лучших воинов и охотников. Остановить их будет непросто.\n\nЯ пойду с тобой и помогу. Копье матери вновь познает азарт битвы.\n\nКогда мы одолеем предков, используй этот тотем. Он поможет их духам вернуться в погребальный холм.', '', '', '', '', '', '', 47187),
(66655, 'ruRU', 'Реагенты анти-некромантии', 'Добудьте $1oa |4целый череп:целых черепа:целых черепов; оживленных питомцев и $2oa |4комок:комка:комков; священной земли.', 'Я боюсь, что духи не смогут вернуться в свои гробницы, даже если мы освободим их от Укхел.\n\nА еще эти нечестивцы насильно возвращают к жизни питомцев наших предков, которые при жизни были их защитниками и спутниками.\n\nПринеси мне черепа питомцев и немного священной земли с потревоженных курганов. Это поможет нашим предкам обрести покой.', '', '', '', '', '', 'Встретьтесь с Зоригом среди Вечных курганов.', 47187),
(66654, 'ruRU', 'Истребитель осквернителей', 'Убивайте осквернителей из клана Нокхуд и разорителей могил из клана Укхел и собирайте украденное ими оружие предков.', 'Моя мать была настоящей героиней. Она заслуживает мира и покоя... а не порабощения! Никто из героев такого не заслужил.\n\nЗлодеи заплатят за все. А наши предки снова должны обрести покой – с почестями и со своим оружием. Забери его у нечестивцев!', '', '', '', '', '', 'Встретьтесь с Зоригом среди Вечных курганов.', 47187),
(66652, 'ruRU', 'Вернуть исправителю', 'Узнайте о ритуале клана Укхел, который проходит у ближайшего кургана.', 'Отсюда мне не видно, что они делают, но я боюсь, что они оскверняют курганы.\n\nЗайди в ближайшую гробницу и постарайся прервать их ритуал. \n\nЕсли найдешь какую-то зацепку, которая поможет нам раскрыть их планы, принеси ее мне.', '', '', '', '', '', 'Верните копье Зоригу.', 47187),
(66651, 'ruRU', 'Сейчас кому-то будет Нок-худо', 'Встретьтесь с посвященным Зоригом у Вечных курганов.', 'Кланы Нокхуд и Укхел захватили Вечные курганы – наверняка для своих нечестивых замыслов. Там похоронены наши самые прославленные предки.\n\nЯ отправил на разведку посвященного Зорига, но он пока не вернулся.\n\nОн очень способный, но ему не хватает решимости. Помоги ему сорвать их коварные планы!', '', '', '', '', '', '', 47187),
(66650, 'ruRU', 'Финал судьбы', 'Победите $1oa разных боссов в судьбоносных рейдах.', '<Вы спокойны. Природа этих явлений остается неизвестной, но вы уже знаете, чего ждать. Вы научились проходить эти испытания, и ясный разум – лучшая награда за победу.>\n\n<Вы сильны телом и духом, отправляясь в поход в последний раз. Творите собственную судьбу и смотрите, как ее нити распутываются вокруг вас.>', '', '', '', '', '', '', 47187),
(66647, 'ruRU', 'Рассредоточение стихий', 'Добудьте средоточие стихий.', 'Мы с Калесгосом под постоянным обстрелом в небе над горой. Воины стихий не собираются сдаваться, и в их армии все прибывает.\n\nСкоро мы можем не выдержать такого натиска.\n\nНо у меня есть план.\n\nУ подножья горы ты найдешь разгневанную орчиху по имени Рувин Камнедробительница. Кирин-Тор не раз безуспешно пытался с ней совладать.\n\nУ нее есть устройство, способное поглощать и перенаправлять энергии стихий. \n\nВозьми его у нее, а затем найди меня дальше по дороге.', '', 'В руках Рувин оказалось мощное средоточие стихий.', 'Рувин Камнедробительница', '', '', 'Встретьтесь с проекцией Кадгара дальше по гряде Вактрос.', 47187),
(66646, 'ruRU', 'Подавление причинных связей', 'Убейте элементалей времени.', 'Драконы Бесконечности создали сильные колебания энергетических потоков времени. Плохо дело.\n\nТебе нужно убить всех элементалей времени, каких встретишь, пока будешь помогать послу Хронорму. А я останусь здесь и помогу ей сдерживать Вечнос.', '', '', '', '', '', '', 47187),
(66633, 'ruRU', 'Недвусмысленный намек', 'Вонзите знамена черных драконов в $1oa |4труп джарадина:трупа джарадинов:трупов джарадинов;.', 'Эти джарадины думают, что с черными драконами покончено. Они не боятся Гневиона и не признают его авторитета.\n\nНужно напомнить им, что обсидиановые драконы вернулись и сильны как никогда.\n\nУбей джарадинов и поставь наши знамена над трупами, чтобы враги не забывали, кто здесь правит.', '', '', '', '', '', '', 47187),
(66622, 'ruRU', 'Сбежавшие инструменты', 'Спасите $1oa |4сбежавший инструмент:сбежавших инструмента:сбежавших инструментов;.', 'Это просто ужас! Похоже, мои... ик... инструменты сбежали, стоило мне отвернуться. Страшно даже... ик... подумать, что они там совсем одни и наверняка очень напуганы!\n\nРазыщешь их? Прояви терпение и... ик... постарайся их успокоить – я уверен, после этого они проникнутся к тебе симпатией!', '', '', '', '', '', '', 47187),
(66617, 'ruRU', 'Мортанис', '', '', '', '', '', '', '', '', 47187),
(66612, 'ruRU', 'Крабовый кризис', 'Убейте $1oa |4горлока:горлоков:горлоков; в лагере Мокрого утеса.', 'Крабы в опасности!\n\nЭтой стае и так пришлось нелегко. Их прошлое место обитания разорили воины стихий, после чего я привела их сюда. Но теперь сюда нагрянули горлоки!\n\nЯ думала, что здесь крабы будут в безопасности, но горлоки их ловят и заставляют сражаться, обрекая на раннюю смерть!\n\nПрошу тебя, срази нескольких горлоков, чтобы крабы смогли сбежать!', '', '', '', '', '', '', 47187),
(66598, 'ruRU', 'Техника ночнорожденных', 'Найдите исказительницу Деландру в лагере Антонидаса в Лазурном Просторе.', 'Я не очень-то сведущ в древних символах. Однако...\n\n<Телин роется в своих вещах, пока наконец не достает карту. На ее верхней части большими кривыми буквами выведено имя \"Антонидас\".>\n\nАга! Вот она где!\n\nТопать придется долго, но знатоков магии можно найти... вот здесь. \n\n<Телин указывает на часть карты.>\n\nМожет, они чем помогут.', '', '', '', '', '', '', 47187),
(66597, 'ruRU', 'Старый булыжник', 'Осмотрите древний монолит с гравировкой.', 'Тот камень позади меня – только один пример... Как их там... Древних технологий, найденных на этих островах.\n\nНо мы так и не поняли, что они из себя представляют. Ума не приложу, для чего они.\n\nМы уже обратились за помощью к нескольким союзникам. Пока ждем ответа, может, и ты попробуешь разобраться?', '', '', '', '', '', '', 47187),
(66596, 'ruRU', 'Шепот ветров', 'Поговорите с верховным магом Кадгаром в Штормграде.', 'Здравствуй, $p, давно не виделись. Жаль, что у нас нет времени обменяться историями.\n\nВидишь ли, я только что говорил со старым другом... Разговор был бы очень познавательным, если бы не вселял такую тревогу.\n\nС внезапными открытиями такое бывает.\n\nЯ должен тебе все рассказать.', '', '', '', '', '', '', 47187),
(66595, 'ruRU', 'Неочевидная находка', 'Доставьте послание Телину Темная Наковальня на Рубиновую заставу на Берегах Пробуждения.', '<Не ломайте голову над тем, как этот странный пергамент появился в вашей сумке. Самое главное – содержащееся в нем послание.>\n\nУчастники Драконьей экспедиции!\n\nНа Рубиновой заставе требуется ваша помощь! Действовать нужно незамедлительно!\n\n<Прежде чем вы успеваете разобрать подпись, зачарованный текст исчезает в облачке бело-голубой пыли, оставляя лишь пустую страницу и восхитительный цветочный аромат.>', '', '', '', '', '', '', 47187),
(66589, 'ruRU', 'Организация экспедиции', 'Завербуйте в Штормграде исследователей, мастеров и ученых для экспедиции на Драконьи острова.', 'Меня звать Тодди. Я поведу бравых искателей приключений под знаменем Драконьей экспедиции. Но об этом потом. Пока займемся сбором команды.\n\nВ каждой стоящей экспедиции должны быть самые разные участники. Нам нужны ученые, умельцы и, ясное дело, исследователи.\n\nНу? Что стоим, кого ждем? Иди собирать команду!', '', '', '', '', '', 'Сообщите о своих успехах Тодди Баки в порту Штормграда.', 47187),
(66586, 'ruRU', 'Наследие Тира: тайны прошлого', 'Отправляйтесь в Ульдаман в Бесплодных землях. Узнайте причину странных событий.', 'Чтобы не дать Рашагет освободить других Воплощений, нужно восстановить силу Аспектов.\n\nНо задача не из простых. Титаны нам не помогут, а хранитель Тир давно мертв.\n\nУ королевы Алекстразы созрел план. В Бесплодных землях находится построенный титанами Ульдаман. Она предполагает, что в его глубинах спутники Тира могли спрятать диск с его воспоминаниями.\n \nСобери союзников и отправляйся в Ульдаман, чтобы отыскать диск для королевы драконов. Будем надеяться, что знания Тира помогут вернуть силу Аспектам.', '', '', '', '', '', '', 47187),
(66582, 'ruRU', 'Снабжение силой', 'Соберите энергию в специальный сосуд и доставьте ее исказительнице Деландре в лагерь Антонидаса.', 'В обычных ситуациях собирать энергию несложно. Но энергия, которая нам требуется, концентрированная и нестабильная. Этот зачарованный сосуд позволит тебе безопасно ее переносить.\n\nНа юго-западе отсюда обитают существа, насыщенные нужной нам материей. Аномалии наделили их мощной, но непредсказуемой силой.\n\nИзвлеки их энергию и принеси ее мне. Остаток пути мы сможем проделать вместе.', '', '', '', '', '', '', 47187),
(66578, 'ruRU', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'ruRU', 'Приглашение Аспектов', 'Поговорите с Гневионом о встрече совета.', 'А вот и ты, $p. Как нельзя вовремя!\n\nЯ только что встретился с лордом-командиром Туралионом и его союзниками. Альянс принял приглашение Аспектов на Драконьи острова. \n\nТы же не останешься в стороне? Без тебя все будет не так интересно!\n\nДумаю, ты уже $gзаметил:заметила; вокруг новые лица. Эти крылатые создания зовутся драктирами. Мы знакомы недолго, но они уже успели стать моими ярыми поклонниками.\n\nАх, прости меня, все о себе, да о себе... Давай побеседуем и все обсудим.', '', '', '', '', '', '', 47187),
(66575, 'ruRU', 'Предмет, дающий задание, – флакон', 'Отнесите предмет Алви Стражу Дорог.', '<Этот странный флакон среди прочих вещей в тайнике тарасекков, похоже, наполнен вязкой пузырящейся жидкостью.>\n\n<Будет разумно показать это Алви.>', '', '', '', '', '', '', 47187),
(66559, 'ruRU', 'Снова в лагерь', 'Вернитесь к исследователю Роу в Прибежище Китобоя.', 'Я видела, как Мордиган выскочил оттуда, будто одержимый. Пойду за ним и прослежу, чтобы он благополучно вернулся к остальным.\n\nЕсли обогнешь утес и спрыгнешь в водопад, то больше не потревожишь горлоков. \n\nУвидимся в лагере.', '', '', '', '', '', '', 47187),
(66558, 'ruRU', 'Роуи', 'Найдите Роуи.', 'Ты ведь $gбыл:была; среди тех, кто спасся от Бурошкуров? Тогда, возможно, знаешь, что случилось с Каквиатой...\n\nЕе сын Роуи был сам не свой с тех пор, как Брена и остальные вернулись без нее. Я останусь здесь на случай, если он вернется, а ты не $gмог:могла; бы его поискать? \n\nДумаю, он направился к ледяной пещере к востоку отсюда. Говорил что-то про поединки с тамошними йети!', '', '', '', '', '', '', 47187),
(66557, 'ruRU', 'Знакомые знатоки', 'Найдите другого эксперта по фурболгским языкам в Затерянном лагере.', 'М-да, эта разновидность фурболгского – та еще задачка, даже для меня.\n\nВ Затерянном лагере у меня есть коллеги, которые, возможно, смогут помочь. Говорят, поблизости есть и другие кланы фурболгов – если мы сравним записи об их диалектах, возможно, нащупаем отправную точку.', '', '', '', '', '', '', 47187),
(66556, 'ruRU', 'Прохладная пещера', 'Осмотрите пещеру.', 'Ну, акцент у тебя ужасный, да и десять тысяч лет изоляции и языковых изменений не улучшают положение, но, думаю, хотя бы приблизительное впечатление я получил.\n\nВ том, что они пытались сказать, прослеживается общая тема – что-то о \"злом пещерном ветре\" или \"пещере злого шторма\". Или о том, что постиранное белье завалялось с четверга?\n\nСлушай, это тебе не гномский язык учить: тут трудности неизбежны. Однако я вполне уверен насчет пещеры, так что давай начнем оттуда.', '', '', '', '', '', '', 47187),
(66555, 'ruRU', 'Медвежья услуга', 'Помогите Сонове с переводом.', 'Да, похоже там та еще неразбериха – как будто прошел ураган, не оставив камня на камне. Понятно, почему фурболги так воинственно настроены, но зачем нападать на нас?\n\nВсе было бы куда проще, если бы мы сели за стол переговоров, но клан Зимней Шкуры известен своей молчаливостью, да и их язык не похож ни на один из распространенных диалектов фурболгского. Фурболгийского? В общем, понимаешь, о чем я.\n\nВряд ли тебе удалось вступить с кем-то из них в светскую беседу, я прав?', '', '', '', '', '', '', 47187),
(66554, 'ruRU', 'Агрессивная самозащита', 'Победите $1oa |4фурболга:фурболгов:фурболгов; из клана Зимней Шкуры.', 'В клане Зимней Шкуры сейчас царит такое напряжение, что вряд ли они будут в восторге, если застанут там тебя. \n\nСмело защищайся, если они надумают напасть: твердое напоминание о том, что с тобой лучше не шутить, возможно, вразумит их.\n\nТолько постарайся никого не убить, ладно? А то знаю я вас, искателей приключений.', '', '', '', '', '', '', 47187),
(66553, 'ruRU', 'Поиски в пещере', 'Найдите $1oa |4подсказку:подсказки:подсказок; в пещере клана Зимней Шкуры.', 'Фурболги из клана Зимней Шкуры отличаются от своих собратьев. \n\nЯ их называю \"изоляционисты\" – они всегда держатся особняком. А еще они похожи на призраков, потому что их шкуры создают отличную маскировку на снегу. \n\nОни всегда сторонились других общин, но недавно начали проявлять агрессию. Даже напали на наш лагерь – вот уж чего я не ожидал!\n\nДолжно быть, случилось что-то серьезное, если они на это решились. Я, конечно, не могу их расспросить, но попробуй заглянуть к ним в деревню. Вдруг найдешь какие-то зацепки?', '', '', '', '', '', '', 47187),
(66550, 'ruRU', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'ruRU', 'Слет на Берегах Пробуждения', '', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66534, 'ruRU', 'Взлет с земли', 'Исследуйте Оргриммар.', 'Похоже, наше прибытие все же заметили. Возможно, для местных еще не все потеряно.\n\nМы кое-что обсудим с Абиссианом и командованием Орды – попробуем найти общий язык. А ты пойдешь на разведку.\n\nОсмотрись как следует. В конце концов, мы вроде бы тут надолго.\n\nПосле обхода города возвращайся к нам. Надеюсь, все скучные мелочи мы к тому времени уже уладим.', '', '', '', '', '', '', 47187),
(66529, 'ruRU', 'Вместо тысячи слов', 'Сделайте снимок Дервишиан рядом со скелетом протодракона.', 'После всего, что мы тут узнали, я просто не могу уйти без памятной вещи. \n\nТы не $gмог:могла; бы сфотографировать меня рядом с останками протодракона?', '', '', '', '', '', '', 47187),
(66528, 'ruRU', 'Король без короны', 'Осмотрите скелет протодракона.', 'Представь, каким величественным был этот протодракон при жизни. Возможно, это было самое могучее создание в Диком уделе.\n\nНо даже это не уберегло его от смерти. Надо внимательно осмотреть скелет. Попробуем понять, что произошло в его последние минуты.', '', '', '', '', '', '', 47187),
(66527, 'ruRU', 'Профессиональная протосъемка', 'Сделайте снимок дремлющего протодракона с помощью устройства высотного усиления.', 'Таких умелых фотографов, как ты, я еще не обучал... По крайней мере, среди тех, кто еще жив. Это очень опасная профессия.\n\nКстати об опасностях, твоя последняя цель – огромный протодракон. Судя по нашим наблюдениям, скоро он станет одним из сильнейших хищников в этих землях. Давай подберемся к нему поближе и сделаем снимок!', '', '', '', '', '', '', 47187),
(66526, 'ruRU', 'Охрана дикой природы', 'Освободите 5 пленных протодракончиков или протодраконов.', 'Дикий удел – одно из немногих мест, где протодраконы могут жить и процветать. Но воины стихий разоряют их гнездовья. Они совершают набеги, похищая протодраконов и их детенышей для своих экспериментов.\n\nНе давай этим живодерам пощады. Найди и уничтожь их, а также спаси их пленников. На кону род протодраконов.', '', '', '', '', '', '', 47187),
(66525, 'ruRU', 'Соревновательная протосъемка', 'Сфотографируйте заряженную протодраконицу и яйцо заряженной протодраконицы.', 'На простых примерах ты $gпотренировался:потренировалась;, теперь можно перейти к чему-нибудь поувлекательнее.\n\nЯ видел, что в небе летает потрясающая протодраконица. Изящные рога, чешуя, мерцающая от разрядов тока... Небось воины стихий постарались, но искусство есть искусство!\n\nСделай-ка снимок этой протодраконицы и ее яиц. Только для хорошего ракурса тебе наверняка придется забраться повыше.', '', '', '', '', '', '', 47187),
(66524, 'ruRU', 'Любительская протосъемка', 'Сделайте фотографии протодраконов.', 'Значит, хочешь стать опытным каталогизатором, как я? Ты $gпришел:пришла; по адресу! \n\nДикий удел – кладезь знаний, которые только и ждут, чтобы их кто-нибудь нашел и собрал по крупицам! И как мы это сделаем? С помощью моего \"Каталогизатора 3000\" – версии для Драконьих островов. Теперь с улучшенным захватом движения!\n\nНаберись опыта, запечатлев яйцо протодракона, дракончика, начинающего летать, и взрослого протодракона за охотой. Затем найди меня у древнего скелета протодракона к западу отсюда, и я оценю твои снимки.', '', '', '', '', '', '', 47187),
(66523, 'ruRU', 'Уход за кузней', 'Соберите все необходимое для горна в лагере Антонидаса: шкуры рогоплава, спящие огнешишки и сердцевины ледника.', 'Если ты ищешь наставника, то я, к сожалению... а, ты не $gученик:ученица;! Прошу прощения. Позволь представиться. \n\nЯ комендант Вернагос, одна из смотрителей этих руин. Если конкретнее, на мои усталые плечи легла обязанность их отреставрировать и восстановить во всей былой красоте. \n\nТы мне не поможешь? Все материалы можно легко найти в окрестностях: ядра ледяных элементалей, огнешишки, кожа рогоплавов...\n\nНичего особенного, все просто. Что скажешь?', '', '', '', '', '', 'Вернитесь к коменданту Вернагосу в лагерь Антонидаса.', 47187),
(66517, 'ruRU', 'Новый источник оружия', 'Добудьте 25 уцелевших единиц оружия драктиров у Расколотого Пламени на Драконьих островах для Даррел из клана Маруук.', 'Расколотое пламя представляет существенную угрозу нашим границам. Особенно меня беспокоит их вооружение. Постарайся забрать у них побольше оружия. Так мы сможем узнать слабые стороны врага и заодно пополнить свой арсенал.\n\nЯ верю, что у тебя получится. Если справишься с задачей, я научу тебя нашему кузнечному ремеслу.', '', '', '', '', '', '', 47187),
(66516, 'ruRU', 'Совсем не обычные самоцветы', 'Добудьте 25 \"скучных\" камней у джарадинов на Драконьих островах для Гноклина Глюковерта из Драконьей экспедиции.', 'Какое расточительство! Местные джарадины используют самоцветы как украшения, простые побрякушки! А ведь они нужны для телескопов, зеркал, фокусирующих указателей – не говоря уже о том, что у многих камней есть магические свойства.\n\nМы должны это исправить, $gисследователь:исследовательница;. Забери у джарадинов самоцветы, и я позабочусь, чтобы этим камням нашли более достойное применение. Но осторожнее: джарадины – грозные воины.', '', '', '', '', '', '', 47187),
(66513, 'ruRU', 'Взлет с земли', 'Осмотритесь в Штормграде.', 'Наверное, нам стоит осмотреться в городе, раз уж теперь это наш дом. Сходить на разведку, так сказать.\n\nПрогуляйся по городу, а я пойду с Гневионом и постараюсь чем-нибудь помочь.\n\nТолько не влезай лишний раз в стычки с местными. Думаю, они не привыкли, чтобы среди них расхаживали драконы.\n\nВстретишься с нами, как только разузнаешь обстановку.', '', '', '', '', '', '', 47187),
(66511, 'ruRU', 'Знаменитость среди искарских клыкарров', 'Поговорите с Муриком в Искаре.', 'Раз за разом ты доказываешь, что ты $gодин:одна; из нас. \n\nЭто надо отметить. Приходи ко мне в Искару, у меня есть припасы, которые тебе пригодятся.', '', '', '', '', '', '', 47187),
(66509, 'ruRU', 'Паранойя I', '', 'Агура послал меня сюда собирать цветы, чтобы успокоиться, но тут повсюду существа! Мне ужасно страшно!', '', '', '', '', '', '', 47187),
(66504, 'ruRU', 'Осколок кристаллизованной маны', 'Отнесите кристалл Латосу.', '<Маленький голубой кристалл слегка вибрирует при прикосновении, а затем издает низкий звук, похожий на песню вдалеке. Вы слышите слова, отдающиеся в голове тихой мелодией.>\n\nВозможно, Латоса это заинтересует.', '', '', '', '', '', 'Отнесите кристалл Латосу.', 47187),
(66503, 'ruRU', 'За любовь к ближним', 'Осмотрите вершину разрушенной башни в лагере Антонидаса.', 'А, вижу, мои ученики втянули тебя в свои маленькие шалости. \n\n<Норико посмеивается.>\n\nПохоже, они – вместе с тобой – нашли что-то интересное. Назначение этих руин постепенно открывается нам, и поблекшими рисунками и песней дело не кончится...\n\nЧто-то взывает к нам с вершины башни.\n\nВижу, ты $gзаинтригован:заинтригована;. Можешь отправиться туда, я не против. \n\nПосмотрим, что ты увидишь.', '', '', '', '', '', 'Вернитесь к Норико в лагерь Антонидаса.', 47187),
(66500, 'ruRU', 'Другая перспектива', 'Откройте древние изображения в лагере Антонидаса.', 'Мы ничего не делаем! Мы ничего не делаем!\n\nПогоди-ка...\n\nЯ смотрю, ты $gкакой-то важный:какая-то важная:r; |3-6($r)... Рассказать секрет?\n\nОказывается, в этих руинах есть магические рисунки! И мы их видим!\n\n<Сидролюб гордо выпячивает грудь.>\n\nЯ тебе покажу, как их увидеть! Только... не говори пока что Норико.', '', '', '', '', '', '', 47187),
(66493, 'ruRU', 'Прямо к адресату!', 'Доставьте посылки ученикам из Кирин-Тора в лагере Антонидаса.', '<Вы слышите приглушенное бормотание с другого конца портала.>\n\nЭй! Эй, ты! \n\nМне нужно кое-что отправить ученикам в лагере: посылки из дома, подарки, заказы по магической почте... \n\nОбычная корреспонденция, ничего особенного.\n\nТы окажешь мне большую услугу, если поможешь доставить ее по назначению.', '', '', '', '', '', '', 47187),
(66489, 'ruRU', 'Создание защиты', 'Усильте лазурных защитников в лагере Антонидаса.', 'Мы с комендантом Сайнегосом обсуждали влияние атаки воинов стихий на планы по нападению на Кобальтовую ассамблею. И тут у меня возникла идея. \n\n<Селеста достает жезл из складок мантии.>\n\nВозьми мой жезл и зачаруй их оружие! \n\nМагия огня будет в самый раз...', '', '', '', '', '', '', 47187),
(66488, 'ruRU', 'Разыскивается: Фригеллий', 'Убейте Фригеллия у лагеря Антонидаса.', '<Буквы на пергаменте слегка светятся синим.>\n\nЭлементаль Фригеллий, некогда любимец Малигоса, страдает без своего хозяина. \n\nКогда процветающее поселение в один миг превратилось в руины, проказливое и игривое существо стало злобным и опасным.\n\nЕго нужно устранить.\n\nО победе сообщите коменданту Сайнегосу.', '', '', 'Фригеллий', '', '', '', 47187),
(66473, 'ruRU', 'Земля пробуждается', 'Одолейте Первозданный гнев и Первозданный град на дозорной площадке геликиров.', 'Те ублюдки в пещере задали мне жару.\n\n<Шарнакс с трудом кашляет.>\n\nЧто ж, я видела, на что ты $gспособен:способна;.\n\nТеперь пойди и убей этих элементалей, пока они не набрались сил. Нельзя, чтобы Тирхолд достался воинам стихий!', '', '', '', '', '', '', 47187),
(66472, 'ruRU', 'Стихийные планы', 'Доставьте связку приказов воинов стихий командиру Тадезусу на мост Геликирского дозора.', 'Врата закрыты, элементали повержены, а воины стихий больше нам не угрожают... по крайней мере, пока.\n\n<Шарнакс смеется.>\n\nЕсть ли какое-нибудь дело, |3-6($c), которое нам с тобой не по плечу? Поживем – увидим.\n\nА теперь отнеси планы командиру. Уверена, он будет очень рад нашим успехам.', '', '', '', '', '', 'Поговорите с командиром Тадезусом на мосту Геликирского дозора.', 47187),
(66471, 'ruRU', 'Стихийные замыслы', 'Добудьте $1oa |4приказ:приказа:приказов; у воинов стихий на верхней террасе Геликирского дозора.', 'Командир приказал мне устроить передовую заставу и подавить всякое сопротивление. И когда я его подавила, до меня вдруг кое-что дошло.\n\n<Шарнакс глубоко вздыхает.>\n\nВоины стихий говорили о Тирхолде.\n\nЕсли исключительно умелый допрос не входит в число твоих талантов, то попытайся как-нибудь иначе узнать, что они задумали.', '', '', '', '', '', 'Встретьтесь с Шарнакс у входа в пещеру Геликирского дозора.', 47187),
(66470, 'ruRU', 'Прямое наступление', 'Добудьте туманный, земляной и закаленный льдом камень врат, а затем закройте $7oa |4стихийные врата:стихийных врат:стихийных врат;.', '<Шарнакс чешет подбородок.>\n\nКомандир был прав. Враги призывают на помощь подкрепления из царства стихий.\n\n<Шарнакс усмехается.>\n\nПредставь, как они расстроятся, если что-нибудь случится с их вратами, |3-6($c).', '', '', '', '', '', 'Встретьтесь с Шарнакс у входа в пещеру Геликирского дозора.', 47187),
(66468, 'ruRU', 'То, что было утрачено', 'Одолейте воинов стихий, занимающих дозорную площадку геликиров.', '<Тадезус фыркает, увидев вас.>\n\nТы любишь действовать? Если нет, то не стой у нас на пути, |3-6($c).\n\nЯ потерял много хороших солдат в схватках с воинами стихий, что засели неподалеку.\n\nУ нас есть предположение, что они планируют, но сначала нужно разбить врага и спасти тех, кто служит под моим началом.', '', '', '', '', '', 'Поговорите с Шарнакс на дозорной площадке геликиров.', 47187),
(66467, 'ruRU', 'Искусство подражает жизни', 'Уничтожьте гигантский ядоплющ.', 'Когда я была в этой пещере в последний раз, мне удалось зарисовать огромный цветок, из которого капал гнусный вязкий сок. Это один из моих лучших эскизов – не забыла бы при всем желании.\n\nНа копьях тарасекков – этот сок, я уверена. Должно быть, они начали его собирать, чтобы смазывать оружие.\n\nЦветок красив, и будет жаль его уничтожать. Но мы не можем позволить тарасеккам и дальше добывать из него сок. $n, прошу, уничтожь растение и покончи со всем этим.', '', '', 'Гигантский ядоплющ', '', '', '', 47187),
(66465, 'ruRU', 'Запасы на будущее', 'Уничтожьте $1oa |4стойку:стойки:стоек; с отравленными копьями.', 'Даже без вожака тарасекки вряд ли прекратят смазывать копья ядом только потому, что мы их вежливо попросим. Ни одно из этих копий не должно коснуться невинного путника. Я не могу рисковать.\n\nИх все нужно уничтожить. Если ты не $gзамечал:замечала; их в тайниках у прудов, углезубы, скорее всего, держат их при себе. \n\nНикто больше не пострадает из-за мой беспечности. Войди в пещеру и уничтожь все тайники с оружием, какие найдешь.', '', '', '', '', '', '', 47187),
(66464, 'ruRU', 'Поле Дикой Ярости: мастер охоты!', 'Победите старшую охотницу Амаа.', 'Ну и ну. Вы с друзьями произвели настоящий фурор! И ваш следующий оппонент – чемпионка, старшая охотница Амаа собственной персоной. Так что не спешите радоваться. Она не знает, что такое милосердие. Что ж, был рад познакомиться!\n \nВы же не против, если я заберу ваши вещи, когда она вас убьет?', '', '', '', '', '', '', 47187),
(66463, 'ruRU', 'Поле Дикой Ярости: месть стихий!', 'Одолейте могучего воина стихий.', 'Нам пришлось изменить список участников. Один важный воин стихий захотел с тобой сразиться. А я не собираюсь отказывать разъяренному дракону, вооруженному силой стихий.\n \nНичего, справишься. А если нет... Ты ведь $gподписал:подписала; отказ от претензий?', '', '', '', '', '', '', 47187),
(66462, 'ruRU', 'Поле Дикой Ярости: потерянные сновидцы!', 'Одолейте Шерат и Тареш.', 'Слушай, вот мы на Драконьих островах, а драконов я так почти и не видел. Зато к нам на состязание записалась парочка драконоидов. Причем они настояли на том, чтобы сражаться вместе.\n \nПохоже, настроены они серьезно, так что ни пуха!', '', '', '', '', '', '', 47187),
(66461, 'ruRU', 'Поле Дикой Ярости: боец из жерла вулкана!', 'Одолейте Смутьяна Киику.', 'Первым поучаствовать в состязании вызвался житель Берегов Пробуждения. Здоровый такой джарадин, хотя и поспокойнее своих собратьев.\n \nПохоже, ему просто нравится сражаться, что для меня как раз кстати.', '', '', '', '', '', '', 47187),
(66460, 'ruRU', 'Поле Дикой Ярости: повелитель гнили!', 'Одолейте Ночегниля.', 'Я хотел выставить на арену одного из тех мерзких гноллов. Вот только моим помощникам не удалось установить с ними контакт.\n \nЗато мы отловили их жуткое творение. Думаю, неплохой выйдет боец! Скажи, когда будешь $gготов:готова; ко второму раунду!', '', '', '', '', '', '', 47187),
(66459, 'ruRU', 'Поле Дикой Ярости: ужас болот!', 'Одолейте Манита.', 'Добро пожаловать на Поля Дикой Ярости!\n \nОбычно здесь проводят традиционные поединки, но сейчас межсезонье, и кентавры великодушно разрешили мне воспользоваться их ареной. Сказали, что это будет хорошее испытание силы, которое принесет им честь.\n \nХочешь заслужить звание чемпиона? Тогда подготовься и дай мне знать, когда начнешь свой первый бой.', '', '', '', '', '', '', 47187),
(66458, 'ruRU', 'Наследие Тира: тайны прошлого', 'Отправляйтесь в подземелье \"Ульдаман: наследие Тира\" в Бесплодных землях и добудьте диск.', 'Чтобы не дать Рашагет освободить других Воплощений, нужно восстановить силу Аспектов.\n\nПравда, у титанов и так хватает забот, а хранитель Тир давно мертв.\n\nУ королевы Алекстразы созрел план. В Бесплодных землях находится построенный титанами Ульдаман. Союзники Тира могли спрятать диск с его воспоминаниями там.\n \nНо говорят, что это место заполонили трогги. Собери подмогу, отправляйся в Ульдаман и отыщи диск во имя королевы драконов!', '', '', '', '', '', '', 47187),
(66457, 'ruRU', 'Когти разжимаются', 'Убейте Синешкура.', 'Углезубы подчиняются огромному громиле, которого я называю Синешкуром. Он всегда был агрессивен не в меру, но до сих пор его шайка сторонилась главных дорог. Да, они всегда свирепо защищали территорию, но нападать? До этого они дошли только недавно.\n\nПричиной внезапных нападений может быть только Синешкур. Найди его и убей.', '', 'Глава углезубов. Идти на переговоры не намерен.', 'Синешкур', '', '', '', 47187),
(66456, 'ruRU', 'Ядовитый арсенал', 'Соберите 8 отравленных копий.', 'Может, Страж Дорог из меня не очень, но во время обучения я слушала внимательно. А любой уважающий себя Страж знает, как изготовить противоядие. Мне только нужно немного яда, чтобы смешать их вместе.\n\nНори сказала, что у напавшего тарасекка копье было вымазано ядом. Найди их и принеси мне их копья. Если чутье меня не подводит, я смогу приготовить противоядие из отравы с наконечников.\n\nТолько бы хватило времени.', '', '', '', '', '', '', 47187),
(66449, 'ruRU', 'Чистая работа', 'Спасите $1oa |4пленного дракончика:пленных дракончиков:пленных дракончиков;, уничтожьте $2oa |4феникса:фениксов:фениксов; пламенного когтя и убейте ваятельницу пепла Торнеку.', 'Куалаши-пылевязы пытаются похитить наших дракончиков для своей предводительницы. Она явно затеяла что-то ужасное. Мы должны этому помешать!\n\nНо остерегаться стоит не только джарадинов. Фениксы, которые загоняют дракончиков, похоже, представляют еще большую опасность. \n\nНужно защитить дракончиков и расправиться с теми, кто им угрожает. В этом тебе поможет Осория.', '', 'Опасный противник, способный управлять пеплом и сажей.', 'Ваятельница пепла Торнека', '', '', '', 47187),
(66448, 'ruRU', 'Беспутный Страж Дорог', 'Найдите Алви Стража Дорог.', 'Стражи Дорог, сколько я себя помню, оберегают путников в Тальдразусе. Моя семья многие поколения остается верна этому почетному долгу.\n\nВот только моя сестра Алви в последнее время совсем потеряла к нему интерес. Она должна отчитываться передо мной каждое утро, но я уже больше дня ее не видела. \n\nЕсли повстречаешь на востоке отсюда бронзового драконида, лениво витающего в облаках, скажи ей, чтобы возвращалась сюда. Иначе мне придется найти ее самой.', '', '', '', '', '', '', 47187),
(66447, 'ruRU', 'За барьером', 'Исследуйте хранилище в руинах хранилища Жизни.', 'С барьером покончено. Теперь давай тут все исследуем!', '', '', '', '', '', '', 47187),
(66445, 'ruRU', 'Почести павшим', 'Добудьте предметы из списка у джарадинов.', 'Джарадины оскверняют не только священную цитадель, но и трупы наших павших товарищей! Они ломают им кости и забирают личные вещи в качестве трофеев.\n\nНи один черный дракон не потерпит такого неуважения. Мертвые заслужили покой. \n\nВерни предметы, которые джарадины взяли с трупов.', '', '', '', '', '', '', 47187),
(66442, 'ruRU', 'Теоретические соображения', 'Помогите испытать сферы на барьере титанов в руинах хранилища Жизни.', 'Теперь у нас четыре сферы стихий! Посмотрим, чья гипотеза подтвердится.', '', '', '', '', '', '', 47187),
(66441, 'ruRU', 'Очищенная сила', 'Убейте Ацеквиана в пещере на востоке от руин хранилища Жизни.', 'Сфера первозданного камня – удачная находка, но гипотезы Акадии и Тей\'шары противоречат друг другу.\n\nУ меня тоже есть одна. Может, когда мы найдем больше сфер стихий, ответ прояснится сам собой.\n\nОдин из исследователей видел огромного элементаля воды в ближайшей пещере. Одолей его. Возможно, так ты добудешь еще одну сферу.', '', 'Разведчики сообщают, что этот элементаль стремительно увеличивается в размерах.', 'Ацеквиан', '', '', '', 47187),
(66439, 'ruRU', 'На горячую голову', 'Добудьте фрагменты первозданного пламени у воинов стихий в Лощине рогоплавов.', 'Сферы стихий, говоришь? Если есть земля, должен быть и огонь!\n\nВоины стихий возле гнезд рогоплавов ваяют из земли с помощью магмы. Им-то уж точно пригодится сфера первозданного пламени!\n\nРазберись с ними и поищи что-нибудь ценное!', '', '', '', '', '', '', 47187),
(66438, 'ruRU', 'Возвышенные цели', 'Найдите разведчицу Ри\'тал в лощине рогоплавов.', 'Воздух – могучая стихия. Он продувает насквозь камни и наполняет паруса, чтобы умчать нас по морю.\n\nМоя гипотеза в том, что воздух вернее всего разрушит барьер. Ничего сложного.\n\nМои разведчики сообщают, что они нашли сферу первозданных бурь. Разведчица Ри\'тал отведет тебя к ней. Поищи ее около Лощины рогоплавов. Торопись!', '', '', '', '', '', '', 47187),
(66437, 'ruRU', 'Ключевой элемент', 'Верните сферу первозданного камня повелительнице стихий Тайянь в руинах хранилища Жизни.', '<В этой сфере гулко бьется энергия.>\n\n<Повелительница стихий Тайянь может рассказать о ее предназначении.>', '', '', '', '', '', '', 47187),
(66436, 'ruRU', 'Неожиданные хулиганы', 'Убейте $1oa |4элементаля:элементалей:элементалей; земли в руинах хранилища Жизни.', 'Элементали пытаются избавиться не только от нас: еще они уничтожают артефакты и снаряжение! Будто кто-то внушил им разрушать все, что связано с титанами...\n\nМы сдерживаем их, но не можем продолжить изучение руин, пока не избавимся от них окончательно. Прошу, помоги нам прогнать их и расчистить пространство для исследований.', '', '', '', '', '', '', 47187),
(66435, 'ruRU', 'Спасайся кто может', 'Спасите $1oa |4окруженного исследователя:окруженных исследователей:окруженных исследователей; в руинах хранилища Жизни.', 'Я шаман и часто имею дело с элементалями, но таких агрессивных еще никогда не видела!\n\nИсследователи экспедиции обнаружили здесь хранилище титанов, но его внутренний зал защищает барьер. Кажется, когда мы попытались убрать преграду, сработала система защиты... Раз – и повсюду разъяренные элементали!\n\nКогда они напали, многие исследователи еще трудились на раскопках. Большинство оказалось в западне, а бойцы из них никакие. \n\nПрошу тебя, спустись к месту раскопок и помоги им выбраться!', '', '', '', '', '', '', 47187),
(66429, 'ruRU', 'Я буду помнить', 'Встретьтесь с Рэннаном возле Затерянного лагеря.', 'Я... Дай мне пару минут. \n\nВозвращайся в Затерянный лагерь, $p. Увидимся там.', '', '', '', '', '', '', 47187),
(66428, 'ruRU', 'Не ценить дружбу', 'Примените КРУТЕЙШИЙ, чтобы рассеять чародейский барьер', 'Итак! КРУТЕЙШИЙ отрегулирован и готов к работе... с тобой!\n\nПочему я его не применю? Очень просто! \n\nНадо просчитывать все варианты. \n\nДопустим, он взорвется. Кто будет его чинить, если меня покалечит, контузит или даже убьет? Можешь себе представить? \n\nДавай, отключи барьер, чтобы мы могли вернуться в лагерь и подлатать Латоса. А я... подожду на безопасном расстоянии.', '', '', '', '', '', '', 47187),
(66427, 'ruRU', 'Надвигающаяся угроза', 'Убейте Тарон.', 'Мои магические раны нельзя исцелить в полевых условиях. Не хочется это признавать, но с ними я сражаться не смогу. \n\nМне снова нужна твоя помощь, $n.\n\nНайди Тарон и помешай ей перегружать новые панели управления. \n\nТогда у Рэннана появится несколько драгоценных мгновений на настройку КРУТа... КРУТО... или как он теперь зовет эту штуку? \n\nВозможно, тогда мы сумеем сорвать замыслы Расколотого Пламени.', '', 'Этот лидер Расколотого Пламени не остановится ни перед чем, чтобы завладеть силой руин Карнтара.', 'Мастер чар Тарон', '', '', '', 47187),
(66426, 'ruRU', 'Время на исходе', 'Доберитесь до восточной башни.', 'Уровень магической энергии растет прямо на глазах. \n\nСкоро тут полыхнет так, что ПЧВ Рэннана покажется далекой звездочкой в ночном небе. \n\nНадо найти источник и вырубить его.\n\nБудь $gосторожен:осторожна;, $p. \n\nНайди нас у восточной башни. Там мы оценим ситуацию.', '', '', '', '', '', 'Встретьтесь с Рэннаном и Латосом у восточной башни.', 47187),
(66425, 'ruRU', 'Волшебная перегрузка', 'Помогите Рэннану рассеять магические барьеры.', 'Вот так! Все готово!\n\nПредставляю твоему вниманию... КРУТО!\n\nТа-дам!!\n\nЯ настроил устройство на частоту энергии, которая окружает драконьи панели управления, и вывел на нем символ рассеивания магии.\n\nТеперь КРУТО может рассеивать чародейскую энергию и отключать драконьи панели, но с каждым применением символ будет слабеть.\n\nПолезная штука, да?\n\nЯ засек поблизости четыре таких панели. Поскорее отключи их!', '', '', '', '', '', '', 47187),
(66423, 'ruRU', 'Тревоги и доказательства', 'Найдите подсказки, проливающие свет на происхождение руин.', 'Смерть воинов Расколотого Пламени только подтверждает, насколько опасны руины Карнтара.\n\nРэннан уверен, что доработает КРУТ, и тот успокоит разбушевавшуюся энергию.\n\nНо мы опять боремся с проявлениями проблемы, а не с ней самой.\n\nОбыщи руины и постарайся понять, для чего это место было создано. Там наверняка есть зацепки. И поспеши, $n. У нас вряд ли осталось много времени.', '', '', '', '', '', '', 47187),
(66422, 'ruRU', 'Экспедиция продолжается!', 'Встретьтесь с Рэннаном и Латосом у башни.', 'Древние руины, организация с неясными намерениями... даже устройство Рэннана и его показания... \n\nВсе это пробуждает во мне дух исследователя.\n\nНадо разобраться, что здесь происходит.\n\nК югу отсюда ты найдешь ступени, ведущие в башню. Мы отправимся туда.', '', '', '', '', '', '', 47187),
(66421, 'ruRU', 'Грозовой разлом', '', '', '', '', '', '', '', '', 47187),
(66419, 'ruRU', 'Присяга', '', '', '', '', '', '', '', '', 47187),
(66412, 'ruRU', 'Прошу, лорд Бэзилтон', 'Поговорите с Бэзилтоном в садах.', 'Пока ты не $gушел:ушла;, окажи-ка старому дракониду последнюю услугу.\n\nКогда мы с лордом Бэзилтоном только встретились, то много путешествовали. Думаю, поэтому он и пропадает. Ему не хватает приключений.\n\nЯ уже не смогу ему этого дать. Зато ты можешь! Знаю, с тобой он увидит края, о которых я никогда и не мечтал.\n\nДавай спросим Бэзилтона, что он думает по этому поводу.', '', '', '', '', '', '', 47187),
(66391, 'ruRU', 'В руины!', 'Встретьтесь с Рэннаном и Латосом в руинах Карнтара.', 'Хочешь послушать о моем изобретении? КРУТ называется. Нет?\n\nА я все равно расскажу, ведь оно обнаружило кое-что интересное.\n\nСегодня засекло на руинах Карнтара мощнейший выброс чародейской энергии. Латос подозревает, что здесь замешано Расколотое Пламя. Это наилучшая возможность опробовать КРУТ в деле!\n\nХочешь посмотреть? Ты не останешься $gравнодушен:равнодушна;.', '', '', '', '', '', '', 47187),
(66369, 'ruRU', 'Земляной оберег', 'Активируйте земляной оберег.', 'Я усилила оберег с помощью собранных тобой колец. Камни из земли вокруг него образовали ожившего земельника-защитника. Он будет защищать это место.\n\nПроверь, правильно ли работает земляной оберег.', '', '', '', '', '', '', 47187),
(66368, 'ruRU', 'Остров во время бури', 'Устраните $1oa |4пылающее проявление:пылающих проявления:пылающих проявлений; и плавильщика Пламия.', 'Времени на отдых мало, этих элементалей ничем не сдержать!\n\nДаже небольшая передышка была бы очень кстати, и я успела бы сделать больше оберегов для защиты.\n\nПопробуй хоть немного ослабить натиск врага.', '', '', 'Плавильщик Пламий', '', '', '', 47187),
(66364, 'ruRU', 'Полет на воздушном змее', 'Добудьте 10 свежих крыльев у протодраконов Драконьих островов для Тэмнааю из Искары.', 'У меня появилась идея.\n\nПротодраконы в полете обладают невероятной свободой движений. А перепонки на их крыльях потрясающе эластичны. Чаще всего мы делаем воздушных змеев из натянутых шкур. Но раз драконы решили поубивать друг друга, может, ты сможешь принести мне несколько их крыльев? Я сделаю из них змеев на зависть всему племени.', '', '', '', '', '', '', 47187),
(66363, 'ruRU', 'Щиты из василисков', 'Соберите 20 жестких шкур василисков Драконьих островов для Даррел из клана Маруук.', 'Крепкое переплетение чешуек – хорошая защита против стрел. Мы делаем лучшие щиты на равнинах. Правда, сейчас у меня кончаются шкуры василиска для следующей партии. \n\nЯ вижу, тебя интересуют секреты нашего мастерства. Добудь шкуры у василисков на Драконьих островах, и я расскажу тебе, как с ними работать.', '', '', '', '', '', '', 47187),
(66356, 'ruRU', 'Железнолес', '', '', '', '', '', '', '', '', 47187),
(66354, 'ruRU', 'Искра', 'Перекуйте поврежденные части камня клятвы.', 'Кузня готова. Осталось только зажечь огонь.\n\nПоложи осколки камня клятвы на горн, а Гневион позаботится о разжигании.', '', '', '', '', '', '', 47187),
(66353, 'ruRU', 'КРУТые аномалии', 'Используйте КРУТ, чтобы рассеять три магических аномалии.', 'Здесь просто тьма чародейской энергии...\n\nНо КРУТ все исправит! Доверься названию: Колоссальная Раннанова Ультравосхитительная Технология! Он не только обнаруживает, но и рассеивает чародейскую энергию.\n\nВот... возьми его в руки! Чувствуешь, как они наполняются силой? Нет?\n\nЧто ж, зато теперь ты можешь избавиться от аномалий!', '', '', '', '', '', '', 47187),
(66352, 'ruRU', 'Что знает враг', 'Найдите документы Расколотого Пламени и принесите их Латосу.', 'Чем раньше мы узнаем планы Расколотого Пламени и их связь с выбросом чародейской энергии, тем лучше.\n\nВоспользуемся проверенными методами: разведкой и шпионажем.\n\nЭти руины осаждают последователи Расколотого Пламени. У некоторых из них наверняка найдутся приказы, которые все прояснят.\n\nСделай все, чтобы добыть нужные нам записи.', '', '', '', '', '', '', 47187),
(66351, 'ruRU', 'Дым над горой', 'Найдите самолет первопроходца Йипс.', '<Первопроходец Джеб смотрит на горную гряду за лагерем и шмыгает носом.>\n\nЯ переживаю. Первопроходец Йипс должна была вернуться еще несколько дней назад. Собиралась вместе со мной учить следующую партию исследователей, как безопасно карабкаться по столпам.\n\nА теперь вдали что-то дымится.\n\nОх как я переживаю.', '', '', '', '', '', '', 47187),
(66349, 'ruRU', 'Тренировочный камень', 'Уберите $1oa |4камень:камня:камней;.', 'Убери эти камни!', '', '', '', '', '', '', 47187),
(66344, 'ruRU', 'С попутным ветром', 'Отправьтесь в полет с Геритием и Меритрой.', 'Значит, воины стихий и кентавры из клана Нокхуд теперь союзники. \n\nНам удавалось сдерживать натиск врага, но нокхуды вывели на поле боя новое оружие: драконобойную баллисту. Боюсь, Солетус станет не единственным драконом, павшим от ее гнусной магии бури.\n\nОтправляйся со мной в наше укрытие, Тенистый Приют. Расскажешь мне все, что знаешь о нокхудах, пока ханам Матра собирает войска. Нужно продумать наш следующий шаг.', '', '', '', '', '', '', 47187),
(66340, 'ruRU', 'В небеса', 'Найдите Масуда Мудрого на переправе у речной развилки.', 'Мы выполнили свой долг, $gсмертный:смертная;. Я должна охранять камень клятвы и наставлять зеленых драконов, но знай, что с тобой наша благодарность и вера.\n\nМне сообщили, что Кирин-Тору нужна помощь с лазурным камнем клятвы. Помоги им, и мы еще на шаг приблизимся к исцелению Азерота.\n\nНайди Пакину и Масуда Мудрого из Кирин-Тора. Они скажут тебе, что делать дальше. Удачного пути и приятных снов, $n.', '', '', '', '', '', '', 47187),
(66339, 'ruRU', 'Наступление клана Нокхуд: ветру место в небе', 'Одолейте хана Балакара и освободите Он\'ару во время наступления клана Нокхуд.', 'Что скажешь, $n? Ты покидаешь нас или окажешь еще одну услугу?\n\nМои разведчики доложили, что Балакар скрылся в своей крепости. Там он держит Он\'ару. Это не должно сойти ему с рук!\n\nЕго налетчики тем временем сеют хаос на равнинах. Пока мы сражаемся с ними, у тебя будет возможность проникнуть в крепость клана Нокхуд и спасти Он\'ару. Мы можем рассчитывать на твою помощь?', '', '', '', '', '', '', 47187),
(66337, 'ruRU', 'Остановить бурю', 'Одолейте Королет.', 'Сюда, $n! Мы почти победили!\n\nРяды воинов стихий поредели, они уже не в силах сражаться. Все, к чему мы шли, решится в последней битве с их лидером Королет.\n\nДавай завершим начатое – ты и я! Вместе! В бой, $Gбрат мой:моя сестра;!', '', 'Лидер воинов стихий, стремящийся уничтожить обитель зеленых драконов.', 'Королет', '', '', '', 47187),
(66336, 'ruRU', 'Изумрудный остров', 'Встретьтесь с Меритрой в Древних Ветвях.', 'Твои старания принесли плоды. Нам удалось одолеть воинов стихий во многом благодаря твоей отваге.\n\nЯ пригласила кентавров на встречу под сенью Древних Ветвей. Тебе с ханам Матрой и ее народом всегда будут рады у нас дома.\n\nПройди через арку и иди по тропе над водой, а затем через лесную чащу. Я буду ждать тебя там.', '', '', '', '', '', '', 47187),
(66335, 'ruRU', 'Уничтожение других столпов', 'Пометьте столпы стихий зачарованными семенами.', 'Их гнусные орудия уничтожены. Теперь зеленые драконы могут вступить в бой.\n\nНам уже хорошо знакома ситуация на земле. Надо подсветить цели, чтобы Меритра и ее драконы могли нанести удар с воздуха.\n\nОна дала мне эти зачарованные семена. Размести их у столпов стихий. Свет, излучаемый этими семенами, поможет нам направлять атаки летящих драконов.', '', '', '', '', '', '', 47187),
(66333, 'ruRU', 'Месть за Солетуса', 'Убейте $1oa |4подстрекателя:подстрекателей:подстрекателей; из клана Нокхуд и уничтожьте $2oa |4драконобойную баллисту:драконобойные баллисты:драконобойных баллист;.', 'Пока хотя бы один зеленый дракон жив, воины стихий не осквернят Древние Ветви без боя.\n\nНам не терпится сразиться с врагом, но мы не можем приблизиться к полю боя, пока на него направлены драконобойные баллисты. Орудия сторожат самые сильные воины нокхудов, так что тебе придется разобраться и с ними.\n\nУничтожь баллисты и нокхудских подстрекателей. Избавь зеленых драконов от этой угрозы, и мы переломим ход боя.', '', '', '', '', '', '', 47187),
(66331, 'ruRU', 'Авангард воинов стихий', 'Поговорите с разведчицей Томуль, Ари и Беликой, он\' Сештэн и Меритрой в Грозовом разломе.', 'Ханам Матра сообщила, что она и ее воины прибыли в Изумрудные сады. Им удалось отыскать Королет и ее прислужников. Похоже, силы врага готовятся к наступлению на берегу к северу отсюда.\n\nНо ханам Матра поступила мудро: она велела своим разведчикам наблюдать за ключевыми позициями вокруг поля боя. Выслушай их доклады и найди меня на линии фронта. В бою нас будет ждать слава, а если повезет – и отмщение.', '', '', '', '', '', '', 47187),
(66329, 'ruRU', 'Звук рога', 'Узнайте, что задумали Балакар и Королет.', 'Зачем они принесли сюда Он\'ару? Если только... \n\nПослушай, $n! Думаю, Балакар не собирается уничтожать рог. Он готовит ловушку! Надо как-то преодолеть этот ветер и поскорее!', '', '', '', '', '', '', 47187),
(66328, 'ruRU', 'Зеленый дракон подбит', 'Встретьтесь с ханам Матрой у водопоя.', 'Те драконы должны были приземлиться на поля к западу отсюда. Надо добраться до них раньше нокхудов.\n\nНельзя допустить, чтобы из-за преступлений Балакара они посчитали всех кентавров Маруук своими врагами.', '', '', '', '', '', '', 47187),
(66327, 'ruRU', 'Погоня за ветром', 'Выслушайте доклад разведчицы Томуль.', 'Надо собраться с мыслями и обдумать план действий. \n\nНам нужно получить благословение Он\'ары, чтобы протрубить в рог Друсала и призвать зеленых драконов. Без них мы не победим. Нокхуды сильнее всех остальных кланов, к тому же им помогают воины стихий. А тут еще Королет похитила мать ветров! Нам надо отыскать Он\'ару, прежде чем нокхуды нанесут завершающий удар и окружат Марукай.\n\nЯ отправлю на поиски всех наших разведчиков. Надеюсь, успеем.', '', '', '', '', '', '', 47187),
(66326, 'ruRU', 'Чей-то рабочий инструмент', 'Соберите $4oa |4молоточек:молоточка:молоточков; для тонких работ, $3oa |4обсидиановую двурогую наковальню:обсидиановых двурогих наковальни:обсидиановых двурогих наковален;, $2oa |4пару:пары:пар; клещей из вороненой стали и $1oa |4керн:керна:кернов; драконьего когтя.', 'Такой мощной кузне нужны особые инструменты, способные выдерживать невероятный жар.\n\nНо джарадины разграбили это место и украли многие из них.\n\nМожет быть, ты сумеешь их вернуть. С ними мы сможем и дальше вооружать наших воинов.', '', '', '', '', '', '', 47187),
(66324, 'ruRU', 'Никто не будет забыт', 'Добудьте вещи и спасите выживших в Колыбели целителей.', 'Противоядие готово. Воспользуйся им, чтобы найти выживших в Колыбели целителей. И поспеши, эффект действует недолго. Если что, прими еще одну дозу.\n\nЕсли хоть кто-то из моего вирна еще жив, спаси их.\n\nА если нет... Собери печатки драктиров на их рогах, чтобы мы отдали почести мертвым.\n\nИ, если получится, узнай, что привело к заражению.', '', '', '', '', '', '', 47187),
(66320, 'ruRU', 'Течение времени', 'Отправляйтесь в Зыбучие Пески и поговорите с Хроми.', 'Время протекает подобно реке со множеством излучин и притоков. Порой течение времени нарушается, и если такую аномалию не исправить, мир обречен следовать по ложному пути.\n\nВот что угрожает нам сейчас. Я уже послал Хронорму в Зыбучие пески, чтобы она разобралась, что там происходит, и восстановила истинный ход реальности.\n\nЯ чувствую, что без твоей помощи не обойтись. \n\nПрошу, скорее отыщи Хронорму.', '', '', '', '', '', '', 47187),
(66308, 'ruRU', 'Разжигание огня', 'Соберите $1oa |4вечнотлеющий уголь:вечнотлеющих угля:вечнотлеющих углей;.', 'Новое оружие и доспехи, выкованные в кузне Хранителя Земли, со временем обеспечат нам победу над джарадинами.\n\nВ кузне необходимо постоянно поддерживать пламя. Вечнотлеющий уголь горит жарче всего. Именно такой жар нужен для выплавки оружия.\n\nДобыть его можно в месторождениях или у элементалей в пласте Тлеющих Осколков.', '', '', '', '', '', '', 47187),
(66299, 'ruRU', 'Омлет со взрывчаткой', 'Убейте матриарха из племени Драконьего Крика.', 'Прототип сработал! Замечательно!\n\nВремя для главного блюда. В этот раз поварихой будешь ты.\n\nЯ немного подправила маскировку, чтобы ты $gсправился:справилась; с задачей. Затем возьми нашу потрясающую яйцебомбу, окуни ее в зловонный отвар, доберись до пещеры матриарха, подай ей кушанье и спланируй обратно вниз под звуки взрывов!\n\nЕсли все пойдет по плану, от нее останется лишь кучка пепла. Из-за взрыва. Он сожжет ее дотла.', '', 'Недоверчивый матриарх гарпий Драконьего Крика! Чем она утолит свой ненасытный аппетит сегодня – бомбой Язвотрель или вашим мясом?', 'Матриарх Аветира, предводительница гарпий Драконьего Крика', '', '', '', 47187),
(66279, 'ruRU', 'Из рук в руки', 'Отнесите карманные часы Оризму в сады.', 'Да-да, это часы одного из смотрителей. Он помогает мне в садах. \n\nОдин из ребят Ноздорму. Оризму, кажется? Столько молодежи, всех и не упомнишь. Чаще всего он неподвижно стоит у песочных часов рядом с деревом Алекстразы. Даже не моргает.\n\nНа мой взгляд, у всех, кто служит с Ноздорму, есть свои странности. Но Оризму будет рад, если ты вернешь ему часы.', '', '', '', '', '', 'Отнесите карманные часы Оризму в сады.', 47187),
(66278, 'ruRU', 'Что одному дракониду мусор...', 'Отнесите карманные часы Грирмпеху в сады.', '<Среди гор хлама поблескивают карманные часы. Может быть, Грирмпех знает, что с ними делать.>', '', '', '', '', '', 'Отнесите карманные часы Грирмпеху в сады.', 47187),
(66270, 'ruRU', 'Гноллобой', 'Победите несостоявшихся вождей.', 'Свет милостивый... их все больше! Откуда они только берутся?\n\nТакой гениальный был план! Я так долго прятался в этом вонючем озере! Столько смертей подстроил!\n\nМой замысел должен был ввергнуть всю их общину в хаос, но мы их даже толком не задержали!\n\nМожет быть... может, ты и $gправ:права;, $n. Я с самого начала ошибался...\n\nНет! Не может такого быть! К тому же теперь уже поздно останавливаться.\n\nИди... разберись с новыми гноллами. А я пока еще немного подумаю.', '', '', '', '', '', '', 47187),
(66269, 'ruRU', 'Просто на всякий случай', 'Убейте $1oa |4шамана-буреклыка:шаманов-буреклыков:шаманов-буреклыков;.', 'Ты просто... убивай всех, у кого есть хоть капля таланта к магии. Или лидерских качеств. Или амбициозности.\n\nПросто доверься своему чутью.\n\nЧто? Чутье подсказывает тебе больше со мной не разговаривать? Ну что ты, |3-6($c)! Они же... явно затеяли что-то неладное!', '', '', '', '', '', '', 47187),
(66268, 'ruRU', 'На третий раз повезет', 'Убейте Кровавого Когтя.', 'Что? Еще один захватил власть? Свято место пусто не бывает... Но могли бы по крайней мере соблюсти траур и подождать из уважения к покойнику!\n\nЧто, они забыли про приличия? Про банальную вежливость? Про уважение к такому продуманному плану? Я даже графики нарисовал!\n\nРазберись с этим Кровавым Когтем. Мне надо собраться с мыслями.\n\nТолько, пожалуйста, без назойливых комментариев!', '', 'А этот как умудрился попасть в командиры?', 'Кровавый Коготь', '', '', '', 47187),
(66267, 'ruRU', 'Зоозащита', 'Освободите $1oa |4замученное животное:замученных животных:замученных животных;.', 'Мерзкие твари! Грабеж и убийства – еще ладно, но жестокое обращение с животными? Это уже перебор. \n\nГноллы расставляют ловушки и скармливают пойманных зверьков своим слюнявым гиенам. Освободи пушистых пленников и покажи этим бандитам, как маги заботятся о животных!\n\nКонечно, это этично! Двойные стандарты в свете моих недавних поступков?.. О чем ты? На что ты намекаешь?', '', '', '', '', '', '', 47187),
(66266, 'ruRU', 'Грязные дворняжки', 'Убейте $1oa |4гиену-матриарха:гиены-матриарха:гиен-матриархов; и $2oa |4гиену-дворнягу:гиены-дворняги:гиен-дворняг;.', 'Я больше не собираюсь терпеть гиен-дворняг, которых разводят эти гноллы! Они не только не понимают приличий – ты не поверишь, где они справляли при мне нужду – но и наверняка учуют меня даже сквозь великолепнейшую маскировку.\n\nОкажи цивилизованному миру услугу и избавь нас от них.', '', '', '', '', '', '', 47187),
(66265, 'ruRU', 'Кто следующий?', 'Убейте Зуболома.', 'Ага! Кажется, место предыдущего командира занял другой гнолл. Как я и ожидал. Да.\n\nДоверенный вице-вождь, который обеспечит преемственность власти – совершенно разумная идея. Надо всего лишь подложить им свинью побольше, и тогда весь их административный аппарат посыплется.\n\nА? Не пора ли мне задуматься? Считаешь, что я осудил гноллов слишком поспешно? Что за чепуха! Это же гноллы! \n\nДействуй! Скорее убей Зуболома. Куй железо, пока горячо, иначе они проведут выборы!', '', 'Куда одному гноллу столько гиен?', 'Зуболом', '', '', '', 47187),
(66264, 'ruRU', 'Нет оружия – нет проблем', 'Добудьте $1oa |4образец:образца:образцов; боевого снаряжения Костоглодов.', 'Там наверху оружие у каждого второго. Что меня, мягко говоря, напрягает. Избавим их от лишнего, и все успокоится. Или как минимум успокоятся мои нервы.\n\nЧто они без оружия-то будут делать? Нападут на тебя с голыми руками? Ха!', '', '', '', '', '', '', 47187),
(66263, 'ruRU', 'Прицельный подход', 'Убейте Раздирателя.', 'Отвратительные создания эти гноллы. Воняют, постоянно чешутся, над всеми смеются. Их тут уже целые толпы, и приток все не иссякает. Коси их мы, то есть ты, хоть целый день пачками, все равно ничего бы не добились. Но это нельзя так оставлять.\n\nНадо поразить змею прямо в сердце! Убей их вожака, и они оцепенеют от нерешительности и отчаяния. \n\nЗачем мы все это делаем? Как зачем? Это же гноллы! Какая еще тебе нужна причина?', '', 'Без обожаемого вожака у них никаких шансов.', 'Раздиратель', '', '', '', 47187),
(66262, 'ruRU', 'Очищение сточных вод', 'Очистите озеро от $1oa |4кучи:куч:куч; гниющих отбросов.', 'Первое и самое важное – надо вернуть мою оперативную базу! Но когда повсюду носятся разъяренные элементали, трудно пробиться на шаг вперед, не то, что к самой цели!\n\nЕстественно, всему виной проклятые гноллы.\n\nОни завалили озеро таким количеством отбросов, падали и Свет знает чего еще, что местные элементали начали сходить с ума.\n\nБудь другом, убери особенно омерзительный мусор, пока все не зашло слишком далеко. И, что самое главное, пока он безнадежно не замарал мне мантию!', '', '', '', '', '', '', 47187),
(66261, 'ruRU', 'Мелкая неудача', 'Доберитесь до Детри.', 'А, $gискатель:искательница; приключений! Как раз на такого хорошо вооруженного путника я и мечтал наткнуться.\n\nЯ забрел в такую глушь по важному делу Кирин-Тора, но стоило мне начать разбивать лагерь, как нагрянула толпа шелудивых гноллов.\n\nБолее того, в окрестностях их собралось просто невиданное количество. Столько гноллов могут угрожать всему Простору.\n\nНо не бойся, ибо у меня есть план! Найди меня в ближайшем озере, и я все объясню.', '', '', '', '', '', '', 47187),
(66259, 'ruRU', 'Буря дурных вестей', 'Явитесь с докладом к ханам Матре в Марукай.', 'Скорее, $n, надо сообщить ханам Матре, что случилось. Особенно о похищении Он\'ары.\n\nОтправляйся в Марукай прямо сейчас. Тебе придется идти в одиночку. Я сильно ударился при падении и только тебя задержу.\n\nНе волнуйся, я тебя догоню. Не жди!', '', '', '', '', '', '', 47187),
(66258, 'ruRU', 'Он\'ара! О нет!', 'Защищайте Боку, пока он пытается освободить Он\'ару.', 'Тот воин стихий едва сдерживает Он\'ару. Похоже, она нас не замечает.\n\nКак говорит хан Тигари, \"Даже легкое дуновение обрушит неустойчивый камень\". Если я пробью хотя бы небольшую брешь в этих чарах, Он\'ара сможет освободиться.\n\nОтвлеки стражников. У меня есть идея.', '', '', '', '', '', '', 47187),
(66257, 'ruRU', 'Птичье колдовство', 'Уничтожьте повозки нокхудов с помощью тотема Боку.', 'Существует легенда о том, что Он\'ара наделила копье нашего предка Маруука частью своей силы. Видимо, хан Балакар рассказал об этом воинам стихий.\n\nОни похитили магию у детей Он\'ары и отравили ее чарами бури, чтобы зарядить снаряды для баллисты. Зачем нокхудам понадобились такие орудия?\n\nДавай не будем дожидаться ответа. Сейчас они загружают эти стрелы бури в повозки. Возьми мои тотемы и помести на повозки с оружием. Моя магия ветра разнесет их в щепки.', '', '', '', '', '', '', 47187),
(66256, 'ruRU', 'Орлиные повадки', 'Освободите $1oa |4дитя:детей:детей; Он\'ары и убейте $2oa |4воина:воинов:воинов; стихий на подъеме Песни Ветра.', 'Мы узнали, для чего нокхудам нужны тотемы мистиков: с их помощью можно поймать детей Он\'ары. И хотя тотемы украдены нокхудами, этот гнусный замысел принадлежит воинам стихий.\n\nДети Он\'ары – это священные охуны, благословленные самой матерью ветров. Прошу, $n, если увидишь охунов в неволе, обязательно освободи! А если повстречаешь воинов стихий...\n\n<Боку замолкает, но на его лице читается суровая решимость.>', '', '', '', '', '', '', 47187),
(66254, 'ruRU', 'Пессимистичный мистик', 'Поместите усиливающие тотемы вокруг Боку.', 'Война? Драконы? Мне нужно установить связь с Он\'арой?\n\nНо я не могу. Я ее больше не слышу. Я всего лишь посвященный, а великая орлица, похоже, от меня отвернулась. Должно быть, я недостоин ее благословения...\n\n<Боку начинает копаться в своей сумке.>\n\nНаставница дала мне эти тотемы, когда я уходил служить сюда мистиком. Она сказала, что если я когда-нибудь усомнюсь в себе, то они придадут мне сил.\n\nПомоги их разместить, и я попробую воззвать к Он\'аре еще раз.', '', '', '', '', '', '', 47187),
(66252, 'ruRU', 'Отчет об обстановке', 'Вернитесь в Вальдраккен и доложите капитану Драйн.', 'Воины стихий разбиты, $n, так что угроза устранена. Скоро сюда прибудут наши подкрепления из Вальдраккена. Они займутся теми, кто остался. \n\nВозвращайся назад и доложи обо всем капитану Драйн. Она обязательно захочет узнать о ситуации с командиром Эраногом.\n\nЕще раз спасибо, $n. Спасибо за все.', '', '', '', '', '', '', 47187),
(66251, 'ruRU', 'Пожарная команда', 'Убейте Магмакогтя.', 'Командир Эраног предал нас и оставил крепость этому чудищу.\n\nЗнаю, ты и так уже много для меня $gсделал:сделала;, но я не справлюсь с этой тварью в таком состоянии.\n\nПрошу, окажи мне последнюю услугу. Врата Южной крепости не должны попасть в лапы воинов стихий.\n\nНадо убить их главаря!\n\n$n, сделай это.', '', 'Главарь воинов стихий, напавших на ворота Южной крепости.', 'Магмакоготь', '', '', '', 47187),
(66250, 'ruRU', 'Где вождь?', 'Сопроводите стража Веломира и осмотрите дозорную башню ворот Южной крепости.', '$n, это единственная часть крепости, которую мы еще не обыскали. Если мы и найдем командира Эранога, то только здесь.\n\n<Веломир бросает взгляд на ближайший дверной проем.>\n\nДавай узнаем, что нас там ждет.', '', '', '', '', '', '', 47187),
(66249, 'ruRU', 'Очищение небес', 'Получите управление осадным скорпионом и очистите небо от изначальных магмарожденных.', 'Ты правильно $gпоступил, что собрал:поступила, что собрала; копья и веревку. С ними мы покончим с тиранией воинов стихий в небе.\n\nПоднимись по ступеням, и выйдешь на платформу с осадными скорпионами. Если ты привяжешь к ним веревку, чтобы получилась тетива, и используешь копья вместо стрел, то сможешь сбивать драконов магмарожденных в небе!\n\nИзбавься от них, и мы сможем подняться по шпилю и продолжить поиски командира Эранога.', '', '', '', '', '', 'Встретьтесь со стражем Веломиром на дозорной башне у ворот Южной крепости.', 47187),
(66248, 'ruRU', 'Крепкие узлы', 'Соберите $1oa |4моток:мотка:мотков; тяжелой веревки.', 'На вид этот моток тяжелой веревки в хорошем состоянии. \n\nСтраж Веломир велел высматривать полезные материалы. Может быть, если раздобыть еще несколько мотков, он найдет им применение.', '', '', '', '', '', '', 47187),
(66247, 'ruRU', 'Подержанное оружие', 'Соберите $1oa |4копье:копья:копий; магмарожденных.', 'Копье неплохо сохранилось, если учитывать состояние его прошлого владельца.\n\nСтраж Веломир просил собирать полезные материалы. Возможно, стоит добыть побольше таких копий у магмарожденных.', '', '', '', '', '', '', 47187),
(66246, 'ruRU', 'Туман битвы', 'Поищите бойцов из отряда стража Веломира у ворот Южной крепости.', 'Воины стихий напали внезапно, без предупреждения. Наш отряд пытался найти командира Эранога, но враги не дали дойти до той стороны гарнизона.\n\nМой командир сержант Тагрик бился сразу с троими воинами стихий, а Каора, Микор и я сражались рядом с ним.\n\nИх крики – последнее, что я помню. Потом опустилась тьма. \n\nПожалуйста, |3-6($r), если увидишь кого-то из моего отряда, сообщи мне об их судьбе.', '', '', '', '', '', '', 47187),
(66245, 'ruRU', 'Память о павших', 'Соберите $1oa |4печатку:печатки:печаток; гарнизона Южной крепости.', 'Столько наших товарищей погибло.\n\nПрошу... собери их печатки, чтобы имена павших не были преданы забвению.', '', '', '', '', '', '', 47187),
(66244, 'ruRU', 'В Вальдраккен', 'Отправляйтесь в Вальдраккен и встретьтесь с Алекстразой Хранительницей жизни.', 'Благодаря тебе мы чудом избежали страшной катастрофы.\n\nНо нам нужно встретиться с остальными Аспектами и рассказать о том, что случилось.\n\nНайди меня у Престола Аспектов в Вальдраккене. У остальных должна быть информация о том, что затевают Рашагет и ее воины стихий.\n\nВ Тальдразус можно попасть, если отсюда отправиться на север и немного отклониться на восток. В полете открываются захватывающие виды, но постарайся сильно не задерживаться.', '', '', '', '', '', '', 47187),
(66242, 'ruRU', 'Управление погодой', 'Убейте $1oa |4скованную сущность бури:скованные сущности бури:скованных сущностей бури; и $2oa |4посвященного призывателя бури:посвященных призывателей бури:посвященных призывателей бури;.', 'Этот противоестественный шторм пропитан магией. Похоже, нокхуды искажают священную сущность подъема Песни Ветра и создают элементалей бури. Не каждый из них добивается нужного результата...\n\n<Боку указывает на тело нокхуда-посвященного, дымящееся от ожогов молнией.>\n\n$n, мы должны их остановить.', '', '', '', '', '', '', 47187),
(66241, 'ruRU', 'Слет в Тальдразусе', '', 'Пролетите через контрольные кольца, которыми отмечен маршрут.', '', '', '', '', '', '', 47187),
(66239, 'ruRU', 'Ползучая гниль', 'Встретьтесь с Бреной в торговом поселке.', '<Брена вертит в толстых лапах тотем Саблелапа.>\n\nСаблелап – просто пешка. Не он первоначальный источник гнили. Нужно найти его, пока гниль не расползлась дальше.\n\nБлижайшая клыкаррская деревня – торговый поселок сразу через мост отсюда до Искары.\n\nНадо проверить, как у них дела... и поскорее.', '', '', '', '', '', '', 47187),
(66237, 'ruRU', 'Мистические союзники', 'Поговорите с представителями города.', 'Наше прибытие не пройдет незамеченным.\n\nПозволь мне поговорить с ними, прежде чем войдем. Мы с некоторыми членами совета немного знакомы.\n\nОфициально представиться можно и после.', '', '', '', '', '', '', 47187),
(66236, 'ruRU', 'Ловушка для ветра', 'Встретьтесь с Боку на подъеме Песни Ветра.', 'Нокхуды собирают тотемы, воины стихий отлавливают охунов, а Он\'ара не отвечает на зов.\n\nНадо нарушить план нокхудов, каким бы он ни был. Вы с Боку должны отправиться на подъем Песни Ветра. Наши враги наверняка уже там.\n\nНачните поиски Он\'ары. Если ее дети в опасности, она наверняка поспешила им на выручку. Мы должны ей помочь. Мать ветров сильна, но я не знаю, на что способны воины стихий.', '', '', '', '', '', 'Встретьтесь с Боку на подъеме Песни Ветра.', 47187),
(66232, 'ruRU', 'Море смоет спесь', 'Соберите $1oa |4кристальную крупицу:кристальных крупицы:кристальных крупиц; на побережье горлоков.', 'Мы не против, если ты со своими друзьями погостишь у нас. Не то чтобы нас кто-то спрашивал, конечно. Но тогда окажи соседу услугу и захвати кристальных крупиц с родников. Они хорошо консервируют продукты. Иначе здесь было бы сложно хранить еду.\n\nКрупные горлоки с ног до головы покрыты этими крупицами – вот с них и собирай. Ты ведь поможешь?', '', '', '', '', '', '', 47187),
(66230, 'ruRU', 'Сомнительная просьба', 'Найдите \"журнал\" Алви и верните его Алви Стражу Дорог.', 'Тарасекки хватали все, что попадалось им в лапы, в том числе мой журнал разведки.\n\nЭти ящерицы-переростки десятками тащат всевозможные ценности и безделушки. Должны были припрятать где-то и мой журнал. Можешь поискать его, пока будешь пробираться по перевалу?\n\nИ вот еще что, $n... Если найдешь, не заглядывай внутрь. Там немного... личное.', '', '', '', '', '', '', 47187),
(66228, 'ruRU', 'Лагерь Антонидаса', 'Встретьтесь с Норико Незабывающей в лагере Антонидаса.', 'Кирин-Тор разбил главный лагерь к югу отсюда. Лагерь Антонидаса.\n\nНорико и Кадгар должны быть там. Они ищут искателей приключений в помощь Калесгосу, чтобы вновь активировать камень клятвы.\n\nЕсли хочешь помочь в нашей миссии, отправляйся туда.', '', '', '', '', '', 'Встретьтесь с Норико Незабывающей в лагере Антонидаса.', 47187),
(66227, 'ruRU', 'Продуктивная рыбалка', 'Поймайте $3oa |4синехвостую миногу:синехвостых миног:синехвостых миног; на месте рыбалки Кхури.', 'Еще одна пара рук! Мне нужна помощь, чтобы наловить рыбы и накормить семью.\n\nЭтих киринторцев очень беспокоят какие-то магические аномалии, чем бы они ни были.\n\nМожешь гостить у нас сколько хочешь, но взамен помоги нам с пропитанием!\n\nБери удочку и начинай рыбачить. Чем больше рук, тем легче дело!', '', '', '', '', '', '', 47187),
(66226, 'ruRU', 'Моральная поддержка', 'Спасите невинных существ от клана Нокхуд на стоянке горных порогов.', 'Пожалуйста, только не бей... \n\nА? Ты хочешь помочь? Спаси наших животных!\n\nКлан Нокхуд напал так неожиданно, что мы едва успели спастись сами! Я выжила только потому, что нырнула в озеро.\n\nНо нам пришлось бросить наших животных! Умоляю, спаси бедняжек. Кто знает, что сейчас с ними творят Нокхуд.', '', '', '', '', '', '', 47187),
(66225, 'ruRU', 'Утерянные тотемы', 'Добудьте $1oa |4набор тотемов:набора тотемов:наборов тотемов; у нокхудов на стоянке горных порогов.', 'Боку спрашивал, зачем я отправила всех своих мистиков на стоянку горных порогов.\n\nНикакого приказа не было. Балакар завел мистиков в ловушку, чтобы сокрушить клан Он\'ир.\n\nНо у него могла быть и другая причина. Нокхуды забирают тотемы мистиков – все, которые им удается достать. На этих тотемах лежит благословение самой Он\'ары.\n\nЯ не знаю, чего нокхуды этим добиваются, но я не позволю им присвоить дары великой орлицы. Постарайся вернуть как можно больше тотемов.', '', '', '', '', '', '', 47187),
(66224, 'ruRU', 'Мистические мистики', 'Встретьтесь с Боку и отправьтесь к стоянке горных порогов.', 'Прости, но мне не удалось связаться с Он\'арой. Просьбу ханам Матры должен выполнить кто-то другой.\n\nНесколько дней назад мои товарищи-мистики отправились на стоянку горных порогов по важному поручению от хана Тигари. Думаю, они все еще там.\n\nНайди меня на окраине города. Раз я не справился с задачей, то хотя бы укажу путь.', '', '', '', '', '', '', 47187),
(66223, 'ruRU', 'Можно его оставить?', 'Принесите Ниило $1oa |4ледяную рыбу:ледяных рыбы:ледяных рыб;. Рыбу можно купить у торговца в Искаре или наловить в океане с Драконьих островов.', 'Он пытается нас съесть только потому, что голодный! \n\nРыба! Кто же откажется от вкусной, холодненькой, сырой рыбы!\n\nЛедяная рыба вкуснее всего. Она водится по всему океану! Но если не поймаешь $gсам:сама;, Джинкутук из Искары тебе продаст. \n\nПринеси мне столько рыбы, чтобы накормить его досыта!', '', '', '', '', '', '', 47187),
(66222, 'ruRU', 'Затишье перед бурей', 'Передайте приказы Джеботая жителям Тиракая.', 'Нокхуды могучи, и у них много сторонников. Чтобы им противостоять, потребуются все наши силы.\n\nХанам Матра верит тебе, $n. Она приказала нам связаться с союзниками и приготовить народ к битве. \n\nМне нужна твоя помощь. Отыщи Ходжина и вели ему подготовить остальных кешиктенов. Предупреди разведчицу Кеньюг о возможных набегах нокхудов. Сообщи Агуре, что скоро к нему начнут поступать раненые, и вели Генсаю готовить для нас припасы.\n\nЧто касается мистиков, они недавно покинули это место. Я постараюсь узнать, не остался ли кто в Тиракае.', '', '', '', '', '', '', 47187),
(66221, 'ruRU', 'Только вперед!', 'Поговорите с Алекстразой у Престола Аспектов в Вальдраккене.', 'Мы восстановили бронзовый камень клятвы, и теперь Алекстраза может перейти к своему плану.\n\nОтправляйся в Вальдраккен, $n. Она захочет узнать о твоих успехах.', '', '', '', '', '', '', 47187),
(66218, 'ruRU', 'Удирающие разбойники', 'Найдите Ниило и Нау.', 'Еще раз здравствуй.\n\nМы с Норукком хотели тебя кое о чем попросить. Наши дети Ниило и Нау убежали играть. Они уже должны были вернуться, но их все нет. \n\nЯ сейчас ужасно занята. Сможешь их поискать? Эти двое умеют за себя постоять, так что вряд ли они угодили в переплет.', '', '', '', '', '', '', 47187),
(66217, 'ruRU', 'РАЗЫСКИВАЕТСЯ: Кроджек Береговой Охотник', 'Убейте Кроджека Берегового Охотника.', 'Мы уже много лет наблюдаем за великой акулой Кроджеком, поджидая самый удачный момент для охоты. \n\nВ последнее время он кормится все ближе и ближе к берегу. Значит, час настал. Собирай охотников и срази его!', '', 'Когда-то Береговой Охотник был важной частью местной природы, но теперь он преследует добычу слишком близко к Искаре.', 'Кроджек Береговой Охотник', '', '', '', 47187),
(66213, 'ruRU', 'Плетение истории', 'Расскажите старейшине Поа историю о рыбе.', 'Моя любимая жена Поа – отличная рассказчица. \n\nНо она рассказывает одни и те же истории тридцать лет подряд! Пожалуйста, |3-6($c), поговори с Поа и подай ей идею для новой истории.\n\nЧто-что? Твои приключения? Не смеши, кто захочет про это слушать! Самые лучшие истории – обязательно про рыбу. Расскажи ей такую, даже если придется ее выдумать!', '', '', '', '', '', '', 47187),
(66212, 'ruRU', 'Рыбная ловля: мелкокрылая рыба-пегас', 'Поймайте $1oa |4мелкокрылую рыбу-пегаса:мелкокрылых рыбы-пегаса:мелкокрылых рыб-пегасов; в океане у Драконьих островов.', 'Сейчас хоть КТО-НИБУДЬ умеет ловить рыбу КАК СЛЕДУЕТ?\n\n<Лукотурукк возмущенно шевелит усами.>\n\nЭй ты, чего кривишься? Давай-ка налови мне рыбы. Только ХОРОШЕЙ! А то еще вздумаешь принести мырзлов!', '', '', '', '', '', '', 47187),
(66211, 'ruRU', 'Лощина Бурошкуров: к истоку', 'Отправьтесь в лощину Бурошкуров и сразитесь с гниломагом Око Гнева.', 'Спасибо, что $gпомог:помогла; отбиться от Бурошкуров. Мы многим тебе обязаны. \n\nНо гноллы продолжают черпать силу для своей гнусной магии разложения из неизвестного источника в лощине Бурошкуров. Что еще хуже, от местных клыкарров уже несколько недель нет никаких вестей!\n\nБоюсь, там происходит что-то ужасное. Надо защитить наш дом. Прошу тебя, собери союзников, отыщи наших соплеменников и останови распространение гнили!', '', '', '', '', '', '', 47187),
(66210, 'ruRU', 'Семейная встреча', 'Добудьте $1oa |4траурное подношение:траурных подношения:траурных подношений; в Искаре и разложите их в погребальной лодке.', 'Твоему другу Калесгосу не терпится поговорить о силовых линиях, но сейчас нам надо готовиться к погребению. \n\nПока я беседую с ним, собери в Искаре траурные подношения и разложи их в погребальной лодке вокруг нашего дорогого Понольяка.\n\nМожешь заодно посмотреть город! Мой народ встретит тебя гостеприимно, особенно после помощи с Бурошкурами.', '', '', '', '', '', '', 47187),
(66201, 'ruRU', 'Копыта войны', 'Доставьте послание Ханам Матры кешиктену Джеботаю в Тиракай.', 'Балакар готовит силы к войне. Я поступлю так же, но нам нужно больше союзников.\n\nДраконы уже предлагали нам объединиться, так пусть помогут уравнять силы. Я собираюсь ответить на их зов, протрубив в Рог Друсала, но для этого нужно благословение Он\'ары. Поможешь установить с ней связь?\n\nОтправляйся в Тиракай и передай объявление войны моему помощнику Джеботаю. Он соберет наши силы и направит тебя к мистикам. Они помогут тебе отыскать Он\'ару.', '', '', '', '', '', 'Доставьте послание ханам Матры кешиктену Джеботаю в Тиракай.', 47187),
(66196, 'ruRU', 'Утенок в беде', 'Отнесите утенка в пузыре обратно в лагерь экологов.', '<Утенок не переставая мечется в пузыре, в ужасе крякая.>\n\n<Может быть, экологи смогут ему помочь?>', '', '', '', '', '', 'Отнесите утенка в пузыре обратно в лагерь экологов.', 47187),
(66187, 'ruRU', 'Безумный Мордиган и Король Кристаллов', 'Освободите Мордигана Стальной Рот от кристаллов на побережье горлоков.', 'Я осмотрела все вокруг. Почти уверена, что Мордиган в этой пещере.\n\n<Изнутри доносятся приглушенные ругательства и оскорбления.>\n\nОн точно в этой пещере.\n\nЛУ-СИ сказала, что от кристаллов быстро наступает критическое обезвоживание. Постарайся отодрать от него эти... геологические находки. Только не причиняй тяжкого вреда здоровью.\n\nОн все-таки уважаемый ученый в своей области.', '', '', '', '', '', 'Поговорите с Эльнарой.', 47187),
(66177, 'ruRU', 'Дворфы – наше все!', 'Идите по следу Мордигана Стальной Рот на побережье горлоков.', 'Содержание соли зашкаливает! Надо найти Мордигана и вернуть его в лагерь. Обезвоживание может убить его. \n\nОн ушел всего пару часов назад. Попробуй разведать, в какую сторону направился этот старый ворчун!', '', '', '', '', '', 'Найдите Эльнару на побережье горлоков.', 47187),
(66176, 'ruRU', 'Эксперименты над стихиями', 'Проведите $1oa |4эксперимент:эксперимента:экспериментов; над элементалями на побережье горлоков.', 'Проведи эксперименты над элементалями воды, донимающими горлоков!', '', '', '', '', '', 'Прекрасно!', 47187),
(66175, 'ruRU', 'Полевой эксперимент', 'Помогите ЛУ-СИ провести тесты в Прибежище Китобоя.', 'Благодаря тебе эффективность нашей геологоразведки составила 96%! \n\n<ЛУ-СИ хмурится.>\n\nТо есть позорно низко.\n\nПомоги мне прогнать собранные образцы через \"Геосканер 289-07\". Он даст более ясную оценку тому, что происходит на плато.', '', '', '', '', '', 'Поговорите с ЛУ-СИ Скрипозубчик в Прибежище Китобоя.', 47187),
(66169, 'ruRU', 'Возмездие подают горячим', 'Убейте $1oa |4магмарожденного:магмарожденных:магмарожденных; у ворот Южной крепости.', 'Воины стихий застали нас врасплох.\n\n<Веломир с омерзением сплевывает.>\n\nДругих стражников эти чудовища разорвали на части. Я бы тоже сейчас с тобой не разговаривал, если бы ты не $gподоспел:подоспела; вовремя.\n\nЯ все еще слышу далекие звуки битвы. Кто-то мог выжить, даже командир Эраног.\n\nМне нужна твоя помощь. Отвлеки их как-нибудь, пока я буду подбираться ближе.\n\nУбить несколько этих \"магмарожденных\" – идеальный вариант.', '', '', '', '', '', '', 47187),
(66167, 'ruRU', 'На южной стороне', 'Отправляйтесь в гарнизон Южной крепости.', 'Судя по добытым тобой сведениям, воины стихий могут в любой момент напасть на гарнизон Эранога в Южной крепости. Если уже не напали. Но чешуекляты не могут покинуть город, оставив его без защиты. Именно на это враг и надеется.\n\nМне снова понадобится твоя помощь, $n. \n\nОтправляйся к Южной крепости и разведай, какие силы выставили воины стихий. Если удастся, свяжись с защитниками гарнизона.', '', '', '', '', '', '', 47187),
(66166, 'ruRU', 'Глаза и уши', 'Поищите зацепки в Вальдраккене.', 'Воины стихий отравляют пропагандой умы жителей Вальдраккена. \n\nНашим врагам хватает хитрости придерживать язык в присутствии чешуеклятов, но ты сможешь подобраться поближе и подслушать их разговоры в поисках ценной информации.\n\nЯ отметила на твоей карте подозрительные точки сбора. \n\nВозьми этот зачарованный камень. Через него мы сможем общаться друг с другом.\n\n$gГотов:Готова; приступать?', '', '', '', '', '', '', 47187),
(66164, 'ruRU', 'Рыбные паль... палочки', 'Добудьте $1oa |4украденную деталь:украденных детали:украденных деталей; на побережье горлоков.', 'Раз Мордиган кончил лизать камни, мы можем заняться главной проблемой...\n\nЭти зловредные рыболюди растащили все мои запчасти!\n\nТолько мы вошли в этот унылый угол, и пожалуйста! Горлоки из каждой щели полезли. Роу орет, Эльнара бесится, а я ношусь со своим ключом туда-сюда как полоумная! \n\nВерни мне хоть немного запчастей – может, еще удастся что-то спасти!', '', '', '', '', '', '', 47187),
(66163, 'ruRU', 'Негде спрятаться', 'Убейте $2oa |4шпиона:шпионов:шпионов; воинов стихий в Вальдраккене.', 'Добро пожаловать в Вальдраккен, |3-6($r)! \nВ городе в последнее время все жарче и жарче, причем я не о погоде.\n\nВоины стихий шныряют повсюду и сеют недовольство среди горожан.\n\nНаши враги изобретательны. Они маскируются под жителей города, чтобы скрыться от чешуеклятов. Но избегать стражи-то они научились, а вот тебя вряд ли в чем-то заподозрят.\n\nВозьми самоцвет драконьего ока. С ним их маскировка тебя не обманет.\n\nВперед. Сорви маски с лазутчиков и убей их!', '', '', '', '', '', '', 47187),
(66159, 'ruRU', 'Страшное послание', 'Поговорите с Алекстразой у Престола Аспектов в Вальдраккене.', 'Калесгос отказывался рассказывать о событиях в Лазурном Просторе до твоего прихода.\n\nЯ чувствую, одно: это не сулит ничего хорошего, $n.', '', '', '', '', '', '', 47187),
(66156, 'ruRU', 'Известность в Драконьей экспедиции', 'Поговорите с каталогизатором Джейкс в лагере Драконьей экспедиции.', 'Твои свершения не прошли незамеченными, и ты снова $gдоказал:доказала;, что не зря считаешься $gзнаменитым исследователем:знаменитой исследовательницей;!\n\nВозвращайся в лагерь Драконьей экспедиции. Я приготовила припасы, которые помогут тебе продолжать исследования.', '', '', '', '', '', '', 47187),
(66155, 'ruRU', 'Прогулка Рурика по речным стремнинам', 'Проплывите на \"Речном страннике\" по реке.', 'Странно, что мой брат согласился... но в любом случае удачно. \n\nВремя пришло! Посмотрим на плоды нашего тяжелого труда!\n\nВзойди вместе со мной на борт \"Речного странника\", $n. Мы помчимся вниз по реке и наловим по дороге рыбы для Искары!', '', '', '', '', '', '', 47187),
(66154, 'ruRU', 'Соблазнительные образцы', 'Соберите $1oa |4образец:образца:образцов; слюны на побережье горлоков.', '<Тощий Отрекшийся сжимает двумя пальцами переносицу и тяжело вздыхает.>\n\nПредставляю, что теперь напишут в моем личном деле. Всего за один день мы умудрились поднять на уши местных горлоков, остались без половины оборудования и потеряли одного дворфа. \n\nВ такой ситуации регламент предписывает максимизировать усилия. Иди прибей парочку наших зубастых врагов и заодно принеси мне их слюну для дальнейших опытов.\n\nИ смотри, чтобы была хорошего качества.', '', '', '', '', '', '', 47187),
(66152, 'ruRU', 'Некуда идти', 'Встретьтесь с Гарзом в Затерянном лагере.', 'Мы не можем остаться здесь.\n\nНе знаю, что нам делать... куда податься...\n\nМы вернемся в ваш Затерянный лагерь. Надо рассказать клыкаррам, что случилось с кланом Рыжей Иглы.\n\nЕсли мы расскажем свою историю и будем ее помнить, возможно, она больше не повторится...', '', '', '', '', '', '', 47187),
(66151, 'ruRU', 'Его каменное сердце', 'Убейте Камнесерда.', 'Мы воем от горя, оплакивая вождя. Но он еще жив.\n\nЖалкая тень Камнесерда скрывается в пещере впереди. Многие пытались его образумить. \n\nОн убил их и чуть не погубил Нарна.\n\nОн чудовище! Этого и хотят воины стихий. Подчинить нас, превратив в пламя и камень.\n\nОн больше не фурболг Рыжей Иглы. Его надо уничтожить, пока остальные не разделили его судьбу.', '', 'Дар воинов стихий превратил тело вождя Рыжей Иглы в камень.', 'Камнесерд', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66150, 'ruRU', 'Спасение Радзы', 'Спасите Радзу Громокоготь.', 'Радза Громокоготь – наша духовная хранительница. Она помнит ход истории. Следит за соблюдением традиций.\n\nЗамыслы воинов стихий во всем противоречат идеалам клана. Я знал, что она выступит против Камнесерда! \n\nОн готов на все, чтобы ее сломить. Без ее благословения вождь – пустое имя!\n\nНарн говорит, что ее истязает страж вождя Харгалл Пять Клыков. Если Радза погибнет, не станет и нашего клана.\n\nСпаси ее, $n, но будь $gготов:готова;: он не отпустит ее без боя.', '', '', '', '', '', 'Встретьтесь с Радзой Громокоготь в пещере клана Рыжей Иглы.', 47187),
(66149, 'ruRU', 'Влияние стихий', 'Уничтожьте $1oa |4тотем:тотема:тотемов; оков земли воинов стихий, а затем встретьтесь с Нарном в пещере клана Рыжей Иглы.', 'Нарн говорит, что не все фурболги Рыжей Иглы последовали за Камнесердом и воинами стихий.\n\nНекоторых бунтарей удерживают против воли. Их сковывают тотемы, извергающие камни и грязь... пока жертва не подчинится. \n\nРасколи тотемы. Освободи несчастных!', '', '', '', '', '', 'Встретьтесь с Нарном в пещере клана Рыжей Иглы.', 47187),
(66148, 'ruRU', 'Бывшие сородичи-фурболги', 'Убейте $1oa |4фурболга и элементаля:фурболгов и элементалей:фурболгов и элементалей; из клана Рыжей Иглы, а затем встретьтесь с Нарном в глубине пещеры клана Рыжей Иглы.', 'Однажды пришли воины стихий. Они предложили новую силу: власть над стихиями.\n\nЯ не думал, что Камнесерд примет их дары. Клану не нужна была сила. А он и не подумал о цене.\n\nЕго страшную ошибку уже не исправить. Магия осквернила мой клан... как гниль поражает корни деревьев.\n\nМое сердце разрывается от боли, но оскверненных фурболгов надо убить. Это единственный выход.', '', '', '', '', '', 'Встретьтесь с Нарном в пещере клана Рыжей Иглы.', 47187),
(66147, 'ruRU', 'Кристаллы в воде', 'Соберите $1oa |4образец:образца:образцов; кристаллов на побережье горлоков.', 'По нам сейчас не очень заметно, но вообще мы профессионалы. Экспедиция поручила нам отыскать залежи редких кристаллов. Своего рода геологическая разведка.\n\nЯ все никак не могу оправиться от нападения горлоков. Будь другом, поищи эти кристаллы пока без меня. И принеси образцы, если найдешь.', '', '', '', '', '', '', 47187),
(66141, 'ruRU', 'Нарушенные традиции, искалеченные тела', 'Встретьтесь с Гарзом и Нарном по дороге к пещере клана Рыжей Иглы.', 'Мои братья-фурболги потеряли разум. Они творят... страшные вещи. И сами стали чудовищами.\n\nФурболги никогда не убивали фурболгов!\n\nМы с братом сбежали. Он ждет у пещеры клана. Я ищу помощь здесь.\n\nПомоги нам, пока хоть кого-то можно спасти!', '', '', '', '', '', '', 47187),
(66139, 'ruRU', 'Долгожданный огонь', 'Одолейте неистовое пламя в садах с помощью концентрированной сущности воды.', 'Итак, дитя, я поместил сущности элементалей воды в эту банку.\n\nПросто брось ее в здоровенного элементаля огня. Вода тушит огонь – закон природы. Чего уж проще.\n\nОт жара, кхм, у меня болят суставы, поэтому я останусь здесь. Ты ведь и $gсам:сама; справишься.\n \nУдачи, дитя!', '', '', '', '', '', '', 47187),
(66138, 'ruRU', 'Как песок в часах', 'Соберите в садах $1oa |4горку:горки:горок; песка времени.', 'Песочные часы Ноздорму пострадали от нашествия элементалей не меньше всего остального. Бурные элементали ветра промчались мимо и раскидали магический песок, засыпанный внутрь.\n\nБез этого песка магия Ноздорму в садах намного ослабеет.\n\nКак младшему смотрителю, мне поручили охранять песочные часы денно и нощно. Если поможешь мне собрать песок, я буду вечно тебе благодарен.', '', '', '', '', '', '', 47187),
(66137, 'ruRU', 'Бунт', 'Уничтожьте $1oa |4разрастающийся смертоцвет:разрастающихся смертоцвета:разрастающихся смертоцветов; и |4плеточного травлинга:плеточных травлингов:плеточных травлингов; в садах.', 'Вряд ли одни стручлинги так разбушевались.\n\nС деревом Алекстразы всегда было полно мороки. Ее магия жизни притягивает все растения и животных без разбору, что полезные, что вредные. А кому потом с вредными разбираться? Правильно, старику Грирмпеху!\n\nВидят Аспекты, я уже слишком стар для таких упражнений.\n\nУ смотрителей нет боевой подготовки, поэтому выпалывать сорняки Хранительницы жизни придется тебе.', '', '', '', '', '', '', 47187),
(66136, 'ruRU', 'Настой стихий', 'Соберите $1a |4водную сущность:водных сущности:водных сущностей; в садах.', 'Огромный элементаль огня несколько дней назад уничтожил пруд. Скорее всего, он и устроил этот бардак. Но на такую громадину в лоб не попрешь. Надо как-то его ослабить.\n\nНо не сбрасывай со счетов старого Грирмпеха. У меня есть план!\n\nБеседку синих драконов облюбовали элементали воды. Если ты соберешь их сущности, мы применим магию врагов против них самих.\n\nКак говорится, огонь против огня. В данном случае вода против огня...\n\nВ общем, выдвигайся.', '', '', '', '', '', '', 47187),
(66135, 'ruRU', 'Подмастерье садовника', 'Расчистите кучи мусора в сарае и поищите лорда Бэзилтона.', 'Бэзилтон! Лорд Бэзилтон, где ты?\n\nУ меня пропал лорд Бэзилтон, мой ассистент и подмастерье. Он любит бродить по далеким уголкам садов, но защищается еще хуже меня. Я садовник, а не воин!\n\nНе поищешь этого бездельника? С ним мне легче думается. Обычно он валяется в сарае и роется в мусоре.\n\nТолько осторожней. Незнакомцев он так и норовит уколоть.', '', '', '', '', '', '', 47187),
(66134, 'ruRU', 'Дезинсекторы Азерота', 'Убейте $1oa |4взволнованный росток:взволнованных ростка:взволнованных ростков; в садах.', 'Эй! Молодежь!\n\nНе подсобишь? Стручлинги перетоптали все мои растения!\n\nСады кишат элементалями, а они... странно влияют на природу. Со стручлингами и так сладить непросто, но энергия элементалей будто и вовсе свела их с ума!\n\nЭти трое меня совсем доконали. Пожалуйста! Помоги, пока они не переломали мне все клумбы.', '', '', '', '', '', '', 47187),
(66133, 'ruRU', 'Ключи преданности', 'Найдите $1oa |4большой обсидиановый ключ:больших обсидиановых ключа:больших обсидиановых ключей;.', '', '', '', '', '', '', 'Верните собранный ключ в цитадель черных драконов.', 47187),
(66131, 'ruRU', 'Ключ к нашему прошлому', 'Найдите $1oa |4собранный ключ:собранных ключа:собранных ключей;.', 'Принеси мне собранный ключ', '', '', '', '', '', 'Верните собранный ключ любой фракции в цитадели черных драконов', 47187),
(66130, 'ruRU', 'Ключ к нашему прошлому', 'Найдите $1oa |4собранный ключ:собранных ключа:собранных ключей;.', 'Принеси мне собранный ключ', '', '', '', '', '', 'Верните собранный ключ любой фракции в цитадели черных драконов', 47187),
(66129, 'ruRU', 'Ключ к нашему прошлому', 'Найдите $1oa |4собранный ключ:собранных ключа:собранных ключей;.', 'Принеси мне собранный ключ', '', '', '', '', '', 'Верните собранный ключ любой фракции в Обсидиановой цитадели.', 47187),
(66126, 'ruRU', 'Ключ к нашему прошлому', 'Найдите $1oa |4собранный ключ:собранных ключа:собранных ключей;.', 'Принеси мне собранный ключ', '', '', '', '', '', 'Верните собранный ключ любой фракции в Обсидиановой цитадели.', 47187),
(66124, 'ruRU', 'Уход под аплодисменты', 'Сбегите из Анклава Морозной Вспышки вместе с мажордомом Селистрой.', 'По моим сведениям, королева отступила в Дикое гнездовье – аванпост, с которого ведут наблюдение за протодраконами... могу только надеяться, что его гарнизона хватит для ее защиты.\n\nВыступаем туда немедленно!', '', '', '', '', '', '', 47187),
(66123, 'ruRU', 'Обрубить голову', 'Победите Джадзигет в Анклаве Морозной Вспышки.', 'Джадзигет, одна из бесчестных командиров Рашагет, командует силами воинов стихий в этих краях.\n\nДавай покажем им, что бывает с теми, кто встает у нас на пути.', '', 'Если ее не остановить, эта помощница Рашагет доставит массу неприятностей.', 'Джадзигет', '', '', '', 47187),
(66122, 'ruRU', 'Прото-драка', 'Победите $2oa |4протодракона:протодраконов:протодраконов; в Анклаве Морозной Вспышки.', 'Эти протодраконы ненавидят нас. Они считают нас извращенным подобием драконов – жалкими рабами, доверившимися титанам. Они не понимают, с кем связались.\n\nПотому-то и не боятся, даже когда атакуют наши стены. \n\nА зря.\n\nВозьми это копье, $p. Убей наших врагов.', '', '', '', '', '', 'Встретьтесь с мажордомом Селистрой в Анклаве Морозной Вспышки.', 47187),
(66121, 'ruRU', 'Эвакуация яиц', 'Спасите 4 яйца из Анклава Морозной Вспышки.', 'Воины стихий выкрали яйца и проводят над ними свои грязные ритуалы! Это не должно продолжаться.\n\nПомоги нам вернуть яйца, пока не поздно. Найди и отметь их, $p. Мы постараемся осторожно вынести их в убежище.', '', '', '', '', '', 'Встретьтесь с мажордомом Селистрой в Анклаве Морозной Вспышки.', 47187),
(66119, 'ruRU', 'Рубиновые Омуты Жизни: вторжение воинов стихий', 'Отправьтесь в Рубиновые Омуты Жизни и остановите нападение воинов стихий.', 'Воины стихий вторглись в наш дом. Мы не были готовы к такому натиску, и некоторым из них удалось прорваться.\n\nОдин из наших драконидов отправился за ними, но вестей от него так и нет. Я опасаюсь худшего.\n\nЯ останусь на страже. Пока мы живы, никто больше не проникнет за эти стены. Но ты $gдолжен:должна; остановить тех, кто ворвался внутрь.\n\nВперед!', '', '', '', '', '', '', 47187),
(66118, 'ruRU', 'Каменная атака', 'Уничтожьте $1oa |4разъяренный утес:разъяренных утеса:разъяренных утесов; в Натиске Морозной Вспышки.', 'Рашагет и воины стихий призвали гигантских элементалей земли, чтобы проломить стены. Их нужно остановить!', '', '', '', '', '', '', 47187),
(66117, 'ruRU', 'Зачистка поля боя', '', '', '', '', '', '', '', '', 47187),
(66116, 'ruRU', 'Основная угроза', 'Найдите командира Летанака в Натиске Морозной Вспышки.', 'Многие яйца все еще остаются без защиты. Если враги прорвутся, все пропало!\n\nНаша стража должна сейчас собираться на поле, чтобы отбросить их. Поговори с командиром Летанаком: он пошлет тебя на помощь туда, где это нужнее всего.', '', '', '', '', '', '', 47187),
(66115, 'ruRU', 'Обязанности красных драконов', 'Поговорите с хранителями в Рубиновом святилище Жизни.', 'Самое главное для нас – сострадание и забота. Помогая другим семействам, мы поддерживаем не только их, но и всех драконов мира.\n\nПоговори с драконоидами в Рубиновом святилище Жизни. Возможно, они помогут тебе нас понять.', '', '', '', '', '', '', 47187),
(66114, 'ruRU', 'Ради блага королевы', 'Отправляйтесь к Рубиновому святилищу Жизни с мажордомом Селистрой.', 'Мы бережем яйца ради будущего всех драконьих родов. Воины стихий сулят нам не просто боль и мучения. \n\nОни стремятся уничтожить драконов раз и навсегда.\n\nНадо немедленно сообщить королеве.', '', '', '', '', '', '', 47187),
(66112, 'ruRU', 'Работа кипит', 'Добудьте изначальное земляное ядро и изначальное расплавленное ядро.', 'Ты $gвидел:видела; когда-нибудь таких могучих элементалей?!\n\n<Грун издает радостное восклицание.>\n\nЯ только и слышу от стражников, как им надоело с ними сражаться. Но надо смотреть шире... Чем больше элементали, тем больше материалы!\n\nПока будешь убивать элементалей ради нашей безопасности и так далее, собирай части самых крупных. А я придумаю, что из них смастерить!', '', '', '', '', '', '', 47187),
(66111, 'ruRU', 'Вторжение элементалей', 'Убейте $1oa |4элементаля:элементалей:элементалей; в посольстве Крылатого Приюта.', 'Мастера, ремесленники и исследователи Драконьей экспедиции не выдержат тягот борьбы.\n\nА вот мы с тобой – другое дело, $p.\n\nНа Драконьих островах мы должны защитить тех, кто не может защитить себя сам.\n\nОтгони элементалей, наступающих с севера, чтобы экспедиция не отвлекалась на повседневные заботы.', '', '', '', '', '', '', 47187),
(66110, 'ruRU', 'Попробуем мирный подход', 'Представьтесь посланникам от Альянса.', 'Ака\'Магош, $p.\n\nЭта экспедиция проходит при содействии и Орды, и Альянса. Мы получили четкие распоряжения: помогать всем участникам Драконьей экспедиции, невзирая на фракции.\n\nПредставители Альянса, капитан Гэррик и ее сын Генри, стоят на страже на другой стороне лагеря.\n\nМы с капитаном вместе боролись против Плети. Она высоко ставит честь и станет ценным членом команды.\n\nИди и предложи ей помощь. Покажи, что Орда уважает договоренности.', '', '', '', '', '', 'Поговорите с капитаном Гэррик в посольстве Крылатого Приюта.', 47187),
(66108, 'ruRU', 'Кувалда – это выход', 'Убейте Соггмлоггла, короля мокроротов, и Уирглгургла, короля ветрожабров.', 'Я рад, что Тару наконец меня понял. Но все равно я должен сказать ему спасибо, что он отправил тебя спасать животных, пока я даром терял время.\n\nИх положение намного хуже, чем мы оценивали. Хорошо, что он не стал сидеть сложа руки. Судя по нашим данным, этот природный обстрел так и будет продолжаться, пока мы не остановим горлоков.\n\nНа месте Тару с его практическим мышлением я бы начал сразу с их вожаков. Если их станет некому объединять, горлоки растеряют боевой пыл и больше не будут угрожать болотам.', '', '', '', '', '', '', 47187),
(66107, 'ruRU', 'Спасение диких зверей', 'Спасите диких зверей на Беспокойных болотах.', 'Болота переживают не лучшие времена, тут и экологом быть не надо.\n\nНо из-за Исхи мы только и делаем, что копаемся в трупах здешних зверей, хотя в первую очередь должны спасать их от смерти! Красные драконы должны защищать все живое, а не возиться с тем, что уже мертво!\n\nЯ уважаю Исху и признаю его талант, но, если он не перестанет тратить время на ерунду, на болотах будет уже нечего спасать. \n\nЯ попробую ему это втолковать, а ты возьмись за дело – пройдись по болотам и спаси кого-нибудь.', '', '', '', '', '', '', 47187),
(66106, 'ruRU', 'Не прячься в панцире', 'Добудьте $1oa |4раковину, полную энергии воды:раковины, полные энергии воды:раковин, полных энергии воды;, и $1oa |4раковину, полную энергии ветра:раковины, полные энергии ветра:раковин, полных энергии ветра;, у горлоков-мокроротов и горлоков-ветрожабров.', 'Зря я не поверил Исхе, когда он утверждал, что тут не все так просто. Он всегда на два шага впереди меня, потому я и беру его в напарники.\n\nПомоги мне искупить вину. Перейдя к действиям, конечно же. Если стихии разбушевались от ракушек, почему бы тебе не пойти в лагерь горлоков и не вырвать их прямо из мерзких скользких лап?\n\nПринеси сюда по груде ракушек ветра и воды – достаточно, чтобы Исха мог изучать их сколько душе угодно.', '', '', '', '', '', '', 47187),
(66105, 'ruRU', 'Скальпель – это выход', 'Уничтожьте $1oa |4буйную воду:буйные воды:буйных вод; и $1oa |4буйный ветер:буйных ветра:буйных ветров;.', 'Мне кажется, мы получаем здесь достаточно данных, но... \n\nТару – потрясающий эколог, и он уверен, что необходимо переходить к активным действиям. Но местная экосистема очень хрупкая, и любая неосторожность может все испортить. Правда, времени у нас мало, тут я соглашусь. \n\nВозможно, имеет смысл пойти ему на уступки. Но не сильно.\n\nЕсли ты сократишь число беснующихся элементалей, то подаришь нам время и не помешаешь исследованиям. Только убивай их поровну – мы не хотим еще сильнее нарушить баланс местной природы.', '', '', '', '', '', '', 47187),
(66104, 'ruRU', 'Детективная экология', 'Проведите вскрытие трупов горлоков.', 'Я не знаю, что и делать, $n. Мы с Тару разделались почти со всеми кадаврами и вдруг оказались в тупике, потому что не можем решить, чья методика лучше. Ну почему он совсем меня не слушает?!\n\n<Эколог Исха вздыхает.>\n\nМы оба ужасно нервничаем, вот и срываемся друг на друга. Я даже еще не остановился на вероятной теории.\n\nВижу, у тебя крепкие нервы. Не поможешь нам с последними двумя горлоками? Можешь одолжить у меня скальпель.', '', '', '', '', '', '', 47187),
(66103, 'ruRU', 'Боевое рвение', 'Испытайте $1oa |4убийцу:убийц:убийц; и |4мстителя:мстителей:мстителей; Черного Когтя в Обсидиановом бастионе.', 'Чтобы защитить Обсидиановую цитадель, нам нужны дополнительные войска. Позицию мы закрепили, и теперь нам требуются новые умы и свежая кровь.\n\nВ Обсидиановом бастионе есть резервные силы, которые пополнят наши ряды.\n\nОни хорошо обучены, но было бы неплохо проверить их навыки в бою с таким умелым и опытным противником, как ты. Мы должны убедиться, что они готовы.', '', '', '', '', '', 'Встретьтесь с Фао Неутомимым в Обсидиановом бастионе.', 47187),
(66101, 'ruRU', 'С большой высоты', 'Поднимитесь в небо на диске геодезиста и разведайте местность.', 'Тодди и Налейдее срочно нужен доклад об окружающей местности.\n\nК счастью, я как раз раздобыл зачарованный телескоп и диск геодезиста. С ними можно безопасно исследовать окрестности с высоты птичьего полета.\n\nК несчастью, я ужасно боюсь высоты и не могу даже ступить на этот агрегат.\n\nНо ты ведь не боишься?', '', '', '', '', '', '', 47187),
(66100, 'ruRU', 'Поставки на вес', 'Соберите $1oa |4сумку:сумки:сумок; с припасами Стражей Дорог.', 'Надо же было так напортачить... Я отошла от лагеря всего на мгновение, а когда вернулась, лишь успела заметить, как тарасекки уносят отсюда все, что не прикручено к земле.\n\nПрипасы были недешевые, а попросить новые я не могу! Моя сестра Нори и так думает, что я ничего не умею.\n\nЕсли ты точно будешь проходить через долину, поищи-ка по пути странно лежащие сумки с припасами.', '', '', '', '', '', '', 47187),
(66087, 'ruRU', 'Время исчерпано', 'Помогите Дозорным Времени, убивая затерянных во времени противников, усиливая бронзовых союзников, возвращая утраченные артефакты и закрывая разрывы во времени в Зыбучих песках.', 'Эти вторжения увеличивают нагрузку на нашу временную линию до предела. Если б только у нас было больше обученных Дозорных Времени!\n\nХотя посох – новый для тебя инструмент, мне сказали, что ты уже здорово нам помогаешь. Думаю, ты $gсмог:смогла; бы совершить гораздо больше.\n\nВ обычной ситуации я бы провел полный инструктаж, но сейчас... времена непростые. Возьми этот свиток углубленных знаний и с его помощью дай отпор захватчикам! Только поспеши, потому что действует он временно.', '', '', '', '', '', '', 47187),
(66085, 'ruRU', 'Повернуть бы время вспять', 'Закройте разрывы во времени в Зыбучих песках вместе с Сиазератель.', 'Настоящий Дозорный Времени всегда устраняет аномалии до конца. Зачем ждать и наблюдать, когда у нас уже есть решение?\n\nУ тебя есть мой посох, и мне удалось найти запасной вариант. Думаю, никто его не хватится. Так что план такой: мы с тобой можем объединить усилия, чтобы со временем закрыть все разрывы. И тогда все будет в порядке... со всем временем. Что-то я немного путаюсь в этих временах.\n\nНу так что? Ничего сложного, правда?', '', '', '', '', '', '', 47187),
(66084, 'ruRU', 'В такие времена', 'Добудьте $1oa |4частицу:частицы:частиц; осадка времени у затерянных во времени противников в Зыбучих песках.', 'Несмотря на тот небольшой инцидент на тренировке, я думаю, ты $gготов:готова; нам помогать.\n\nИз-за временных искажений в долине некоторые временные периоды начали накладываться на наш. Мы пока не знаем, как и почему они оказались связаны, и это пугает. Нужно больше данных.\n\nВыясни что-нибудь о существах, попавших сюда из другого времени. Их переход через временные линии должен был оставить отпечаток. Надеюсь, если мы их изучим, то поймем, как предотвратить более серьезные нарушения.', '', '', '', '', '', '', 47187),
(66083, 'ruRU', 'Как будто в первый раз', 'Поговорите с Андантенорму и пройдите обучение Дозорного Времени.', 'Регулирование линий времени – очень опасная работа.\n\nТы не Дозорный Времени, но посол Хронорму верит, что ты отлично справишься. Но для твоей же безопасности тебе потребуется пройти обучение.\n\nПравда, наставников сейчас среди нас нет, так что я попытаюсь взять эту задачу на себя. Любопытно, как мы оба справимся. Я знаю, что посол Хронорму на нас рассчитывает.', '', '', '', '', '', '', 47187),
(66082, 'ruRU', 'Время в бутылке', 'Добудьте энергию времени у заряженных временем животных в Текущих лесах Тальдразуса.', 'Отлично! Посох Дозорного Времени не пострадал! Правда, в нем не осталось ни капли магии.\n\nУ меня идея! Ты можешь зарядить его, собрав темпоральную энергию, которая накопилась в животных вокруг. К сожалению, для этого их надо убить. Но от них в любом случае пришлось бы избавиться – из-за этой энергии они стали слишком опасными и непредсказуемыми... \n\nИногда для благих целей нужно идти на жертвы. Поможешь мне с этим? Сама я пока не в состоянии.', '', '', '', '', '', '', 47187),
(66081, 'ruRU', 'Время на исходе', 'Добудьте $1oa |4временной накопитель:временных накопителя:временных накопителей; в Текущих лесах Тальдразуса.', 'Когда на Бронзовый Храм напали, темпоральная энергия стала просачиваться наружу и распространяться вокруг.\n\nЧтобы ее собрать, Дозорные Времени по всему лесу установили накопители. Дополнительная энергия нам очень пригодится! А то наши ресурсы совсем истощены.\n\nЯ должна была забрать эти накопители, но сейчас мне очень нужна небольшая передышка.\n\nТы не $gмог:могла; бы этим заняться?', '', '', '', '', '', '', 47187),
(66080, 'ruRU', 'Временные затруднения', 'Найдите пропавшего новобранца в Текущих лесах Тальдразуса.', 'Здравствуй, |3-6($c). Ты вовремя!\n\nИз-за происшествий в храме временные линии выходят из-под контроля и просачиваются в долину. Мало того, начали пропадать даже Дозорные Времени!\n\nПоэтому мы отправили запрос о помощи. Но одна из наших новых коллег до сих пор сюда не добралась.\n\nНе поищешь ее? Только будь $gосторожен:осторожна;. Пока потоки времени в долине нестабильны, никто не знает, каких опасностей можно ожидать.', '', '', '', '', '', '', 47187),
(66079, 'ruRU', 'Гневион ждет', 'Встретьтесь с Гневионом в Обсидиановом бастионе.', 'Эти яйца – символ нового поколения драконов. Им понадобится защита, воспитание и уход. Но на душе все равно тяжело... Меня беспокоит судьба Гневиона. Как бы его упрямое рвение не обернулось несчастьем. \n\nТы многие годы $gбыл:была; мне надежным товарищем, $n. Поговори с ним вместо меня и постарайся помочь. \n\nИщи его в Обсидиановом бастионе. И прошу тебя, позаботься о нем. Таких драконов, как он, почти не осталось...', '', '', '', '', '', 'Встретьтесь с Гневионом в Обсидиановом бастионе.', 47187),
(66078, 'ruRU', 'Темные дела', 'Испытайте $1oa |4убийцу:убийц:убийц; и |4мстителя:мстителей:мстителей; Черного Когтя.', 'Я многие годы взращивал воинов Черного Когтя, обучая их и помогая достичь тех же высот, каких $gдостиг:достигла; ты.\n\nПризнаю, они не совершали таких же великих подвигов, но определенных успехов добились. Я могу ими гордиться.\n\nДумаю, любой из них почтет за честь показать тебе свои навыки. Мне кажется, вы с ними в чем-то похожи.', '', '', '', '', '', '', 47187),
(66076, 'ruRU', 'Древний рогоплав', '', '', '', '', '', '', '', '', 47187),
(66074, 'ruRU', 'Королева косильщиков', '', '', '', '', '', '', '', '', 47187),
(66071, 'ruRU', 'Летающие рухи', 'Помогите $1oa |4ораненому синеперому руху:раненым синеперым рухам:раненым синеперым рухам;.', 'К вашим услугам – профессор Харлин Язвотрель, прославленный гений-орнитолог! Я приехала на Драконьи острова изучать мифических синеперых рухов, но попалась птичка покрупнее.\n\nСкорее всего, эти гарпии прилетели сюда с Калимдора, как только острова открылись. Они захватывают территории и наедаются, как толпа огров на банкете в казино Трюмных Вод.\n\nНадо уравнять силы и дать местным рухам шанс на выживание. Возьми эту аптечку и помоги раненым пташкам.', '', '', '', '', '', '', 47187),
(66070, 'ruRU', 'Кости Сияющего Клинка', '', '', '', '', '', '', '', '', 47187),
(66057, 'ruRU', 'Возрождение веры', 'Восстановите обсидиановый камень клятвы.', 'Осколки перекованы. Мы готовы восстановить камень клятвы.\n\nИди и помоги Гневиону завершить начатое.', '', '', '', '', '', 'Встретьтесь с Гневионом у Обсидианового Трона', 47187),
(66056, 'ruRU', 'Построить новое будущее', 'Подготовьте кузню Хранителя Земли.', 'Кузня Хранителя Земли – самая мощная кузница драконов на свете. С ее помощью наши предки создавали лучшие доспехи и оружие для защиты Азерота.\n\nВ очаге этой кузни можно перековать осколки камня клятвы.\n\nИдем. Подготовим ее к этой работе.', '', '', '', '', '', 'Отнесите вечнотлеющий уголь главному кузнецу Базентусу.', 47187),
(66055, 'ruRU', 'Расколотое прошлое', 'Найдите $2oa |4осколок:осколка:осколков; камня клятвы.', 'Камень клятвы поврежден, ему недостает нескольких частей.\n\nСделай все возможное, чтобы вернуть фрагменты... Может, мы еще сумеем восстановить камень!', '', '', '', '', '', '', 47187),
(66049, 'ruRU', 'Обсидиановый камень клятвы', 'Найдите обсидиановый камень клятвы.', 'Когда Нелтарион стал Хранителем Земли, он поклялся оберегать этот мир, $n. Хранить глубины земли и вместе со своими сородичами служить защитником Азерота. Обсидиановый камень клятвы – воплощение этого обещания. \n\nМы должны активировать камень, чтобы все на Драконьих островах узнали, что черные драконы вернулись!\n\nСледуй за мной, $n.', '', '', '', '', '', '', 47187),
(66048, 'ruRU', 'Лучшие планы и намерения', 'Обсудите планы с разными представителями Гневиона.', 'Нападение на джарадинов, занимающих Обсидиановую цитадель, будет непростой задачей. Даже с Гневионом и его бойцами Черного Когтя битва будет тяжелой. Гневион, может, и уверен в победе, но... Я вот не уверена.\n\nМожет, мы сможем поговорить с теми, кто занимается планированием, и понять, можно ли что-то улучшить.', '', '', '', '', '', 'Передайте то, что вам удалось узнать, Гневиону в Обсидиановом бастионе.', 47187),
(66044, 'ruRU', 'Зачистка стен', 'Устраните 3 осадные аркбаллисты и защитника Чорука.', 'Сабеллиан и другие драконы пока сдерживают джарадинов. Мы должны действовать быстро. Чтобы одержать победу, нужно захватить высокие башни.\n\nМы с тобой избавимся от аркбаллист, которые угрожают нам сверху.\n\nСкажи, когда будешь $gготов:готова;.', '', '', '', '', '', 'Встретьтесь с Гневионом.', 47187),
(66040, 'ruRU', 'Назад в будущее', 'Защищайте союзников от сил Темной Империи, пока не будет создан темпоральный портал.', 'Нас перестало тащить сквозь время, но зашвырнуло далеко в прошлое. О-о-очень далеко. В дотитановую эпоху Азерота. Да, настолько далеко. Как нам попасть домой? Ну... это сложный вопрос.\n\nНо драконы все могут! \n\nТолько тебе придется отгонять от нас слуг Темной Империи. Много времени не займет! \n\nСкорее всего.\n\nНаверное.\n\nЛадно, не забивай себе голову! Просто не подпускай близко жутких чудовищ, а остальное предоставь нам! Элементарно!', '', '', '', '', '', '', 47187),
(66039, 'ruRU', 'Время Хроми', 'Найдите Хроми и завершите ритуал темпоральной стабилизации.', 'Это... это же Темная Империя. Мы и правда улетели очень далеко в прошлое.\n\nСмотри! Я вижу посла Хронорму и Вечнос! Надо скорее завершать ритуал. \n\nХоть любопытства мне не занимать, но даже я не жажду увидеть, куда их забросит в следующий раз.', '', '', '', '', '', '', 47187),
(66038, 'ruRU', 'Гонка через время!', 'Начните гонку сквозь время, следуя по пути Хроми и Вечнос.', '$n, чтобы догнать посла Хронорму, надо поторопиться, причем в буквальном смысле.\n\nМы с Зерой постараемся как можно сильнее ускорить процесс, но надолго вмешиваться в этот временной период совершенно недопустимо. Иначе мы настолько замедлимся, что упустим посла туда, где ее не разыщет даже магия Ноздорму.\n\nНельзя терять ни секунды!\n\n|cFF0000FF(После принятия этого задания начнется обратный отсчет)|r', '', '', '', '', '', '', 47187),
(66037, 'ruRU', 'Назад в реальность', 'Вернитесь к Ноздорму в настоящее.', 'Мы смогли укрепить связь посла Хронорму с нашим временем. Я уверен, что когда мы обнаружим ее снова, то сумеем довести ритуал до конца.\n\nА пока что вернемся в настоящее. В мир, где... не так много мурлоков.', '', '', '', '', '', '', 47187),
(66036, 'ruRU', 'Мугурлглрл!', 'Мурглгулглрлглгул!', 'Мрглгулглррлглгул! Грургуглуллгурл!\n\nГруглрлгллруг рргулгрулгргл груглл гургулл гур. Мургллгллруг гургллглрл Мургул груггуллгл. Мургуглегургллгур гурглл гургулгул гуруулгурллгр гууглрллгл.\n\nМгргулллгллл гурл гуглл.\n\n<Вы точно не знаете, что говорит ваш собеседник, но он постоянно повторяет пронзающий жест. Похоже, этот мурлок просит вас кого-то убить.>', '', '', '', '', '', '', 47187),
(66035, 'ruRU', 'Материя мурлоков', 'Вытяните $1oa |4темпоральную частицу:темпоральные частицы:темпоральных частиц;.', 'Параллельная временная линия, где мурлоки дали начало всему живому?\n\nПрости за эгоизм, но не $gмог:могла; бы ты изловить для меня несколько частиц темпоральной энергии, пока ищешь посла Хронорму? \n\nПросто пройди сквозь них, а твой посох сделает все остальное. Я изучу данные потом... когда мы закончим путешествовать по разрывам в реальностях Азерота.', '', '', '', '', '', '', 47187),
(66033, 'ruRU', 'Куда? В прошлое?..', 'Воспользуйтесь порталом в Азмерлот и встретьтесь с Андантенорму.', 'Очень жаль, что нам не удалось стабилизировать Хронорму, но есть и другой участок, где мы можем перехватить ее и остановить этот полет сквозь время. \n\n<Ноздорму хмурится.>\n\nОбрывки этой версии прошлого... очень странные. Даже на фоне всего остального, что я повидал.\n\nБудь начеку, $n. Не знаю, с чем ты столкнешься, но это будет великая сила – и подозрительно знакомая.', '', '', '', '', '', 'Воспользуйтесь порталом в Азмерлот и встретьтесь с Андантенорму.', 47187),
(66032, 'ruRU', 'Возвращение в настоящее', 'Вернитесь к Ноздорму в настоящее.', 'Эта временная линия спуталась и затянулась туманом. Ее успели серьезно повредить. Я задержусь здесь ненадолго, чтобы закрыть оставшиеся разломы. \n\nВозвращайся к Ноздорму. Ему надо рассказать о нашей победе, даже если мы достигли немногого.', '', '', '', '', '', '', 47187),
(66031, 'ruRU', 'Выиграть время', 'Соберите сущность элементалей и отнесите в лагерь выживших.', 'Видимо, не стоит удивляться такому повороту событий.\n\nЭто не тот Азерот, который мне хотелось увидеть, но что есть, то есть. Мы пытаемся сохранить и вернуть себе то, что осталось, но из-за твоего появления можем все потерять. \n\nМы используем сущность тех элементалей, чтобы заряжать укрепления и прятаться от врагов. Видишь тот щит? Только он не дает им обнаружить и уничтожить нас, а из-за тебя наши ресурсы истощились. Верни нам немного этой сущности, и мы сможем протянуть еще один день.', '', '', '', '', '', '', 47187),
(66030, 'ruRU', 'Сопротивление не бесполезно', 'Исцелите бойцов сопротивления в будущем воинов стихий.', 'Темпоральные колебания досаждают местным жителям. Враги появляются там, где их раньше не было, или становятся гораздо сильнее обычного. Даже такие небольшие изменения могут привести к катастрофе.\n\nПрошу тебя, помоги бойцам сопротивления. Исцели их раны и поставь их на ноги. Направь их поток времени в нужное русло, чтобы он не пересекался с нашим. Не такая уж значительная помощь, но больше мы ничего не можем для них сделать.', '', '', '', '', '', '', 47187),
(66029, 'ruRU', 'Настройка временных линий', 'Используйте хронокристалл на Вечнос и Хроми в будущем воинов стихий, чтобы они перестали падать сквозь время.', 'Хронорму и Вечнос падают сквозь время, но иногда падение прекращается. Эти краткие мгновения – наш шанс найти их.\n\n<Ноздорму создает маленький хронокристалл.>\n\nЯ наполнил этот кристалл силой и моим собственным темпоральным резонансом. Они попали... в не самое хорошее будущее. Найди их и примени кристалл. Надеюсь, это стабилизирует их во времени прежде, чем они снова исчезнут.', '', '', '', '', '', 'Возвращайтесь к Ноздорму в настоящее время.', 47187),
(66028, 'ruRU', 'В будущее!', 'Отправляйтесь в будущее воинов стихий.', 'Я проследил потенциальное будущее Хронорму и Вечнос. Не знаю, что тебя там ждет. Вижу только тьму и хаос.\n\nСоридорми вместе с несколькими Дозорными Времени отправилась в будущее заранее, чтобы удержать связь с той временной линией. Вся ее сила, хоть и немалая, уйдет на стабилизацию портала, поэтому действовать будешь ты.\n\nСоридорми передаст тебе конкретные распоряжения, как только окажешься на месте.\n\nПоспеши, $n. Найди Хронорму.', '', '', '', '', '', 'Поговорите с Соридорми в будущем воинов стихий.', 47187),
(66027, 'ruRU', 'Призыв к синим драконам', 'Посмотрите, как Калесгос созывает синих драконов.', 'Я больше не могу избегать воссоединения синих драконов, $n. Для нас будет лучше стать единой семьей... а не осколками прошлого.\n\nХотя я и не могу завладеть камнем клятвы, его сила позволит мне подать сигнал моим сородичам. \n\nОни давно не получали вестей... от своего Аспекта.', '', '', '', '', '', '', 47187),
(66026, 'ruRU', 'Действуем немедленно', 'Встретьтесь с Бреной у земель Бурошкуров.', 'Похоже, причина этого разложения – гноллы из племени Бурошкуров.\n\nМы сражались с ними многие поколения, но тогда они не представляли большой угрозы.\n\nУ нас нет иного выбора, кроме как нанести им удар. Эта кошмарная гниль опустошит весь Лазурный Простор. В том числе то, что ты там ищешь.\n\nВстретимся у земель Бурошкуров. Сейчас нам пригодится любая помощь.', '', '', '', '', '', '', 47187),
(66025, 'ruRU', 'Угроза клана Нокхуд', 'Обсудите дальнейшие шаги.', 'Армия клана Нокхуд захватывает Марукай. \n\nОбсудим план в покоях хана. Мы обязаны защитить кентавров Маруук.', '', '', '', '', '', '', 47187),
(66024, 'ruRU', 'Прикрыть тыл', 'Убейте стражницу Бахир.', 'Клан Нокхуд цепляется за легенды о древних победах нашего народа. На самом же деле они слабые, заигравшиеся дети. Одним разрядом молнии они перерубили связь с Он\'арой.\n\nПрекрасно! Если они так низко пали в жажде войны, не будем их разочаровывать.\n\nКонечно, стражницу Бахир назначили командиром, чтобы скрыть его побег. Скоро ее кровь смешается с грязью.', '', 'Бахир, которую Балакар назначил временным командиром, ждала этого момента уже очень давно.', 'Стражница Бахир', '', '', 'Вернитесь к Ханам Матре Сарест.', 47187),
(66023, 'ruRU', 'Нарушители перемирия', 'Убейте $1oa |4воина:воинов:воинов; из клана Нокхуд.', 'Балакар обесчестил свой клан. Он ведет их прямо в сердце шторма, не замечая ничего из-за своей жажды власти.\n\nПредательство лишь раскрыло их слабости. Уничтожь их.', '', '', '', '', '', '', 47187),
(66022, 'ruRU', 'Ханам Матра', 'Поговорите с кешиктеном Акато, чтобы присоединиться к Джемисат для разговора с ханам Матрой.', 'Я не могу задерживаться в землях кентавров. Мне нужно как можно скорее вернуться в сады.\n\nХанам Матра согласилась выслушать наш призыв о помощи. Она ждет меня на вершине куртала – центрального здания в Марукае.\n\nСначала говорить буду я, но будет здорово, если ты тоже присоединишься.', '', '', '', '', '', '', 47187),
(66021, 'ruRU', 'Нежеланный гость', 'Победите $1oa |4кентавра:кентавров:кентавров; из клана Нокхуд.', 'Ха! Что тут у нас? Очередной слабак? Совсем как те жалкие охотники, что привели тебя сюда.\n\nХочешь понять клан Нокхуд? Мы знаем только язык битвы. \n\nНаш боевой ритуал называется \"табарр\". Мы тренируемся. Устраиваем поединки. И это нас закаляет. Наш клан не признает слабости.\n\nНо хватит разговоров. Сразимся.', '', '', '', '', '', 'Вернитесь к разведчице Томуль.', 47187),
(66020, 'ruRU', 'Благовония и предзнаменования', 'Соберите $1oa |4цветок:цветка:цветков; сладкого нектара, перетрите их в благовония и помогите он\' Сештэн провести ритуал.', 'Я рассказала хану Тигари о знамении, явленном нам перед прибытием в Марукай. Она поделилась своими опасениями – ей тоже ветер показался слишком холодным.\n\nЗдесь мы выращиваем особые растения. Если поджечь их цветки, можно погрузиться в некое подобие транса. Это позволит углубить связь и лучше понять знамение. \n\nЯ прошу тебя собрать несколько таких цветов, чтобы изготовить благовоние. Нам поможет хан, и тогда, я надеюсь, мы узнаем больше о том, что произошло с Он\'арой.', '', '', '', '', '', '', 47187),
(66019, 'ruRU', 'Подношения предкам', 'Помогите Куариин Дотур приготовить блюдо для предков.', 'Наши предки сопровождают нас в ветрах Он\'ары, защищая и указывая нам путь. Все Маруук, живые или мертвые, собираются на хурале. \n\nЗапах этого блюда приглашает предков к огню. Хурал начнется, когда они к нам присоединятся.', '', '', '', '', '', '', 47187),
(66018, 'ruRU', 'Клан Нокхуд', 'Идите с Томуль к стражу Бахир.', '<Хан Сансок подает знак, и Окир вслух выражает ее волю.>\n\nВласть клана Нокхуд возросла совсем недавно. Покойный хан Джакан собрал армию и отвоевал территории у их предшественников. Так заведено у нашего народа.\n\nДжакан сам добился уважения, в отличие от своего сына. Балакар убил отца и возложил на себя корону. С тех пор Нокхуд начали еще сильнее сторониться остальных кланов. Но чтобы понять Маруук, надо понять и их.', '', '', '', '', '', 'Встретьтесь с разведчицей Томуль у лагеря Нокхуд.', 47187),
(66017, 'ruRU', 'Клан Он\'ир', 'Встретьтесь с он\' Сештэн у прудов мистиков.', '<Хан Сансок подает знак, и Окир вслух выражает ее волю.>\n\nМистики наших краев, такие как Он\' Сештэн, принадлежат к клану Он\'ир. Он состоит не из семей, а из кентавров любых племен со всех равнин, чувствующих в себе связь с Он\'арой. Они всю жизнь укрепляют эту связь и оттачивают мастерство. Со временем их назначают служить разным кланам и защищать наши земли.\n\nОн\' Сештэн ушла говорить со своим кланом о предзнаменовании, которое она недавно узрела. Отправляйся к ней и узнай о традициях Он\'ир.', '', '', '', '', '', 'Встретьтесь с он\' Сештэн у прудов мистиков.', 47187),
(66016, 'ruRU', 'Клан Тирай', 'Поговорите с Куариин Дотур.', '<Хан Сансок подает знак, и Окир вслух выражает ее волю.>\n\nИз клана Тирай происходит ханам Матра, прямой потомок древних кентавров Маруук. Этот клан хранит наши традиции и передает из поколения в поколение наши легенды.\n\nЧтобы понять Маруук, тебе надо понять Тирай. Куариин Дотур, одна из дочерей ханам Матры, готовит блюдо для наших предков. Помоги ей и узнай об обычаях нашего народа.', '', '', '', '', '', 'Поговорите с Куариин Дотур.', 47187),
(66015, 'ruRU', 'Камень клятвы синих драконов', 'Сопроводите Калесгоса к камню клятвы синих драконов.', 'Магия Лазурного Простора успокоилась, и сюда прибыли новые синие драконы... как раз вовремя.\n\nПора вернуться в Лазурные архивы и активировать камень клятвы.\n\nЯ хочу попросить тебя отправиться со мной, $n. Ведь именно благодаря тебе я смог пройти через все испытания.', '', '', '', '', '', '', 47187),
(66011, 'ruRU', 'Памяти Изеры', 'Найдите Терамуса еще раз.', 'Ах... Я, кажется, поняла. Терамусу... не хватает Изеры, но ее уже не вернуть.\n\nИдем! Кажется, я знаю, куда он пошел. Мы оставим его в покое, только сперва извинимся и пообещаем, что больше его не потревожим.\n\nМы не одни под сенью природы. Мы есть друг у друга.', '', '', '', '', '', '', 47187),
(66009, 'ruRU', 'На защиту Вактроса', 'Победите Кортрокса Разрушителя.', 'Время пришло, $n. Ты $gразобрался:разобралась; с воинами стихий на земле, и их силы в воздухе тоже начали слабеть.\n\nИз-за тебя у Рашагет не осталось выбора, кроме как вызвать подкрепление. Она послала на поле боя сильного союзника.\n\nРазберись с этим противником, а я сражусь с самой Рашагет и помогу Кадгару.\n\nВо время сражения я постараюсь помогать тебе чарами.\n\nСейчас Рашагет узнает, на что способен Аспект магии в гневе!', '', 'Помощник Рашагет, помешанный на истреблении синих драконов.', 'Кортрокс Разрушитель', '', '', 'Поговорите с Кадгаром на возвышенности Вактроса.', 47187),
(66007, 'ruRU', 'Чистый воздух', 'Уничтожьте $1oa |4лавовый маяк:лавовых маяка:лавовых маяков;.', 'Воины стихий сдерживают Калесгоса с помощью этих огромных сфер. \n\nЕсли так будет продолжаться, Калесгос слишком пострадает, чтобы сражаться дальше... а один я не справлюсь с Рашагет.\n\nИспользуй свой усиленный самоцвет, чтобы замаскироваться под элементаля и прокрасться вперед.\n\nЗатем направь его на сферы и уничтожь их. Тогда Калесгос сможет обрушить на воинов стихий всю свою мощь.\n\nЯ сосредоточусь на том, чтобы защитить башню от Рашагет.', '', '', '', '', '', 'Встретьтесь с Калесгосом на вершине Вактроса.', 47187),
(66006, 'ruRU', 'Возвращение к Роше', 'Верните припасы кузнецу Роше.', 'Баба отдохнул, а припасы Роши снова у нас. Теперь мы можем вернуться, не боясь сильнее ее расстроить. \n\nЗахвати пару ящиков, когда отправишься в путь. За остальными пошлю наших воинов.', '', '', '', '', '', '', 47187),
(66005, 'ruRU', 'Медальон павшего друга', 'Верните медальон павшего друга Хасару.', '<Этот изгрызенный кусок металла когда-то служил любимым украшением одному из шикаарских кентавров. \n\nХасар может что-то знать о его хозяине.>', '', '', '', '', '', 'Верните медальон павшего друга Хасару.', 47187),
(66004, 'ruRU', 'Галгреш', '', '', '', '', '', '', '', '', 47187),
(66003, 'ruRU', 'Кольца-оковы', 'Соберите $1oa |4раскаленное кольцо порабощения:раскаленных кольца порабощения:раскаленных колец порабощения;.', 'Джарадины в этих местах совсем осмелели: подконтрольные им элементали огня крушат все на своем пути. Дикие животные разбежались, а элементали уже подобрались совсем близко к нашему лагерю.\n\nК счастью, мне удалось соорудить каменный бастион, который немного защищает от огненного шторма, устроенного джарадинами... мы выстоим!\n\nСобери магические кольца, контролирующие элементалей. С их помощью мы усилим защиту от огня.', '', '', '', '', '', '', 47187),
(66001, 'ruRU', 'Последняя надежда', 'Спасите последнее драконье яйцо, наполненное магией.', 'Целое поколение дракончиков погибло в один миг...\n\n<Сендракс выпрямляет спину и высоко поднимает голову.>\n\nМы не проверили еще одно место. Огромный алтарь, куда протодракон унес яйца.\n\nПрорвемся через их безжалостную оборону вместе, $p, и спасем что сможем.', '', '', '', '', '', '', 47187),
(66000, 'ruRU', 'Библиотека Алекстразы', 'Спасите $1oa |4работу:работы:работ; большого культурного значения.', '<Страницы книги сильно обгорели.\n\nПохоже, воины стихий сжигают хранящиеся здесь древние фолианты, уничтожая знания о семействах драконов. Они словно пытаются стереть своих недругов со страниц истории.\n\nНадо спасти хоть что-нибудь.>', '', '', '', '', '', '', 47187),
(65999, 'ruRU', 'Алые когти и зубы', 'Убейте $1oa |4воина стихий - захватчика:воинов стихий - захватчиков:воинов стихий - захватчиков;.', 'Командир Летанак предупреждал нас. Ему доложили о том, что Рашагет Пожирательница Бурь освободилась из своей темницы. Похоже, ее слуги уже спешат угодить госпоже. Они угрожают всему, что нам дорого.\n\nИ действуют быстро. Еще прошлый патруль докладывал, что в этих руинах не было никаких признаков жизни.\n\nЭтот отряд воинов стихий надо остановить.\n\nЗа Хранительницу жизни и за всех драконов!', '', '', '', '', '', '', 47187),
(65998, 'ruRU', 'Будущее драконьих родов', 'Спасите яйца рубиновых драконов.', 'Священный долг каждого взрослого драконида – защищать драконьи яйца, пусть даже ценой собственной жизни.\n\nРади этого мы тренируемся. Ради этого мы живем.\n\n$p, я больше не могу прятаться и наблюдать со стороны, как воины стихий крадут яйца и наполняют их этой дрянью. Это ставит под угрозу будущее всех драконов!\n\nДа, нас превосходят числом, но ты ведь поможешь мне? Будешь сражаться ради спасения драконов?', '', '', '', '', '', '', 47187),
(65997, 'ruRU', 'В поисках Сендракс', 'Найдите Сендракс в руинах сада Хранительницы Жизни.', 'Кадет Сендракс была здесь не так давно.\n\nОна передала приказ командира Летанака всем драконидам собраться у Омутов Жизни. Наши защитники сразу же выдвинулись в ту сторону.\n\nПравда, разведчики в это время патрулировали древние руины, поэтому она отправилась туда, чтобы оповестить и их.', '', '', '', '', '', 'Встретьтесь с Сендракс в саду Хранительницы Жизни.', 47187),
(65996, 'ruRU', 'Помощь опытных бойцов', 'Помогите раненым стражникам и найдите Сендракс.', 'Командир Летанак проницателен, как и всегда. Чтобы сдержать угрозу, нам понадобятся наши самые опытные бойцы. Объединить их – подходящая задача для молодого кадета, такого как Сендракс, но ей наверняка понадобится поддержка.\n\nСендракс отправится на запад, а эти земли наверняка уже охватила растущая угроза. Их обитателям тоже понадобится помощь. Возьми эту смесь и сделай то, что в твоих силах.', '', '', '', '', '', 'Встретьтесь с Сендракс у заставы сада.', 47187),
(65995, 'ruRU', 'Обсидиановая цитадель', 'Передайте Гневиону планы куалаши.', '<На первый взгляд эти записи похожи на внутреннюю переписку между лагерями джарадинов.\n\nОсобенно вас настораживают слова \"Обсидиановая цитадель\".\n\nГневион наверняка заинтересуется этими посланиями.>', '', '', '', '', '', '', 47187),
(65994, 'ruRU', 'Правосудие для джарадинов', '', '', '', '', '', '', '', '', 47187),
(65993, 'ruRU', 'Никакого праздника', 'Убейте Соток-Мясорубку в крепости Расколотой Чешуи.', 'Точно-точно!\n\nЯ видел, как главарь этих великанов возвращался после удачного налета. Сейчас она празднует победу где-то в лагере. \n\nДосадно будет, если кто-то испортит ей все торжество...', '', 'Зачинщик нападения на заставу Драконьего Сердца.', 'Соток Мясорубка', '', '', 'Встретьтесь с Гневионом в крепости Расколотой Чешуи.', 47187),
(65992, 'ruRU', 'Разведданные Черного Когтя', 'Поговорите со шпионами Гневиона, скрывающимися в крепости Расколотой Чешуи.', 'Когда они увидели меня и Селистру в вышине, их оборона дала трещину.\n\nМои друзья из Черного Когтя следят за всем, что происходит в крепости. Встреться с ними и дай им знать, что ты на нашей стороне. Они поделятся ценной информацией о противнике.', '', '', '', '', '', 'Встретьтесь с Гневионом в крепости Расколотой Чешуи.', 47187),
(65991, 'ruRU', 'Время расплаты', 'Встретьтесь с Гневионом и мажордомом Селистрой в крепости Расколотой Чешуи.', 'Кадет Сендракс сообщила, что мажордом нам поможет. Слава Хранительнице жизни! Это даст нам передышку, чтобы доставить раненых к Омутам Жизни для исцеления.\n\nЯ был бы рад помочь Селистре в бою, но мне необходимо оставаться с ранеными. А ты отправляйся во вражескую крепость.\n\nЕсли бы существовал другой способ справиться с джарадинами, мы воспользовались бы им. Но увы...\n\nСделай то, что должно быть сделано.', '', '', '', '', '', '', 47187),
(65990, 'ruRU', 'Спасение дракончиков', 'Спасите $1oa |4скулящего дракончика:скулящих дракончиков:скулящих дракончиков; на заставе Драконьего Сердца.', 'Они напали внезапно. Мы даже не успели отреагировать. Моя стража сдерживала их изо всех сил, пока мы помогали скрыться малышам и тем, кто без помощи бы не справился. Но я боюсь, что заставу смогли покинуть не все.\n\nПерейди по мосту и поищи выживших.', '', '', '', '', '', '', 47187),
(65989, 'ruRU', 'Джарадины-захватчики', 'Убейте $1oa |4джарадина:джарадинов:джарадинов; на заставе Драконьего Сердца.', 'Сейчас нам не хватит сил, чтобы отвоевать заставу, но без боя мы не сдадимся.\n\nПокажи им, что наши зубы все еще остры.', '', '', '', '', '', '', 47187),
(65977, 'ruRU', 'Восстановление Кирин-Тора', 'Спасите $1oa |4умирающего мага:умирающих магов:умирающих магов;.', 'Когда воины стихий напали на экспедицию, я боялся, что мы уже не вернем многих наших магов.\n\nОказалось, что враги взяли их в плен и пытают в эту самую минуту!\n\nПрошу, спаси наших товарищей. Они вряд ли смогут помочь нам в бою, но мы не можем их бросить.', '', '', '', '', '', 'Встретьтесь с проекцией Кадгара на гряде Вактрос.', 47187),
(65962, 'ruRU', 'Бесконечный обратный отсчет', 'Поговорите с Хроми, когда будете готовы.', 'Никогда бы не подумала, что придется спасать наш храм, избавляясь от его же защиты, а вот на тебе!\n\nЧто ж, элементали времени изгнаны, наши товарищи свободны, а дозорные готовы действовать. Пора рассеять последний стазисный пузырь и разобраться с Вечнос.\n\nДай мне знать, когда будешь $gготов:готова;. Я уверена: с тобой у нас все получится.', '', '', '', '', '', '', 47187),
(65958, 'ruRU', 'Изначальная мощь', 'С помощью средоточия стихий вытяните энергию из убитых воинов стихий и элементалей.', 'Боюсь, мне становится все сложнее поддерживать свои зеркальные копии. Воины стихий пытаются общими силами сбить меня с неба.\n\nНо не волнуйся... У меня есть план.\n\nСобери магию из убитых воинов стихий в добытую тобой сферу. \n\nСила стихий понадобится нам для того, чтобы отвлечь от меня их войска.', '', '', '', '', '', 'Встретьтесь с проекцией Кадгара на гряде Вактрос.', 47187),
(65957, 'ruRU', 'Не время геройствовать', 'Убейте Модак Огнеметательницу, Гигру Пронзающую и Олфиса Раскаленного.', 'Судя по тому, что мы успели увидеть, общество джарадинов построено на демонстрации силы. Сильнейшие воины становятся образцами для подражания, побуждая других усерднее сражаться. \n\nСреди сил джарадинов внизу есть три таких воина... Они и станут твоей целью.\n\nТы, $n, $gдолжен:должна; лично от них избавиться. Это значительно ослабит их боевой дух.', '', '', '', '', '', '', 47187),
(65956, 'ruRU', 'Удар когтями', 'Прорвите оборону джарадинов.', 'Если ты им поможешь, мои убийцы из Черного Когтя разберутся с джарадинами, защищающими периметр. Брось в нужные цели небольшую оглушающую бомбу, и мои воины придут тебе на помощь.\n\nДействуй быстро и устраняй любого, кто может нам помешать.', '', '', '', '', '', '', 47187),
(65955, 'ruRU', 'Лучший друг кентавра', 'Освободите Хасара и встретьтесь с ним в пещере.', 'Торчать на виду слишком опасно, $p.\n\nГорлоки держат Бабу, моего верного пса-спутника, в пещере на востоке.\n\nОсвободи меня, чтобы мы могли спасти и его тоже. Встретимся в пещере, когда расчистишь путь.', '', '', '', '', '', '', 47187),
(65954, 'ruRU', 'Освобождение ищейки', 'Освободите шикаарских бакаров.', 'Я слышал знакомый вой и лай бакаров, которые пропали из лагеря.\n\nНаши собачки сидят взаперти в клетках и ждут, пока их разорвут на части эти... мерзкие существа.\n\nМы не можем бросить верных товарищей. Освободи их и узри, на что способны шикаарские бакары!', '', '', '', '', '', '', 47187),
(65953, 'ruRU', 'А это вы предвидели?', 'Соберите $1oa |4тотем:тотема:тотемов; горлоков-шаманов.', 'Среди всех ужасов в деревне горлоков ничто не сравнится с их шаманами.\n\nЗлобные даже по меркам горлоков, они безрассудно балуются с магией бури и плюют на последствия. \n\nХватит нам их терпеть. Убей их и принеси мне их тотемы. Мистикам будет интересно на них взглянуть.', '', '', '', '', '', '', 47187),
(65952, 'ruRU', 'Вождь из легенд', 'Убейте вождя Гррлгллмеша.', 'Когда-то болотные горлоки жили мирно и просто. Пакостили по-мелкому, но ни разу не грабили, не крали и не убивали собак на еду.\n\nЭто вождь Гррлгллмеш приучил мирный народ к такой жизни.\n\nПрикончи его, и горлоки больше нас не побеспокоят.', '', 'Сильнейший горлок Гррлгллмеш одолел всех соперников и теперь сражается лишь с собственным отчаянием.', 'Вождь Гррлгллмеш', '', '', '', 47187),
(65951, 'ruRU', 'Единственный кормилец', 'Поищите Хасара в лесу.', 'Бедная Роша! Она столько труда положила на снаряжение каравана, а горлоки взяли и украли все ее припасы. \n\nОна и так многое потеряла... Я помогаю ей как могу. \n\nПохоже, Хасар ушел искать припасы один и никому ничего не сказал. Очень на него похоже. Но его уже давно нет. И многие собаки тоже пропали. \n\nМожет, поищешь Хасара и собак, $p?', '', '', '', '', '', 'Поговорите с Хасаром в деревне Илистого Плавника', 47187),
(65950, 'ruRU', 'Горлоки-воры', 'Верните украденные припасы из деревни Илистого Плавника.', 'Будет кузнец Роша в караване? Нет! А кто должен подковать весь караван? Кузнец Роша! А у кого Илистый Плавник все крадет? У Роши, конечно. Тьфу!\n\nЯ бы отправила Хасара, но его опять носит неизвестно где. \n\nНайди мои припасы. Проучи тварей как следует, чтобы знали в следующий раз не красть у кузнеца Роши.\n\nЧего ждешь?', '', '', '', '', '', 'Поговорите с Хасаром в деревне Илистого Плавника', 47187),
(65949, 'ruRU', 'Мастер подков', 'Верните медальон кузнецу Роше.', 'Когда мы воссоединяемся с Он\'арой в ветре, то оставляем на бренной земле такие медальоны.\n\nХоть я и помогал мастерить этот медальон, он принадлежит совсем не мне.\n\nЕго надо вернуть Роше. Это последняя память о ее подруге.\n\nОтнеси его ей, чтобы она оплакала свою утрату и обрела мир в душе.', '', '', '', '', '', '', 47187),
(65948, 'ruRU', 'Трещины во времени', 'Усильте посох Дозорного Времени от восточного и западного кристалла.', 'Когда двери храма закрылись, дозорные оказались заперты внутри. Чтобы освободить их, надо уничтожить стазисный пузырь! Правда, для этого посох Дозорного Времени должен быть заряжен полностью...\n\nЗнаю! Подзаряди его от кристаллов на платформах! Их силы должно хватить.\n\nОни тоже защищены полями стазиса, так что вытягивай их посохом.\n\nНе бойся, если вдруг разобьешь кристаллы – сила из осколков никуда не денется!', '', '', '', '', '', '', 47187),
(65947, 'ruRU', 'Путешественники, застрявшие во времени', 'Освободите $1oa |4Дозорного Времени:Дозорных Времени:Дозорных Времени; из темпоральных пузырей.', 'Я так рада, что ты здесь! Ты уладишь помехи тут, на платформах, а Данте и Зера помогут мне удержать нашу бесконечную подругу.\n\nСистема безопасности храма поймала Вечнос в стазисный пузырь, когда она попыталась подчинить камень клятвы. К несчастью, Дозорные Времени угодили в такие же пузыри.\n\nТвой посох запросто их вызволит. Главное – разберись со злобными временниками.', '', '', '', '', '', '', 47187),
(65944, 'ruRU', 'Выброс лавы', 'Уничтожьте $1oa |4сферу:сферы:сфер; лавы.', 'Воины стихий разрушили гору, чтобы их силы могли штурмовать Вактрос нескончаемым потоком!\n\nЯ заметил в первом коридоре лавовые сферы, с помощью которых они распространяют бушующие стихии.\n\nУничтожь их, чтобы замедлить натиск врага, а я постараюсь помочь Калесгосу наверху.', '', '', '', '', '', 'Встретьтесь с проекцией Кадгара дальше по гряде Вактрос.', 47187),
(65943, 'ruRU', 'Атака стихий', 'Одолейте $1oa |4воина:воинов:воинов; стихий в Вактросе.', 'Нам с Кадгаром удается сдерживать воинов стихий в небе, но пробиться к башне мы не в силах.\n\nОслабь врагов на земле, и мы сможем подобраться к Рашагет, чтобы остановить ее раз и навсегда.\n\nДвигайся вперед, пробиваясь через воинов стихий. Если враг не прервет мою концентрацию, тебя будет ждать еще одна проекция.', '', '', '', '', '', 'Встретьтесь с проекцией Калесгоса дальше по гряде Вактрос.', 47187),
(65940, 'ruRU', 'У разбитой дороги', 'Доберитесь с караваном клана Шикаар до речной переправы.', 'Надеюсь, мокрые ноги тебя не пугают – следующая часть пути пролегает через две реки.\n\nОн\' Сештэн хочет рассказать тебе историю о нашей священной покровительнице Он\'аре. С радостью передаю тебя ее заботам.', '', '', '', '', '', '', 47187),
(65939, 'ruRU', 'Смелость убеждений', 'Захватите Обсидиановую цитадель.', 'Следующая битва, несомненно, будет тяжелой, но отвага и решимость помогут нам одолеть врага, превосходящего числом.\n\nЯ рассчитываю на твои исключительные таланты: помоги нам привести войско к победе.\n\nМы начнем атаку, когда будешь $gготов:готова;.', '', '', '', '', '', '', 47187),
(65938, 'ruRU', 'Вместе отныне и вовек', 'Уничтожьте стазисный пузырь у ворот храма с помощью посоха Дозорного Времени.', 'Итак! Давай лопнем этот стазисный пузырь у дверей храма и выпустим дозорных! $gГотов:Готова; вырвать победу у самого времени?\n\nВытяни из пузыря энергию, как из тех кристаллов. Но имей в виду: выпущенная энергия наверняка соберется в опасные сгустки. Я точно не знаю, с чем именно ты столкнешься, но освобожденные дозорные тебе обязательно помогут.\n\nЖелаю удачи, $n!', '', '', '', '', '', '', 47187),
(65937, 'ruRU', 'Недопустимая небрежность', 'Найдите доказательство того, как пострадала Сиреневая Тропа, и принесите его Терамусу.', 'Нельзя сдаваться. Он должен понять, что творится вокруг! Раз он не выходит из пещеры, придется сунуть ему под нос доказательство.\n\nПодойдет что угодно. Столько всего пошло не так: от оскверненных растений до страдающих животных!', '', '', '', '', '', '', 47187),
(65935, 'ruRU', 'Догнать Хроми', 'Встретьтесь с Хроми на платформах Временного Перекрестка.', 'Ты $gпомог:помогла; нам восстановить контроль над песками, но я чувствую, что у платформ храма происходит что-то еще более серьезное. Давай поднимемся в небо и найдем посла Хронорму.\n\nИ помни: нам нельзя тянуть время.', '', '', '', '', '', '', 47187),
(65930, 'ruRU', 'Борьба ветра и воды', 'Сразитесь с духом воздуха Краунотом рядом с Блестящим заливом Корик.', 'Теперь мы можем вызвать духов на бой.\n\nРурик тебе не сказал? По традиции нашего племени, мы не можем попросить духов об услуге, пока не сразимся с ними. Сила их благословения будет зависеть от того, как хорошо мы себя покажем. \n\nНаверное, поэтому Блесколовка и настояла на том, чтобы мы действовали вместе.\n\nТы можешь сразиться с Краунотом, духом воздуха, а мы с Руриком займемся Оту\'рорком, духом воды.\n\nОни обитают в пещере, за тем водопадом неподалеку. Встретимся там.', '', 'Причудливый дух ветров в окрестностях Блестящего залива Корик. Любит, когда ему бросают вызов молодые клыкарры, желающие проявить себя.', 'Краунот', '', '', '', 47187),
(65929, 'ruRU', 'Раскалывание льда', 'Освободите ото льда ледяные воды рядом с Блестящим заливом Корик.', 'Я знал, что Блесколовке понравится моя идея!\n\nЯ не очень много знаю о духах – это Кауджа у нас шаман... Но мы точно должны задобрить великих духов воды и воздуха, чтобы они к нам явились. \n\nМы уже давно наблюдаем за тем, как постепенно замерзают элементали воды на горе. Это не обычный мороз. В последнее время от гор становится все холоднее. Если это так и оставить, вся наша река покроется льдом.\n\nОсвободи элементалей из ледяной тюрьмы!', '', '', '', '', '', '', 47187),
(65928, 'ruRU', 'Шальные ветра', 'Добудьте $1oa |4беспокойную частицу:беспокойные частицы:беспокойных частиц; ветра у неугомонных ветров рядом с Блестящим заливом Корик.', 'Хм! Объединиться? Скажет тоже... \n\nХотя... если Блесколовка считает, что мы поможем другим племенам, то... попытаться стоит. \n\nЧтобы дух ветра Краунот обратил на нас внимание, надо позаботиться о его стихии. Элементали ветра недалеко отсюда неспокойны с тех пор, как эти земли начали пробуждаться.\n\nПока я осматриваю вашу лодку, одолейте их и принесите мне беспокойные частицы. Это должно успокоить местные стихии.', '', '', '', '', '', '', 47187),
(65926, 'ruRU', 'Исправление ошибок', 'Помогите Рурику построить \"Речной странник\".', 'Тебе знакома история о Блесколовке? Она соорудила прочную лодку, на которой преодолела пороги реки! \n\nСтарейшина Нава обожает рассказывать эту историю.\n\nБлагородные духи мамонтов будут рады, что их останки пойдут на создание еще одной такой лодки.\n\nМой брат против, но если у нас все получится, мы сможем переправить рыбу к голодающим племенам. \n\nТвои навыки и рвение превосходны! Вместе мы обязательно построим великолепную лодку.', '', '', '', '', '', '', 47187),
(65925, 'ruRU', 'Истребление истребителей', 'Убейте ледяных ползунов и ледяных бурильщиков у Блестящего залива Корик.', 'Этим змеям здесь не место. Не знаю, что выманило их из подземных нор, но теперь им уже не помочь.\n\nНельзя, чтобы они убивали местных животных.\n\nИстреби змеев, $n. И если нужно, забери части их тел. Когда закончишь, найди меня в Блестящем заливе.', '', '', '', '', '', 'Встретьтесь с Руриком в Блестящем заливе Корик.', 47187),
(65921, 'ruRU', 'Возмездие рефти', 'Убейте воинов стихий и спасите рефти в Тирхолдском резервуаре.', 'Я не могу перестать об этом думать, $p. Столько моих сестер убито! Столько жизней загублено!.. Но мы за них отомстим.\n\nНаши бойцы проследили за воинами стихий и сообщили, что нескольким сестрам удалось выжить.\n\nМы обязаны их спасти. И пусть воины стихий познают мой гнев!', '', '', '', '', '', '', 47187),
(65920, 'ruRU', 'Храни меня, мой тотем', 'Восстановите обереги, вернув на место замковые камни, а затем активируйте консоль.', 'Мы наконец можем восстановить обереги. Дело надо довести до конца, невзирая на наши потери.\n\n$p, нам снова не справиться без тебя. Помести замковые камни на свои места – тогда обереги снова станут целыми. \n\nПосле этого возвращайся сюда. Мы активируем консоль и восстановим порядок в резервуаре.', '', '', '', '', '', '', 47187),
(65918, 'ruRU', 'Превентивные меры', 'Убейте $1oa |4высвобожденного элементаля:высвобожденных элементалей:высвобожденных элементалей; в Тирхолдском резервуаре.', 'В этих местах расплодились изначальные элементали. Обычно нам с сестрами удается держать их в узде, но сейчас мы просто не можем сражаться из-за огромных потерь. \n\nДа и у тех, кто выжил, теперь совсем другие заботы.\n \n<Зуттики морщится от боли.>\n\nПоможешь нам, $p? Нужно усмирить этих элементалей.', '', '', '', '', '', '', 47187),
(65916, 'ruRU', 'Никаких переговоров с врагом', 'Убейте Ко\'джо, главаря воинов стихий, и верните украденные замковые камни в Тирхолдский резервуар.', 'Воины стихий решили, что могут совладать с мощью Тира. Но они ошиблись. \n\nИх выследили мои рефти: воины стихий скрываются в пещере неподалеку. Как я и думала, пропавшие замковые камни у них. \n\nЧтобы восстановить резервуар, эти камни нужно вернуть.\n\nИ лучше убить вражеского предводителя, чтобы они не атаковали снова.', '', '', '', '', '', '', 47187),
(65914, 'ruRU', 'Почести мамонтам', 'Соберите обрезки шкур и бивни с погибших Он\'тукских мамонтов у Блестящего залива Корик.', 'Наше племя многие поколения заботилось о стаде Он\'тук. А теперь его больше нет. \n\nПосле такой резни яростные души мамонтов не смогут успокоиться. Мы должны почтить усопших, пустив их останки на благое дело.\n\nИх слишком много, чтобы справиться в одиночку. Постарайся собрать как можно больше сырья у молодняка и матриархов, а затем приходи в Блестящий залив Корик.', '', '', '', '', '', 'Встретьтесь с Руриком в Блестящем заливе Корик.', 47187),
(65913, 'ruRU', 'Держать оборону', 'Спасите смотрительницу Мару от воинов стихий в Тирхолдском резервуаре.', 'Хвала титанам! $C, прошу тебя, помоги!\n\nНа нас только что напали воины стихий. Нам с сестрами удалось отбиться, но лишь ценой тяжелых потерь...\n\nНо мы еще успеем погоревать о павших. Сейчас главное – защитить смотрительницу! Во время боя группа воинов стихий отделилась от своих, и если они атаковали смотрительницу, то я клянусь...\n\nТы $gдолжен:должна; ей помочь, пока не случилось непоправимое!', '', '', '', '', '', '', 47187),
(65911, 'ruRU', 'Лазурная настройка', 'Вернитесь к Калесгосу в Лазурные архивы.', 'Узы, связывающие этот народ... верная дружба и любовь родных. \n\nУ меня... никогда этого не было. И у всех синих драконов. Должно быть, у нас просто не было такой возможности. \n\nПора все изменить. Нужно собрать сородичей.\n\nЯ буду ждать тебя в Лазурных архивах. Нам еще многое предстоит сделать.', '', '', '', '', '', 'Вернитесь к Калесгосу в Лазурные архивы.', 47187),
(65907, 'ruRU', 'Любимый фрукт', 'Соберите у гейзеров Он\'ир дикие кустоплоды и накормите ими $1oa |4ленивого илоплава:ленивых илоплавов:ленивых илоплавов;.', 'Учиться на мистика так скучно. Я только и делаю, что пялюсь на воду. Вода как вода. Мокрая. Мои братья уже скачут по равнинам и убивают драконов и воинов стихий. Словом, делают что-то полезное.\n\nКстати, я обещала показать тебе кое-что классное! Ты знаешь, что илоплавы любят кустоплоды? Они растут неподалеку, у гейзеров. Принеси немного, и мы вместе покормим зверей.', '', '', '', '', '', '', 47187),
(65906, 'ruRU', 'Недовольная посвященная', 'Поговорите с посвященной Радией у ключей Он\'ир на равнинах Он\'ары.', 'Мне пришло интересное письмо из ключей Он\'ир.\n\nВ письме описывается, цитирую: \"Заточение в кошмарных условиях, наставники-тираны и невыносимая скука\". Подпись: посвященная Радия. И еще тут рисунок орла, который... сбрасывает кентавра Мелуун со скалы.\n\nМда... Я так понимаю, это крик о помощи. Но можешь сходить и убедиться лично, если вдруг очень захочется. Сказать по правде, я считаю, с Радией все в порядке. Она часто шлет мне такие письма.', '', '', '', '', '', 'Поговори с посвященной Радией у ключей Он\'ир на равнинах Он\'ары.', 47187),
(65905, 'ruRU', 'Не просто сорняки', 'Избавьтесь от зарослей и чудовищ на Сиреневой Тропе.', 'Наверное, лучше пока оставить Терамуса в покое. \n\nНо мы не можем сидеть сложа руки. Роща стремительно уничтожает саму себя. Прошу, помоги нам!', '', '', '', '', '', '', 47187),
(65904, 'ruRU', 'Всему есть предел', 'Покажите Терамусу, как пострадала Сиреневая Тропа.', 'Пока Терамус киснет, работы меньше не становится. Он прячется внутри и не видит, во что превратилась неухоженная роща.\n\nПошли вместе. Покажем ему наглядно.', '', '', '', '', '', '', 47187),
(65903, 'ruRU', 'Пушистика не победить', 'Поймайте $1oa |4полянного прыгуна:полянных прыгунов:полянных прыгунов;.', 'Бедняжка Терамус. Но я знаю, что поднимет ему настроение!\n\nВозьми сеть и налови местных прыгунов. Они дружелюбные, но юркие. У побережья целое гнездо.\n\nМы принесем их Терамусу. Пушистые милахи сразу его развеселят!', '', '', '', '', '', '', 47187),
(65902, 'ruRU', 'Еда или пушок', 'Принесите Терамусу черепашье мясо с травами и полянных прыгунов.', 'Посмотри, какое сочное и аппетитное черепашье мясо! Я даю объективную оценку, не более. Я вегетарианка.\n\nНу же, не стой! Он, похоже, целый день ничего не ел.', '', '', '', '', '', '', 47187),
(65901, 'ruRU', 'Незаметный побег', 'Разместите тотемы воздуха у ключей Он\'ир и сообщите Радии.', 'Мне запретили выходить из лагеря. Навсегда! Разве моя он\' не знает, что следующей весной мне исполнится шестнадцать? Мне должны позволить уходить, когда я захочу.\n\nПохоже, ты можешь мне помочь. У меня есть план побега: я могу зарядить тотемы воздуха, чтобы закрутить вихри и устроить суматоху. Но я не могу расставить их сама, потому что за каждым моим шагом следят. Даже Того не будет мне помогать.\n\nНо ты... пожалуйста! Помоги мне, и я тебе покажу кое-что классное.', '', '', '', '', '', 'Встретьтесь с Радией у Зеркала Небес.', 47187),
(65900, 'ruRU', 'Стейк со странными специями', 'Соберите $1oa |4кусок:куска:кусков; нежнейшего черепашьего мяса, $2oa |4скорлупку:скорлупки:скорлупок; от яйца рептилии и $3oa |4стебель:стебля:стеблей; кислоцвета.', 'Идея сестры прелестна, но Терамусу нужно как можно быстрее восстановить силы.\n\nЩедрая порция кислоцвета вмиг даст ему заряд энергии. Мы можем перетереть ягоды в кашицу и обмазать ей любимое блюдо Терамуса – черепашье мясо.\n\nПоможешь мне собрать ингредиенты?', '', '', '', '', '', '', 47187),
(65899, 'ruRU', 'Поиски Терамуса', 'Обыщите пещеры и найдите Терамуса.', 'Эй, |3-6($r)! Хочешь полюбоваться на Сиреневую Тропу? Прости, что она в таком запустении. Уверяю тебя, обычно мы прекрасно за ней ухаживаем!\n\nСегодня мы должны были встретиться с главным садоводом Терамусом и вместе привести все в порядок. В последнее время ему стало тяжело поддерживать тропу в хорошем состоянии, и мы с Фелиной начали ему помогать. Но на все нас не хватает.\n\nПоможешь нам его поискать? Может, он просто забыл...', '', '', '', '', '', 'Вернитесь к Селине Хрустолист.', 47187),
(65898, 'ruRU', 'Прото-проблемы', 'Добудьте локус и победите протодракона, который его защищает.', 'Я не питаю любви к Расколотому Пламени, но даже я не могу спокойно смотреть, как они сами себя разрывают на куски. Слишком знакомая картина.\n\nНе знаю, что с этим локусом, но ему в любом случае будет надежнее у нас, а не в лапах Расколотого Пламени. Иди по следу из трупов, и наверняка на него наткнешься.\n\nПожалуйста, будь осторожнее, $p. Я боюсь, мы скоро обнаружим, что это гнездо не такое уж заброшенное.', '', '', '', '', '', '', 47187),
(65896, 'ruRU', 'Да начнется исцеление', 'Помогите жителям Штормграда исцелиться.', 'Думаешь, ты можешь войти в этот город втайне от меня? Нет!\n\nМне сразу все было понятно про ваше племя, и разрази меня гром, если я позволю драконам снова уничтожить мой дом.\n\nКогда-то это был прекрасный мирный парк – а потом появился твой предок, Смертокрыл. О да, я все про него знаю. \n\nПосмотри, что он тут натворил. Эти улицы до сих пор полны боли.', '', '', '', '', '', '', 47187),
(65895, 'ruRU', 'Компания конкурентов', 'Соберите информацию о Расколотом Пламени.', 'Тьфу! Перебив работников, мы ничего не добьемся.\n\nНайди командиров. Один из них должен знать, что нам нужно.\n\nИ еще, $n. На этот раз выслушай их до того, как убивать. Они могут рассказать что-нибудь интересное.', '', '', '', '', '', 'Встретьтесь с Аденедалом у вершины руин.', 47187),
(65893, 'ruRU', 'Запрос Реликвария', 'Соберите $1oa |4фрагмент:фрагмента:фрагментов; артефакта из Нелтазана.', 'Здесь объявилось Расколотое Пламя. Раскололи один раз – расколют и в другой. Разве можно при таком названии доверять им бесценные артефакты?\n\nОчень сомневаюсь. Как бы там ни было, мы не сможем продолжить работу, пока не выясним, что они ищут. Разузнай, что сможешь, и доложи мне.\n\nУ этой головоломки больше кусочков, чем тут в земле зарыто.', '', '', '', '', '', '', 47187),
(65892, 'ruRU', 'Вдребезги Расколотое Пламя', '', '', '', '', '', '', '', '', 47187),
(65891, 'ruRU', 'Рабочий инструмент', 'Примените зачарованные инструменты к $1oa |4груде обломков:грудам обломков:грудам обломков;.', 'Какая удача: я как раз подумывал нанять искателя приключений. Сильного. Крепкого. Согласного на любую работу за пустяковую плату.\n\nЯ пожелал, и вот ты стоишь передо мной. Ну не чудо ли? Я просто сам себя удивляю. У нас в этих руинах появились конкуренты. Но на них нельзя положиться: они наверняка напутают что-нибудь с раскопками и загубят образцы!\n\nДержи этот инструмент. Направь его на артефакты, которые встречаются в этих руинах. Он зачарован на выполнение любых необходимых процедур.', '', '', '', '', '', '', 47187),
(65890, 'ruRU', 'Руины Нелтазана', 'Встретьтесь с небесным начертателем Аденедалом в руинах Нелтазана.', 'Драконьей экспедиции нужна твоя помощь.\n\nНедавно в руины отправили небесного начертателя, чтобы собрал для нас сведения. Предполагалось, что руины необитаемы, но я даже отсюда слышу, как он вопит.\n\nПохоже, дела у него совсем плохи, раз крики доносятся с такого расстояния.\n\nУчастники экспедиции должны заботиться о товарищах. Даже о самых назойливых. Найди его и защити от напасти.', '', '', '', '', '', '', 47187),
(65887, 'ruRU', 'К горе', 'Встретьтесь с проекциями Кадгара и Калесгоса у подножия гряды Вактрос.', 'Потрясающее зрелище: Кадгар и Калесгос сражаются с воинами стихий на небесах!\n\nОни создали несколько своих копий, чтобы помочь тебе преодолеть ужасный котлован, созданный противником.\n\nПервая пара ждет тебя у подножия тех гор. \n\nЕсли дела пойдут совсем плохо... я свяжусь с нашими союзниками в Лазурном Просторе.', '', '', '', '', '', 'Встретьтесь с проекциями Кадгара и Калесгоса у подножия гряды Вактрос.', 47187),
(65886, 'ruRU', 'К Щиту Ронина', 'Встретьтесь с Дрокком Свиткорезом на обзорной площадке башни.', 'Рашагет и ее воины стихий хотят бросить все силы на ту башню на севере под названием Вактрос. Нельзя допустить, чтобы этот рубеж пал!\n\nМы с Кадгаром отправимся вперед и будем сражаться в небе.\n\nТы тем временем выдвигайся к Щиту Ронина, крайнему лагерю Кирин-Тора в этой местности.\n\nТы доберешься туда быстрее, если взлетишь на своем драконе с вершины архивов.\n\nПроверь, как идут дела у наших союзников, и отправляйся к Вактросу.\n\nМы будем рассчитывать на твою поддержку с земли.', '', '', '', '', '', 'Встретьтесь с Дрокком Свиткорезом в Щите Ронина.', 47187),
(65875, 'ruRU', 'Драконий выходной', 'Найдите разнообразные напитки для Вазаллии.', 'Мы целую вечность проторчали в Запределье... Постоянно сражались, не зная отдыха!\n\nДраконам иногда тоже нужно отдохнуть на берегу моря, сжимая в когтях стаканчик холодного напитка.\n\nМожет, ты мне поможешь расслабиться? Будь $gдобр:добра;, найди мне несколько напитков из этого списка. Нам надо пополнить запасы.', '', '', '', '', '', '', 47187),
(65873, 'ruRU', 'Вожак стаи Темнолапов', 'Убейте Саблелапа и заберите его тотем.', 'Саблелап – верховный предводитель гноллов в этой части леса. Мы с ним уже пересекались... и закончилось это не лучшим образом.\n\nВ этот раз все было по-другому. Он носит с собой странный тотем, будто искажающий саму его сущность.\n\nНадо разобраться с Саблелапом и забрать этот тотем. Боюсь, гноллы связались с поистине темными силами.', '', 'Саблелап всегда отличался жестокостью, но тотем озлобил его еще больше.', 'Саблелап Зловонный', '', '', '', 47187),
(65872, 'ruRU', 'Больные затеи больных гноллов', 'Убейте $1oa |4гнолла:гноллов:гноллов; из стаи Темнолапов в логове Саблелапа.', 'Ветер доносит сюда странный запах. Здесь явно что-то не так...\n\nХану сказала, что гноллы в пещере ведут себя странно... и выглядят больными. Надо узнать, в чем тут дело.\n\nГлавное, не теряй бдительности. Несмотря на хилый вид, они наверняка все еще хитры и опасны.', '', '', '', '', '', '', 47187),
(65871, 'ruRU', 'Гноллы в мешке', 'Спасите Норукка и еще $1oa |4пленного клыкарра:пленных клыкарров:пленных клыкарров;.', 'Мне удалось их выследить. Пойманных клыкарров, в том числе моего мужа, Норукка, увели в эту пещеру. \n\nНорукк нередко попадает в передряги, и я привыкла его выручать. Но мне не стыдно попросить о помощи.\n\nДавай спасем их!', '', '', '', '', '', '', 47187),
(65870, 'ruRU', 'Припасы!', 'Верните ящики с охотничьим снаряжением.', 'На Холмах Большого Леса нет и следа украденного у нас охотничьего снаряжения. Должно быть, его унесли в ту пещеру.\n\nПоищи там ящики с припасами, но будь начеку.\n\nНе думаю, что гноллы оставили бы их без защиты.', '', '', '', '', '', '', 47187),
(65869, 'ruRU', 'Еще одна засада', 'Поговорите с Акиуном и осмотрите $2oa |4труп:трупа:трупов; неподалеку.', 'Ужасная трагедия. И, возможно, далеко не последняя.\n\nРасспроси Акиуна, а затем осмотри всех погибших. \n\nЯ догадываюсь о том, что здесь случилось. Посмотрим, подтвердят ли следы нападения мое предположение.\n\nА я постараюсь успокоить своих напуганных друзей.', '', '', '', '', '', '', 47187),
(65868, 'ruRU', 'Не жевать!', 'Верните $1oa |4погребальное подношение:погребальных подношения:погребальных подношений;.', 'Я нашла одно из погребальных подношений Понольяку. Темнолапы наигрались с ним и бросили... Оно все покрыто следами от укусов!\n\nТакие подношения понадобятся в погребальной церемонии для недавно почившего вождя Искары.\n\nУ меня в голове не укладывается, как они решились точить клыки об эти священные вещи. Прошу тебя, поищи вокруг и другие подношения.', '', '', '', '', '', 'Встретьтесь с Хану у входа в логово Саблелапа на Холмах Большого Леса.', 47187),
(65867, 'ruRU', 'Вой на Холмах Большого Леса', 'Убейте Дургун, Керваля и Бакру.', 'У гноллов, напавших на наш караван, было три предводителя.\n\nДургун привела с собой десяток гиен.\n\nКерваль безумно хохотал каждый раз, когда мы начинали гнаться за ним и попадали в одну из его стальных ловушек.\n\nБакра глумилась над нами, не давая пощады.\n\nЕсли мы хотим вернуть украденное, их придется убить.', '', '', '', '', '', 'Встретьтесь с Хану у входа в логово Саблелапа на Холмах Большого Леса.', 47187),
(65866, 'ruRU', 'Щелчки ловушек', 'Обезвредьте $1oa |4острозубый капкан:острозубых капкана:острозубых капканов;.', 'Холмы впереди усеяны коварными острозубыми капканами.\n\nИх можно заметить, если хорошо присмотреться. Постарайся аккуратно их обезвредить хитрой уловкой клыкарров: длинной палкой. Конечно, ловушку можно вывести из строя, просто наступив на нее, но этот способ я тебе очень не советую.\n\nКогда справишься с большей частью ловушек, найди Хану. Мы со старейшиной Поа подоспеем, когда сможем.', '', '', '', '', '', 'Встретьтесь с Хану у входа в логово Саблелапа на Холмах Большого Леса.', 47187),
(65864, 'ruRU', 'Догнать караван', 'Догоните Брену у Холмов Большого Леса.', 'Тебе лучше догнать Брену. Она проходила здесь со своим караваном всего несколько часов назад.\n\nОни собирали наиболее значимые вещи нашего покойного вождя для достойного погребения.\n\nКараван с таким большим грузом не мог далеко уйти.', '', '', '', '', '', '', 47187),
(65855, 'ruRU', 'Помощь Лазурному Простору', 'Вернитесь к Норико Незабывающей в лагерь Антонидаса.', 'Энергия камня клятвы останется недоступна, пока повреждены силовые линии Лазурного Простора.\n\nДобраться до некоторых из них под силу только кому-то вроде Калесгоса... И все же ты сможешь помочь.\n\nНайди клыкарров, если их народ еще не вымер. Они жили здесь в мои времена и многое знают об этих землях.\n\nПоговори с одним из наших магических помощников, чтобы вернуться к союзникам.', '', '', '', '', '', 'Поговорите с Норико Незабывающей в лагере Антонидаса.', 47187),
(65854, 'ruRU', 'Возвращение камня клятвы', 'Пронаблюдайте, как Калесгос восстанавливает лазурный камень клятвы.', 'Отличная работа. Похоже, силовые линии в Лазурных архивах наконец-то восстановлены.\n\nКогда синие драконы еще были едины, я советовал своим братьям и сестрам никогда не сомневаться в силе смертных.\n\nНайди меня у камня клятвы к югу отсюда. Я активирую его и продолжу путь в Тальдразус.', '', '', '', '', '', 'Поговорите с Синдрагосой.', 47187),
(65852, 'ruRU', 'На самую вершину', 'Найдите в сумке с полезными вещами волшебный камень и примените его около источника магической энергии, чтобы добраться до верхнего яруса Лазурных архивов.', 'Что-то поглощает чародейскую энергию на вершине башни. \n\nВнизу она немного успокоилась, и ты сможешь взлететь на магии \"верхом\".\n\nНайди в сумке волшебный камень и воспользуйся им, чтобы подняться наверх. Я буду ждать тебя там.', '', '', '', '', '', 'Встретьтесь с Калесгосом на вершине Лазурных архивов.', 47187),
(65850, 'ruRU', 'Цикл моря', 'Поговорите с Бреной, чтобы увидеть погребальную церемонию.', 'Благодарю тебя, $n. Наши новые друзья рассказали мне все, что нужно. \n\nПогребальная церемония для их бывшего вождя вот-вот начнется. Искарские клыкарры отнеслись к нам невероятно радушно. Думаю, будет правильно разделить с ними это важное событие, прежде чем вернуться в архивы. \n\nСкажи Брене, что мы готовы и не хотим их задерживать.', '', '', '', '', '', '', 47187),
(65849, 'ruRU', 'В Искару', 'Встретьтесь с Бреной в Искаре.', 'Спасибо за все, что ты $gсделал:сделала;, $n. Теперь моя семья в безопасности.\n\nМы сможем наконец-то вернуться в Искару и увидеть, как старик Понольяк возвращается в море. Он был замечательным вождем и моим наставником. \n\nОтпразднуй это событие вместе с нами! На торжестве Цикла моря всегда всем рады.', '', '', '', '', '', 'Встретьтесь с Бреной в Искаре.', 47187),
(65848, 'ruRU', 'Книжный курс', 'Поговорите с Калесгосом, чтобы открыть портал. Затем расправьтесь с Бурошкурами-разлагателями и оскверненным древнем с помощью того, что он принесет.', 'Надо остановить это дерево! Благодаря силовым кристаллам у меня наконец хватит энергии. \n\nПоговори со мной, когда подготовишься. Я открою портал в Лазурные архивы и попробую забрать оттуда что-нибудь полезное. \n\nОтойди подальше, портал может повести себя непредсказуемо.', '', '', '', '', '', 'Поговорите с Калесгосом в пещере силовых кристаллов.', 47187),
(65847, 'ruRU', 'Перестройка', 'Сосредоточьтесь на силовом кристалле, а затем уничтожьте 3 заражения гнилью.', 'Теперь займемся силовой линией. Кажется, мои опасения подтвердились – ее затронуло разложение.\n\nНадо избавиться от гнили и ускорить исцеление, но моя проекция не сможет направить к линии достаточно энергии.\n\nСосредоточься на этом силовом кристалле. Благодаря связи между нами я смогу перенестись к тебе лично, и тогда моя сила возрастет.', '', '', '', '', '', 'Найдите Калесгоса у колючих зарослей Бурошкуров.', 47187),
(65846, 'ruRU', 'Чародейский мусор', 'Соберите $1oa |4силовой кристалл:силовых кристалла:силовых кристаллов; на окраинах Бурошкуров.', 'Силовая линия здесь, я чувствую! \n\nНо сначала надо остановить гноллов. То древо может причинить немало вреда по их приказу.\n\nПоищи силовые кристаллы, которые собрали гноллы. К счастью, они вряд ли осознали их силу. \n\nПринеси мне все, что сможешь найти. Они усилят мою проекцию, и я смогу призвать из архивов какое-нибудь оружие для борьбы с этим чудовищем.', '', '', '', '', '', '', 47187),
(65845, 'ruRU', 'Эхо павших', 'Поставьте тотем Брены рядом с $1oa |4телом:телами:телами; клыкарров, чтобы наладить связь с их духами.', 'Здесь клыкарры! Мои друзья, мой народ... моя семья. Они ушли на охоту не больше недели назад.\n\nМы даже не сможем забрать их тела: разложение зашло слишком далеко. \n\nНо их духи еще здесь. Ярость и сожаление не дают им отойти в мир мертвых. Каквиата, Лутокк, Туюки...\n\nПожалуйста, $n, возьми мой тотем и поставь его рядом с телами павших. Я поговорю с духами... и помогу им обрести покой.', '', '', '', '', '', '', 47187),
(65844, 'ruRU', 'Борьба с гнилью', 'Убейте $1oa |4гниющего древня:гниющих древней:гниющих древней; и $2oa |4Бурошкура-гниломета:Бурошкуров-гнилометов:Бурошкуров-гнилометов;.', 'Похоже, гниль разъела гноллам не только тела, но и мозг! \n\nКак и мы, гноллы – исконные обитатели этих земель, пусть даже не самые цивилизованные.\n\nНо племя Большого Леса уже заражено гнилью. Если так пойдет и дальше, они заразят весь Простор и уничтожат сами себя.\n\nМы не должны этого допустить. Как ни печально... придется их перебить.', '', '', '', '', '', '', 47187),
(65842, 'ruRU', 'Разоружение', 'Убейте оружейника Вордака и добудьте $1oa ед. оружия разрушителей миров.', 'Не люблю я этих разрушителей миров. Они слепо верят в возвращение Смертокрыла и не желают помогать нам у Обсидианового Трона.\n\nОружейник Вордак, который когда-то служил Черному принцу, похитил из цитадели большую партию оружия и раздал его разрушителям миров. Я не потерплю воровства. И предательства.\n\nОтправляйся к Дымящемуся пику и забери оружие... силой, если придется.', '', '', 'Оружейник Вордак', '', '', '', 47187),
(65841, 'ruRU', 'Остановить заражение', '', '', '', '', '', '', '', '', 47187),
(65838, 'ruRU', 'Вылазка в заросли', 'Исследуйте окраины Бурошкуров.', 'Если местные гноллы освоили магию разложения, силовая линия и все эти земли в большой опасности. \n\nМои проекции – это лишь слабые копии. Они не выдержат мощной энергии потревоженных стихий. Отправляйся в тот лес и осмотри участки распространения гнили. \n\nА я пообщаюсь с нашими союзниками-клыкаррами и постараюсь найти в лесу место, где смогу поддерживать свою проекцию. Встретимся там.\n\nМы обязаны придумать, как остановить разложение.', '', '', '', '', '', 'Поговорите с Калесгосом в колючих зарослях Бурошкуров.', 47187),
(65837, 'ruRU', 'Беда в сосновом лесу', 'Поговорите с часовым Олекком на Сосновой заставе на равнинах Он\'ары.', 'Недавно воины стихий совершили нападение на Шикаарском нагорье.\n\nЕсли ты хочешь что-то сообщить или помочь, найди кентавра по имени Олекк на Сосновой заставе. Скажи ему, что ты от меня. <Тиррен усмехается.> Надеюсь, эта старая развалина меня еще помнит.\n\nСтарайся не сворачивать с дороги, $p. Равнины стали опасным местом с тех пор, как все это началось.', '', '', '', '', '', 'Поговорите с часовым Олекком на Сосновой заставе на равнинах Он\'ары.', 47187),
(65836, 'ruRU', 'Обещание шторма', 'Встретьтесь с Уату в Сероверхих соснах.', '<Уату легко встает, как будто его рана моментально прошла.>\n\nЯ... я... я воткнул в себя осколок. Мне уже совсем не больно. Я неплохо себя чувствую. Даже отлично.\n\nОлекка все еще нет. Что-то пошло не так. Не стоило ему идти без меня!', '', '', '', '', '', '', 47187),
(65834, 'ruRU', 'Убить королеву', 'Убейте льдистую королеву.', 'Вот так! Немного научных знаний и обоснованных догадок, пара новых узоров на рунах, и у нас есть разряжатель магии! Или распылитель? Обезвреживатель?\n\nАй, все равно! Их королеве это точно не понравится, уж поверь мне. А от нее-то и нужно избавиться, чтобы остановить угрозу. Давить мелочь бесполезно, мы только замедлим их натиск. Надо уничтожить источник.', '', 'Никогда не должно быть королевы-паучихи.', 'Льдистая королева', '', '', '', 47187),
(65833, 'ruRU', 'Вмешательство воинов стихий', 'Добудьте три рунических камня морозных шаманов.', 'Воины стихий наделяют пауков изначальным льдом и хотят натравить их на драконов в Лазурном Просторе. Такого допускать нельзя.\n\nВон та мерзлая троица всем тут заправляет. Разберись с ними и принеси мне рунические камни – те, которыми они направляют магию стихий. Попробуем прервать ее поток.', '', '', '', '', '', '', 47187),
(65832, 'ruRU', 'Дворфийский антифриз', 'Найдите $1oa |4флягу:фляги:фляг; с дворфийской незамерзайкой.', 'У меня тут проблемка, $gмалой:дорогуша;. Эти поедатели снега оставили меня в глыбе льда. Я не замерз до смерти только потому, что припрятал у себя средство как раз для таких случаев. \n\nПравда, заначек у меня было больше, но эти ворюги все вытащили! Я скоро останусь без подогрева!\n\nОкажи дворфу услугу, принеси мои фляги, пока у меня кровь в жилах не застыла.\n\nИ еще вот что: если вдруг придется вытащить флягу у паука из закромов, мне об этом не рассказывай. О таком лучше не знать.', '', '', '', '', '', '', 47187),
(65806, 'ruRU', 'Марукай', 'Доберитесь до Марукая.', '<Хан Сансок подает знаки, и Окир озвучивает ее речь.>\n\nУ этой рощи, неподалеку от склона горы, расположился Марукай. Наше путешествие близится к концу. \n\nНа время хурала провозглашается перемирие, но после предупреждения он\' Сештэн лучше быть начеку.', '', '', '', '', '', '', 47187),
(65805, 'ruRU', 'Связь с Он\'арой', 'Соберите на речном берегу $1oa |4пучок:пучка:пучков; речного тростника, $2oa |4хвостовое перо:хвостовых пера:хвостовых перьев; и сердце саламантеры.', 'Ветер дует все сильнее, $n. Он\'ара обращается ко мне, и я должна ответить на зов.\n\nМне понадобятся ингредиенты для ритуала: тростник с речного берега, перья из хвостов диких уток и сердце саламантеры. Собери эти компоненты у реки, чтобы я смогла услышать ее голос.', '', '', '', '', '', '', 47187),
(65804, 'ruRU', 'Ради еды и соперничества', 'Добудьте $1oa |4кусок:куска:кусков; свежей дичи в Степи Странствий.', 'На хурал собираются кентавры Маруук со всех равнин. Встреча длится много дней.\n\nНакормить столько кентавров – большой труд. Клан Шикаар снабжает хурал мясом для общих трапез. По традиции мы охотимся прямо на пути в Марукай. \n\nТебе тоже нужно внести посильный вклад.', '', '', '', '', '', '', 47187),
(65803, 'ruRU', 'В город', 'Идите вместе с шикаарским караваном через Степь Странствий.', 'Во время хурала кланы собираются вместе, советуются и обмениваются новостями. Хотя на равнинах живет много кланов, все кентавры принадлежат одному племени – Маруук.\n\nКараван готов к путешествию. Поскольку путь до Марукая неблизкий, мы будем делать привалы по дороге.\n\nКогда и ты подготовишься к отъезду, найди меня в караване. Не вынуждай нас тебя ждать.', '', '', '', '', '', '', 47187),
(65802, 'ruRU', 'Припасы для путешествия', 'Добудьте $1oa |4контейнер:контейнера:контейнеров; с лагерными припасами вокруг заставы Лесной тропы и $2oa |4стручок:стручка:стручков; дикоцвета из ближайшего леса.', '<Хан Сансок изъясняется жестами, и Окир говорит за нее вслух.>\n\nПока ты путешествуешь с нами, будешь работать, как и остальные. Горлоки повадились воровать у нас медикаменты. Пропажу надо восполнить. Добудь в окрестностях оранжевых цветов, чтобы мы смешали новые порошки.\n\nТакже на стоянке остались припасы, которые надо отнести к каравану. Собери их, пока занимаешься цветами.\n\nКогда у тебя будет все необходимое, приходи к Томуль.', '', '', '', '', '', 'Явитесь к разведчице Томуль.', 47187),
(65801, 'ruRU', 'Знакомство', 'Представьтесь кентаврам из клана Шикаар.', '<Хан Сансок изъясняется жестами, и Окир говорит за нее вслух.>\n\nСменилось немало поколений с тех пор, как на этих землях бывали иноземцы вроде тебя. Повсюду рыщут воины стихий, искушающие местных существ запретной магией. Сейчас нам нелегко довериться посторонним.\n\nЧтобы с тобой путешествовать, нам надо узнать тебя получше. Представься другим участникам клана.', '', '', '', '', '', 'Явитесь к разведчице Томуль.', 47187),
(65798, 'ruRU', 'Прагматичный подход', 'Собирайте оружие и убивайте нокхудов в предместьях клана Нокхуд.', 'Клан Шикаар пошел в атаку на нокхудов на севере. Мне претит сама мысль о такой низости, как мародерство, но увы – сейчас это необходимое зло. Если принесешь нам оружие с поля битвы, я щедро тебе отплачу.\n\nА если то будет оружие нокхудов, может, предки отнесутся ко мне не так сурово.', '', '', '', '', '', '', 47187),
(65796, 'ruRU', 'Лучшая защита...', 'Убейте Сирену Клыколомку.', 'В этот раз наш путь лежит через территорию клана Нокхуд. Долгое время между нами сохранялись напряженные, но все же мирные отношения. С тех пор все изменилось. \n\nЕсли мы не нанесем удар первыми, то станем для них уязвимы. Мои разведчики видели у Круга драконов одного из их полководцев. Напади, как только ее увидишь. Не дай ей собрать союзников, чтобы те застали нас врасплох по пути.', '', '', '', '', '', '', 47187),
(65795, 'ruRU', 'Постепенные шаги', 'Встретьтесь с посланником Тауразой на Рубиновой заставе.', 'Зеленым драконам нужна твоя помощь, герой. Дочь моей сестры и ее сородичи погрузились в Изумрудный Сон, чтобы вернуть силу своему камню клятвы. С тех пор от них нет вестей.\n\nНайди кентавров, которые правят равнинами Он\'ары. Тебе может потребоваться их связь с землей и духами, чтобы разбудить зеленых драконов.\n\nОднако постарайся не обидеть кентавров ненароком: они гордый народ и не потерпят оскорблений от чужаков. Поговори с нашим послом, он тебе все объяснит.', '', '', '', '', '', 'Встретьтесь с посланником Тауразой на Рубиновой заставе.', 47187),
(65794, 'ruRU', 'Долг хранителей', 'Понаблюдайте, как яйца черных драконов возвращаются в Омуты Жизни.', 'Благодарю тебя, |3-6($c). Жаль, что тебе пришлось провести столько времени в обществе этих двоих.\n\nНа красных драконах лежит обязанность оберегать и выращивать потомство всех наших сородичей. Даже тех, которые иногда нас утомляют.\n\nТеперь, когда яйца черных драконов вернулись к нам, все рода по-настоящему объединились впервые за тысячелетия. Думаю, это и восстановит рубиновый камень клятвы.\n\nПоговори со мной, когда будешь $gготов:готова; принести яйца к обсидиановым Омутам Жизни.', '', '', '', '', '', '', 47187),
(65793, 'ruRU', 'Черновой план', 'Сопроводите яйца к Омутам Жизни.', 'Теперь, когда камню клятвы возвращена энергия, мы должны перенести наших потомков в Омуты Жизни. Эти воды должны быть доступны для всех истинных драконов.\n\nУвы, мы выдали себя, и наши враги будут зорко следить за небесами. Последний отрезок пути мы проделаем пешком, чтобы скрыться от их взглядов.\n\nНайди меня возле Обсидианового бастиона, |3-6($c). Я буду рад, если ты присоединишься ко мне от имени Хранительницы жизни.', '', '', '', '', '', 'Поговорите с Сабеллианом на вершине Рубинового святилища Жизни.', 47187),
(65792, 'ruRU', 'Зуб за зуб', 'Убейте $1oa |4камнезуба:камнезубов:камнезубов; вместе с Толуйджином.', 'Толикви клянется, что всего пару дней назад в одиночку одолела камнезуба. Наши души связаны, и потому я не хочу обвинять ее во лжи. Вместо этого... \n\nЯ докажу ей и всем остальным, что моя часть души сильнее! Ближайшая охота на камнезубов проходит на северо-востоке. Встретимся там!', '', '', '', '', '', '', 47187),
(65791, 'ruRU', 'Хранительница жизни на задании', 'Встретьтесь с Алекстразой у рубинового камня клятвы.', 'Скоро Омуты Жизни вновь заполнятся яйцами всех родов.\n\nСпасибо тебе, $n. Мою благодарность не выразить словами.\n\nНайди Хранительницу жизни у камня клятвы. Скажи ей, что мы готовы разместить яйца.', '', '', '', '', '', 'Встретьтесь с Алекстразой у рубинового камня клятвы.', 47187),
(65789, 'ruRU', 'Там, где спят реки', 'Соберите реагенты в топи Илистого Древа.', 'В топи Илистого Древа можно найти материалы, необходимые для связи с предками. Увы, в этом месте обитает племя Илистого Плавника, и собирать здесь ингредиенты небезопасно.\n\nЯ буду очень тебе благодарен, если ты добудешь несколько бутонов в болотах или из запасов этого племени.', '', '', '', '', '', '', 47187),
(65783, 'ruRU', 'Добро пожаловать к нашему очагу', 'Встретьтесь с разведчицей Томуль на заставе Лесной Тропы.', 'Ты $gсражался:сражалась; вместе с нашими охотниками и $gзаслужил:заслужила; место у нашего очага.\n\nХан готовит к путешествию караван на стоянке у болота. Я доложу ей о твоем визите и его цели.\n\nНадеюсь, дорогу ты отыщешь $gсам:сама;.', '', '', '', '', '', 'Встретьтесь с разведчицей Томуль на заставе Лесной Тропы.', 47187),
(65782, 'ruRU', 'Под замком', 'Добудьте ключ от клетки разрушителей миров и освободите Айясант.', 'Когда до нас дошли слухи о культе Смертокрыла, мажордом Селистра велела мне наставить наших заблудших собратьев на путь истинный. Мы надеялись, что все дело в простом недопонимании.\n\nКак видишь, мы ошибались.\n\nС их лидером надо что-то решать... Но сначала помоги мне выбраться из клетки. Найди ключ и принеси его сюда.', '', '', '', '', '', '', 47187),
(65780, 'ruRU', 'Доказательство силы', 'Убейте пылающего протодракона.', 'Кое-кого дар драконов восхитил бы, но клан Шикаар хочет увидеть тебя на охоте.\n\nОдин из наших охотничьих отрядов только что сбил протодракона с силой огня. Помоги им загнать добычу и покажи свое охотничье искусство.', '', 'Достигнув совершеннолетия, юный кентавр впервые принимает участие в охоте на протодракона.', 'Пылающий протодракон', '', '', '', 47187),
(65779, 'ruRU', 'На равнины', 'Встретьтесь с разведчиком клана Шикаар на равнинах Он\'ары.', 'Зеленые драконы вернулись в свои сады на окружающих равнинах. Королева Алекстраза просит тебя встретиться с Меритрой из Сна.\n\nПлемена кентавров на этих равнинах – свирепые охотники. Чтобы попасть в Изумрудные сады, тебе сначала понадобится наладить с ними отношения.\n\nДержись почтительно, но не проявляй слабости.', '', '', '', '', '', 'Встретьтесь с разведчиком клана Шикаар на равнинах Он\'ары.', 47187),
(65778, 'ruRU', 'Похлебка для гарпий', 'Замаскируйтесь и протестируйте прототип \"яйца\" на личной поварихе матриарха.', 'Пора пустить в ход актерский талант, $n!\n\nЧто? У тебя нет такого таланта? Ну тогда хорошо, что я сделала такую безупречную маскировку под гарпию – перышко к перышку!\n\nМы с Сегалией еще не закончили финальную версию \"яйца\" для матриарха, но я изготовила прототип, который ты протестируешь на поварихе.\n\nИ не о чем беспокоиться! Благодаря перьям ты на 12% лучше $gзащищен:защищена; от взрыва!', '', '', '', '', '', '', 47187),
(65777, 'ruRU', 'Испачканное ожерелье', 'Найдите того, кто разбирается в охоте на равнинах и артефактах ручной работы.', '<Древние символы на ожерелье довольно трудно разобрать, но сделано оно, похоже, из шкуры животного и резных костей.\n\nВозможно, опытный охотник сможет определить ценность этой вещицы.>', '', '', '', '', '', '', 47187),
(65770, 'ruRU', 'Обещания надо выполнять', 'Пообещайте посвященной Радии сохранить ее секрет.', 'Животные тебя любят. А они обычно хорошо чувствуют характер.\n\nА ты... умеешь хранить секреты? Я хочу познакомить тебя с другом. О ней больше никто не знает.\n\nПообещай никому не рассказывать. Моя он\' изгнала бы меня с равнин, если бы узнала.', '', '', '', '', '', 'Поговорите с охуном Годолото.', 47187),
(65769, 'ruRU', 'Ледяная паутина', 'Освободите $1oa |4выжившего:выживших:выживших; из коконов в долине льдистых ткачей.', 'Когда напали арахниды и их хозяева – воины стихий, многих моих друзей и коллег схватили. \n\nЯ видела, как их запутали в огромные коконы ледяной паутины и куда-то утащили. Боюсь даже представить, какая участь им уготована. \n\nПрошу тебя, освободи всех, кого сможешь!', '', '', '', '', '', '', 47187),
(65761, 'ruRU', 'Неожиданное продолжение приключений', 'Отыщите и спасите Радию, заручившись помощью Годолото.', '<Годолото обвиняюще смотрит на вас пронзительным взглядом.>\n\n<Может быть, охун поможет вам отыскать и спасти Радию.>', '', '', '', '', '', '', 47187),
(65760, 'ruRU', 'Готовность к службе', 'Следуйте за Сендракс к заставе Драконьего Сердца.', 'Я знаю о джарадинах только по книгам.\n\nЭто древние враги драконов, могучие великаны, которым подвластна сила земли и лавы... Они не успокоятся, пока не истребят всех драконов до единого.\n\n<Сендракс хмурится, смотря вдаль на очертания вулкана.>\n\nПо словам моего инструктора, джарадины исчезли вместе с драконами, уснув глубоко под землей.\n\nЕсли они пробудились, дракончики на островах в огромной опасности!\n\nИдем, я отведу тебя на заставу Драконьего Сердца к командиру Летанаку.', '', '', '', '', '', 'Поговорите с командиром Летанаком на заставе Драконьего Сердца.', 47187),
(65758, 'ruRU', 'Грунгир Исследователь', 'Найдите Грунгира Стальнотруба.', '$N! Среди спасенных тобой участников экспедиции не было моего коллеги из Лиги исследователей, Грунгира Стальнотруба. Ему удалось самому выбраться из западни, но потом он увидел, как мало нас спаслось, развернулся и побежал обратно! Совсем один!\n\nОтваги у этого увальня поровну с безрассудством. Что бы ни случилось с ним там, он этого не заслуживает.\n\nНайди его, пожалуйста.', '', '', '', '', '', '', 47187),
(65752, 'ruRU', 'Надоедливая магия', 'Убейте $1oa |4пожирающего змея:пожирающих змеев:пожирающих змеев;.', 'Дикая магия привлекла множество маназмеев, поглощающих магическую энергию из архивов.\n\nОни пожирают ее с такой скоростью, что силовые линии не успевают прийти в равновесие... что мешает нам активировать камень клятвы.\n\nЯ создам из нестабильной магии, которую ты $gсобрал:собрала;, что-то вроде крюка.\n\nУничтожь им нескольких змеев. Уровень чародейской энергии ненадолго поднимется, и я смогу перенастроить силовые линии внизу.', '', '', '', '', '', '', 47187),
(65751, 'ruRU', 'Настройка платформы', 'Рассейте $1oa |4область:области:областей; нестабильной чародейской энергии на верхнем ярусе Лазурных архивов.', 'Похоже, здесь находится последняя утечка чародейской энергии. \n\nЯ продолжу работать с энергией из силовых потоков, а ты воспользуйся собранной чистой магией, чтобы рассеять аномалии в этом месте.', '', '', '', '', '', '', 47187),
(65750, 'ruRU', 'Восьминогое чудовище', 'Убейте $1oa |4паука:пауков:пауков; или |4ядовитого паука:ядовитых пауков:ядовитых пауков; льдистой нити и $2oa |4смотрителя-воина:смотрителей-воинов:смотрителей-воинов; стихий в долине льдистых ткачей.', '$C!\n\nЕсли не возражаешь, нужна твоя помощь...\n\nНаша совместная экспедиция должна была изучить необычных арахнидов в этом месте. Как видишь, все пошло не по плану. \n\nИзначально мы думали, что эти арахниды эволюционировали, адаптируясь к окружающей среде. Как бы не так! Это надругательство над природой – дело рук воинов стихий!\n\nЯ очень серьезно отношусь к своей работе по защите природы, но время изучать живые образцы прошло. Зато мы сможем изучить трупы тех, кто сотворил это с ними. Нельзя допустить, чтобы этот ужас распространился. \n\nТы ведь поможешь нам?', '', '', '', '', '', '', 47187),
(65711, 'ruRU', 'Приглушенный рокот', 'Убейте извлекающих шторм и спасите громоспина Яшу из лагеря Кейган.', 'Это ты! Хвала Он\'аре. Я притворялась раненой, чтобы обдурить следующего дуболома, у которого хватит глупости сюда войти. Кхм... эти прихвостни наложили на меня какое-то сковывающее заклятье. Я разберусь с этим.\n\nЯшу они тоже держат в пещере. Спаси ее. Я сама смогу освободиться.\n\nДелай что угодно, только помоги ей.', '', '', '', '', '', '', 47187),
(65709, 'ruRU', 'Удаление лишней магии', 'Найдите в сумке с полезными вещами силовой скипетр и почините с его помощью 2 платформы.', 'Мы не сможем активировать камень клятвы в Лазурных архивах, пока не найдем способ контролировать силовую энергию.\n\nЕе должны сдерживать три руны, но две из них переполнены нестабильной магией.\n\nПрости, что приходится поручать это тебе – Кадгар слишком занят, а мои сородичи проигнорировали призыв.\n\nВ выданной тебе сумке с полезными вещами есть силовой скипетр.\n\nИспользуй его, чтобы починить руны.', '', '', '', '', '', '', 47187),
(65702, 'ruRU', 'Обезумевшие', 'Добудьте $1oa ед. нестабильной чародейской энергии.', 'Когда-то в Лазурных архивах синие драконы исследовали и изучали магию.\n\nТеперь здесь не осталось никого, кроме меня.\n\nЭто место сдерживало силовые линии под Лазурным Простором, но архивы и их служители вышли из-под контроля.\n\nЕсли мы восстановим здесь порядок, я смогу вновь активировать камень клятвы.\n\nМестные големы и элементали переполнены нестабильной чародейской энергией. Ее нужно куда-то направить.\n\nУничтожь этих существ и постарайся собрать как можно больше энергии.', '', '', '', '', '', '', 47187),
(65701, 'ruRU', 'Хранитель или опустошитель', 'Выберите специализацию.', 'Если эти драконы говорят правду, нас ждет тяжелое сражение. Соберись с силами, $gпробудитель:пробудительница;.\n\nПора выбрать твою боевую специализацию. Хочешь ли ты оберегать своих союзников или уничтожать врагов? \n\nЧтобы отточить свои боевые навыки, выбери \"Опустошитель\".\n\nЧтобы сосредоточиться на навыках целителя, выбери специализацию \"Хранитель\".\n\nОбе специализации хорошо тебе послужат. И помни, что в дальнейшем специализацию можно сменить или адаптировать к другому стилю боя.', '', '', '', '', '', '', 47187),
(65691, 'ruRU', 'Тень черных крыльев', 'Бросьте вызов Цайгеноту, Гласу Нелтариона.', 'Мы найдем Глас Нелтариона внизу, где он отравляет умы своих последователей. \n\nНа вид это такой же драконоид, как и я, но по-драконьи говорит с трудом, словно гладкокожий. \n\nЗдесь наверняка есть какая-то хитрость... возможно, иллюзия. Давай разберемся с ним, и правда раскроется сама.', '', 'Самопровозглашенный Глас Нелтариона и предводитель разрушителей миров.', 'Цайгенот', '', '', '', 47187),
(65690, 'ruRU', 'Опасливые сектанты', 'Найдите Айясант в Дымящемся гнездовье.', 'Вчера к нам прибыла еще одна незнакомка. Она назвалась послом красных драконов и попросила встретиться с нашим лидером, Гласом Нелтариона. \n\nНо Глас жутко рассердился. Он сказал, что Хранитель Земли так нас испытывает и посла нужно казнить!\n\nЯ понимаю, что мы не должны верить чужакам, но убивать их – это уже слишком! Прошу, помоги ее спасти.', '', '', '', '', '', 'Поговорите с Айясант в Дымящемся гнездовье.', 47187),
(65689, 'ruRU', 'Множество отражений Калесгоса', 'Доберитесь до Лазурных архивов с помощью кристального пилона.', 'Рад возможности наконец официально познакомиться, $n. Я Калесгос, верховный маг Кирин-Тора и Аспект синих драконов.\n\nМне нужна помощь в восстановлении Лазурных архивов и усилении камня клятвы моего рода. То есть пара крепких рук.\n\nСейчас я нахожусь на верхнем ярусе архивов. Мне удалось восстановить пилон здесь рядом. Попробуй подняться сюда с его помощью.', '', '', '', '', '', 'Поговорите с Калесгосом в Лазурных архивах.', 47187),
(65688, 'ruRU', 'Встреча с Калесгосом', 'Заберите сумку с полезными вещами и найдите Калесгоса на первом ярусе Лазурных архивов.', 'Боюсь, нам придется разделиться. Воинов стихий на востоке нельзя оставлять без внимания.\n\nПоэтому попрошу тебя вот о чем: отправляйся в Лазурные архивы вместо меня и помоги Калесгосу вернуть лазурный камень клятвы.\n\nНе знаю, что там происходит, но тебе в любом случае понадобятся припасы.\n\nОбратись к распорядителю порталов – тебе дадут вещи, которые пригодятся в пути.\n\nУдачи, $n. Калесгос будет рад твоей помощи.', '', '', '', '', '', 'Встретьтесь с Калесгосом у входа в Лазурные архивы.', 47187),
(65687, 'ruRU', 'По заслугам', 'Убейте $1oa |4дракона:драконов:драконов; разрушителей миров.', 'Некоторые последователи... очень злючие.\n\n<Слиток потирает недавно пострадавший нос.>\n\nВот раньше все было не так. Но потом пришел Цайгенот и сказал, что сила – это самое главное. И теперь все постоянно дерутся.\n\nЯ стараюсь отбиваться! Но у них такие толстые шкуры... а я маленький.\n\nЗато ты нет! Ты с такими, небось, каждый день дерешься. Не поможешь мне?', '', '', '', '', '', '', 47187),
(65686, 'ruRU', 'В Лазурный Простор', 'Встретьтесь с Гланией Благословенной в Лазурном Просторе.', 'Приветствую тебя, $n! \n\nМы с Пакиной прибыли сюда искать союзников для целей Кирин-Тора.\n\nМы собираемся взять под контроль неуправляемую магию, рассеянную по всему Лазурному Простору.\n\nА Калесгосу, Аспекту синих драконов и одному из наших предводителей, нужна помощь в поисках лазурного камня клятвы.\n\nЕсли хочешь помочь, иди дальше по этой дороге, там найдешь Гланию Благословенную.\n\nОна расскажет тебе, с чего начать в первую очередь.', '', '', '', '', '', 'Встретьтесь с Гланией Благословенной в Лазурном Просторе.', 47187),
(65615, 'ruRU', 'Магические незваные гости', 'Осмотрите маяк.', 'Этот маяк впереди... до того, как нас пленили, его там не было.\n\nЯ плохо разбираюсь в чарах, но это точно тайная магия. Такая же, как у того синего дракона в колыбели.\n\nОн назвал имя... Малигос. Звучит знакомо – но многое из того, чему нас учил Хранитель Земли, теперь как в тумане.\n\nЕсли это Малигос заключил нас в стазис, может, и чародейский маяк был установлен по его приказу.\n\nОсмотри его и доложи мне. Сделай так, чтобы с его помощью враги не могли призывать подкрепления.', '', '', '', '', '', '', 47187),
(65613, 'ruRU', 'Драконы всегда в моде', 'Примите человеческий облик.', 'Уверен, твое появление в Оргриммаре привлекло внимание местных. Кто-то отнесся к этому спокойно, а кто-то не очень.\n\nВ юности я выбрал облик смертного, который ты видишь сейчас, и это позволило мне жить в Крутогорье в мире с тауренами.\n\nДа, у нас с тобой разные пути, $p, но в тебе тоже есть сущность дракона. Так что ты наверняка научишься принимать собственный облик, чтобы находиться среди смертных.\n\nДавай немного пройдемся.', '', '', '', '', '', '', 47187),
(65606, 'ruRU', 'Знаменитость среди Маруук', 'Поговорите с Агари в Марукае.', 'Твои старания на благо клану не остались незамеченными. \n\nВозвращайся в Марукай. У меня есть для тебя припасы, которые помогут нам сотрудничать и дальше.', '', '', '', '', '', '', 47187),
(65595, 'ruRU', 'Одна паршивая овца', 'Уничтожьте корень разложения.', 'От гнили нет еды.\n\nГниль ранит друзей.\n\nУбьем гниль. Это долг мон-арха.', '', 'Этот мерзкий древень научил гноллов пользоваться магией разложения. И не следить за гигиеной.', 'Корень разложения', '', '', '', 47187),
(65594, 'ruRU', 'Царь гнолльей горы', 'Уничтожьте $2oa |4тотем разложения:тотема разложения:тотемов разложения;.', 'Глупая гниль. Думает, что всем заправляет. Я тут главный! Сейчас убьем ее. У меня теперь есть друзья из слизи.', '', '', '', '', '', '', 47187),
(65490, 'ruRU', 'Взрывоопасные выделения', 'Наполните автоматический пометосборщик Язвотрель.', 'Гарпии – это, конечно, приятный сюрприз, но я приехала в эти горы по одной-единственной причине: ЭКСКРЕМЕНТЫ!\n\nА именно экскременты синеперых рухов, после того как их съели и переварили жуки. Желудочный сок скарабеев усиливает взрывную мощность азотных веществ в десять раз! Как минимум!\n\nДержи. Это автоматический пометосборщик Язвотрель. Передави скарабеев на полу пещеры и собери драгоценную добычу.\n\nНаполни пометосборщик доверху, чтобы мы могли перейти к самому интересному: ВЗРЫВАМ!', '', '', '', '', '', '', 47187),
(65486, 'ruRU', 'Как на картинке', 'Прокатитесь с Френ на плоту каталогизатора и сделайте снимки местной фауны.', 'Прости. Надеюсь, ты не $gждал:ждала; слишком долго. Бывает, я засматриваюсь в телескоп.\n\nТебе тоже иногда кажется, что мир гораздо проще познавать с расстояния? Ничего не отвлекает, просто природа, где все идет своим чередом...\n\n<Каталогизатор Акунда вздыхает.>\n\nВижу, Корали дала тебе камеру. Отлично.\n\nСпустись по реке вместе с Френ. Сделай снимки животных в естественной среде обитания. Я хочу их изучить.', '', '', '', '', '', 'Вернитесь к каталогизатору Акунде в ее лагерь.', 47187),
(65475, 'ruRU', 'Как гарпия лапой', 'Принесите свиток Драконьего Крика Харлин Язвотрели на утесы Синего Пера.', '<Вы достаете обрывок пергамента из склизкой окровавленной сумки Рухоедки. Все, что вам удается различить, – это изображения гарпий, пожирающих огромные яйца.\n\nВы уверены, что эти грубые невразумительные каракули многое расскажут вашему любимому старшему орнитологу Харлин Язвотрели.>', '', '', '', '', '', 'Принесите свиток Драконьего Крика Харлин Язвотрели на утесы Синего Пера.', 47187),
(65453, 'ruRU', 'Изначальные вредители', 'Убейте $1oa |4изначального протодракона:изначальных протодраконов:изначальных протодраконов; на Диких берегах.', '<Золомолот с подозрением косится на протодраконов, затаившихся на гряде.>\n\nКлянусь, эти протодраконы приближаются к лагерю каждый раз, когда я поворачиваюсь к ним спиной...\n\nЭто точно не те драконы, к которым нас пригласил Абиссиан.\n\nЭто безжалостные хищники, которые не станут слушать уговоры. Придется ответить такой же жестокостью.\n\nЧтобы протодраконы не распоясались, придется сократить их число, иначе наша экспедиция не успеет и начаться.', '', '', '', '', '', 'Встретьтесь с дракомандиром Золомолот в посольстве Крылатого Приюта.', 47187),
(65452, 'ruRU', 'Исследователи в опасности', 'Спасите 3 участников Драконьей экспедиции на Диких берегах.', 'Не прими научное любопытство участников экспедиции за трусость, $p.\n\nМы тебе не отшельники, сгорбившиеся над книгами в одиноких башнях.\n\nМы искатели приключений, исследующие каждый уголок Азерота в погоне за знаниями!\n\nНо наша любовь к приключениям нередко приводит к опасным ситуациям, заставляя нас переоценивать свои возможности... Увы, именно это и произошло с несколькими нашими коллегами.', '', '', '', '', '', 'Встретьтесь с Налейдеей в посольстве Крылатого Приюта.', 47187),
(65451, 'ruRU', 'Сырье для практики', 'Добудьте $1oa |4чешуйку изначального протодракончика:чешуйки изначальных протодракончиков:чешуек изначальных протодракончиков;.', 'Эти протодраконы совсем не похожи на всех, которых я раньше видел в Азероте.\n\nИх чешуя от природы огнеупорна и прочнее стали, но при этом остается гибкой. Просто невероятно. \n\nМоим умельцам не терпится с ней поработать.\n\nДля начала добудь чешую протодракончиков – нам нужен максимально пластичный материал, пока мы учимся с ним работать.', '', '', '', '', '', 'Встретьтесь с боссом Магором в посольстве Крылатого Приюта.', 47187),
(65444, 'ruRU', 'К Драконьим островам!', 'Взойдите на борт \"Дерзкого дракона\" на башне дирижаблей рядом с Оргриммаром и отправляйтесь на Драконьи острова.', 'Нашему отряду первопроходцев удалось высадиться на Драконьих островах.\n\nБлагодаря отважным участникам Драконьей экспедиции мы подготовили на островах защищенное место высадки и уже связались с посольством драконов.\n\n$gГотов:Готова; отправиться с нами в новое плавание до Драконьих островов?', '', '', '', '', '', 'Встретьтесь с Налейдеей Речной Блеск на побережье Драконьих островов.', 47187),
(65443, 'ruRU', 'Организация экспедиции', 'Завербуйте в Оргриммаре исследователей, мастеров и ученых для экспедиции на Драконьи острова.', 'Я Налейдея Речной Блеск, рада знакомству.\n\nНам выпала небывалая возможность побывать на Драконьих островах. Потрясающе, не правда ли?\n\nЧтобы распределить обязанности, Реликварий объединится с нашими коллегами-исследователями. Как участница Драконьей экспедиции, я торжественно принимаю тебя в наши ряды.\n\nТолько сначала нам нужно набрать в команду еще нескольких участников. Что ж, займемся делом!', '', '', '', '', '', 'Встретьтесь с Налейдеей у башни дирижаблей около Оригриммара.', 47187),
(65439, 'ruRU', 'Шепот ветров', 'Поговорите с верховным магом Кадгаром у Оргриммара.', 'Здравствуй, $p, давно не виделись. Жаль, что у нас нет времени обменяться историями.\n\nВидишь ли, я только что говорил со старым другом... Разговор был бы очень познавательным, если бы не вселял такую тревогу.\n\nС внезапными открытиями такое бывает.\n\nЯ должен тебе все рассказать.', '', '', '', '', '', '', 47187),
(65437, 'ruRU', 'Приглашение Аспектов', 'Поговорите с Абиссианом.', 'Ты $gприбыл:прибыла; как раз вовремя, $p.\n\nЯ говорил с советом Орды. Они приняли приглашение Аспектов и согласились отправиться на Драконьи острова.\n\nТы тоже $gприглашен:приглашена;.\n\nИ еще одно... Думаю, ты уже $gзаметил:заметила; в Оргриммаре новые лица. Это драктиры, твои новые союзники. По пути на острова ты сможешь узнать их получше.\n\nА пока давай все обсудим.', '', '', '', '', '', '', 47187),
(65436, 'ruRU', 'Драконьи острова ждут', 'Встретьтесь с Гневионом в Штормграде.', 'Отличные новости, друг мой! Драконьи острова пробуждаются!\n\nМой народ покинул их во времена Раскола, и острова погрузились в глубокий сон. Но теперь они вновь взывают к нам.\n\nОстрова скрывают немало чудес, но и немало опасностей. Мы не сумеем вернуть свое наследие без помощи наших смертных союзников.\n\nВстретимся в Штормграде. Там я представлю Альянсу приглашение Аспектов.', '', '', '', '', '', '', 47187),
(65435, 'ruRU', 'Драконьи острова ждут', 'Встретьтесь с Абиссианом в Оргриммаре.', 'У меня для вас новости, герои Орды. Драконьи острова пробуждаются!\n\nВо времена Раскола эти земли погрузились в глубокий сон, но теперь они вновь призывают меня и моих сородичей.\n\nОстрова скрывают немало чудес, но и немало опасностей. Мы не сумеем вернуть свое наследие без помощи наших смертных союзников.\n\nСкоро я представлю приглашение Аспектов совету Орды в Оргриммаре. Встретимся там и выслушаем их ответ.', '', '', '', '', '', '', 47187),
(65422, 'ruRU', 'Охота за сокровищами – легко сказать', 'Возьмите снаряжение скалолаза, найдите на скале опору и доберитесь до вершины, не сорвавшись.', 'Я все по твоим глазам вижу: тебя так и тянет забраться на эту гору и узнать, что на вершине!\n\nОдин скалолаз другого за версту узнает. Мы всегда хотим показать горе, кто круче.\n\nЧто ж, тебе повезло! У меня как раз с собой запасное снаряжение. Бери себе комплект и начинай подъем!', '', '', '', '', '', 'Поговорите с Твитс Легкозубчик на вершине горы.', 47187),
(65421, 'ruRU', 'Покорить все горы мира', 'Возьмите снаряжение скалолаза, найдите на скале опору и доберитесь до вершины, чтобы спасти первопроходца Йипс!', 'Надеюсь, ты все быстро схватываешь, |3-6($c). Потому что учить тебя времени нет! \n\nБери себе комплект и начинай подъем.\n\nКогда будешь на вершине, брось парашют подруге Йипс. Бедняжка запуталась в лианах, когда элементали воздуха подбили наш самолет!\n\nИ поскорее! Нам надо отсюда выбираться!', '', '', '', '', '', '', 47187),
(65417, 'ruRU', 'Разгадать все', '', '', '', '', '', '', '', '', 47187),
(65403, 'ruRU', 'Запутанная ситуация', '', '', '', '', '', '', '', '', 47187),
(65374, 'ruRU', 'Долой перья', 'Выдерните $1oa |4перо:пера:перьев; птенцов.', 'Харлин рассказала, что она делает для тебя маскировку! Поверить не могу! Но ей нужны перья птенцов рухов, чтобы завершить наряд.\n\nК счастью, я только что закончила ремонтировать \"Перощип 3300\"!\n\nГарпии Драконьего Крика ловят птенцов на нижних утесах, чтобы растить и разводить их самим. Возьми \"Перощип\" и выхвати птенцов прямо у них из-под носа. Он заодно еще и перьев надергает!\n\nКак там говорится? Приготовить яичницу, не разбив яиц!', '', '', '', '', '', '', 47187),
(65373, 'ruRU', 'Понадергать деталей', 'Соберите части \"Перощипа 3300\".', 'Нет... Я совершила ужасную ошибку.\n\nХарлин доверила мне свое необыкновенное изобретение: знаменитый \"Перощип 3300\"!\n\nЯ пошла к южной пещере, чтобы выдернуть несколько перьев у синеперых рухов для ее исследований, но гарпии вдруг как нападут! Когда я убегала, \"Перощип\" разбился на куски.\n\nПожалуйста, собери его части! Наверное, они валяются по всей пещере, как сброшенные чешуйки.\n\nЯ могу сложить их обратно. Сто процентов. Ну, может не совсем сто.', '', '', '', '', '', '', 47187),
(65371, 'ruRU', 'Собственное гнездышко', 'Соберите $1oa |4коготь:когтя:когтей;, гарпий, $2oa |4посох:посоха:посохов; гарпий и $3oa |4ядро:ядра:ядер; речного духа.', 'В свитке, который ты $gнашел:нашла;, приказано относить все яйца синеперых поварихе гарпий Жарь-Ине. Как видно, матриарх Драконьего Крика отказывается есть их сырыми и несолеными.\n\nТогда мы сами подадим ей наше фирменное яйцо. Со ВЗРЫВНЫМ вкусом... чтобы оно взорвалось у нее во рту. А как же иначе.\n\nКак ты его доставишь? Мы тебя замаскируем!\n\nУбей существ на нижних скалах и собери вот эти части, а я разодену тебя в пух и прах.', '', '', '', '', '', '', 47187),
(65363, 'ruRU', 'Опасное состояние', 'Убейте укротителя Хельзида и $1oa |4подчиненного джиро:подчиненных джиро:подчиненных джиро;.', 'Наши враги напали на джиро и вырвали их из круга. Теперь эти джиро нестабильны. Они угрожают порядку вещей.\n\nИх придется устранить.', '', 'Жестокий и коварный прислужник Тюремщика.', 'Укротитель Хельзид', '', '', '', 47187),
(65313, 'ruRU', 'На вкус как курица', 'Убейте Хаутию Рухоедку.', 'Тарзера мне нравится. Умеет обращаться с техникой. Вот только паникует на ровном месте.\n\nНапример: когда я послала ее в пещеры к югу отсюда, она моментально сбежала от необычно крупной гарпии. Кажется, та же гарпия отдавала остальным приказы.\n\nМожет, это и есть матриарх стаи? Или своего рода командир? Сходи и узнай, $n.\n\nИ не бойся, так сказать, помять им перышки.', '', 'Огромная кровожадная гарпия Драконьего Крика, которая любит полакомиться костями синеперых рухов.', 'Хаутия Рухоедка', '', '', '', 47187),
(65307, 'ruRU', 'Нельзя забывать о пощаде', 'Исцелите раненых драктиров и драконидов.', 'Отрава в Колыбели чуть не убила нас всех. Пока противоядие готовится, пожалуйста, отыщи раненых и исцели их. \n\nДа, синих драконидов тоже. Целительные Крылья не могут стоять и смотреть, как другие страдают.', '', '', '', '', '', '', 47187),
(65306, 'ruRU', 'Разводчик гнили', 'Добудьте $1oa |4порцию:порции:порций; вонючей слизи из разлагающейся гнили.', 'Гниль мерзкая. Она смердит и делает больно. Есть идея, но нужна слизь. Неси слизь!', '', '', '', '', '', '', 47187),
(65302, 'ruRU', 'Ключи от королевства', 'Добудьте ключ и откройте им тайник с оружием.', 'Есть план. Нужно оружие. Хорошее оружие заперто. У гноллов в лагере есть ключ. Защищает оружие.\n\nБери палки поострее. На них больше крови.', '', '', '', '', '', '', 47187),
(65287, 'ruRU', 'Отделяем желток', 'Соберите $1oa |4яйцо:яйца:яиц; синеперых рухов.', 'Я расшифровала свиток. Сюрприз-сюрприз! Новости просто отвратительные!\n\nГарпии едят синеперых не просто ради пропитания. Оказывается, они нашли какие-то заклятия, которые передают им силу съеденных рухов. Причем лучше всего действуют яйца!\n\nСпустись по скалам и спаси как можно больше их яиц. Это отвлечет гарпий, и мы приведем мой план в исполнение.\n\nИ берегись буйных элементалей. Заклинания мастериц проклятий их очень разозлили!', '', '', '', '', '', '', 47187),
(65286, 'ruRU', 'Драконьи связи', 'Получите разрешение войти в Штормград.', 'Обычно такой перелет занял бы куда больше времени. Но когда тебе помогает сам бронзовый Аспект, можно уложиться в рекордное... \n\n<Хм> ...время.\n\nЧто? Солдаты с острым оружием? Не волнуйся. Это просто формальность.\n\nЯ организую встречу с лордом-командиром, а вы с Лазурателом пока отдохните.\n\nК счастью, у меня хорошие связи в этом городе.', '', '', '', '', '', 'Поговорите с Лазурателом.', 47187),
(65279, 'ruRU', 'Королевский указ', 'Убейте $1oa |4Бурошкура-воина:Бурошкуров-воинов:Бурошкуров-воинов; и $2oa |4Бурошкура-шамана:Бурошкуров-шаманов:Бурошкуров-шаманов; в пещере Речного Клыка.', 'Глупые гноллы. Не знают, что значит корона. Зато знают, что такое сила. Побей их, а не то съем.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65267, 'ruRU', 'Только перья полетят', 'Убейте $1oa |4иссушительницу:иссушительницы:иссушительниц; и $2oa |4проклинательницу:проклинательницы:проклинательниц; Драконьего Крика.', 'Я хотела узнать больше об этих крылатых существах и решила с ними познакомиться. Меня бы сожрали, если бы не профессор Язвотрель со своей гигантской механической курицей!\n\nНе поможешь нам разобраться с этими... \"гарпиями Драконьего Крика\"? Синеперые рухи не в силах защитить свои гнезда от их нашествия.\n\nИ еще я боюсь, что кто-то другой тоже захочет с ними пообщаться – и с ним будет то же, что и со мной.', '', '', '', '', '', '', 47187),
(65133, 'ruRU', 'Как ускоряться на драконе', 'Спикируйте через кольца и приземлитесь в указанной области.', 'Как быть, если перед тобой препятствие?\n\nЕсли все сделаешь правильно, то сможешь спикировать вниз, а потом снова набрать высоту за счет скорости.\n\nНа этот раз после пикирования ты окажешься ниже места посадки. Используй инерцию, чтобы в конце маршрута взлететь и приземлиться где нужно.\n\nЕсли застрянешь, активируй бронзовые часы, и Селорму отправит тебя к старту.', '', '', '', '', '', '', 47187),
(65120, 'ruRU', 'Как пикировать на драконе', 'Спикируйте, а затем пролетите через кольца и приземлитесь в указанной области.', 'Планируя в воздухе, ты рано или поздно доберешься до цели. Но что если ты спешишь?\n\nНачни полет с возвышенности и спикируй вниз, чтобы набрать скорость.\n\nПролети через кольца к отмеченной точке.\n\nЕсли застрянешь, используй бронзовые часы, и Селорму отправит тебя к старту.', '', '', '', '', '', '', 47187),
(65118, 'ruRU', 'Как планировать на драконе', 'Пролетите через кольца и приземлитесь в указанной области.', 'Начнем с основ.\n\nЕсли направишься по прямой, то далеко не улетишь. Используй силу притяжения и лети с небольшим наклоном вниз, чтобы дольше оставаться в воздухе. Кольца подскажут тебе, под каким углом совершать простые маневры.\n\nСначала призови своего дракона.\n\nЗатем пролети через кольца и приземлись в указанной точке.\n\nЕсли застрянешь, используй бронзовые часы, и Селорму отправит тебя к старту.', '', '', '', '', '', '', 47187),
(65101, 'ruRU', 'Драконы всегда в моде', 'Примите облик $gсмертного:смертной;.', 'Твое прибытие поставило на уши весь Штормград, $p. Разумеется, все жители реагируют... по-разному.\n\nЧтобы общаться с представителями других народов, мы, драконы, принимаем облики смертных – вроде того, что ты видишь перед собой. Это не только успокаивает собеседников, но и позволяет входить в двери без лишних разрушений.\n\nДрактир обладает сущностью дракона, поэтому ты наверняка можешь так же менять облик.\n\nСледуй за мной.', '', '', '', '', '', 'Продемонстрируйте ваш облик Гневиону.', 47187),
(65100, 'ruRU', 'Последние поручения', 'Организуйте эвакуацию из Запретного края.', 'Буря, которую призвала Рашагет, слишком сильна. Нам придется покинуть наш единственный дом.\n\nХранитель Земли больше не направляет нас. Впервые мы вольны сами принимать решения и выбирать собственную судьбу.\n\nКуда бы ты ни $gнаправился:направилась;, я надеюсь, ты найдешь достойных союзников в этой новой эпохе. Расскажи им про нас.\n\nЯ же останусь здесь и поищу выживших. Может, заодно мне удастся узнать больше о нашем прошлом.\n\nДа благоволит нам удача, $p.', '', '', '', '', '', 'Доложите вашему дракомандиру.', 47187),
(65098, 'ruRU', 'Расплата за храбрость', 'Найдите Абиссиана.', 'Спасибо, что $gисцелил:исцелила; меня, $n. Кажется, мы можем рассчитывать друг на друга.\n\n<Гневион содрогается.>\n\nПожирательница Бурь. Я впервые вижу дракона с такой властью над стихией. Если есть и другие такие же, как она...\n\nСтой... А где Абиссиан? Он выжил? Найди его обязательно!', '', '', '', '', '', 'Поговорите с Эмберталь.', 47187),
(65097, 'ruRU', 'Бежим!', 'Спасайтесь!', 'Буря слишком сильная! Надо отступать!\n\nСпаси всех, кого сможешь. И найди черных драконов!', '', '', '', '', '', 'Поговорите с Гневионом.', 47187),
(65087, 'ruRU', 'Скрытая награда', 'Защитите хранилище.', 'Значит, воинам стихий нужно содержимое хранилища?\n\n<Саркарет щурится.>\n\nПусть приходят.\n\nМы покажем им, ради чего драктиры появились на свет!', '', '', '', '', '', '', 47187),
(65084, 'ruRU', 'Ледокаменное хранилище', 'Доберитесь до Ледокаменного хранилища.', 'Смотри, вон там, на той стороне! Воины стихий собираются у Ледокаменного хранилища.\n\nБуря, которую они хотят выпустить на свободу, скрыта внутри.\n\n<Эмберталь морщится, пытаясь ухватить ускользающие воспоминания.>\n\nМы уже сражались с этим врагом и победили. Нелтарион велел закрыть хранилище, но я... не помню почему...\n\nСейчас не время рассуждать. Саркарет и Черная Чешуя ждут тебя у хранилища. Враг не должен туда прорваться!', '', '', '', '', '', 'Явитесь к дракомандиру Саркарету в Ледокаменное хранилище.', 47187),
(65075, 'ruRU', 'Целительные Крылья', 'Поговорите с Эмберталь.', 'Благодарю тебя, $gпробудитель:пробудительница;. Ты $gподдержал:поддержала; мой вирн в самый темный час.\n\nКогда мы восстановим силы, Целительные Крылья присоединятся к остальным драктирам.\n\nЗоломолот сказала, что весь вирн Эмберталь погиб. Боюсь, такую рану не исцелит никакая магия.\n\nОна стойко держится, но ее боль велика, $n. Скажи ей, что я скоро буду.', '', '', '', '', '', 'Поговорите с Эмберталь.', 47187),
(65074, 'ruRU', 'Легкая добыча', 'Убейте $1oa |4косильщика:косильщиков:косильщиков;.', 'В диких землях вокруг этой Колыбели живут косильщики. Это прожорливые насекомые, агрессивно защищающие свою территорию. \n\nНаши раненые могут стать легкой добычей для этих тварей. Я не хочу, чтобы они напали на наших лекарей, пока те восстанавливают силы.\n\nУбей их как можно больше, а я пока займусь Виридией.\n\nОна... очень храбрая.', '', '', '', '', '', '', 47187),
(65073, 'ruRU', 'Нейтрализация яда', 'Добудьте $1oa |4ядовитую железу:ядовитые железы:ядовитых желез;.', 'Ты быстро восстанавливаешь силы, $n. Это хорошо.\n\nТе, кто выбрался из моей колыбели, уже получают помощь, но многие еще остаются внутри. А если ты побежишь их спасать, мне придется снова тебя вытаскивать.\n\nПо всей кальдере можно найти гнезда жуков, которые обладают ядовитыми железами. Возможно, с их помощью мне удастся найти способ нейтрализовать действие яда.\n\nОднако я сейчас не в том состоянии, чтобы добывать их. Надеюсь на твою помощь, $gпробудитель:пробудительница;.', '', '', '', '', '', '', 47187),
(65071, 'ruRU', 'Спасай!', 'Спасите малышку Ко.', 'Помоги мне!\n\nЯ То\'но и я исследовал, потому что я это хорошо умею, но за мной увязалась сестрица Ко, а я про нее не знал, и мне нужна помощь, потому что она в беде и помоги, пожалуйста.\n\nОна зашла в пещеру, но она прячется хуже, чем я, а родители далеко и не успеют. \n\nНайди ее, пока монстры не нашли, ладно?', '', '', '', '', '', 'Верните детей родителям.', 47187),
(65065, 'ruRU', 'Клыкарры', 'Найдите То\'но.', 'О, прости, мы не знали, что подобные тебе есть на острове. Мы прибыли сюда лишь недавно, ищем незанятую землю, чтобы на ней поселиться. Мы никому не желаем зла и, если это место и вправду запретное, просто продолжим наш путь.\n\nМой сын То\'но обожает самых разных драконов. У этого маленького исследователя наверняка будет к тебе много вопросов! Имей это в виду, если встретишь его раньше, чем я.\n\nКуда же он запропастился?..', '', '', '', '', '', 'Поговорите с То\'но.', 47187),
(65063, 'ruRU', 'В улей', 'Помогите Золомолот найти Виридию.', 'Яд, который проник в эту колыбель, достаточно сильный, чтобы сгубить наших лучших медиков.\n\nЭто очень опасно для всех нас, $n.\n\nНо драктиры оказались в ловушке, так что мы отправляемся внутрь, чего бы это ни стоило.\n\nВдохни поглубже и следуй за мной!', '', '', '', '', '', 'Поговорите с Виридией.', 47187),
(65060, 'ruRU', 'Кальдера Целителей', 'Встретьтесь с Золомолот в Кальдере Целителей.', 'Остальные, возможно, все еще заперты в своих колыбелях. Надо мобилизовать наши силы.\n\nОсмотри Кальдеру Целителей вместе с Золомолот. Лазурател вызвался помочь драктирам Черной Чешуи.\n\nМы никого не бросаем.', '', '', '', '', '', 'Поговорите с Золомолот в Кальдере Целителей.', 47187),
(65057, 'ruRU', 'Сбор у Эмберталь', 'Явитесь к Эмберталь.', 'Теперь, когда бой закончен, ты хочешь, чтобы я явился с докладом к Эмберталь. Лазурател и вправду считает, что я стану ей подчиняться?\n\nЯ так не думаю.\n\nЧерная Чешуя служит только Хранителю Земли, и пока я не получал приказов от Нелтариона.\n\n<Взгляд Саркарета предельно суров.>\n\nНо я понимаю, что воины стихий – это существенная угроза. Я уверен, что когда-то уже сражался с ними, так что...\n\nМы явимся на общий сбор, когда восстановим силы. Можешь идти, $gпробудитель:пробудительница;.', '', '', '', '', '', '', 47187),
(65052, 'ruRU', 'Черная Чешуя', 'Доберитесь до дракомандира Саркарета.', 'С воинами стихий покончено, теперь надо добраться до колыбели.\n\nДракомандир Саркарет – хороший боец, и его вирн держит оборону, но против дракона им приходится тяжело.\n\nПора объединить силы.\n\nСтупай вперед. Подай сигнал, когда мы будем в пределах досягаемости, и тогда атакуем противника всеми силами.\n\nИ будь осторожнее, не попади в засаду. У меня плохое предчувствие.', '', 'Древнее чудище, поймавшее воинов Черной Чешуи в ловушку.', 'Экразатал', '', '', 'Поговорите с дракомандиром Саркаретом.', 47187),
(65050, 'ruRU', 'Рукотворная армия', 'Убейте $1oa |4сотворенного элементаля:сотворенных элементалей:сотворенных элементалей;.', 'Воины стихий призывают нескончаемые полчища элементалей.\n\nНо мы это так не оставим.\n\n$gПробудитель:Пробудительница;! Обрушь на них дождь пламени! Сожги элементалей, а потом займись теми, кто их призывает.', '', '', '', '', '', 'Встретьтесь с Лазурателом в кратере Шрам Бури.', 47187),
(65049, 'ruRU', 'Стычки с тарасекками', 'Убейте $1oa |4тарасекка:тарасекков:тарасекков;.', 'Тарасекки – дикие и непредсказуемые существа, что-то вроде первобытных драконидов.\n\nНелтарион не считал их угрозой, мы на них тренировались. Однако это ловкие охотники, которые, собравшись в стаю, могут быть поистине смертоносными.\n\nЕсли наши враги наполнят их силой стихий, они станут еще опаснее.\n\nНельзя этого допустить, $n. Сократи их численность.', '', '', '', '', '', 'Встретьтесь с Лазурателом в кратере Шрам Бури.', 47187),
(65046, 'ruRU', 'Воины стихий', 'Узнайте больше о происхождении и намерениях воинов стихий.', 'Моя память еще не восстановилась после стазиса, но, кажется, в прошлом мы уже имели дело с этими воинами стихий.\n\n<Дервишиан скрежещет клыками.>\n\nБесполезно. Я пытаюсь что-то вспомнить, но это как фрагменты сновидения.\n\nМожет, у тебя получится лучше. Попробуй узнать, что движет этими чужаками или кто ими командует.', '', '', '', '', '', 'Найдите Дервишиан в кратере Шрам Бури.', 47187),
(65045, 'ruRU', 'Кратер Шрам Бури', 'Встретьтесь с Лазурателом в кратере Шрам Бури.', 'Отчет Дервишиан мне совсем не нравится. Отряд воинов, называющих себя воинами стихий, захватил кратер Шрам Бури, отрезав нам путь из Колыбели завоевателей.\n\nОни призывают яростных элементалей и вербуют под свое крыло тарасекков. \n\nОтправляйся к Лазурателу. Спаси драктиров Черной Чешуи любой ценой.', '', '', '', '', '', 'Поговорите с Лазурателом в кратере Шрам Бури.', 47187),
(65036, 'ruRU', 'В учении как в бою', 'Потренируйтесь использовать \"Парение\".', 'Полеты через кольца хорошо помогают освоиться в воздухе, но в учении, как и в бою, важна практика.\n\nПолетай вокруг, пока не почувствуешь себя достаточно уверенно. Учти, что тут водятся дикие животные и могут подстерегать другие опасности. Но для этого и нужны тренировки.\n\nВозвращайся к Эмберталь, когда будешь $gготов:готова;. Удачи!', '', '', '', '', '', 'Поговорите с дракомандиром Эмберталь, когда будете готовы продолжить.', 47187),
(64873, 'ruRU', 'Расправь крылья', 'Потренируйтесь использовать \"Парение\".', 'Я рада, что многим удалось выбраться из Колыбели воинов. Моему вирну... повезло меньше.\n\n<Эмберталь ненадолго умолкает.>\n\nЗдесь есть и другие колыбели, и драктирам в них тоже грозит опасность. Чтобы добраться до них, нужен сильный ветер.\n\nСосредоточься. Вспомни, чему тебя учили. Почувствуй ветер в крыльях. Соберись с силами – и лети к другим Колыбелям.\n\nВремя для отдыха закончилось.', '', '', '', '', '', '', 47187),
(64872, 'ruRU', 'Внутреннее пламя', 'Научитесь \"Огненному дыханию\" и поупражняйтесь проводить усиленные атаки.', 'Ты – $gпробудитель:пробудительница;, $n. $gЛучший:Лучшая; из лучших. Элитный боец, овладевший военным искусством всех вирнов.\n\nЯ возлагаю на тебя большие надежды.\n\nТвои воспоминания можно стереть, но в твоих жилах течет мощь драконов. Используй ее.\n\nСамое грозное оружие $gпробудителя:пробудительницы; – дыхание. Чем дольше ты набираешь воздух, тем жарче разгорается внутренний огонь.\n\nЭти насекомые, кружащие над нашей площадкой, – хорошая цель, потренируйся на них.', '', '', '', '', '', '', 47187),
(64871, 'ruRU', 'Дракон у двери', 'Одолейте Ляписагоса и выберитесь из Колыбели воинов.', 'Синий дракон хочет обрушить колыбель, чтобы мы не смогли выбраться!\n\nНо зачем ему это? Он говорит, что служит Малигосу. Это имя кажется таким знакомым...\n\nПослушай, $p. Мы учились сражаться вместе с драконами, а не против них. Но сейчас у нас нет выбора.\n\nПришло время сделать то, что нужно, $gпробудитель:пробудительница;.', '', 'Преграждает вам путь на волю.', 'Ляписагос', '', '', '', 47187),
(64866, 'ruRU', 'В котел', 'Приготовьтесь покинуть колыбель.', 'Нам нужны твои навыки, $gпробудитель:пробудительница;.\n\nКолыбель рушится, и у нас мало припасов. Надо пробиться к выходу, но для начала нужно преодолеть этот чародейский барьер.\n\nВ зале за ним находятся драктиры, которым нужна помощь. Исцели их. Убей всех, кто захочет тебя остановить.\n\nВозможно, это наш последний разговор в этих стенах, $n. Пусть все будет не напрасно.', '', '', '', '', '', '', 47187),
(64865, 'ruRU', 'Сборы', 'Добудьте оружие, броню и припасы.', 'На нас напали. Братья и сестры в плену в магическом стазисе, а колыбель вот-вот будет разрушена.\n\nПоэтому мы тренируемся, $n. То, чему ты научишься, поможет в минуты сомнений.\n\nНачнем с самого главного. Оружие, доспехи, припасы. Найди себе снаряжение и приготовься. А я пока соберу остальных.\n\nЗатем мы отправимся к Хранителю Земли. Нелтарион точно сможет ответить на наши вопросы.', '', '', '', '', '', '', 47187),
(64864, 'ruRU', 'Пробудитесь, драктиры', 'Пробудите остальных драктиров.', '<В вашем сознании проносятся лишь разрозненные обрывки воспоминаний, пока вы приходите в себя. Такое ощущение, что вы проспали целую вечность.\n\nДрактир перед вами по-прежнему находится в глубоком сне, застыв на месте под действием неизвестной магии. Вы чувствуете внутри силу, которая способна разбить оковы вашего союзника.\n\nДругие обитатели колыбели тоже могли зависнуть в стазисе.\n\nПробуждать их придется вам.>', '', '', '', '', '', 'Поговорите с дракомандиром Лазурателом.', 47187),
(64863, 'ruRU', 'Чародейские стражи', 'Уничтожьте $1oa |4стража или голема:стражей или големов:стражей или големов;.', 'Големы, которые патрулируют колыбель, созданы не магией Хранителя Земли.\n\n<Дервишиан щурится.>\n\nНельзя оставлять врагов в тылу.\n\nУничтожь их, чтобы расчистить путь.', '', '', '', '', '', '', 47187),
(63948, 'ruRU', 'Seeking the Seeker\'s Staff [PH]', 'Верните три части расколотого посоха.', 'Одним из предметов наших исследований был артефакт, который мы назвали \"Расколотый посох\".\n\nОн был слишком нестабилен в собранном виде, и нам пришлось разделить его на три части.\n\nНе думаю, что захватчики его специально разыскивали или знали о его свойствах, но все части оказались у них. Каждая из них теперь находится у разных воинов Верных Утробе.\n\nНужно поскорее вернуть все фрагменты.\n\nНаши враги могут в любой момент догадаться, что вместе они очень опасны.', '', '', '', '', '', '', 47187),
(63947, 'ruRU', 'Raiders in the Ruins [PH]', 'Убейте $1oa |4Верного Утробе захватчика:Верных Утробе захватчиков:Верных Утробе захватчиков;.', 'Я ненавижу насилие и предпочитаю разрешать конфликты мирным путем, но здесь альтернативы нет.\n\nЧтобы сбежать, нам придется избавиться от атакующих. Нанеси решающий удар Верным Утробе, что ворвались в Ро-Домам.\n\nИзбавься от них.', '', '', '', '', '', '', 47187),
(61620, 'ruRU', 'Кузнечное дело: кандалы гордыни', '', '', '', '', '', '', '', '', 47187),
(61619, 'ruRU', 'Алхимия: эликсир смирения', '', '', '', '', '', '', '', '', 47187),
(61447, 'ruRU', 'Ювелирное дело: сияющее киранитовое ожерелье', '', '', '', '', '', '', '', '', 47187),
(54586, 'ruRU', 'Фозрук', '', '', '', '', '', '', '', '', 47187),
(54359, 'ruRU', 'Пожертвования на битву за Темные берега: песочный плутишка', '', '', '', '', '', '', '', '', 47187),
(53832, 'ruRU', 'Меры против саботажа', '', '', '', '', '', '', '', '', 47187),
(51457, 'ruRU', 'Варгарбл Раздражительный', '', '', '', '', '', '', '', '', 47187),
(44028, 'ruRU', 'РАЗЫСКИВАЕТСЯ: лейтенант Стратмар', '', '', '', '', '', '', '', '', 47187),
(42820, 'ruRU', 'ОЧЕНЬ ОПАСЕН: Эгир Сокрушитель Волн', '', '', '', '', '', '', '', '', 47187),
(37924, 'ruRU', 'Утилизация судов', 'Отметьте флагами $1o |4тайник:тайника:тайников; с припасами.', 'Пока занимаешься зачисткой, заодно можешь отметить большие тайники с припасами. Так у меня дело пойдет гораздо быстрее.$b$bПросто поставь там этот флаг, и кто-нибудь вскорости обязательно придет их забрать.', '', '', '', '', '', '', 47187),
(37484, 'ruRU', 'Свисток капитана', 'Принесите Анне Данворс 100 фрагментов артефакта, чтобы получить свисток капитана.', '', '', '', '', '', '', '', 47187),
(37483, 'ruRU', 'Свисток капитана', 'Принесите Анне Данворс 100 фрагментов артефакта, чтобы получить свисток капитана.', '', '', '', '', '', '', '', 47187),
(37114, 'ruRU', 'Чолуна', '', '', '', '', '', '', '', '', 47187),
(34213, 'ruRU', 'Они схватили моего сына', 'Найдите ключ от клетки Корки и выпустите его на волю.', 'Умоляю тебя, $p! Пожалуйста, помоги мне. Я получил требование о выкупе от жестокого и бесчестного орка из Железной Орды.$b$bОн похитил моего сына!$b$BА еще он внизу своей записки пририсовал пару ужасных картинок, чтобы дать мне понять, какая участь ждет моего сына, если выкупа не будет. Видимо, он считает, что мы умеем делать золото из воздуха. А если я отправлюсь спасать его сам, нас обоих точно убьют.$b$bТы можешь спасти моего сына из лап Грон\'мара?$b$bЕго зовут Корки.', '', '', '', '', '', '', 47187),
(32724, 'ruRU', 'Впереди кузня!', 'Убейте главного кузнеца и получите фрагмент кодекса от стража врат могу на острове Грома.', 'Тебе придется сделать еще кое-что.\n\nУбей Итоку, главного кузнеца, и найди фрагмент кодекса Плотореза Хоку, хранителя врат Властелина Грома.', '', '', '', '', '', '', 47187),
(27846, 'ruRU', 'Благодарный покойник', 'Принесите поминальный хлеб веселому духу воргена на кладбище Оргриммара.$B$BЧтобы увидеть дух, используйте оранжевые бархатцы.', 'Как приятно было навестить друзей и родных! Только, кажется, я немного перестарался... и съел все, что они приготовили для меня! Даже крошки подмел!$B$BМогу ли я попросить тебя принести мне еще вкусного поминального хлеба? Я бы был очень благодарен!$B$BКажется, рецепт можно купить у Чепмана.', '', '', '', '', '', '', 47187),
(1073, 'ruRU', 'Неумение + реактивы = потеха!', 'Принесите 4 крохотных флакона с зельем маны и 2 слабых эликсира стойкости Ломаку Демонтирсу в Стальгорн.', 'Ха-ха-ха!.. Тебе нужен нитромирглицероний, чтобы остановить гоблинов, уничтожающих лес?!$B$BМне все равно, знаешь ты Гаксима или нет... я дам тебе этот состав, чтобы посмотреть, как кого-нибудь разнесет на мелкие кусочки: или тебя, или гоблинов.$B$BНо есть проблемка: у меня кончились химикалии.$B$BНо вот что я тебе скажу: принесешь мне нужные зелья, и я прямо сразу же смешаю для тебя составчик.$B$BПо крайней мере, ты докажешь, что кое-что понимаешь в алхимии, прежде, чем я передам тебе образец своего величайшего творения.', '', '', '', '', '', '', 47187);
